var book = {
	"name": "လုကၭ",
	"numChapters": 24,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ၦဒိၪၥံၫအီဖလၧၭဧ့, ဆၧမၩအၥၭလၧပကျၩလၧပ နဲၩပဝ့ၫလၩ့ထံးလၩ့ဆ့ၭ, ဘဲၫၦလၧအမၩဆၧအလူအ",
			"2": "<sup>2</sup> ထၫအဆၧၥ့ၪနီၪ,- ဒဲဒၪဘၪလၧအမ့ၬလၧအၥၫ့လံၩ လံၩနီၪ,ဖ့ၪလၫ့ပၧၩအၥိၭတၭ, ၦအၪဂၩအီၪက့ၪအၥၭ",
			"3": "<sup>3</sup> လၧအမိတဲၩ့ဝဲၩကွ့ၭဝ့ၫအဂဲးတၭ,- ယဝ့ၫဒၪယီၩလၧ အၥၫ့လံၩလံၩယအၪ့ဎၬ ထီးန့ဆၧလၩ့ထံးလၩ့ဆ့ၭ ထီးအလူၬတၭ, အီၪယူၭလၧယၥၭလၧယမိကွ့ၭန့နၧၩ",
			"4": "<sup>4</sup> လၧခံၫလၧထံၭ,- မွဲဘဲၫၥိၭနမိၥ့ၪယၫဆၧလၧနမၩလိၪ ဝဲၩလဖၪနီၪ လၧအမွဲဆၧအတီၩလီၫ.",
			"5": "<sup>5</sup> လၧခးယုဒၫအစဎွၩဟ့ရၧၭအဆိၩနီၪ, ၦလုဆၧလၧ စအဘဲယၫလဒီၪ့အကျၩ, အမံၩ့မွဲစဇၭခရဲအၫအီၪ ဝ့ၫလဂၩတၭ, အမၫမွဲၦလၧစအၫရၧၫ့အဖိၪမုၪအကျၩ,",
			"6": "<sup>6</sup> အမံၩ့မွဲနးအလံၭစဘ့ၭလီၫ.- အဝ့ၫၥံၪတီၩဝ့ၫလီၩ့ဝ့ၫ လၧယွၩအမ့ၬယၫနံၫဂၩလူၬတၭ, လ့ၩဝ့ၫလၧယွၩအ ဆၧမၪလူၬ, ဒဲအဆၧတီၩဆၧလီၩ့ ထီးအလူၬအဖၧၩ့",
			"7": "<sup>7</sup> တၭ,အီၪက့ၪဆၧမၪလၧအလီၩ့အလးအီၪအ့ၬ.- အ ဖိၪအလံၩအီၪအ့ၬ. အဂဲးဘဲၫယီၩ နးအလံၭစဘ့ၭနီၪ မွဲၦထူၬဖိၪတၭ, အၥၭၡါက့ၭယူၭနံၫဂၩလူၬလီၫ.",
			"8": "<sup>8</sup> ဆၧမၩအၥၭလၧအမၩ ၦလုဆၧအဆၧမၩလၧယွၩ အမ့ၬယၫ, လၧအဒီၪ့ဒၪဝ့ၫအကျၩ ဘဲၫၦလုဆၧအထူၫ",
			"9": "<sup>9</sup> အရူၫအၥိၭနီၪ,- ဖၭဝ့ၫတၭ, ထီးအလ့ၩနုၬလၧယွၩအ",
			"10": "<sup>10</sup> ဆၧလုဂံၪ့ဖၧၩ့နီၪ, ဆူၭခဲၩထၪ့ဆၧနၧၫ့မၧၫ့လီၫ.- ဆူၭ ခဲၩထၪ့ဆၧနၧၫ့မၧၫ့အနၩရံၩနီၪ, ၦခမျၧးထီးအလူၬ",
			"11": "<sup>11</sup> ဘၩဆိၪဖၪဆၧလၧခီၫ့လီၫ.- ယွၩအၥီၫ့လဂၩနဲၪဖျီၪ ထၪ့အၥၭလၧ အမ့ၬယၫတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧဆူၭ",
			"12": "<sup>12</sup> ခဲၩနၧၫ့မၧၫ့အလးအစူၪထွ့ၪလခီၫနီၪလီၫ.- စဇၭခရဲ အၫဒၪဘၪဝ့ၫနီၪ, အၥုၪ့ခိအၥၭဝီၩတၭ, ဘၪဆၧၥၭ",
			"13": "<sup>13</sup> မဲၪၥၭဖျဲၩ့ဝ့ၫလီၫ.- အၥီၫ့စံၭအဝ့ၫဒၪ,စဇၭခရဲအၫဧ့, ၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩနဆၧဘၩဆိၪဖၪနီၪ ဆၧနါဂၧၫ့ယူၭတၭ, နမၫနးအလံၭဇဘ့ၭ မိအီၪဖျဲၪန့",
			"14": "<sup>14</sup> နဖိၪခွၫတၭ, နမိဘၪဖျိၬအမံၩ့လၧစယီဟၫ့း- အဝ့ၫ ဒၪမိကဲၪထၪ့ ဆၧၥုၪ့ထိၬၥၭထိၬဒဲ ဆၧၥုၪ့ဎွံၫၥၭယီၫလၧ နဂးတၭ, ၦမိၥုၪ့ထိၬၥၭထိၬလၧအအီၪဖျဲၪဝ့ၫအဂဲး",
			"15": "<sup>15</sup> အၪဂၩလီၫ.- အဂဲးဘဲၫယီၩမွဲအမိကဲၪထၪ့ဝ့ၫလၧအ ဒိၪလၧယွၩအမ့ၬယၫတၭ, စဘံၭထံၫ,ဒဲဆၧမၧၩ့ န့ၦနီၪမိအီၩဝ့ၫအ့ၬ. လၧအမိအဒၧၩ့လးဖၧၩ့လံၩလံၩ",
			"16": "<sup>16</sup> နီၪ,မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧၥၭမုဆံၫ့ဎံၪလီၫ.- မိ ကၠၪထဲၩ့န့ၦအံၫစရ့လၭဖိၪအၪဂၩထီၩ့လၧကဆါအ",
			"17": "<sup>17</sup> ဝ့ၫၥံၪအယွၩအအီၪနီၪလီၫ.- မိလ့ၩဝ့ၫလၧအမ့ၬယၫ လၧစအံၫလဲယၫအၥုၪ့အၥၭ, ဒဲအစီၩ့အမၩ့ဘဲၫၥိၭအ မိဘိၭထဲၩ့ဖါၥံၪအၥၭလၧဖိၪၥံၪအအီၪ, ၦလခိၭနၪဘၪ ဆၧနီၪလၧၦတီၩၦလီၩ့အဆၧကိၪ့ၥ့ၪ, ဘဲၫၥိၭအမိ တဲၩ့ဝဲၩၦလၧဆၧတဲၩ့ဝဲၩအၥၭလဆၨၩ လၧကဆါအ ဂးလီၫ.",
			"18": "<sup>18</sup> စဇၭခရဲအၫစံၭအၥီၫ့နီၪ, ဆၧယီၩမွဲယမိၥ့ၪယၫဘဲၫ ၥ့ၪလဲၪ, အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩယၥၭၡါဖီၩ,",
			"19": "<sup>19</sup> ယမၫနီၪအၥၭၡါက့ၭယူၭ.- အၥီၫ့နီၪချဲၩ့ဆၧၫ့ဆၧတၭ, လီၩဘၪအဝ့ၫနီၪ, ယဝ့ၫဒၪယီၩ ယမွဲဂၫဘြံလၭလၧ အဆၧၫ့ထုၪ့လၧယွၩအမ့ၬယၫတၭ, ဆၧအၪ့မၧၫ့ယ ဂဲၫလီၩဘၪနၧၩ လၧဆၧၥၭထိၬအပရၧၫ့ယီၩလီၫ.",
			"20": "<sup>20</sup> ယိခွါ,ယလူလၧအ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ထီးအထီဘၪ နီၪမွဲနလနဲၩဘၪအကၠီၩ့တၭ, ဘိၩ့အလချႃၭ မၩဒံၭ ဘၪအၥၭနီၪနချဲၩ့ဆၧၥ့ၪအ့ၬ, နမိအုၭအၭလီၫ.",
			"21": "<sup>21</sup> ၦခမျၧးယိလါ စဇၭခရဲအၫအဖၧၩ့ၥၭနီၪ, အဝ့ၫဒၪ အီၪလၧဆၧလုအဂံၪ့ဖၧၩ့ ယံၬယံၬတၭ, အဝ့ၫၥံၪထီၫ",
			"22": "<sup>22</sup> မံၫထီၫမၪလီၫ.- အဝ့ၫဒၪဂဲၫထဲၩ့ထၪ့ဝ့ၫတၭ, ချဲၩ့ဆၧ လၥ့ၪဘၪတၭ, အဝ့ၫၥံၪၥ့ၪယၫလၧအဒၪဆၧလၧယၫ လခီၫလၧဆၧလုအဂံၪ့ဖၧၩ့နီၪ, အဝ့ၫဒၪဖျၭအခိၪတၭ, အီၪအုၭအၭဝ့ၫလီၫ.",
			"23": "<sup>23</sup> ဆၧမၩအၥၭလၧအနံၩအၥၫ့ လၧအမၩအဆၧမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့ဒၪဝ့ၫ",
			"24": "<sup>24</sup> လီၫ.- ဆၧလၧအနံၩအၥၫ့လဖၪနီၪဖီၩ့ခွံၬဝ့ၫတၭ, အမၫ နးအလံၭစဘ့ၭဒၧၩ့ထၪ့တၭ, အီၪက့ၪၥူၪအၥၭလၩယဲ",
			"25": "<sup>25</sup> ဘံၪ့,- စံၭဝ့ၫဒၪ, လၧကဆါမၩယၧၩဘဲၫယီၩလၧမုနံၩ လဖၪ ထီးအယိလၩ့ဝ့ၫလၧယၧၩဘဲၫၥိၭအမိမၩဖီၩ့မၩ ဖျ့ၭယၧၩလၧဆၧဒုၪဒွ့ၪလၧၦၡၩအကျၩလီၫ.",
			"26": "<sup>26</sup> လၩဎူၫဘံၪ့လဘံၪ့အဖၧၩ့နီၪ, ယွၩအၥီၫ့ဂၫဘြံလၭ လ့ၩလၧဒိၩ့လဖျိၪ့လၧဂၫလလံၫအဖၧၩ့ ကိၭဝ့ၫအမံၩ့",
			"27": "<sup>27</sup> လၧနၭဇရ့ၭ,- လၧၦမုၪနၩ့လၧအဘၪအဲၪတၩ့လၧ ၦလၧစဒၫဝံၭအဂံၪ့ဖၧၩ့လဂၩအမံၩ့ မွဲစယိၥၭအအီၪ",
			"28": "<sup>28</sup> တၭ,ၦမုၪနၩ့နီၪအမံၩ့မွဲနးမၫရံၫလီၫ.- အၥီၫ့လ့ၩနုၬ လၧအအီၪတၭ, စံၭဝ့ၫ,ၦလၧအဘၪဆၧအခိးအတၩ အၪလဂၩဧ့, ယွၩအီၪလၧနၥိၭလီၫ. လၧၦမုၪအကျၩ",
			"29": "<sup>29</sup> နီၪ,နဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.- ထီးအဝ့ၫနီၪဒၪဘၪဝ့ၫ တၭ,အၥုၪ့ခိအၥၭဝီၩလၧအဆၧချဲၩ့အကၠီၩ့နီၪ, မွဲဆၧ ချဲၩ့ဒုၪ့ဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ဆီၫ့မီၪ့ဝ့ၫဒၪလီၫ.",
			"30": "<sup>30</sup> အၥီၫ့နီၪစံၭဝ့ၫ, နးမၫရံၫဧ့,ၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫ",
			"31": "<sup>31</sup> ယီၩနဘၪဆၧအခိးအတၩလၧယွၩလီၫ.- ယိခွါ,နမိ ဒၧၩ့ထၪ့လၧနဒၧၩ့လးဖၧၩ့တၭ, နမိအီၪဖျဲၪန့နဖိၪခွၫ",
			"32": "<sup>32</sup> နီၪနမိဘၪဖျိၬအမံၩ့ယ့ၫၡုၬလီၫ.- အဝ့ၫဒၪနီၪမိကဲၪထၪ့ လၧၦအဒိၪတၭ, ဆၧမိကိၭဝ့ၫလၧဆၧထီၫထုၬ အဖိၪခွၫလီၫ.ကဆါယွၩမိဖ့ၪလၫ့ဝ့ၫ လၧအဖါစဒၫဝံၭ",
			"33": "<sup>33</sup> အလးဆီၩ့ဆီတၭ,- အဝ့ၫဒၪမိ စ့ၩရၫ့စယၫကူၭအ ဂံၪ့အဆိၩဆိၩအကၠၪကၠၪတၭ, အဘၩ့အမုးနီၪ အထုၬ အီၪအ့ၬ.",
			"34": "<sup>34</sup> နမၫရံၫစံၭအၥီၫ့နီၪ, မွဲယလၥ့ၪယၫဘၪ ၦခွၫတၭ,",
			"35": "<sup>35</sup> ဆၧယီၩမိမၩအၥၭဘဲၫၥ့ၪလဲၪ.- အၥီၫ့နီၪချဲၩ့ဆၧၫ့ ဆၧတၭ,လီၩဘၪဝ့ၫ, ၥၭမုဆံၫ့ဎံၪမိဂဲၫလၩ့လၧနလီၩ့ တၭ,ဆၧထီၫထုၬအစီၩ့အမၩ့ မိကဒုၩဘၪနၧၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧဆံၫ့ဎံၪလၧနမိအီၪဖျဲၪန့ဝ့ၫ",
			"36": "<sup>36</sup> နီၪဆၧမိကိၭဝ့ၫလၧယွၩအဖိၪခွၫနီၪဆ့လီၫ.- ယိခွါ, ၦထၧၫ့ဘူၭထၧၫ့ထံးလၧနၧၩ နးအလံၭစဘ့ၭလဂၩလၧ အၥၭၡါက့ၭယူၭနီၪ, ဒၧၩ့ထၪ့န့အဖိၪခွၫဆ့ယူၭတၭ, ဘိၩ့နဲၪ့ယီၩ, ၦလၧဆၧကိၭအဝ့ၫဒၪလၧ ၦထူၬဖိၪလဂၩ",
			"37": "<sup>37</sup> နီၪအီၪယူၭဝ့ၫလၩဎူၫဘံၪ့ယူၭ.- အဂဲးဘဲၫယီၩဆၧ",
			"38": "<sup>38</sup> လၧယွၩမၩလၥ့ၪဘၪနီၪအီၪနးမံၩ့အ့ၬ.- နးမၫရံၫ စံၭဝ့ၫ,ယိခွါ,ကဆါအခ့ၫအၡၩမုၪတၭ, မွဲဆၧမၩ ဒၪဝ့ၫအၥၭလၧယၧၩ ဘဲၫနလူအၥိၭနီၪဆံၭ. အၥီၫ့ နီၪစဲၪ့ထၪ့ခွံၬလၧအအီၪလီၫ.",
			"39": "<sup>39</sup> လၧမုနံၩလဖၪနီၪ နးမၫရံၫဂဲထုၪ့တၭ, လ့ၩထၪ့ဝ့ၫ ချဲၫ့ချံၭလၧခိၪလီၩ့ထိၩ့ချိၬအလး လၧဒိၩ့အီၪလၧခး",
			"40": "<sup>40</sup> ယုဒၫလဒိၩ့လီၫ.- လ့ၩနုၬဝ့ၫလၧစဇၭခရဲအၫအဂံၪ့",
			"41": "<sup>41</sup> ဖၧၩ့တၭးချဲၩ့ဒုၪ့နးအလံၭစဘ့ၭလီၫ.- လၧနးအလံၭ စဘ့ၭနါဂၧၫ့ နးမၫရံၫအဆၧချဲၩ့ဒုၪ့နီၪ, ဆၧမၩအၥၭ လၧအဖိၪဂဲၩဝ့ၫ လၧအဒၧၩ့လးအဖၧၩ့လီၫ. နးအလံၭ",
			"42": "<sup>42</sup> စဘ့ၭလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧၥၭမုဆံၫ့ဎံၪနီၪတၭ,- ကိၭ ထၪ့ဆၧလၧအလူဖၭဒိၪ, စံၭဝ့ၫ,နဝ့ၫဒၪယီၩနဘၪဆၧ ဆိၪဂ့ၩလၧၦမုၪအကျၩလီၫ. နဒၧၩ့လးအဆၧၥၪနီၪ",
			"43": "<sup>43</sup> ဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.- လၧယကဆါအမိဂဲၫလၧယ အီၪယီၩတၭ, ဆၧယီၩလမံၩ့မွဲအအီၪထၪ့လၧယဂး",
			"44": "<sup>44</sup> ခီၫခီၫလဲၪ.- အဂဲးဘဲၫယီၩ ယိခွါ,လၧနဆၧချဲၩ့ဒုၪ့ ယၧၩၥီၫနီၪနုၬလၧယနါဖၧၩ့တၭ, ဖိၪၥၪၥုၪ့ဎွံၫၥၭယီၫ",
			"45": "<sup>45</sup> အကၠီၩ့ဂဲၩလၧယဒၧၩ့လးဖၧၩ့လီၫ.- ၦမုၪလၧအနဲၩ ဆၧလၧယွၩလီၩဘၪဝ့ၫနီၪ, မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ, ဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.",
			"46": "<sup>46</sup> နးမၫရံၫစံၭဝ့ၫ, ယၥၭယီၩအီၪက့ၪယွၩလၧဆၧ",
			"47": "<sup>47</sup> အဒိၪ,- တၭယၥုၪ့ထိၬၥၭထိၬလၧယွၩ,ယဆၧထိး",
			"48": "<sup>48</sup> ထဲၩ့တၩ့ထဲၩ့အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအယိထဲၩ့ ယူၭအခ့ၫအၡၩမုၪအဆၧၡၪ့ယူၭး အဂဲးဘဲၫယီၩ, ယိခွါ,ထီးယီၩစူၩယၫခိၬ, ကယဲၦအဆိၩဆိၩအကၠၪ",
			"49": "<sup>49</sup> ကၠၪမိကိၭယၧၩလၧၦဘၪဆၧဆိၪဂ့ၩလီၫ.- အဂဲး ဘဲၫယီၩၦလၧအၥ့ၪဆၧလူၬလဂၩနီၪ မၩဆၧဖၭဒိၪလၧ",
			"50": "<sup>50</sup> ယဂးတၭ, အမံၩ့နီၪမွဲအဆံၫ့ဎံၪဝ့ၫလီၫ.- တၭအ ဆၧယၫ့ၥုၪ့ယၫ့ၥၭနီၪ အီၪဝ့ၫလၧၦလၧအၥၭမဲၪဝ့ၫ",
			"51": "<sup>51</sup> အလီၩ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- အဝ့ၫမၩယူၭဆၧ အစီၩ့အမၩ့လၧအစူၪယူၭတၭ, မၩလၩ့ပြံၩလၩ့ပၩ ယူၭၦလၧအအီၪက့ၪထၪ့ထီၫအၥၭ လၧအဆၧကိၪ့",
			"52": "<sup>52</sup> ထၪ့ဖၭလၩ့အဖၧၩ့ယူၭ.- ခွံၬလၩ့ယူၭၦလၧအဒိၪအ မုလၧအအီၪဝ့ၫလၧအလးဆီၩ့ဆီ အဖၫ့ခိၪတၭ,",
			"53": "<sup>53</sup> အီၪက့ၪထၪ့ထီၫယူၭၦလၧအဘၪၡၪ့ဘၪယၬယူၭ.- ၦ လၧဆၧၥၭဝံအၥၭနီၪ ဒုၭဘျဲၩအၪ့ဝ့ၫလၧဆၧအအွံၪ ယူၭ.အ့ၪမွဲၦၥထံၫလဖၪနီၪ ဒုၭထဲၩ့ပျီၩယူၭဝ့ၫယူၭ.",
			"54": "<sup>54</sup> မွဲအယိထဲၩ့ခွါထဲၩ့ အခ့ၫအၡၩအံၫစရ့လၭဖိၪ ဘဲၫၥိၭ",
			"55": "<sup>55</sup> အဝ့ၫၥံၪမိနၪ့ထၪ့အဆၧယၫ့ၥုၪ့ယၫ့ၥၭ,- ဘဲၫအစံၭ ဝဲၩဝ့ၫအၥိၭလၧပဖါၥံၪနီၪ, လၧစအၫဘြဟၫ့ဒဲအ ချံၫအၥၪအဂးအဆိၩ ဆိၩအကၠၪကၠၪလီၫ.",
			"56": "<sup>56</sup> နးမၫရံၫအီၪလၧနးအလံၭစဘ့ၭအၥိၭ လၩၥၧၫ့ဘံၪ့ ကၪယူၭတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့ဒၪဝ့ၫလီၫ.",
			"57": "<sup>57</sup> နးအလံၭစဘ့ၭအမုအလၩဘၪဝ့ၫတၭ, အီၪဖျဲၪန့အ",
			"58": "<sup>58</sup> ဖိၪခွၫလီၫ.- ၦလၧအအီၪဝၬဖီၩ့ဝ့ၫ, ဒဲအဘူၭအထံးလ ဖၪနီၪ, နါဂၧၫ့လၧယွၩနဲၪဖျီၪထၪ့အဆၧယၫ့ၥၭအၪလၧ အလီၩ့တၭ, အၥုၪ့ထိၬအၥၭထိၬဎုၬဝ့ၫလၧအၥိၭ လီၫ.",
			"59": "<sup>59</sup> ဆၧမၩအၥၭလၧအဘၪဎိၭနံၩလနံၩနီၪ, အဝ့ၫၥံၪ ဂဲၫဝ့ၫဘဲၫၥိၭ အမိကူၭတရံၭဖိၪၥၪနီၪတၭ, ဖျိၬဝ့ၫအ",
			"60": "<sup>60</sup> မံၩ့လၧအဖါ စဇၭခရဲအၫအမံၩ့လီၫ.- အမိချဲၩ့ဆၧၫ့ ဆၧတၭစံၭဝ့ၫ,မွဲအ့ၬး ဘၪဖျိၬအမံၩ့လၧစယီဟၫ့လီၫ.",
			"61": "<sup>61</sup> အဝ့ၫၥံၪလီၩ ဘၪဝ့ၫလၧအဘူၭအထံးအကျၩနီၪၦလၧ",
			"62": "<sup>62</sup> ဆၧကိၭဝ့ၫအမံၩ့ဘဲၫနီၪအီၪနးဂၩအ့ၬ.- အဖါမိကိၭ ဘၪအၥၭအမံၩ့ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, အဝ့ၫၥံၪဖျါ",
			"63": "<sup>63</sup> အခိၪလၧအဝ့ၫနီၪလီၫ.- အဝ့ၫဒၪအၪ့ကံၩ့ဆၧကွ့ၭအ လးတၭ,ကွ့ၭဝ့ၫနီၪစံၭဝ့ၫ,အမံၩ့မွဲစယီဟၫ့လီၫ. အ",
			"64": "<sup>64</sup> ဝ့ၫၥံၪထီၫမံၫထီၫမၪဝ့ၫဒၪထီးအလူၬလီၫ.- အနိၭအၩ့ ထၪ့ထဲၩ့အၥၭ, အဖျ့ၩလၩ့ပၠၪဝ့ၫချဲၫ့မၬတၭ, ချဲၩ့",
			"65": "<sup>65</sup> ထၪ့ဆၧစံၭထၪ့အၪ့အူၭယွၩလီၫ.- ၦအီၪဝၬဖီၩ့ဝ့ၫလ ဖၪဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့တၭ, ဆၧမၩအၥၭနီၪဂၧၫ့ထၪ့ ၥၩလၩ့လၧခိၪလီၩ့အလး လၧခးယုဒၫအဖၧၩ့ဎံၩ့ဎံၩ့",
			"66": "<sup>66</sup> လ့ၬလီၫ.- ၦလၧအနါဂၧၫ့ဆၧလဖၪနီၪ,အီၪက့ၪဝ့ၫလၧ အၥၭတၭ,စံၭဝ့ၫ,ဆၧလၧဖိၪၥၪယီၩ မွဲအမိကဲၪထၪ့ ၦဘဲၫၥ့ၪလဲၪ. တၭယွၩအစူၪအီၪလၧအၥိၭလီၫ.",
			"67": "<sup>67</sup> အဖါစဇၭခရဲအၫလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧၥၭမုဆံၫ့ဎံၪ",
			"68": "<sup>68</sup> တၭ,ချဲၩ့ဆၧလၧမီၪအချိၬ,စံၭဝ့ၫ,- ၦအံၫစရ့လၭဖိၪ အကဆါယွၩနီၪ မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ. အဂဲး ဘဲၫယီၩမွဲအအီၪၡီၩ့ယူၭ ဒဲဎွ့ၩန့ထဲၩ့ယူၭ အခ့ၫအၡၩ",
			"69": "<sup>69</sup> တၭ,- ဒုၭအီၪထၪ့ယူၭ ဆၧထိးထဲၩ့တၩ့ထဲၩ့အနိၩ့",
			"70": "<sup>70</sup> လၧပဂးလၧအခ့ၫအၡၩစဒၫဝံၭအဂံၪ့ဖၧၩ့ယူၭ.- (ဘဲၫ အစံၭဆၧ လၧအဝံခိၪထံၭ လၧဖျိၩ့လၧမီၪဆံၫ့ဎံၪအ",
			"71": "<sup>71</sup> ၥိၭနီၪ,)- ဆၧထိးထဲၩ့တၩ့ထဲၩ့ပၧၩလၧပဒုၪပဒၩ ၥံၪ,ဒဲကယဲၦလၧအၥၭဂဲၫ့ပၧၩ အစူၪဖၧၩ့ထီးအလူၬ,",
			"72": "<sup>72</sup> ဘဲၫၥိၭအမိဒုၭနဲၪအဆၧယၫ့ၥၭ လၧဖါၥံၪအလီၩ့,ဒဲနၪ့",
			"73": "<sup>73</sup> ထၪ့ထဲၩ့အဆၧအုၩ့လၩ့ဆံၫ့ဎံၪနီၪ,- အဆၧဆိၪလၧ",
			"74": "<sup>74</sup> အဆိၪလၩ့အၥၭလၧပဖါစအၫဘြဟၫ့,- လၧအမိ ထုၭထၪ့န့ပၧၩလၧပဒုၪပဒၩၥံၪအစူၪဖၧၩ့ ဘဲၫၥိၭပမိ",
			"75": "<sup>75</sup> မၩအဆၧလၧပၥၭဒူၩ,- လၧဆၧဆံၫ့ဎံၪ,ဒဲလၧဆၧ တီၩဆၧလီၩ့အဖၧၩ့လၧအမ့ၬယၫလဆိၩဒၪပၥၭ လီၫ.",
			"76": "<sup>76</sup> နဝ့ၫဒၪယီၩဖိၪၥၪဧ့, ဆၧမိကိၭနၧၩလၧဆၧထီၫထုၬ အမီၪလီၫ. အဂဲးဘဲၫယီၩနမိလ့ၩတဲၩ့ဝဲၩကဆါအဖၧၩ့",
			"77": "<sup>77</sup> ၥၭလၧ အမ့ၬယၫ.- ဘဲၫၥိၭနမိဒုၭၥ့ၪယၫ အခ့ၫအၡၩ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ လၧဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭအ",
			"78": "<sup>78</sup> ဂဲး,- လၧပယွၩအဆၧယၫ့ၥၭအကၠီၩ့လီၫ. လၧဆၧနီၪ လမံၩ့အကၠီၩ့တၭ, မုဂိးထၪ့ဂဲၫလၩ့ လၧထၭနီၪအီၪၡီၩ့",
			"79": "<sup>79</sup> ပၧၩ,- ဘဲၫၥိၭအမိဖၩ့ထၪ့န့ၦအီၪလၧဆၧခံၭကျၩ, ဒဲဆၧၫ့နၩ့လၧ ဆၧၥံၫအလၩၡုၪ အကျၩဘဲၫၥိၭအမိၥိၫ့",
			"80": "<sup>80</sup> ပခၪ့လၧဆၧဘၪ လိၬအိၭလိၬအဖၧၩ့ၥၭလီၫ.- ဖိၪၥၪဒိၪ ထၪ့,အၥၭဆီၪ့ထၪ့ဝ့ၫတၭ, အီၪဝ့ၫလၧမံၩ့လၬကျၩ ထီၩ့လၧမုလနံၩဘၪ လၧအမိဒုၭနဲၪအၥၭလၧၦအံၫစရ့ လၭဖိၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧမုနံၩလဖၪနီၪ, စံစၧၫအီဂၧၭစတၧၭ အလူလၩ့လၧကယဲထံၫဖိၪခးဖိၪအမံၩ့ မိဘၪဆ့ၭလၩ့",
			"2": "<sup>2</sup> အၥၭထီးအလူၬလီၫ.- ဆၧဆ့ၭလၩ့အမံၩ့ လၧအခၪ့ ထံၭနီၪ, အီၪထၪ့ထီးစဲၫရံနအၧၭ မွဲခးစံရအၫအၦဒိၪ",
			"3": "<sup>3</sup> ဖၭဒိၪလီၫ.- ၦလ့ၩဆ့ၭလၩ့အမံၩ့လဂၩလၧ အဒိၩ့ဒၪ",
			"4": "<sup>4</sup> ဝ့ၫ,လဂၩလၧအဒိၩ့ဒၪဝ့ၫ, ထီးအလူၬလီၫ.- စယိၥၭ နီၪမွဲစဒၫဝံၭအဖိၪအလံၩအဆၨၩအဆၬတၭ, ဘဲၫၥိၭ",
			"5": "<sup>5</sup> အမိဆ့ၭလၩ့ဘၪအမံၩ့,- ဒဲအမၫနးမၫရံၫနီၪဆ့လၧ အဘၪဆၧအဲၪတၩ့လိၬအၥၭ အီၪလၧအဂူၭအၥၭတၭ, စဲၪ့ထၪ့ခွံၬ လၧဂၫလလံၫအဒိၩ့နၭဇရ့ၭ အဖၧၩ့တၭ, ထီၩ့လၧစဒၫဝံၭအဒိၩ့ကိၭဝ့ၫ လၧဘ့ၭၥလံၫဟံၫ့ အီၪ",
			"6": "<sup>6</sup> လၧခးယုဒၫအဖၧၩ့နီၪလီၫ.- လၧအဝ့ၫၥံၪအီၪဝ့ၫထီး နီၪအဘိၩ့ဘၭဆၧမၩအၥၭ, လၧအမုအလၩ ဘၪဝ့ၫ",
			"7": "<sup>7</sup> လၧအမၫမိလၩ့ဖျဲၪတၭ,- အီၪဖျဲၪန့အဖိၪခွၫဝဲၡါနီၪ, ဘီၪ့ဝ့ၫလၧဆၧယၬဘီၪ့ထၬဆၧနီၪ, ဒုၭမံၫနၩ့ဝ့ၫလၧချီ အၪ့အဆၪအလးလီၫ. အဂဲးဘဲၫယီၩၦမွံၩအီၪအလး ဎွ့ၩယူၭလီၫ.",
			"8": "<sup>8</sup> ဆၧလၧခးဖၧၩ့နီၪ, ၦယူၬၥိၪလဖၪအီၪဝ့ၫလၧမံၩ့",
			"9": "<sup>9</sup> လၬကျၩတၭ, ယူၬအၥိၪလၧမုနၩလခီၫလီၫ.- ယိခွါ, ယွၩအၥီၫ့လဂၩဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭတၭ, ယွၩအ လၩအဖၩ့ဂိးၡ့ၭဂိးၡီၫအီၪဝၬဖီၩ့ အဝ့ၫၥံၪတၭ, မွဲအၥၭ",
			"10": "<sup>10</sup> မဲၪၥၭဖျဲၩ့ဝ့ၫဒၪဒိၪမၬလီၫ.- အၥီၫ့နီၪလီၩဘၪအဝ့ၫၥံၪ, ထီးၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩ,ယိခွါ,ယလီၩဘၪ နၥံၪလၧဆၧၥၭထိၬဖၭဒိၪ အပရၧၫ့လၧအမိကဲၪထၪ့",
			"11": "<sup>11</sup> ဝ့ၫလၧၦခမျၧးထီးအလူၬအဂးလီၫ.- အဂဲးဘဲၫယီၩ အယီၩလနံၩယီၩ ၦလၧအထိးထဲၩ့တၩ့ထဲၩ့ဆၧလ ဂၩနီၪ,အီၪဖျဲၪယူၭဝ့ၫလၧနၥံၪအဂးလၧစဒၫဝံၭအဒိၩ့",
			"12": "<sup>12</sup> ဖၧၩ့ယူၭ. အဝ့ၫနီၪမွဲဎရံၬ,ကဆါနီၪလီၫ.- အဆၧမၩ နဲၪ့လၧနၥံၪအဂးမွဲအယီၩ, နၥံၪမိဒၪဖိၪၥၪဘၪဘီၪ့ဘံၭ အၥၭလၧဆၧယၬဘီၪ့ထၬဆၧနီၪ, အီၪဝ့ၫလၧချီအၪ့ အဆၪအလးလီၫ.",
			"13": "<sup>13</sup> မူၭခိၪအၥုၭမုခမျၧးအီၪထၪ့ချဲၫ့မၬလၧအၥီၫ့နီၪ",
			"14": "<sup>14</sup> အၥိၭတၭ,အၪ့အူၭထၪ့ယွၩ, စံၭဝ့ၫဒၪ,- ဆၧအလၩအ ဖၩ့မွဲအဘၪယွၩလၧဆၧထီၫထုၬဆံၭ, ဒဲဆၧဘၪလိၬ အိၭလိၬအီၪလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ဆၧမုၬလၩလိၬအ ၥၭအီၪလၧၦၡၩၥံၪအကျၩလီၫ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭလၧအၥီၫ့လဖၪ ထဲၩ့ခွံၬလၧအဝ့ၫၥံၪ အအီၪတၭထၪ့လၧမူၭခိၪနီၪ, ၦယူၬၥိၪလဖၪစံၭလိၬအ ၥၭ,မွဲပလ့ၩၡီၩ့လၧဘ့ၭၥလံၫဟံၫ့တၭ, ယိၡီၩ့ဆၧယီၩ",
			"16": "<sup>16</sup> လၧကဆါဒုၭၥ့ၪယၫပၧၩဘီၪ.- အဝ့ၫၥံၪလ့ၩဝ့ၫချဲၫ့ချံၭ တၭ,ဒၪဘၪနးမၫရံၫ, ဒဲစယိၥၭ,ဒဲဖိၪၥၪအီၪလၧချီအၪ့",
			"17": "<sup>17</sup> အဆၪအလးလီၫ.- ထီးအဒၪဘၪဝ့ၫနီၪ, ဆၧလၧအ လီၩဘၪဝ့ၫလၧဖိၪၥၪလဂၩအဂဲးအကၠီၪ့လဖၪနီၪ, အ",
			"18": "<sup>18</sup> ဝ့ၫၥံၪမၩဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫလီၫ.- ကယဲၦလၧအနါဂၧၫ့ ဝ့ၫလဖၪ ထီၫမံၫထီၫမၪလၧၦယူၬၥိၪၥံၪလီၩဘၪဆၧ အကၠီၩ့လီၫ.",
			"19": "<sup>19</sup> ဆၧနီၪလဖၪနးမၫရံၫထီးန့ဝ့ၫထီးအလူၬတၭ, ဆီၫ့",
			"20": "<sup>20</sup> မီၪ့ဝ့ၫလၧအၥၭလီၫ.- ၦယူၬၥိၪလဖၪနီၪ, စံၭထၪ့အၪ့ အူၭဒဲၥံၫကျံၩထၪ့ယွၩ လၧအနါဂၧၫ့ဆၧ ဒဲလၧအဒၪ ဘၪဆၧထီးအလူၬအကၠီၩ့ ဘဲၫဆၧစံၭဝဲၩဝ့ၫအၥိၭနီၪ တၭ,ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ထီးဎိၭနံၩလနံၩဎွ့ၩထၪ့ဖိၪၥၪဘၪဆၧကူၭတရံၭ နီၪတၭ,ဆၧကိၭဝ့ၫအမံၩ့လၧယ့ၫၡုၬ ဘဲၫအၥီၫ့ဖျိၬဝဲၩ ဝ့ၫအၥိၭလၧအလချႃၭအီၪထၪ့ဒံၭဘၪလၧဆၧဒၧၩ့ လးအဖၧၩ့နီၪလီၫ.",
			"22": "<sup>22</sup> ထီးအဝ့ၫၥံၪၥူၫဝၭဆံၫ့ဆၧအမုနံၩလဖၪလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫ, ဘဲၫစမိစ့ၭအဆၧမၪလူၬအၥိၭနီၪ, အဝ့ၫၥံၪ လ့ၩဆိၬဝ့ၫလၧယရုစလံၫ့ ဘဲၫၥိၭအမိအီၪက့ၪဝ့ၫလၧ",
			"23": "<sup>23</sup> ကဆါအမ့ၬယၫ,- (ဘဲၫဆၧကွ့ၭအၥၭလၧကဆါအ ဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့အၥိၭ,) က ယဲ ၦ ခွၫ လၧ အ ဝဲ ထၪ့ ဆိၫ ဆၧ ဒၧၩ့ လး လ ဂၩ လါ လါ မိ ဘၪ ဆၧ ကိၭ ဝ့ၫ လၧ ဆၧ ဆံၫ့ ဎံၪ လၧ",
			"24": "<sup>24</sup> က ဆါ အ ဂး,- ဒဲ လု ထၪ့ ဆၧ ဘဲၫ ဆၧ စံၭ ဝ့ၫ လၧ က ဆါ အ ဆၧ ၥီၪ့ ဆၧ ၥၫ့ အ ဖၧၩ့ အ ၥိၭ နီၪ, ထိၪ လွံ နံၫ ဘံၪ့, အ့ၪ လ မွဲ ဘၪ တၭ, ကၪ ကဲၪ ဖိၪ နံၫ ဘံၪ့ လီၫ.",
			"25": "<sup>25</sup> ယိခွါ, ၦကိၭဝ့ၫအမံၩ့လၧစစံမအၧၫ့လဂၩအီၪဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့လီၫ. ၦလဂၩနီၪမွဲအတီၩအ လီၩ့,ဒဲအယူၭယၪ့ယွၩတၭ, ယိလါဝ့ၫလၧအံၫစရ့လၭ အဆၧမၩမုၬဝ့ၫအဖၧၩ့ၥၭတၭ,ၥၭမုဆံၫ့ဎံၪအီၪလၧ",
			"26": "<sup>26</sup> အလီၩ့လီၫ.- ၥၭမုဆံၫ့ဎံၪဒုၭနဲၪဝ့ၫလၧ အလချႃၭဒၪ ဒံၭဘၪဆၧၥံၫတၭ, မိဒၪဘၪအကဆါအဎရံၬနီၪ",
			"27": "<sup>27</sup> လီၫ.- ၥၭမုအီၪလၧအလီၩ့အဘိၩ့ဘၭနီၪ လ့ၩနုၬဝ့ၫ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, အမိအဖါဂဲၫဆိၬဖိၪၥၪယ့ၫ ၡုၬနီၪ,ဘဲၫၥိၭအမိမၩဝ့ၫလၧအဂး ဘဲၫဆၧမၪလူၬအ",
			"28": "<sup>28</sup> ထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪ, လ့ၩနုၬဝ့ၫတၭ,- အဝ့ၫဒၪ ဆိၬထၪ့ဝ့ၫလၧအစူၪလီၩ့, စံၭထၪ့အၪ့အူၭယွၩ, စံၭ",
			"29": "<sup>29</sup> ဝ့ၫ,- ကဆါဧ့, ဘဲၫနလူအၥိၭနီၪ,ဘိၩ့နဲၪ့ယီၩကွဲၪ",
			"30": "<sup>30</sup> ဖျါနဎီးနၡၩယီၩမုၬမုၬဆံၭ.- အဂဲးဘဲၫယီၩယမ့ၬဒၪ",
			"31": "<sup>31</sup> ဘၪယူၭနဆၧထိးထဲၩ့တၩ့ထဲၩ့,- လၧနတဲၩ့ဝဲၩဝ့ၫ",
			"32": "<sup>32</sup> လၧၦထီးအလူၬအမ့ၬယၫ,- ဆၧဖၩ့လဖျိၪ့လၧအဖၩ့ ထၪ့ဝ့ၫလၧၦဆၨၩလဖၪအဂး, ဒဲနခ့ၫနၡၩၦအံၫစရ့ လၭဖိၪအလၩအဖၩ့ယူၭလီၫ.",
			"33": "<sup>33</sup> မွဲဆၧလၧအချဲၩ့ဝ့ၫလၧအဂဲးတၭ,အမိ, ဒဲစယိၥၭ",
			"34": "<sup>34</sup> ထီၫမံၫထီၫမၪလီၫ.- စစံမအၧၫ့ဆိၪဂ့ၩအဝ့ၫၥံၪတၭ,",
			"35": "<sup>35</sup> လီၩဘၪအမိနးမၫရံၫ,ယိခွါ,- ဘဲၫၦၡၩအၪဂၩအဆၧ ကိၪ့ထၪ့ဖၭလၩ့ မိအီၪဖျီၪတၭ, အဝ့ၫလဂၩယီၩဘၪဆၧ အီၪက့ၪလၩ့ဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪအၪဂၩ အဆၧ လၩ့ထံၩဖါအလး,ဒဲဂဲထုၪ့ထဲၩ့အလး, ဒဲၦစံၭအၧၩ့ အလးတၭ, နၭလဘံၪ့မိဆ့ၭဖျီၫ့နၥၭဒၪနဝ့ၫဆ့ လီၫ.",
			"36": "<sup>36</sup> ၦလၧစအၭၡၧၫအဒီၪ့အကျၩ စဖၪ့နုၫအ့လၭအဖိၪ မုၪမီၪနးအၫ့နၫအီၪဝ့ၫလဂၩတၭ, လၧအမုၪနၩ့အလး ခဲၫ့နီၪ အီၪဎုၬဘၪလၧအဝၩ နွ့ၫနံၪ့, အၥၭၡါက့ၭယူၭ",
			"37": "<sup>37</sup> လီၫ.- မွဲၦမုၪမဲၫဝ့ၫနီၪ,အနံၪ့ဎိၭဆံၫလံနံၪ့ကၪယူၭတၭ, ဒုၪဆၧအၪ့ဆၧအီၩ, ဒဲဘၩဆိၪဖၪဆၧတၭ, မၩယွၩအ ဆၧလၧမုနၩနၩ,မုဆၫဆၫတၭ, စဲၪ့ဖၭလၧဆၧလုအဂံၪ့",
			"38": "<sup>38</sup> ဖၧၩ့အ့ၬ.- ထီးအဆၧၫ့အထီနီၪဂဲၫနုၬဝ့ၫတၭ, စံၭ ထၪ့အၪ့အူၭကဆါတၭ, လီၩဘၪအဝ့ၫဒၪအဂဲးအကၠီၪ့ လၧၦလၧအယိလါဆၧထိးထဲၩ့တၩ့ထဲၩ့ အဖၧၩ့ၥၭလၧ ယရုစလံၫ့အဖၧၩ့ထီးအလူၬလီၫ.",
			"39": "<sup>39</sup> ထီးအဝ့ၫၥံၪမၩဝ့ၫ ဘဲၫယွၩအဆၧၥီၪ့ဆၧၥၫ့အီၪဝ့ၫ အၥိၭနီၪ, ထဲၩ့ထဲၩ့ဝ့ၫလၧအဒိၩ့ဒၪဝ့ၫနၭဇရ့ၭ လၧခး",
			"40": "<sup>40</sup> ဂၫလလံၫအဖၧၩ့လီၫ.- ဖိၪၥၪနီၪဒိၪထၪ့ဝ့ၫဒဲအၥၭဆီၪ့ ထၪ့တၭ, လၧၫ့ဎွ့ၩဝ့ၫလၧဆၧကိၪ့ၥ့ၪနီၪ, ယွၩအခိး အတၩအီၪ လၧအလီၩ့လီၫ.",
			"41": "<sup>41</sup> ထီးဘိၪ့လ့ၩဖၬအ့ၪဘၪနီၪ အမိအဖါလ့ၩဝ့ၫလၧယ",
			"42": "<sup>42</sup> ရုစလံၫ့ကိၭနံၪ့ဒ့ၭလီၫ.- ဆၧမၩအၥၭလၧအအီၪလ ဆံၫနံၫနံၪ့နီၪ ဘဲၫဆၧဘိၪ့အထူၫအရူၫအၥိၭနီၪ အဝ့ၫ",
			"43": "<sup>43</sup> ၥံၪလ့ၩထၪ့ဝ့ၫလၧယရုစလံၫ့,- အမုနံၩလဖၪဎွ့ၩထၪ့ ဝ့ၫတၭ, ၦလဖၪနီၪထဲၩ့ထဲၩ့ဝ့ၫ, ဖိၪၥၪယ့ၫၡုၬအီၪထး ဝ့ၫလၧယရုစလံၫ့အဖၧၩ့နီၪတၭး အမိအဖါၥ့ၪယၫဝ့ၫ",
			"44": "<sup>44</sup> အ့ၬ.- အဝ့ၫၥံၪဆီၫ့မီၪ့ဝ့ၫလၧအအီၪလၧၦဂဲၫထဲၩ့လၧ အၥိၭအကျၩတၭ, ထဲၩ့ထဲၩ့ဝ့ၫလနံၩဖၧၩ့ၥၭတၭ, အၪ့ ဎၬဝ့ၫလၩ့ထံးလၩ့ဆ့ၭ လၧအဘူၭအထံးဒဲလၧအထံၩ",
			"45": "<sup>45</sup> အၥိၭအကျၩ,- လဒၪဘၪဝ့ၫတၭ, ထဲၩ့ထဲၩ့အၪ့ဎၬဝ့ၫ လၧယရုစလံၫ့လီၫ.",
			"46": "<sup>46</sup> ဆၧမၩအၥၭလၧၥၧၫ့နံၩဖီၩ့ခွံၬတၭ, မွဲအဒၪထဲၩ့ဝ့ၫ အီၪလၧဆၧလုအဂံၪ့ဖၧၩ့ ဆၧၫ့နၩ့ဝ့ၫလၧ ဆရၫၥံၪအ ကျၩတၭ, ခိၭနၪအဝ့ၫၥံၪအလူနီၪ ဒဲအၪ့စၪ့ဆၧလီၫ.",
			"47": "<sup>47</sup> လၧအဆၧကိၪ့ၥ့ၪ, ဒဲအစံၭဆၧၫ့ဆၧအကၠီၩ့တၭ, ၦနါ ဂၧၫ့ဝ့ၫလဖၪနီၪ ထီၫမံၫထီၫမၪဝ့ၫထီးအလူၬလီၫ.",
			"48": "<sup>48</sup> ထီးအဝ့ၫၥံၪဒၪဘၪဝ့ၫနီၪ,ထီၫမံၫထီၫမၪဝ့ၫတၭ, အ မိစံၭအဝ့ၫ,ဖိၪဧ့မွဲဘၪနီၫနမၩပၧၩဘဲၫယီၩလဲၪ. ယိခွါ, နဖါဒဲယၧၩယီၩ, ပၥုၪ့အုၭပၥၭအုၭတၭ, ပအၪ့ဎၬယူၭ",
			"49": "<sup>49</sup> နၧၩယူၭ.- အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, မွဲဘၪနီၫနၥံၪအၪ့ဎၬ ယၧၩလဲၪ.ယဘၪအီၪလၧယဖါအဂံၪ့ဖၧၩ့မွဲနၥံၪ",
			"50": "<sup>50</sup> ၥ့ၪယၫအ့ၬဧၪ.- ဆၧချဲၩ့လၧအလီၩဘၪဝ့ၫနီၪ,အဝ့ၫၥံၪ",
			"51": "<sup>51</sup> နၪဝ့ၫၥ့ၪအ့ၬ.- အဝ့ၫဒၪထဲၩ့ထဲၩ့ဝ့ၫလၧအဝ့ၫၥံၪအၥိၭ လၧနၭဇရ့ၭတၭ, အီၪက့ၪအၥၭလၧအဝ့ၫၥံၪအဖၫ့လၬ လီၫ.ဆၧလဖၪနီၪ အမိထီးန့ဝ့ၫ လၧအၥၭဖၧၩ့ထီး",
			"52": "<sup>52</sup> အလူၬလီၫ.- ယ့ၫၡုၬဒိၪထၪ့ဝ့ၫတၭအဆၧကိၪ့ၥ့ၪ, ဒဲအခိးအတၩလၧယွၩအမ့ၬ ယၫဒဲလၧၦၡၩအမ့ၬယၫ အၪထၪ့ဝ့ၫဒၪဆ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> လၧတဘံရအၧၭစံစၧၫ ပၧၩ့ဆၧလဆံၫယဲနံၪ့လနံၪ့ အဖၧၩ့နီၪ, ဆၧပီၪ့တအၧၭပဲလၭ မွဲခးယုဒၫအၦဒိၪဖၭ ဒိၪဒဲစဟ့ရၧၭမွဲဂၫလလံၫအၦဒိၪဖၭဒိၪ, ဒဲအထၧၫ့ဖုဝဲ စဖံလံၭမွဲခးအံထုၫရံအၫ, ဒဲခးတြၭခနဲတံၭအၦဒိၪဖၭ",
			"2": "<sup>2</sup> ဒိၪ,ဒဲစလဲၫစ့နအၭ မွဲအၫဘလံနံၫအၦဒိၪဖၭဒိၪ,- ထီး စအၫ့နၭ,ဒဲစက့ၭအဖၭမွဲၦလုဆၧအခိၪနီၪ,ယွၩအလူ လၩ့ဘၪ စဇၭခရဲအၫအဖိၪခွၫစယီဟၫ့ လၧမံၩ့လၬ",
			"3": "<sup>3</sup> ကျၩလီၫ.- ဆၧဘၭတံၫဇၫ့လၧအဘၪဆဲၫ့ ဆၧနီၫ့ယါ လၩ့ထဲၩ့အၥၭ လၧဆၧကွဲၪဖျါဆၧဒဲၩဘၭအဂဲးနီၪ, စ ယီဟၫ့လ့ၩလီၩလၩ့လၬလၩ့ဆၧ လၧယီၫဒၫ့အနဲၩ့",
			"4": "<sup>4</sup> လၧထံၫထၪလၧထံၫခံၫလီၫ.- ဘဲၫဆၧကွ့ၭအၥၭလၧ လံၬမီၪစအဲၫစ့ယၫအလူအၥိၭနီၪတၭ, စံၭဝ့ၫ, ဆၧအလူၥီၫထၪ့လၧမံၩ့လၬကျၩတၭ, စံၭဝ့ၫ, တဲၩ့ဝဲၩကဆါအဖၧၩ့ၥၭဆံၭး မၩလီၩ့အဖၧၩ့မုလဖၪနီၪဆံၭ.",
			"5": "<sup>5</sup> ကယဲခိၪလီၩ့အဆူၭလစီၪ့လါလါမိဎွ့ၩဝ့ၫ, ကယဲခိၪလီၩ့ဒဲဆၧစီၩ့ခိၪလဖျိၪ့လါလါမိဘၪလၩ့ ဒၩဝ့ၫ, ဆၧအကဲၪ့လဖၪနီၪမိလီၩ့ထၪ့ထဲၩ့ဝ့ၫ, ဖၧၩ့ၥၭလၩ့အိၪ့ထၪ့စီၩ့လဖၪနီၪမိဎၩ့ဝ့ၫဒၪတၭ,",
			"6": "<sup>6</sup> ကယဲဆၧယၪထီးအလူၬနီၪ မိဒၪဘၪယွၩအဆၧထိးထဲၩ့တၩ့ထဲၩ့လီၫ.",
			"7": "<sup>7</sup> အနီၪတၭအဝ့ၫဒၪစံၭၦခမျၧး လၧအဂဲၫဝ့ၫလၧအ အီၪဘဲၫၥိၭအမိဒိၭဘၭတံၫဇၫ့ဘၪအၥၭ လၧအစူၪ ဖၧၩ့နီၪးဂူအၧၩ့အဆၨၩအဆၬၥံၪဧ့,မွဲပလၫၥီၪ့လိၪ နၥံၪဘဲၫၥိၭနၥံၪမိစဲၪ့ဒၪဆၧၥၭထၪ့ လၧအမိဂဲၫနီၪလ",
			"8": "<sup>8</sup> ဂၩလဲၪ.- ဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭအဆၧၥၪဂ့ၩနီၪ, ၥၪ ဒၪခလူၬနၥံၪဝ့ၫဆံၭ. နၥံၪထီးစံၭလၩ့နၥံၪအၥၭလၧစ အၫဘြဟၫ့မွဲပဖါနီၪလဂ့ၩ. အဂဲးဘဲၫယီၩယစံၭနၥံၪ, လၧလိးလဖၪယီၩအကျၩ, ယွၩဒုၭကဲၪထၪ့ဖိၪလဖၪ လၧစအၫဘြဟၫ့အဂးၥ့ၪလီၫ.",
			"9": "<sup>9</sup> ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, ကွၩဘၪဆၧအီၪက့ၪလၩ့ဝ့ၫ လၧၥံၪ့အခၪ့ထံၭယူၭး မၩအၥၭဘဲၫနီၪတၭ, ကယဲၥံၪ့ လၧအလၥၪဘၪဝ့ၫ လၧအဂ့ၩကိၭထံၭဒ့ၭနီၪ, မိဘၪ ဆၧခူၬခွံၬဝ့ၫတၭ, မိဘၪဆၧဖျႃၭလၩ့ခွံၬဝ့ၫလၧမ့ၪဖၧၩ့",
			"10": "<sup>10</sup> လီၫ.- ၦခမျၧးနီၪအၪ့စၪ့ဝ့ၫတၭ, စံၭဝ့ၫ,အ့ၪမွဲဘဲၫနီၪ",
			"11": "<sup>11</sup> တၭ,ပဘၪမၩပဝ့ၫဘဲၫၥ့ၪလဲၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧ တၭစံၭအဝ့ၫၥံၪ, ၦလၧအဆဲၫ့အီၪဝ့ၫနံၫဘံၪ့နီၪ,မွဲအ အၪ့နၩ့ဖၭဖ့ၪလၫ့ ၦလၧအ ဆဲၫ့လအီၪဘၪဆံၭ. ၦလၧ",
			"12": "<sup>12</sup> အဆၧအၪ့အီၪဝ့ၫနီၪ, မွဲအမၩဘဲၫနီၪၥိၭဆ့ဆံၭ.- ၦ လၧအအၪ့ကံၩ့အခီၫ့လဖၪနီၪ, ဘဲၫၥိၭအမိဒိၭဘၭ တံၫဇၫ့ဘၪအၥၭတၭ, ဂဲၫဝ့ၫလၧအအီၪနီၪ, စံၭဝ့ၫ, ဆ",
			"13": "<sup>13</sup> ရၫဧ့, ပဝ့ၫဒၪယီၩမွဲပဘၪမၩဘဲၫၥ့ၪလဲၪ.- အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪ, ဆၧလၧဆၧမၪလူၬနၥံၪနီၪ, နၥံၪထီးမၩန့",
			"14": "<sup>14</sup> အၪနဲၪ့အနီၪလဂ့ၩ.- ၦၥုၭဖိၪလဖၪအၪ့စၪ့ဝ့ၫတၭ, စံၭ ဝ့ၫ,ပဝ့ၫဒၪယီၩမွဲပဘၪမၩဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪစံၭ အ ဝ့ၫၥံၪ,နၥံၪထီးမၩနၧၩ့ဆီၪ့ၦနးဂၩလဂ့ၩ,နၥံၪထီး အၪ့ဘျံၭအၪ့ဘျၪဆၧလဂ့ၩ. ထီးဒၪနၥံၪန့ဘၪနၥံၪအ",
			"15": "<sup>15</sup> လံၩ့နီၪ, ၥုၪ့မံၫ့ၥၭမံၫ့ဆံၭ.- ၦခမျၧးယိလါဆၧအ ဖၧၩ့ၥၭတၭ,ၦထီးအလူၬကၩ့ကၩလိၬအၥၭ လၧစယီ",
			"16": "<sup>16</sup> ဟၫ့အဂဲးနီၪလၧအမွဲဎရံၬဧၪ, လမွဲဘၪဎရံၬနီၪဧၪ.- စ ယီဟၫ့ချဲၩ့ဆၧၫ့ၦထီးအလူၬတၭစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ, ယဘၭတံၫဇၫ့နၥံၪလၧထံၫကျၩလီၫ. မွဲလါနၫ့တၭၦမိ ဂဲၫဝ့ၫလဂၩ ၥ့ၪနဲၪ့ဒံၭယၧၩဒံၭလီၫ. ထီးယကွဲၪလၩ့ အခၪ့ဖံၭဖျံၩနီၪ ယကြၨၭအ့ၬ. အဝ့ၫနီၪမိဘၭတံၫဇၫ့န",
			"17": "<sup>17</sup> ၥံၪလၧၥၭမုဆံၫ့ဎံၪ,ဒဲလၧမ့ၪအဖၧၩ့လီၫ.- အချဲၩ အီၪဝ့ၫလၧအစူၪဖၧၩ့တၭ, မိမၩဆံၫ့ခွံၬအခရဲးဂ့ၩဘၪ စဲၪနီၪ,မိအီၪက့ၪကီၪ့ထဲၩ့ အဘုၪၥံၪဂူၫၥံၪလၧအဖၫ့ ဖၧၩ့တၭ,အ့ၪမွဲလီခၫ့နီၪ, မိဆူၭထၪ့ခွံၬဝ့ၫလၧမ့ၪလၧ အလၩ့ဖံၬလၥ့ၪဘၪလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪၦဂၨၪထၪ့ၦၡၩလၧ အဆၧချဲၩ့ဂူၫဂၩအၪ ထံၪတၭ, လီၩလၩ့လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့ လၧ",
			"19": "<sup>19</sup> ၦခမျၧးလီၫ.- ၦဒိၪဖၭဒိၪစဟ့ရၧၭဘၪဆၧအၪ့လၬ လၧအဝ့ၫနီၪ လၧအထၧၫ့ဖုဝဲအမၫနးဟရိဒအၭအကၠီၩ့ ဒဲကယဲဆၧအၧၩ့လၧစဟ့ရၧၭ မၩဝ့ၫထီးအလူၬအကၠီၩ့",
			"20": "<sup>20</sup> တၭ,- မွဲအမၩအၪထၪ့အဆၧအၧၩ့လမံၩ့ လၧအဒူၭ ထၬစယီဟၫ့လၧထီၫ့ဖၧၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> ဆၧမၩအၥၭလၧၦခမျၧးထီးအလူၬ ဒိၭဘၭတံၫဇၫ့ အၥၭနီၪ, ယ့ၫၡုၬဘၭတံၫဇၫ့လၩ့အၥၭဆ့တၭ, ဘၩ",
			"22": "<sup>22</sup> ဆိၪဖၪဆၧအဘိၩ့ဘၭနီၪ, မူၭခိၪဝဲထၪ့အၥၭတၭ,- ၥၭ မုဆံၫ့ဎံၪအမိၡါဘဲၫထိၪလွံအၥိၭနီၪ ဂဲၫဆီးလၩ့လၧ အလီၩ့လီၫ. ဆၧအလူၥီၫလၩ့လၧမူၭခိၪတၭ, စံၭဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲယဖိၪခွၫၥၭဘီၩ့တၭ, မုၬယၥၭလၧနၧၩ လီၫ.",
			"23": "<sup>23</sup> ယ့ၫၡုၬအနၫ့ဆါဒၪဝ့ၫထီးအမၩထၪ့ၥၫ့ဆၧ, မွဲအၥၭ ၡါအနံၪ့ၥၧၫ့ဆံၫကၪယူၭတၭ, ၦဆီၫ့မီၪ့ဝ့ၫလၧအမွဲ",
			"24": "<sup>24</sup> စယိၥၭအဖိၪခွၫ,စဟံလဲၫအဖိၪခွၫ,- စမၭၥၭအဖိၪ ခွၫ,စလံဝဲၫအဖိၪခွၫ, စမ့လခ့အဖိၪခွၫ, စယၪ့နၫအဖိၪ",
			"25": "<sup>25</sup> ခွၫ,စယိၥၭအဖိၪခွၫ,- စမၭတၥဲအၭအဖိၪခွၫ, စအ့မ အၧၭအဖိၪခွၫ, စနၫဟၫ့အဖိၪခွၫ, စအ့စလဲၫအဖိၪခွၫ,",
			"26": "<sup>26</sup> စနၭဂဲၫအဖိၪခွၫ,- စမၫအၥၭအဖိၪခွၫ, စမၭတၥဲအၭ အဖိၪခွၫ, စၡံမအဲၫအဖိၪခွၫစယိၥၭအဖိၪခွၫ, စယုဒၫ",
			"27": "<sup>27</sup> အဖိၪခွၫ,- စယိအၪ့နၫအဖိၪခွၫ,စရ့ဇၫအဖိၪခွၫ, စဇ ရၧၭဘၫဘ့လၭအဖိၪခွၫ, စအၫၥအ့လၭအဖိၫခွၫ, စနံ",
			"28": "<sup>28</sup> ရဲၫအဖိၪခွၫ,- စမ့လခဲၫအဖိၪခွၫ, စအၭဒဲၫအဖိၪခွၫ,",
			"29": "<sup>29</sup> စကိစၪ့အဖိၪခွၫ,စအ့လမိဒၫ့အဖိၪခွၫ, စအၧၭအဖိၪခွၫ, စယိစံၫအဖိၪခွၫ, စအံလအ့ဇၧၫအဖိၪခွၫ, စယိရံၫ့အ",
			"30": "<sup>30</sup> ဖိၪခွၫ,စမၭၥၭအဖိၪခွၫ, စလံဝဲၫအဖိၪခွၫ,စစံမအၧၫ့ ဖိၪခွၫ,စယုဒၫအဖိၪခွၫ, စယိၥၭအဖိၪခွၫ,စယိနၫ့အ",
			"31": "<sup>31</sup> ဖိၪခွၫစအံၫလဲအကံၪ့အဖိၪခွၫ,- စမလံအၭအဖိၪခွၫ, စမဲနၫ့အဖိၪခွၫ, စမၭတၥၫအဖိၪခွၫ, စနၫၥၫ့အဖိၪ",
			"32": "<sup>32</sup> ခွၫ,စဒၫဝံၭအဖိၪခွၫ,- စယ့ၫစံၫအဖိၪခွၫ,စအိဘ့ၭ အဖိၪခွၫ,စဘိအၭအဖိၪခွၫ, စစၫလမၧၫ့အဖိၪခွၫ, စနၫ",
			"33": "<sup>33</sup> ဟၧၫ့အဖိၪခွၫ,- စအမံနဒၭအဖိၪခွၫ, စရၫ့အဖိၪခွၫ, စတ့ဇရၧၫ့အဖိၪခွၫ, စဖ့ရ့ၭအဖိၪခွၫစယုဒၫအဖိၪ",
			"34": "<sup>34</sup> ခွၫ,- စယၫကူၭအဖိၪခွၫ, စအံစၭအဖိၪခွၫ, စအၫဘြ ဟၫ့အဖိၪခွၫစတံရၫအဖိၪခွၫ, စနၫဟီၫအဖိၪခွၫ,- စစံ",
			"35": "<sup>35</sup> ရၧၭအဖိၪခွၫ, စရုၫအဖိၪခွၫ, စပံလ့ၭအဖိၪခွၫ, စအံ",
			"36": "<sup>36</sup> ဘၧၫအဖိၪခွၫ, စစၫလၫအဖိၪခွၫ,- စကဲနၫ့အဖိၪခွၫ, စအၫဖစၭအဖိၪခွၫ,စၡံၫ့အဖိၪခွၫ, စနိအၫအဖိၪခွၫ,",
			"37": "<sup>37</sup> စလၫမ့ၭအဖိၪခွၫ,- စမၥုစလၫအဖိၪခွၫ, စအံနၧၭ အဖိၪခွၫ,စယၫရ့ၭအဖိၪခွၫ, စမဟၫလလံၪလၭအဖိၪ",
			"38": "<sup>38</sup> ခွၫစကဲနၫ့အဖိၪခွၫ,- စအံနိၭအဖိၪခွၫ,စစ့ၥၭအဖိၪ ခွၫ,စအၫဒၫ့အဖိၪခွၫ,ယွၩအဖိၪခွၫလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ယ့ၫၡုၬလၧၫ့ဎွ့ၩဝ့ၫလၧၥၭမုဆံၫ့ဎံၪ, ထဲၩ့ခွံၬဝ့ၫ လၧယီၫဒၫ့တၭ, ၥၭမုနီၪလ့ၩၥိၫ့ဝ့ၫ လၧမံၩ့လၬကျၩ တၭ,ဘၪဆၧကျဲၩ့ဖစီၩ့ လၧမုၪခီၩလဲး အၥၫ့လံဆံၫ",
			"2": "<sup>2</sup> လီၫ.- လၧအနံၩအၥၫ့နီၪလအၪ့ဘၪဆၧနးမံၩ့တၭ, ထီးအထုၬဝ့ၫဒၪ နီၪဆၧၥၭဝံအၥၭလီၫ.",
			"3": "<sup>3</sup> မုၪခီၩလဲးစံၭဝ့ၫ, နအ့ၪမွဲယွၩအဖိၪခွၫတၭ, ဘဲၫၥိၭ",
			"4": "<sup>4</sup> လိးလဖျိၪ့ယီၩမိကဲၪထၪ့ကိၪတၭ, ချဲၩ့ထၪ့ဘီၪ.- ယ့ၫ ၡုၬ ချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫ,ဆၧကွ့ၭအၥၭ, ၦ ၡၩ မၧၫ့ ဝ့ၫ န့ၫ ကိၪ လ မံၩ့ ယီၩ မွဲ အ့ၬ. မွဲလၧကယဲ ယွၩအလူလမံၩ့လါလါနီၪလီၫ.",
			"5": "<sup>5</sup> မုၪခီၩလဲးၥိၫ့ထၪ့ဝ့ၫ လၧခိၪလီၩ့ထီၫလဖျိၪ့ အလီၩ့ တၭ, လၧလဆိဖိၪအထးဖၧၩ့နီၪ, ဒုၭနဲၪဝ့ၫကယဲဘၩ့",
			"6": "<sup>6</sup> ၥံၪမုးၥံၪလၧဂၪ့ခိၪချိၫ့လီၫ.- မုၪခီၩလဲးစံၭဝ့ၫ, ကယဲ ဆၧအစီၩ့အမၩ့ယီၩ, ဒဲအလၩအဖၩ့နီၪ ယမိဖ့ၪလၫ့ နၧၩလီၫ. အဂဲးဘဲၫယီၩဆၧဖ့ၪလၫ့ယူၭလၧယစူၪ ဖၧၩ့တၭ,ထီးဒၪၦလၧဆၧမိဖ့ၪလၫ့ဘၪ ယၥၭလဂၩ",
			"7": "<sup>7</sup> ဂၩနီၪ,ယဖ့ၪလၫ့ယဝ့ၫဒၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နအ့ၪဘိၪ့ထၪ့ဘၩထၪ့ယၧၩတၭ, ဆၧမိကဲၪထၪ့နဆၧ",
			"8": "<sup>8</sup> ထီးအလူၬလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫတၭ, စံၭဝ့ၫ ဒၪ,ဆၧကွ့ၭအၥၭ, ယွၩ န က ဆါ နီၪ န ဘၪ ဘိၪ့ ထၪ့ ဘၩ ထၪ့ အ ဝ့ၫ ဆံၭး န မိ ဘၪ မၩ န့ၫ အ ဝ့ၫ ဒၪ အ ဆၧ လီၫ.",
			"9": "<sup>9</sup> အဝ့ၫဒၪလ့ၩၥိၫ့ထၪ့ဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့တၭ, အီၪက့ၪထၪ့ဝ့ၫ လၧဆၧလုအဂံၪ့အခိၪစီၪ့လီၫ. စံၭအ",
			"10": "<sup>10</sup> ဝ့ၫ,နအ့ၪမွဲယွၩအဖိၪခွၫနီၪ, ခွံၬလၩ့နၥၭဘီၪ.- အဂဲး ဘဲၫယီၩဆၧကွ့ၭအၥၭးဆၧ မိ မၪ လူၬ အ ၥီၫ့ လ ဖၪ လၧ န ဂဲး ဘဲၫ ၥိၭ အ မိ ယိ ထဲၩ့ ခွါ",
			"11": "<sup>11</sup> ထဲၩ့ နၧၩ တၭ,- အ ဝ့ၫ ၥံၪ မိ ဆိၬ ထၪ့ နၧၩ လၧ အ စူၪ လီၩ့ ဘဲၫ ၥိၭ န ခၪ့ ထီး ဘၪ ထံၭ လၧ လိး လ ဂ့ၩ လီၫ.",
			"12": "<sup>12</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ဆၧစံၭဝ့ၫ,",
			"13": "<sup>13</sup> ထီးကျဲၩ့ဖစီၩ့ယွၩနကဆါနီၪလဂ့ၩ,- မုၪခီၩလဲး ကျဲၩ့ဖစီၩ့ဆၧထီးအလူၬဂီၩ့တၭ, စဲၪ့ဖၭလၧအဝ့ၫနီၪ လဆိလီၫ.",
			"14": "<sup>14</sup> ယ့ၫၡုၬထဲၩ့ထဲၩ့ဝ့ၫလၧဂၫလလံၫ အီၪဝ့ၫလၧၥၭမု အစီၩ့အမၩ့လၧအလီၩ့တၭ, အပရၧၫ့ဂၧၫ့ထၪ့ၥၩလၩ့",
			"15": "<sup>15</sup> ထၧၫ့ခးယၫလီၫ.- အဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ လၧအ ဝ့ၫၥံၪအၥရိၬလဖၪအဖၧၩ့တၭ, ၦထီးအလူၬစံၭထၪ့ အၪ့အူၭဝ့ၫဒၪလီၫ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪထဲၩ့ထဲၩ့ဝ့ၫလၧနၭဇရ့ၭလၧအဒိၪထၪ့ ဝ့ၫလၧအဖၧၩ့တၭ, ဘဲၫအထူၫအရူၫဒၪဝ့ၫအၥိၭ နီၪ, ဘၪမးၥံၫအနံၩတၭ, လ့ၩနုၬဝ့ၫလၧၥရိၬဖၧၩ့နီၪ,",
			"17": "<sup>17</sup> ဂဲထုၪ့ဝ့ၫဘဲၫၥိၭအမိဖီဘၪလံၬလီၫ.- ဆၧဖ့ၪလၫ့အဝ့ၫ လၧမီၪစအဲၫစ့ယၫအလံၬလီၫ. ပၠၪလၩ့လံၬနီၪတၭ,ဒၪ န့ဝ့ၫအလးထီးဆၧကွ့ၭဝ့ၫ,",
			"18": "<sup>18</sup> ယွၩအၥၭအီၪလၧယလီၩ့လီၫ. အဂဲးဘဲၫယီၩဂုၪယူၭယၧၩ ဘဲၫၥိၭယမိလီၩလၩ့ လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့ လၧၦၡၪ့ဖိၪယၬဖိၪ လီၫ. အၪ့မၧၫ့လၩ့ယၧၩဘဲၫၥိၭယမိမၩဘျၪထဲၩ့ၦ အၥုၪ့ခါအၥၭလၩ့, ဘဲၫၥိၭယမိကိၭထၪ့ဆၧဖီၩ့ဖျ့ၭလၧၦဘၪဆၧ အၪ့မၧၫ့ဎီးဝ့ၫအဂး, ဒဲဒုၭဒၪထၪ့ထဲၩ့ၦလၧအမ့ၬ ဘျီၪ, ဘဲၫၥိၭယမိဖျါခွံၬၦဘၪဆၧမၩအၧၩ့မၩ နၭဝ့ၫ,",
			"19": "<sup>19</sup> ဘဲၫၥိၭယမိမၩဂၧၫ့ထၪ့ၥၩလၩ့နံၪ့လၧအဘၪယွၩ အၥၭနီၪလီၫ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪထူၫထၪ့ထဲၩ့လံၬတၭ, ဖ့ၪလၫ့ထဲၩ့ဝ့ၫလၧ ဆၧအခ့ၫအၡၩလဂၩနီၪ, ဆၧၫ့နၩ့ထဲၩ့ဝ့ၫလီၫ. ၦအီၪ လၧၥရိၬဖၧၩ့ကိၭဂၩဒ့ၭလဖၪနီၪ, ယိအမ့ၬထံၫထံၫ",
			"21": "<sup>21</sup> ဆၭဆၭလီၫ.- အဝ့ၫဒၪချဲၩ့ထၪ့ၥၫ့ဆၧ လၧအဝ့ၫၥံၪ, စံၭဝ့ၫ,ဆၧကွ့ၭအၥၭယီၩ, လၧၫ့ထၪ့ဎွ့ၩထၪ့လၧနၥံၪ",
			"22": "<sup>22</sup> အနါဖၧၩ့လၧမုဆၫလနံၩယီၩလီၫ.- ၦထီးအလူၬထိး အၥၭလၧအဝ့ၫဒၪအဂးတၭ, လၧဆၧချဲၩ့အဂ့ၩလၧအ ဂဲၫထၪ့လၧအနိၭဖၧၩ့အကၠီၩ့နီၪ, ထီၫမံၫထီၫမၪဝ့ၫ ဒၪလီၫ.ၦလဖၪနီၪစံၭဝ့ၫ,အဝ့ၫဒၪယီၩ, မွဲစယိၥၭအဖိၪ",
			"23": "<sup>23</sup> ခွၫနီၪမွဲအ့ၬဧၪ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, မွဲမၬ,နၥံၪမိ စံၭယၧၩလၧဆၧချဲၩ့အဒီၩ့ယီၩ, ၥံၪဎၥံၪ့ဎွံၭ ဆရၫဧ့, မၩဘျၪထဲၩ့ဒၪနၥၭဆံၭ. ထီးဒၪပနါဂၧၫ့ဆၧမၩအ ၥၭလၧကပၧနအၫ့အဖၧၩ့လဖၪနီၪ, မၩဆ့ထီးနခး",
			"24": "<sup>24</sup> ဒၪနဝ့ၫအဖၧၩ့ယီၩဘီၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, ယလီၩဘၪ နၥံၪတီၩတီၩယီၩ, မီၪၥံၪလၧအခးဒၪဝ့ၫအဖၧၩ့နီၪ,ၦ",
			"25": "<sup>25</sup> ထိးဆၧၫ့ဝ့ၫနးဂၩအ့ၬ.- ယလီၩဘၪနၥံၪလၧအမွဲအ တီၩ,လၧမီၪစအံၫလဲယၫအနံၩအၥၫ့ၥံၪ ထီးမူၭခိၪ ကၭဘံၭထၬအၥၭၥၧၫ့နံၪ့ဒဲလၩဎူၫဘံၪ့, ထီးဆၧၥၭဝံ ဖၭဒိၪအီၪထၪ့လၧထၧၫ့ခးယၫနီၪ, ၦမုၪမဲၫအီၪလါနၫ့ အၪဂၩလၧၦအံၫစရ့ၭလၭဖိၪၥံၪအကျၩတၭ, ဆၧ",
			"26": "<sup>26</sup> အၪ့မၧၫ့စအံၫလဲယၫလ့ၩလၧအအီၪနးဂၩအ့ၬ.- အၪ့ မၧၫ့လၩ့ဝ့ၫန့ၫလၧၦမုၪမဲၫအီၪလၧဇၫရဖၭ ဘၪဆဲၫ့ လၧစဲဒၧၫ့လဂၩအအီၪနီၪလီၫ.",
			"27": "<sup>27</sup> လၧမီၪစအံၫလဲၡၫအဆိၩနီၪ, ၦခံၫထူၬဆၫအၧၩ့အီၪ လါနၫ့အၪဂၩလၧၦအံၫစရ့လၭဖိၪၥံၪ အကျၩတၭ, ဆၧမၩဆံၫ့ဝ့ၫနးဂၩအ့ၬ, မၩဆံၫ့ထၪ့ဝ့ၫန့ၫ ၦစံရအၫ",
			"28": "<sup>28</sup> ဖိၪစနၫအမၫ့လဂၩနီၪလီၫ.- ၦအီၪလၧၥရိၬဖၧၩ့နါဂၧၫ့ ဆၧလဖၪနီၪတၭ, အၥၭထၪ့ထီးအလူၬဎွ့ၩတံၭတၭ,",
			"29": "<sup>29</sup> ဂဲထုၪ့နၫ့ထၪ့ခွံၬ အဝ့ၫဒၪလၧဒိၩ့ဖၧၩ့လၧခီၫ့တၭ, လ့ၩ ၥိၫ့ဝ့ၫလၧခိၪလီၩ့ လၧအမၩထၪ့အဒိၩ့ လၧအလီၩ့အ",
			"30": "<sup>30</sup> ထိၭနၫနီၪ, ဘဲၫၥိၭအမိခွံၬလၩ့ခွံၬအဝ့ၫဒၪလီၫ.- မွဲ လါနၫ့တၭ,အဝ့ၫဒၪလဂၩခၫ့ထ့ၬဝ့ၫလၧအဝ့ၫၥံၪအၥၭ ကျၩတၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫဒၪလီၫ.",
			"31": "<sup>31</sup> အဝ့ၫဒၪလ့ၩလၩ့ဝ့ၫလၧဒိၩ့ကပၧနအၫ့ လၧခးဂၫလ လံၫအဖၧၩ့တၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪ လၧမးၥံၫအ",
			"32": "<sup>32</sup> နံၩလီၫ.- ၦလဖၪနီၪထီၫမံၫထီၫမၪဝ့ၫလၧအၥီၪ့ဆၧၥၫ့ ဆၧအဂဲးလီၫ. အဂဲးဘဲၫယီၩအလူအီၪလၧအစီၩ့အ",
			"33": "<sup>33</sup> မၩ့လီၫ.- လၧၥရိၬဖၧၩ့နီၪ, ၦလၧဆၧနၪစံၪစၪအီၪ လၧအလီၩ့အီၪဝ့ၫလဂၩတၭ, ကိၭၡၭထၪ့ဆၧလၧ",
			"34": "<sup>34</sup> အလူၥီၫဖၭဒိၪတၭ, စံၭဝ့ၫ,- အၩလါ,ၦနၭဇရ့ၭဖိၪယ့ၫ ၡုၬဧ့,ဆၧဘၪဆဲၫ့လိၬပၥၭလၧနၧၩ, မွဲဆၧနီၪလ မံၩ့လဲၪ.မွဲနဂဲၫမၩဂၭဂီၩ့ပၧၩဆ့ဧၪ. နဝ့ၫဒၪယီၩ နမွဲ ပလၫလဂၩလဲၪနီၪ,ယၥ့ၪယၫ, နမွဲယွၩအဆၧဆံၫ့",
			"35": "<sup>35</sup> ဎံၪလဂၩနီၪလီၫ.- ယ့ၫၡုၬအၪ့လၬအဝ့ၫတၭ, စံၭ ဝ့ၫ,အီၪလၩ့မါပံၭ, စဲၪ့ထၪ့ခွံၬလၧ ၦလဂၩနီၪအလီၩ့ ဆံၭ.ဆၧနၪထုၭဆ့ၪဝ့ၫလၧဆၧၥၭကျၩတၭ, လမၩ",
			"36": "<sup>36</sup> ဆၫဘၪဝ့ၫနီၪ, စဲၪ့ထၪ့ခွံၬလၧအလီၩ့လီၫ.- ၦထီးအ လူၬထီၫမံၫထီၫမၪဝ့ၫတၭ, ချဲၩ့လိၬအၥၭစံၭဝ့ၫ, ဆၧ ယီၩမွဲဆၧချဲၩ့ဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩမွဲအမၪလူၬ ဆၧနၪစံၪစၪလၧအၥူၭအၥဲၪ့ဒဲအစီၩ့အမၩ့တၭ, အဝ့ၫ",
			"37": "<sup>37</sup> ၥံၪစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ အဂဲးအကၠီၪ့ ဂၧၫ့ထၪ့ၥၩလၩ့လၧခးထၧၫ့ခးယၫကိၭစီၪ့ဒ့ၭလီၫ.",
			"38": "<sup>38</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬလၧၥရိၬဖၧၩ့နီၪ, လ့ၩနုၬဝ့ၫလၧ စစဲမၧၫ့အဂံၪ့ဖၧၩ့တၭ, စစဲမၧၫ့အမံၩ့ၡါမုၪနီၪဘၪဆၧ ဆူၪဂိၬနၭမၬတၭ, ၦလဖၪနီၪ အၪ့ကံၩ့အၪ့ယၫန့အ",
			"39": "<sup>39</sup> ဂးလၧအဝ့ၫနီၪလီၫ.- အဝ့ၫဒၪဆၧၫ့ထုၪ့လၧအဂၩ့ထံၭ တၭအၪ့လၬဆၧဆူၪဂိၬနီၪ, ဆၧဆူၪဂိၬစဲၪ့ထၪ့ခွံၬလၧ အလီၩ့တၭ, မွဲအဂဲထုၪ့ထဲၩ့ဝ့ၫချဲၫ့မၬတၭ, မၩဆၧအ ခ့ၫအၡၩအဆၧမၩလၧအဝ့ၫၥံၪအဂးလီၫ.",
			"40": "<sup>40</sup> ထီးမုလၩ့နုၬနီၪ, ထီးဒၪၦလၧအလကဲၪဘၪဒဲအဘၪ ဆၧဆၫလမံၩ့လါလါနီၪ, ၦဂဲၫဆိၬဝ့ၫလၧအအီၪတၭ, အဝ့ၫဒၪအီၪက့ၪထၪ့အစူၪ လၧအလီၩ့လဂၩဘၪလဂၩ ဆုၬဆုၬတၭ, မၩဘျၪထဲၩ့အဝ့ၫၥံၪလီၫ.",
			"41": "<sup>41</sup> ဆၧနၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧၦၡၩအၪဂၩအလီၩ့တၭ, ကိၭၡၭထၪ့ဆၧစံၭဝ့ၫဒၪ, နဝ့ၫဒၪယီၩနမွဲယွၩအဖိၪခွၫ နီၪလီၫ.အဝ့ၫဒၪအၪ့လၬအဝ့ၫၥံၪတၭ, ဒုၭချဲၩ့ဝ့ၫဆၧ နးမံၩ့အ့ၬ.အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪၥ့ၪယၫလၧအမွဲဎရံၬ နီၪလီၫ.",
			"42": "<sup>42</sup> ထီးဆၧဖၩ့ထၪ့နီၪ, အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လ့ၩထီၩ့ လၧမံၩ့လၬကျၩ ၦခမျၧးအၪ့ဎၬဝ့ၫတၭ, လ့ၩဝ့ၫထီၩ့ လၧအအီၪနီၪ, ယၭထၬဝ့ၫဘဲၫၥိၭအထီၩ့စဲၪ့ထၪ့ခွံၬလၧ",
			"43": "<sup>43</sup> အအီၪလဂ့ၩလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ယဘၪလီၩ လၩ့လၬလၩ့ယွၩအဘၩ့အမုး အဆၧၥၭထိၬအပရၧၫ့ လၧဒိၩ့ အဂူၫဂၩအဖၧၩ့ဆ့လီၫ. အဂဲးဘဲၫယီၩမွဲလၧ ဆၧနီၪအကၠီၩ့တၭ, ဆၧအၪ့မၧၫ့လၩ့ယၧၩလီၫ.",
			"44": "<sup>44</sup> တၭမွဲအလီၩလၩ့လၬလၩ့ဆၧ လၧဂၫလလံၫအၥရိၬ လ ဖၪအဖၧၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧအဆၧၫ့ထုၪ့ လၧကွံၩဂန့ၭဇရ့ၭ အနဲၩ့ထံၭနီၪ, ၦခမျၧးဂဲၫခိၭနၪယွၩအလူအထၫတၭ,",
			"2": "<sup>2</sup> အဝ့ၫၥံၪဘၪထံၭအဝ့ၫဒၪလီၫ.- မွဲအဒၪဘၪချံၫနံၫဖျိၪ့ စိၭထၪ့အၥၭလၧကွံၩအနဲၩ့ထံၭတၭ, ၦမၩယၪလဖၪ နီၪစဲၪ့ထၪ့ခွံၬယူၭဝ့ၫလၧအဖၧၩ့တၭ, ၥူၫဝၭခွံၬအၡၬ လီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪလ့ၩနုၬဝ့ၫလၧချံၫလဖျိၪ့ လၧအမွဲစစဲမၧၫ့အ ဆၧတၭ, အၪ့ကံၩ့ဝ့ၫဘဲၫၥိၭ အမိဆ့ၭဎၪခွံၬလၧခီၫ့နီၪ နးဆံၭး ဆၧၫ့နၩ့ဝ့ၫလၧချံၫဖၧၩ့နီၪ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦ",
			"4": "<sup>4</sup> ခမျၧးလီၫ.- ထီးအလီၩလၩ့လၬလၩ့ဆၧဂီၩ့တၭ, စံၭ စစဲမၧၫ့ၥုၭစိၩချံၫလၧထံၫယိၬတၭ, ဘဲၫၥိၭနၥံၪမိန့ဘၪ",
			"5": "<sup>5</sup> ယၪနီၪ,ခွံၬလၩ့နၥံၪအၡၬဘီၪ.- စစဲမၧၫ့ချဲၩ့ဆၧၫ့ဆၧ တၭစံၭဝ့ၫ,ကဆါဧ့, ၦမၩယူၭၥၫ့နၩချီၩ့တၭ,ပန့ဆၧ နးမံၩ့အ့ၬ. မွဲလါနၫ့ဘိၩလၧနလူအကၠီၩ့တၭ, ပမိခွံၬ",
			"6": "<sup>6</sup> လၩ့ၡၬလီၫ.- မၩဝ့ၫဘဲၫနီၪတၭ, န့ယၪခမျၧးဖၭဒိၪ နီၪ,အၡၬယၬၥၫ့ဝ့ၫတၭ, ဘဲၫၥိၭအထံၩအၥိၭ အီၪ လၧချံၫဂူၫဂၩအဖၧၩ့နီၪ မိဂဲၫမၩဆၧၩ့ဝ့ၫတၭ, ဝါစိၩ",
			"7": "<sup>7</sup> အစူၪလီၫ.- အဝ့ၫၥံၪဂဲၫဝ့ၫတၭ, မၩဎွ့ၩချံၫနံၫဖျိၪ့ထီး",
			"8": "<sup>8</sup> အလၩ့ဘၧၩ့ၥၫ့ဝ့ၫဒၪလီၫ.- စစဲမၧၫ့ပံတၧၫဒၪဘၪဝ့ၫ နီၪ,ထွံၩလၩ့အၥၭ လၧယ့ၫၡုၬအခၪ့လုးခိၪထံၭတၭ, စံၭဝ့ၫ,ကဆါဧ့, စဲၪ့ထၪ့ခွံၬလၧယအီၪဆံၭ. အဂဲးဘဲၫ",
			"9": "<sup>9</sup> ယီၩယမွဲၦဆၧဒဲၩဘၭဖိၪလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫ ဒၪ,ဒဲၦအီၪလၧအၥိၭကိၭဂၩဒ့ၭနီၪ, ထီၫမံၫထီၫမၪလၧ",
			"10": "<sup>10</sup> ယၪခမျၧးလၧအမၩန့ဝ့ၫအကၠီၩ့လီၫ.- စဇ့ၭဘဒံၫ အဖိၪခွၫစယ့မံၭ, ဒဲစယီဟၫ့လၧအမွဲစစဲမၧၫ့အၥိၭနီၪ, မၩအၥၭဘဲၫနီၪၥိၭဆ့လီၫ. ယ့ၫၡုၬစံၭစစဲမၧၫ့, ထီး ၥၭမဲၪဆၧလဂ့ၩ, ထီးယီၩစူၪယၫခိၬတၭ, နမိခွံၬၡၬန့",
			"11": "<sup>11</sup> ဘၪၦၡၩလီၫ.- ထီးအစိၭထၪ့ချံၫလၧခီၫ့တၭ, အဝ့ၫၥံၪ စဲၪ့ဒၪအဆၧထီးအလူၬတၭ, ဖိၬထၪ့အခဲၫ့လီၫ.",
			"12": "<sup>12</sup> ဆၧမၩအၥၭထီးအအီၪ လၧဒိၩ့လဖျိၪ့အဖၧၩ့နီၪ, ယိခွါ,ၦခံၫထူၬဆၫအၧၩ့လဂၩ ဒၪဘၪယ့ၫၡုၬတၭ, ထွံၩလၩ့အၪ့ကံၩ့အၪ့ယၫဝ့ၫ, စံၭဝ့ၫ,ကဆါဧ့,နၥၭအ့ၪ အီၪလၧနမိမၩ ဆံၫ့ထၪ့ထဲၩ့ယၧၩယီၩ နမၩနဝ့ၫၥ့ၪ",
			"13": "<sup>13</sup> လီၫ.- အဝ့ၫဒၪယူၬစိၩအစူၪ, ထိၭဘၪဝ့ၫတၭ,စံၭဝ့ၫ, ယၥၭအီၪ,မွဲနဆံၫ့ထၪ့ဆံၭ. အဆၧခံၫထူၬဆၫအၧၩ့",
			"14": "<sup>14</sup> နီၪစဲၪ့ထၪ့ခွံၬဝ့ၫချဲၫ့မၬလီၫ.- အဝ့ၫဒၪမၪလူၬဝ့ၫဘဲၫၥိၭ အဆၧထီးလီၩဘၪ ၦနးဂၩလဂ့ၩ. မွဲလါနၫ့ဘိၩလ့ၩ ဒုၭနဲၪနၥၭလၧၦလုဆၧတၭ, ဘဲၫၥိၭဆၧထိးအၥၭလၧ အဝ့ၫၥံၪ အမ့ၬယၫမိအီၪဝ့ၫတၭ, မၩဘိၪ့ဆၧဘဲၫ စမိစ့ၭမၪလူၬဝဲၩဝ့ၫအၥိၭ လၧနဆံၫ့ထၪ့အကၠီၩ့ဆံၭ.",
			"15": "<sup>15</sup> မွဲလါနၫ့ဘိၩ, အပရၧၫ့ဂၧၫ့ထၪ့ၥၩလၩ့ အၪထၪ့လခီၫ တၭ, ၦခမျၧးဖၭဒိၪဂဲၫအီၪကိၩ့အီၪကီၪ့လၧအအီၪ ဘဲၫၥိၭအမိခိၭနၪဆၧ, ဒဲဘဲၫၥိၭအဆၧမိဘျၪထဲၩ့လၧ",
			"16": "<sup>16</sup> အစူၪဖၧၩ့လီၫ.- အဝ့ၫဒၪစဲၪ့ထၪ့လ့ၩဝ့ၫလၧမံၩ့လၬ ကျၩတၭ, ဘၩဆိၪဖၪဆၧလီၫ.",
			"17": "<sup>17</sup> ဆၧမၩအၥၭလၧအနံၩ လနံၩ, လၧအၥီၪ့ထဲၩ့ၥၫ့ ထဲၩ့ဆၧအဘိၩ့ဘၭနီၪ,ၦဖၫရစံၫဒဲၦၥ့ၪလံၬလၧအ ဂဲၫယူၭလၧကယဲဂၫလလံၫ, ဒဲခးယုဒၫအတဝၫ့လစီၪ့ လါလါ,ဒဲလၧယရုစလံၫ့နီၪဆၧၫ့နၩ့အီၪဝ့ၫတၭ, ကဆါ အစီၩ့အမၩ့အီၪထၪ့ဝ့ၫဘဲၫၥိၭအမိမၩဘျၪထဲၩ့အဝ့ၫ",
			"18": "<sup>18</sup> ၥံၪလီၫ.- ယိခွါ,ၦဂဲၫဆိၬၦလၧအၥံၫလခီၫဖၩလဂၩ လၧအလးမံၫဖၧၩ့, အၪ့ဎၬနုၬဝ့ၫ ဘဲၫၥိၭအမိဂဲၫအီၪ",
			"19": "<sup>19</sup> က့ၪလၩ့ဝ့ၫလၧအမ့ၫယၫလီၫ.- မွဲလၧၦခမျၧးအီၪဝ့ၫ အကၠီၩ့တၭ, မိဂဲၫဆိၬနုၬဝ့ၫလၧအလး ခီၫခီၫလဲၪနီၪ အၪ့ဎၬဒၪဘၪဝ့ၫအ့ၬ. လ့ၩထၪ့ဝ့ၫလၧဂံၪ့ခိၪတၭ, ၦ လၧအဘၪ ဆၧဆၫလဂၩနီၪ, ၦဆဲၩလၩ့ဝ့ၫလၧအမၩ ဖိးအလးအီၪလၧအလးမံၫ လၧဆၧအၥၭကျၩလၧယ့ၫ",
			"20": "<sup>20</sup> ၡုၬအမ့ၬယၫလီၫ.- မွဲအဒၪဘၪအဝ့ၫၥံၪအဆၧနဲၩတၭ,",
			"21": "<sup>21</sup> စံၭဝ့ၫ,ၦၡၩဧ့,နဆၧဒဲၩဘၭဖျါယူၭ.- ၦကွ့ၭလံၬၥံၪဒဲၦ ဖၫရစံၫၥံၪကၩ့ကၩလိၬအၥၭတၭ, စံၭဝ့ၫ,ၦလၧအချဲၩ့ မၪယွၩလဂၩယီၩ, မွဲပလၫလဂၩလဲၪ.အ့ၪလမွဲဘၪ",
			"22": "<sup>22</sup> ယွၩနီၪမွဲပလၫကွဲၪဖျါဆၧဒဲၩဘၭၥ့ၪလဂၩလဲၪ.- ယ့ၫ ၡုၬၥ့ၪယၫအဆၧကိၪ့ထၪ့ဖၭလၩ့တၭ, ချဲၩ့ဆၧၫ့ဆၧ တၭလီၩဘၪဝ့ၫ, မွဲဘၪနီၫလၧနၥံၪကၩ့ကၩဆၧလၧနၥံၪ",
			"23": "<sup>23</sup> အၥၭခံဖၧၩ့လဲၪ.- မွဲဆၧချဲၩ့ယီၫထံၪထံၪလဲၪ. ၦစံၭလၧ နဆၧဒဲၩဘၭဖျါယူၭနီၪ,ယီၫလဆံၭဧၪ. ၦစံၭ,ဂဲထုၪ့",
			"24": "<sup>24</sup> စဲၪ့ထၪ့ဆံၭနီၪ,ယီၫလဆံၭဧၪ.- မွဲလါနၫ့ဘိၩ,ဘဲၫနၥံၪ မိၥ့ၪယၫ လၧၦၡၩအဖိၪခွၫယီၩအီၪလၧအစီၩ့အမၩ့လၧ ဂၪ့ခိၪချိၫ့ဘဲၫၥိၭ အမိကွဲၪဖျါဆၧဒဲၩဘၭတၭ, (စံၭၦ လၧအၥံၫလခီၫဖၩလ ဂၩနီၪ,) ယစံၭနၧၩဂဲထုၪ့တၭ,",
			"25": "<sup>25</sup> မၩန့နလးမံၫ,ထဲၩ့ထဲၩ့လၧနဂံၪ့ဆံၭ.- အဝ့ၫဒၪဂဲ ထုၪ့ဝ့ၫချဲၫ့မၬလၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, မၩန့ထဲၩ့အ လးမံၫနီၪ, စံၭထၪ့အၪ့အူၭယွၩတၭ,ထဲၩ့ထဲၩ့ဝ့ၫလၧ",
			"26": "<sup>26</sup> အဂံၪ့လီၫ.- ၦထီးအလူၬထီၫမံၫထီၫမၪဝ့ၫတၭ,စံၭထၪ့ အၪ့အူၭယွၩနီၪ, ဆၧၥၭမဲၪၥၭဖျဲၩ့အီၪဎွ့ၩအၥၭ တၭ,စံၭဝ့ၫအယီၩလနံၩယီၩ, ပဒၪဘၪယူၭမၬ ဆၧ လၩ့လၭကၨ.",
			"27": "<sup>27</sup> ဆၧမၩအၥၭလဖၪနီၪအလးခဲၫ့,အဝ့ၫဒၪစဲၪ့ထၪ့ ခွံၬဝ့ၫတၭ, ဒၪဘၪၦအၪ့ကံၩ့အခီၫ့ဆၧၫ့နၩ့ဝ့ၫ လၧအ အၪ့ကံၩ့အခီၫ့အလးလဂၩ, အမံၩ့မွဲစလံဝဲၫတၭ, စံၭ",
			"28": "<sup>28</sup> အဝ့ၫနီၪ,ဂဲၫဖိၬယခဲၫ့ဆံၭ.- အဝ့ၫဒၪဂဲထုၪ့ဝ့ၫတၭ,စဲၪ့ ဒၪအဆၧ ထီးအလူၬတၭ, ဖိၬထၪ့အခဲၫ့လီၫ.",
			"29": "<sup>29</sup> စလံဝဲၫမၩဆၧအၪ့ဖၭဒိၪ လၧအဝ့ၫဒၪအဂး လၧအ ဂံၪ့ဒၪဝ့ၫအဖၧၩ့တၭ, ၦအၪ့ကံၩ့အခီၫ့အၪဂၩ,ဒဲၦဂူၫ ဂၩလဖၪနီၪ, ဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစပွဲထံၭ လၧအၥိၭလီၫ.",
			"30": "<sup>30</sup> ၦဖၫရစံၫၥံၪ,ဒဲၦကွ့ၭလံၬၥံၪၥူၭဝံၪၥူၭလၩဆၧတၭ, စံၭ အထံၩအဖျဲၥံၪ, မွဲဘၪနီၫလၧနၥံၪအၪ့ဎုၬအီၩဎုၬဆၧ လၧၦအၪ့ကံၩ့အခီၫ့, ဒဲလၧၦဆၧဒဲၩဘၭဖိၪလဖၪအၥိၭ",
			"31": "<sup>31</sup> လဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, လီၩဘၪအဝ့ၫၥံၪ,ၦ လၧအအီၪဆီၪ့အီၪချဲၫ့လဖၪမၩၥံၪဎၥံၪ့ဎွံၭဆရၫအလး အီၪအ့ၬ.မၩဝ့ၫအလးအီၪန့ၫ ၦလၧအဆၫလဖၪ",
			"32": "<sup>32</sup> လီၫ.- မွဲယလဂဲၫကိၭထဲၩ့ဘၪၦအတီၩအလီၩ့တၭ,မွဲၦ ဆၧဒဲၩဘၭဖိၪ လၧဆၧနီၫ့ယါလၩ့ထဲၩ့ၥၭ အဂဲးလီၫ.",
			"33": "<sup>33</sup> ၦစံၭအဝ့ၫ စယီဟၫ့အထံၩအဖျဲဒုၪဆၧအၪ့ဆၧအီၩ ဒဲဘၩဆိၪဖၪဆၧအၪဘျၩ့တၭ, ၦဖၫရစံၫအဖျဲၥံၪ မၩ ဝ့ၫဆ့တၭ, မွဲဘၪနီၫနထံၩနဖျဲလဖၪအၪ့ဆၧအီၩဆၧ",
			"34": "<sup>34</sup> လဲၪ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ဆၧလၧတလၭမူၭအဖျဲၥံၪ နီၪ, ထီးတလၭမူၭအခွၫအီၪဝ့ၫ လၧအၥိၭအဘိၩ့ဘၭ တၭ,နၥံၪအၪ့မၧၫ့အဒုၪဆၧအၪ့ဆၧအီၩ ဘၪမိန့ဆ့ဧၪ.",
			"35": "<sup>35</sup> မွဲလါနၫ့ဘိၩ့, ဆၧထုၭလၩ့ဖၭတလၭမူၭအခွၫ ဒဲအထံၩ အၥိၭအမုနံၩနီၪမိထီၩ့ဝ့ၫလီၫ. ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ",
			"36": "<sup>36</sup> မိဒုၪဆၧအၪ့ဆၧအီၩလၧမုနံၩနီၪလီၫ.- တၭအဝ့ၫ ဒၪလီၩဘၪအဝ့ၫၥံၪ လၧဆၧချဲၩ့အဒီၩ့ဆ့, ဆၧကီၩ့ ဆၧၥိၭအလးလံၩနီၪ ၦဆၭဒၭဝ့ၫလၧဆၧကီၩ့ဆၧၥိၭ အၥၫ့နးဂၩအ့ၬ. အ့ၪမၩအၥၭဘဲၫနီၪတၭ, ဆၧအၥၫ့ ယၬန့ဝ့ၫတၭ, ဆၧအၥၫ့ဒဲဆၧအလးလံၩနီၪဘၪလိၬ",
			"37": "<sup>37</sup> အၥၭအ့ၬ.- ဆၧလၧထိၪ့ဆၧဖံၭအလးလံၩအဖၧၩ့ နီၪ,ၦလူၫလၩ့စဘံၭထံၫအၥၫ့နးဂၩအ့ၬ. ၦအ့ၪမၩဘဲၫ နီၪတၭ, စဘံၭထံၫအၥၫ့မၩဖီးဖၭထိၪ့ဆၧဖံၭနီၪ စဘံၭ ထံၫယွၩလၩ့ခွံၬဝ့ၫတၭ, ထိၪ့ဆၧဖံၭဂၭဂီၩ့ခွံၬဝ့ၫဒၪ",
			"38": "<sup>38</sup> လီၫ.- အ့ၪမွဲစဘံၭထံၫအၥၫ့နီၪ,ၦဘၪလူၫလၩ့ဝ့ၫလၧ ထိၪ့ဆၧဖံၭအၥၫ့အဖၧၩ့တၭ, အီၪဒၪအဆၧနံၫမံၩ့လူၬ",
			"39": "<sup>39</sup> လီၫ.- ၦလၧအအီၩစဘံၭထံၫအလးလံၩနီၪ, ဆၧမိအီၩ ဘၪအၥၭ လၧအၥၫ့ချဲၫ့မၬနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫလၧအလးလံၩနီၪအွံၪလဆံၭလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧ မးၥံၫဒူတရီၭပြိၩတူၭအနံၩနီၪ, အဝ့ၫဒၪလ့ၩဖိၬဖၧၩ့ၥၭ လၧဆံၬဖၧၩ့တၭ, အထံၩအဖျဲ ၥံၪဒ့ၭန့ဘုၪဆဲၩ, ဘံၭတလံၭဝ့ၫလၧအစူၪတၭ, အၪ့",
			"2": "<sup>2</sup> ဝ့ၫလီၫ.- ၦဖၫရစံၫလနၩ့နၩ့စံၭအဝ့ၫၥံၪ,ဆၧလဂ့ၩမၩ ဘၪလၧမးၥံၫအနံၩနီၪ မွဲဘၪနီၫလၧနၥံၪမၩလဲၪ.",
			"3": "<sup>3</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪတၭ, စံၭဝ့ၫ, စဒၫဝံၭ,ဒဲၦအီၪ လၧအၥိၭလဖၪထီးဆၧၥၭဝံအၥၭနီၪ, မၩဝ့ၫဘဲၫၥ့ၪ",
			"4": "<sup>4</sup> လဲၪဘဲၫၥ့ၪလဲၪ,- ထီးအလ့ၩနုၬလၧယွၩအဂံၪ့ဖၧၩ့နီၪ, မၩန့အၪ့ဆၧမ့ၬယၫအကိၪ လၧအလဂ့ၩအၪ့ဘၪဝ့ၫ နီၪ,ဂ့ၩအၪ့န့ၫၦလုဆၧလဖၪတၭ, ဖ့ၪအၪ့ၦအီၪလၧအ",
			"5": "<sup>5</sup> ၥိၭဆ့တၭ,မွဲနၥံၪလဖီဒံၭဘၪဧၪ.- မွဲအစံၭအဝ့ၫၥံၪ, ၦၡၩအဖိၪခွၫယီၩ, မွဲမးၥံၫအနံၩအကဆါဆ့လီၫ.",
			"6": "<sup>6</sup> ဆၧမၩအၥၭ လၧမးၥံၫအနံၩနးဖၧၫ့ဒီၭလနံၩနီၪ, အဝ့ၫဒၪလ့ၩနုၬဝ့ၫလၧၥရိၬဖၧၩ့ တၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့",
			"7": "<sup>7</sup> ဆၧနီၪ,ၦအစူၪထွ့ၪၥံၫအီၪဝ့ၫလဂၩလီၫ.- လၧမးၥံၫအ နံၩမွဲအမိမၩဘျၪထဲၩ့ဆၧ, လမၩဘျၪထဲၩ့ဘၪဆၧ လဲၪနီၪ,ဘဲၫၥိၭအမိဒၪန့ဘၪအလး လၧအမိအီၪက့ၪ ဆၧမၪလၧအလီၩ့တၭ, ၦကွ့ၭလံၬဒဲၦဖၫရစံၫၥံၪယိၥူၪ",
			"8": "<sup>8</sup> ဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪၥ့ၪယၫအဆၧကိၪ့ထၪ့ဖၭလၩ့ တၭ,စံၭၦလၧအစူၪၥံၫလဂၩနီၪ, ဂဲထုၪ့တၭ,ဆၧၫ့ထုၪ့ လၧဆၧၥၭကျၩနီၪဘီၪ. အဝ့ၫဒၪဂဲထုၪ့ထၪ့ဆၧၫ့ထုၪ့",
			"9": "<sup>9</sup> ဝ့ၫလီၫ.- အနီၪတၭ, ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ,ယမိအၪ့စၪ့ နၥံၪလီၫ. လၧမးၥံၫအနံၩနီၪ ဂ့ၩမၩဆၧဘဲၫၥ့ၪလဲၪ. မွဲအကြၨၭမၩဆၧဂ့ၩ, မၩဆၧအၧၩ့လဲၪ, မွဲအကြၨၭ",
			"10": "<sup>10</sup> ထိးထဲၩ့တၩ့ထဲၩ့ၦၥၭမၧၫ့,မၩၥံၫၦၥၭမၧၫ့လဲၪ.- ယိၦ ထီးအလူၬဝၬဝၬတၭ,စံၭၦလဂၩနီၪ,ယူၬထၪ့နစူၪ ဘီၪ.အဝ့ၫလဂၩမၩဝ့ၫတၭ, အစူၪအီၪဆီၪ့ထၪ့ထဲၩ့",
			"11": "<sup>11</sup> ဘဲၫအဝ့ၫလခီၫအၥိၭနီၪလီၫ.- ၦလဖၪနီၪအၥၭထၪ့ဎွ့ၩ တံၭတၭ, မွဲအမိမၩယ့ၫၡုၬဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ကၩ့ကၩလိၬအၥၭလီၫ.",
			"12": "<sup>12</sup> ဆၧမၩအၥၭလၧမုနံၩလဖၪနီၪ,အဝ့ၫဒၪလ့ၩဘၩ ဆိၪဖၪဆၧလၧခိၪလီၩ့လဖျိၪ့အလီၩ့တၭ, အီၪဝ့ၫ လၧအဘၩဆိၪဖၪယွၩၥၫ့နၩချီၩ့လီၫ.",
			"13": "<sup>13</sup> ဆၧဖၩ့ထၪ့တၭ, အဝ့ၫဒၪကိၭန့အထံၩအဖျဲလဖၪ နီၪ, ရွံန့ၦလဆံၫနံၫဂၩလၧအကျၩတၭ, ကိၭအမံၩ့ လၧၦဆၧအၪ့မၧၫ့ဖိၪလီၫ.",
			"14": "<sup>14</sup> စစဲမၧၫ့ကိၭဝ့ၫအမံၩ့လၧစပံတၧၫ, ဒဲအထၧၫ့ဖုဝဲ စအၫ့ဒြူၫ, စယ့မံၭဒဲစယီဟၫ့,စဖံလံၭဒဲစဘၫၥီလမုၫ,",
			"15": "<sup>15</sup> စမၭၥုၫဒဲစထီမၭ, ဒဲစအၫလဖံအၧၭအဖိၪခွၫစယ့မံၭ,",
			"16": "<sup>16</sup> ဒဲစစဲမၧၫ့ကိၭထဲၩ့ဝ့ၫလၧစလိတံၭ,- စယ့မံၭအထၧၫ့ဖု ဝဲစယုဒၭ,ဒဲၦလၧအကဲၪထၪ့ ၦဖ့ၪလၫ့ခွံၬဆၧစယု ဒၭအံၭစကၫရအၧၭလီၫ.",
			"17": "<sup>17</sup> ဂဲၫထဲၩ့လၩ့ထဲၩ့လၧအဝ့ၫၥံၪအၥိၭ လၧခိၪလီၩ့တၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧဒၩဖၧၩ့ အီၪလၧအထံၩအဖျဲလ ဒီၪ့,ဒဲၦလၧခးယုဒၫထၧၫ့ခးယၫ,ဒဲလၧယရုစလံၫ့ဒဲလၧ မၫဆမံၭနဲၩ့, ဘူၭလၧတဲအၫဒဲစဲဒၧၫ့ၥံၪ အၡၩခမျၧး ဖၭဒိၪလၧအဂဲၫဝ့ၫဘဲၫၥိၭအမိနါဂၧၫ့အလူ,ဒဲဘဲၫၥိၭ",
			"18": "<sup>18</sup> အဆၧဆၫမိဘျၪထဲၩ့ဝ့ၫ,- ၦလၧအဘၪဆၧမၩထံၬ ထၬဝ့ၫလၧဆၧနၪစံၪစၪလဖၪနီၪ, အဝ့ၫဒၪမၩဘျၪထဲၩ့",
			"19": "<sup>19</sup> အဝ့ၫၥံၪလီၫ.- ၦခမျၧးထီးအလူၬအၪ့ဂူၬထိၭဘၪ အဝ့ၫဒၪလီၫ. အဂဲးဘဲၫယီၩအစီၩ့အမၩ့စဲၪ့ထၪ့ခွံၬ လၧအလီၩ့တၭ, မၩဘျၪထဲၩ့ဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"20": "<sup>20</sup> ယ့ၫၡှူၬယိထၪ့အထံၩအဖျဲၥံၪတၭ,စံၭဝ့ၫ, ၦၡၪ့ ဖိၪနၥံၪဝ့ၫယီၩ,နၥံၪအီၪမုၬဝ့ၫဒၪနီၪး အဂဲးဘဲၫယီၩယွၩ အဘၩ့အမုးနီၪ မွဲနၥံၪအဆၧလီၫ.",
			"21": "<sup>21</sup> ၦလၧဆၧၥၭဝံအၥၭနၥံၪဝ့ၫဘိၩ့နဲၪ့ယီၩ, နၥံၪအီၪ မုၬဝ့ၫဒၪနီၪး အဂဲးဘဲၫယီၩနၥံၪမိဘျဲၩအၪ့ဘျဲၩအီၩ ဝ့ၫလီၫ.ၦလၧအဂၪ့နၥံၪဝ့ၫဘိၩ့နဲၪ့ယီၩ နၥံၪအီၪ မုၬဝ့ၫဒၪနီၪးအဂဲးဘဲၫယီၩ နၥံၪမိနံထၪ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> ထီးၦၡၩအ့ၪမ့ၬလဲၩနၥံၪတၭ, အ့ၪနၫ့ထၪ့ခွံၬနၥံၪ နီၪ,ဒဲဒုၪဒွ့ၪနၥံၪ, ဒဲခွံၬၡိၭနၥံၪအမံၩ့ ဘဲၫဆၧအၧၩ့အ ၥိၭလၧၦၡၩအဖိၪခွၫယီၩအကၠီၩ့တၭ,နၥံၪအီၪမုၬ",
			"23": "<sup>23</sup> ဝ့ၫဒၪလီၫ.- လၧမု နံၩနီၪၥၭထိၬတၭ,ဖုၫထၪ့နၥံၪဝ့ၫ လၧဆၧၥၭထိၬအကၠီၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩ, ယိခွါ, နၥံၪအဘိၪ့အီၪဝ့ၫ လၧမူၭခိၪဒိၪမၬလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဖါလဖၪနီၪ, မၩမီၪၥံၪဘဲၫနီၪအၥိၭဆ့ လီၫ.",
			"24": "<sup>24</sup> လၧနီၪအမ့ၬယၫ, နၥံၪဝ့ၫဒၪလၧအမွဲၦၥထံၫလဖၪ ယီၩ,နၥံၪဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪအၡုၪ နၥံၪအမုၬနီၪ, နၥံၪန့ဘၪယူၭ.",
			"25": "<sup>25</sup> ၦလၧအဘျဲၩအၪ့ယူၭနၥံၪဝ့ၫဒၪယီၩ, နၥံၪဘၪ အၡၪ့လီၫ. အဂဲးဘဲၫယီၩဆၧမိၥၭဝံ နၥံၪအၥၭလီၫ. ၦလၧအနံဘိၩ့နဲၪ့ယီၩ, နၥံၪမိဘၪဆၧအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ နၥံၪအၥုၪ့မိခါ နၥံၪအၥၭမိလၩ့တၭ, နၥံၪမိဂၪ့ထၪ့ဝ့ၫလီၫ.",
			"26": "<sup>26</sup> ၦၡၩထီးအလူၬအ့ၪအၪ့အူၭနၥံၪတၭ, နၥံၪဘၪဆၧ အၡၪ့လီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအဖါလဖၪနီၪ, မၩမီၪလၧအအၪ့လီၫဆၧလဖၪ ဘဲၫနီၪအၥိၭလီၫ.",
			"27": "<sup>27</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယစံၭၦလၧအနါဂၧၫ့ဆၧနၥံၪ ဝ့ၫဒၪယီၩ, အဲၪနၥံၪအဒုၪအဒၩဆံၭ. ၦလၧအမ့ၬ လဲၩနၥံၪလဖၪနီၪ မၩဂ့ၩအဝ့ၫၥံၪဆံၭ.",
			"28": "<sup>28</sup> ၦလၧအဆိၪအၧၩ့နၥံၪနီၪ, ဆိၪဂ့ၩအဝ့ၫၥံၪဆံၭ. ၦ လၧအချဲၩ့ ကြၩ့ထမးနၥံၪနီၪ, ဘၩဆိၪဖၪန့အဂး ဆံၭ.",
			"29": "<sup>29</sup> ၦလၧအဒဲၩနနိၭဖၩထံၭအယီၩလခီၫနီၪဖ့ၪလၫ့ ဝ့ၫလၧအဝ့ၫလခီၫဆံၭ. ၦလၧအမိမၩန့ဘၪအၥၭလၧ နဖၬဘဲၩ့နီၪ, နၥံၪထီးပဒၩ့အဝ့ၫလၧအမိမၩန့နဆဲၫ့ ဆ့လဂ့ၩ.",
			"30": "<sup>30</sup> ကယဲၦလၧအအၪ့ကံၩ့ဆၧလၧနၧၩ လဂၩလါလါ နီၪ,ဖ့ၪလၫ့အဝ့ၫၥံၪဆံၭ. ၦလၧအမၩန့နဆၧနီၪ,နၥံၪ ထီးအၪ့ကံၩ့ကဒၩထဲၩ့လဂ့ၩ.",
			"31": "<sup>31</sup> ဘဲၫနၥံၪဆိၫ့ၦၡၩမၩနၥံၪအၥိၭနီၪ,မၩအဝ့ၫၥံၪ ဘဲၫနီၪအၥိၭဆ့ဆံၭ.",
			"32": "<sup>32</sup> နၥံၪအ့ၪအဲၪၦလၧအအဲၪနၥံၪနီၪ, မွဲနၥံၪအဘိၪ့အီၪ လၧဆၧနီၪလမံၩ့လဲၪ. အဂဲးဘဲၫယီၩ ၦဆၧဒဲၩဘၭဖိၪ",
			"33": "<sup>33</sup> လဖၪနီၪ, အဲၪၦလၧအအဲၪအဝ့ၫၥံၪဆ့လီၫ.-နၥံၪအ့ၪ မၩဂ့ၩၦလၧအမၩဂ့ၩနၥံၪနီၪ, နၥံၪအဘိၪ့အီၪ လၧဆၧ နီၪလမံၩ့လဲၪ. အဂဲးဘဲၫယီၩ ၦဆၧဒဲၩဘၭဖိၪလဖၪနီၪ, မၩဝ့ၫဘဲၫနီၪၥိၭဆ့လီၫ.",
			"34": "<sup>34</sup> နၥံၪအ့ၪဒုၭအၪ့လီး ဆၧလၧၦၡၩ လၧနၥံၪယိလါ အမိလိၭထဲၩ့ဝ့ၫလဖၪနီၪ, မွဲနၥံၪအဘိၪ့အီၪ လၧဆၧနီၪ လမံၩ့လဲၪ. အဂဲးဘဲၫယီၩ ၦဆၧဒဲၩဘၭဖိၪလဖၪဒုၭ အၪ့လီးဆၧလၧၦဆၧဒဲၩဘၭဖိၪလဖၪ ဘဲၫၥိၭအမိဒိၭ န့ဝ့ၫဎွ့ၩဎီၩ့အလးလီၫ.",
			"35": "<sup>35</sup> လၧနီၪအမ့ၬယၫ, နၥံၪအဒုၪအဒၩလဖၪနီၪအဲၪအ ဝ့ၫၥံၪတၭ, မၩဂ့ၩဆၧတၭ, နၥံၪလယိလါဘၪလၧ နၥံၪမိဒိၭန့ထဲၩ့ဆၧနးမံၩ့ဘၪတၭ, ဒုၭအၪ့လီးဆၧ ဆံၭ.နၥံၪမိန့ဘၪနၥံၪအဘိၪ့ဖၭဒိၪတၭ, နၥံၪမိကဲၪ ထၪ့ဆၧထၪ့ထီၫထုၬ အဖိၪခွၫၥံၪလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪနီၪ မၩဂ့ၩၦလၧအလၥ့ၪယၫဘၪဆၧအခိး",
			"36": "<sup>36</sup> ဒဲၦအအၧၩ့ၥံၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫနၥံၪအ ဖါယၫ့ၥၭဆၧအၥိၭ နီၪ,ယၫ့ၥၭဆၧနၥံၪဝ့ၫ ဘဲၫနီၪၥိၭ ဆ့ဆံၭ.",
			"37": "<sup>37</sup> နၥံၪထီးစ့ၩရၫ့ဆၧလဂ့ၩတၭ,ဆၧမိစ့ၩရၫ့နၥံၪဆ့ အ့ၬ.နၥံၪထီးစ့ၩရၫ့စၪဆၧလဂ့ၩတၭ, ဆၧမိစ့ၩရၫ့စၪ နၥံၪဆ့အ့ၬ. ကွဲၪဖျါဆၧဆံၭ, ဆၧမိကွဲၪဖျါနၥံၪအဆၧ",
			"38": "<sup>38</sup> လီၫ.- ဖ့ၪလၫ့ဆၧဆံၭ,ဆၧမိဖ့ၪလၫ့ဆၧလၧနၥံၪလီၫ. ၦမိတိၪ့ဆၧဂ့ၩဘၪစဲၪ, မိဆၪ့လၩ့ထဲၩ့, မိဂံၩဂုလၩ့ မိဎွ့ၩစီၩ့နီၩ့တၭ, မိဖ့ၪလၫ့ဝ့ၫလၧနၥံၪအၥၭနၫၡါ လီၫ.အဂဲးဘဲၫယီၩ ဘဲၫနၥံၪတိၪ့ဖ့ၪလၫ့ဆၧအၥိၭ နီၪ,ဆၧမိတိၪ့ဖ့ၪလၫ့ထဲၩ့နၥံၪလီၫ.",
			"39": "<sup>39</sup> အဝ့ၫဒၪချဲၩ့ဒီၩ့လၩ့ဆၧတၭ စံၭအဝ့ၫၥံၪ, ၦမ့ၬဘျီၪ မီၩ့ၦမ့ၬဘျီၪနီၪမိၥ့ၪဧၪ, မွဲအမိလၩ့ထ့ၬလၧဆၧဖၧၩ့ နံၫဂၩလူၬအ့ၬဧၪ.",
			"40": "<sup>40</sup> အဖျဲနီၪအီၪလၧအဆရၫအဖၫ့ခိၪအ့ၬး အ့ၪမွဲ ကယဲၦလၧအလၧၫ့ထၪ့ဎွ့ၩထၪ့လဂၩလါလါနီၪ, မိမီၪ့ ဎီၩ့လၧအဆရၫလီၫ.",
			"41": "<sup>41</sup> ၥံၪ့ဖုၫအီၪဝ့ၫလၧနမ့ၬၥၪဒၪနဝ့ၫအဖၧၩ့နီၪ, နလဆီၫ့ မီၪ့ဘၪလၧနၥၭဖၧၩ့တၭ, မွဲဘၪနီၫလၧနယိထံၫယိဆၭ",
			"42": "<sup>42</sup> နိၪကဲၩ့ဖိၪလၧနထၧၫ့ဖုဝဲအမ့ၬၥၪဖၧၩ့နီၪလဲၪ.- ထီးနနၫ့ ဆါလဒၪဘၪၥံၪ့ဖုၫလၧနမ့ၬၥၪဒၪနဝ့ၫအဖၧၩ့တၭ, မွဲန စံၭနထၧၫ့ဖုဝဲ,ထၧၫ့ဖုဝဲဧ့, ဖ့ၪလၫ့ယခွ့ၭထၪ့ခွံၬနိၪကဲၩ့ ဖိၪအီၪလၧနမ့ၬၥၪဖၧၩ့နီၪ, မိၥ့ၪဘဲၫၥ့ၪလဲၪ, ၦလၧအ အၪ့လီၫဆၧဧ့, ခွ့ၭထၪ့ခွံၬဆိၫဒၪခလူၬ ၥံၪ့ဖုၫအီၪ လၧနမ့ၬၥၪဒၪနဝ့ၫအဖၧၩ့နီၪဆံၭ. အနီၪတၭနမိဒၪဆၧ ထံၫထံၫဆၭဆၭ ဘဲၫၥိၭနမိခွ့ၭထၪ့ခွံၬနိၪကဲၩ့ဖိၪ အီၪ လၧနထၧၫ့ဖုဝဲအမ့ၬၥၪဖၧၩ့နီၪလီၫ.",
			"43": "<sup>43</sup> အဂဲးဘဲၫယီၩ ၥံၪ့ထံၭလၧအဂ့ၩနီၪ,ၥၪထၪ့ဆၧ အအၧၩ့အ့ၬ. ၥံၪ့ထံၭလၧအအၧၩ့နီၪ, ၥၪထၪ့ဆၧအ",
			"44": "<sup>44</sup> ဂ့ၩဆ့အ့ၬ.- အဂဲးဘဲၫယီၩၥံၪ့လထံၭလါလါနီၪ, ၦၥ့ၪ ယၫလၧအဆၧၥၪဒၪဝ့ၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩ လၧဆၧဆူၪအလီၩ့နီၪ, ၦအၪ့ဒ့ၭချိၪ့ဒိၩ့ၥၪဆ့အ့ၬ. လၧ ဆၧဆူၪၡိၬအလီၩ့နီၪ, ၦအၪ့ဒ့ၭစဘံၭၥၪဆ့အ့ၬ.",
			"45": "<sup>45</sup> ၦလၧအဂ့ၩနီၪဖီၪ့ထၪ့ဖံၭထၪ့ဆၧအဂ့ၩလၧအ အီၪက့ၪကီၪ့ဝ့ၫလၧအလးဂ့ၩအီၪ လၧအၥၭခံဖၧၩ့တၭ, ၦလၧအအၧၩ့နီၪဖီၪ့ထၪ့ဖံၭထၪ့ ဆၧအၧၩ့လၧအအီၪ က့ၪကီၪ့ဝ့ၫ အလးအၧၩ့အီၪလၧ အၥၭခံဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ဘဲၫအဎွ့ၩလၨၪ လၧအၥၭအၥိၭနီၪ အ နိၭထၪ့ဖျ့ၭဝ့ၫ လီၫ.",
			"46": "<sup>46</sup> ဆၧလၧယမၪလူၬနၥံၪနီၪနၥံၪလမၩဘၪတၭ, မွဲဘၪ နီၫလၧနၥံၪကိၭယၧၩ, ကဆါဧ့, ကဆါဧ့,နီၪလဲၪ.",
			"47": "<sup>47</sup> ကယဲၦလၧအဂဲၫလၧယအီၪ, ဒဲနါဂၧၫ့ယလူယထၫ တၭ,မၩဝ့ၫလဂၩလါလါနီၪ, မၩအၥၭဘဲၫဆၧနီၪအ",
			"48": "<sup>48</sup> ၥိၭလဲၪနီၪ,ယမိဒုၭနဲၪနၥံၪလီၫ.- မၩအၥၭဘဲၫၦမၩဂံၪ့ တၭ,ခုၪ့လၩ့ဆၧဖၧၩ့ယိၬတၭ, မၩဝ့ၫအခၪ့ထံၭလၧ လိးအလီၩ့အၥိၭနီၪလီၫ. ထံၫထၪ့ဖၭဒိၪဆ့ၭဘၪ အ ဂံၪ့နီၪ,မၩဝၭမၩဂဲၩဝ့ၫၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩအခၪ့",
			"49": "<sup>49</sup> ထံၭအီၪလၧလိးအလီၩ့လီၫ.- ၦလၧအနါဂၧၫ့တၭလ မၩဘၪဝ့ၫနီၪ, မၩအၥၭဘဲၫၦလၧအမၩဂံၪ့လၧဂၪ့ ခိၪအလီၩ့နီၪ, အခၪ့ထံၭအခၧၫ့လအီၪဘၪအၥိၭနီၪ လီၫ.ထံၫဆ့ၭဘၪဝ့ၫတၭ, လၩ့ဎီးခွံၬဝ့ၫချဲၫ့မၬတၭး ဂံၪ့အလၩ့ဎီးခွံၬနီၪနၭမၬကၨ."
		},
		"7": {
			"1": "<sup>1</sup> အဝ့ၫဒၪလီၩလၩ့လၬလၩ့ၦၡၩ လၧဆၧချဲၩ့နီၪထီး အလူၬဂီၩ့တၭ, လ့ၩနုၬဝ့ၫလၧကပၧနအၫ့ အဖၧၩ့",
			"2": "<sup>2</sup> လီၫ.- ၦၥုၭဖိၪလယၩအခိၪအခ့ၫအၡၩလၧအအဲၪဝ့ၫ လဂၩနီၪ,ဘၪဆၧဆၫထီးအလၩ့ဘူၭလၧအမိၥံၫလီၫ.",
			"3": "<sup>3</sup> အဝ့ၫဒၪနါဂၧၫ့ယ့ၫၡှူၬအဂဲးတၭ, အၪ့မၧၫ့ၦယုဒၫဖိၪ အၥၭၡါလဖၪလ့ၩလၧအအီၪ အၪ့ကံၩ့အၪ့ယၫအဝ့ၫ",
			"4": "<sup>4</sup> ဘဲၫၥိၭအမိဂဲၫမၩဘျၪထဲၩ့အခ့ၫအၡၩလီၫ.- ၦလဖၪ နီၪဂဲၫလၧယ့ၫၡုၬအအီၪတၭ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫတ ၡါၡါစံၭဝ့ၫဒၪ, ၦလဂၩလၧနမိမၩဆၧလမံၩ့ယီၩလၧ",
			"5": "<sup>5</sup> အဂး,မွဲအကြၨၭဆ့လီၫ.- အဂဲးဘဲၫယီၩအဲၪပဆၨၩ ယီၩတၭ, အနၫ့ဆါၥုၪ့န့ယူၭၥရိၬလဖျိၪ့လၧပဂးယူၭ.",
			"6": "<sup>6</sup> ယ့ၫၡှူၬလ့ၩလၧအဝ့ၫၥံၪအၥိၭလီၫ. ထီးအအီၪလ ယဲၩ့ဘၪလၧဂံၪ့နီၪတၭ, ၦၥုၭဖိၪလယၩအခိၪလဂၩ နီၪ,အၪ့မၧၫ့အထံၩအၥိၭလဖၪ လ့ၩလၧအအီၪစံၭဝ့ၫ, ကဆါဧ့, ထီးမၩပွံၭနၥၭလဂ့ၩ, အဂဲးဘဲၫယီၩနဂဲၫ",
			"7": "<sup>7</sup> နုၬလၧယဂံၪ့ခိၪအဖၫ့လၬယီၩ, ယကြၨၭအ့ၬ.- ဘဲၫနီၪ အၥိၭယကြၨၭလ့ၩယဝ့ၫလၧနအီၪဆ့အ့ၬ. မွဲလါနၫ့ ဘိၩချဲၩ့ဆၧနးထံၪတၭ, ယခ့ၫယၡၩမိဘျၪထဲၩ့ဝ့ၫဒၪ",
			"8": "<sup>8</sup> လီၫ.- အဂဲးဘဲၫယီၩယဝ့ၫဒၪယီၩ ယမွဲၦလၧဆၧအီၪ က့ၪယၧၩ လၧဆၧအစီၩ့အမၩ့ အဖၫ့လၬလါနၫ့ဘိၩ, ၥုၭဖိၪၥ့ၪဖိၪအီၪလၧယဖၫ့လၬတၭ, အယီၩလဂၩယ စံၭ,လ့ၩဘီၪ. တၭလ့ၩဝ့ၫး အနီၪလဂၩ, ဂဲၫဘီၪ, တၭ ဂဲၫဝ့ၫး ယဎီးယၡၩနီၪ, မၩဆၧယီၩဘီၪ,တၭမၩဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- ဆၧလဖၪနီၪယ့ၫၡုၬနါဂၧၫ့တၭ, ထီၫမံၫထီၫမၪ ဝ့ၫတၭ,ကၠၪစိၩအၥၭလၧၦဖိၬအခဲၫ့အအီၪ, စံၭၦခ မျၧးနီၪ,ယစံၭနၥံၪယီၩ, လၧအံၫစရ့လၭ အဖၧၩ့ဒၪ လ့ၬနီၪ,ဆၧနဲၩန့ၫယီၩယဒၪဘၪဒံၭအ့ၬ.",
			"10": "<sup>10</sup> ၦလၧဆၧအၪ့မၧၫ့လၩ့ဝ့ၫလဖၪနီၪ, ထဲၩ့ထဲၩ့ဝ့ၫလၧ အဂံၪ့တၭ, ဒၪဘၪဆၧအခ့ၫအၡၩ လၧအဆၫလဂၩ နီၪ,အီၪဆီၪ့အီၪချဲၫ့ဝ့ၫလီၫ.",
			"11": "<sup>11</sup> လၧခဲၫ့လနံၩနီၪ, ဆၧမၩအၥၭလၧအလ့ၩ လၧဒိၩ့လ ဖျိၪ့ကိၭဝ့ၫအမံၩ့လၧနံၫ့တၭ, အထံၩအဖျဲၥံၪအၪဂၩဒဲ",
			"12": "<sup>12</sup> ၦခမျၧးဖၭဒိၪ လ့ၩဖိၬအခဲၫ့လီၫ.- ထီးအဘူၭထၪ့လၧ ဒိၩ့အတရၫ့နီၪ, ယိခွါ,ၦၡၩယိၭၦလၧအၥံၫယူၭလဂၩ လၧအမွဲအမိအဖိၪခွၫလဂၩဎးတၭ, အမိနီၪ,မွဲၦမုၪမဲၫ",
			"13": "<sup>13</sup> လီၫ.ၦဒိၩ့ဖိၪခမျၧးဖၭဒိၪ အီၪလၧအၥိၭလီၫ.- ကဆါ",
			"14": "<sup>14</sup> ဒၪဘၪၦမုၪနီၪယၫ့ၥၭဝ့ၫ, စံၭအဝ့ၫ, ဂၪ့လဂ့ၩ.- အဝ့ၫဒၪ လ့ၩထိၭဘၪဆိးနီၪ, ၦယိၭဆၧလဖၪအီၪပထုၬဝ့ၫတၭ, အဝ့ၫဒၪစံၭဝ့ၫ, ဖိၪၥၪခွၫဧ့, ယစံၭနၧၩ,ဂဲထုၪ့ဆံၭ.",
			"15": "<sup>15</sup> ၦၥံၫယူၭလဂၩနီၪ ဂဲထုၪ့ဆၧၫ့နၩ့ဝ့ၫ, ဒဲချဲၩ့ထၪ့ဆၧ တၭ,အဝ့ၫဒၪဖ့ၪလၫ့ထဲၩ့ဝ့ၫလၧအမိလီၫ.",
			"16": "<sup>16</sup> ၦထီးအလူၬၥၭမဲၪဝ့ၫတၭ, စံၭထၪ့အၪ့အူၭထၪ့ယွၩ, စံၭဝ့ၫ, မီၪဖၭဒိၪလဂၩအီၪထၪ့ယူၭလၧပကျၩယီၩ,",
			"17": "<sup>17</sup> ယွၩဂဲၫအီၪၡီၩ့ယူၭ အခ့ၫအၡၩယူၭလီၫ.- အဂဲးအ ကၠီၪ့နီၪ,ဂၧၫ့ထၪ့ၥၩလၩ့လၧယုဒၫထၧၫ့ခးယၫ, ဒဲလၧ အနဲၩ့ထံၭဎံၩ့ဎံၩ့လ့ၬလီၫ.",
			"18": "<sup>18</sup> စယီဟၫ့အထံၩအဖျဲၥံၪ လီၩဘၪဝ့ၫလၧဆၧလဖၪ",
			"19": "<sup>19</sup> နီၪထီးအလူၬအဂဲးအကၠီၪ့လီၫ.- စယီဟၫ့ကိၭန့အထံၩ အဖျဲနံၫဂၩလၧအအီၪတၭ, အၪ့မၧၫ့အလ့ၩလၧယ့ၫၡုၬ အအီၪနီၪစံၭဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲၦလၧအမိဂဲၫလဂၩနီၪ ဧၪ.မွဲပဘၪယိလါဒံၭၦဂူၫဂၩလဂၩအဖၧၩ့ၥၭလဲၪ.",
			"20": "<sup>20</sup> ၦလဖၪနီၪ,လ့ၩထီၩ့လၧအအီၪတၭ, စံၭဝ့ၫ,ၦဘၭတံၫ ဇၫ့ဆၧစယီဟၫ့လဂၩ အၪ့မၧၫ့လၩ့ပၧၩလၧနအီၪယီၩ, စံၭဝ့ၫ,နဝ့ၫဒၪယီၩ, နမွဲၦလၧအမိဂဲၫလဂၩနီၪဧၪ,မွဲပ",
			"21": "<sup>21</sup> ဘၪယိလါဒံၭ ၦဂူၫဂၩလဂၩအဖၧၩ့ၥၭလဲၪ.- လၧနၩ ရံၩထီးနီၪ ၦဘၪဆၧဆၫဒဲၦဘၪဆၧၡၪ့ဆၧနၭ,ဒဲၦလၧ ဆၧနၪအီၪလၧအလီၩ့အၪဂၩနီၪ, အဝ့ၫဒၪမၩဘျၪထဲၩ့ ဝ့ၫ,ဒဲၦမ့ၬဘျီၪအၪဂၩနီၪ, မၩဒၪထၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭလီၩဘၪအဝ့ၫၥံၪ, ဆၧလၧ နၥံၪဒၪဘၪဒဲနၥံၪနါဂၧၫ့ဘၪ ဆၧလဖၪနီၪ, ထဲၩ့လီၩဘၪ စယီဟၫ့ဘီၪ. ၦလၧအမ့ၬဘျီၪလဖၪနီၪ, ဒၪထၪ့ ထဲၩ့ဆၧ,ၦလၧအခၪ့ဂၭဂီၩ့လဖၪနီၪစဲၪ့ထၪ့ထဲၩ့ဝ့ၫ, ၦလၧအခံၫထူၬဆၫအၧၩ့လဖၪနီၪ, ဆံၫ့ထၪ့ထဲၩ့ဝ့ၫ, ၦ လၧအနါအၧၩ့လဖၪနီၪ, နါဂၧၫ့ထၪ့ထဲၩ့ဆၧ, ၦလၧအ ၥံၫလဖၪနီၪ, ဂဲထုၪ့ထဲၩ့ဝ့ၫ, ၦလၧအၡၪ့အယၬလဖၪ နီၪ,ဆၧလီၩလၩ့လၬလၩ့အဝ့ၫၥံၪ လၧဆၧၥၭထိၬအ",
			"23": "<sup>23</sup> ပရၧၫ့လီၫ.- ထီးဒၪၦလၧအၥၭလဂၭဂီၩ့ဘၪဝ့ၫ လၧ ယကၠီၩ့လဂၩလါလါနီၪ, အီၪမုၬဝ့ၫဒၪလီၫ.",
			"24": "<sup>24</sup> ထီးစယီဟၫ့အဖျဲလဖၪနီၪစဲၪ့ထၪ့ခွံၬဝ့ၫတၭ, အဝ့ၫ ဒၪလီၩဘၪၥၫ့ၦခမျၧးလၧစယီဟၫ့အဂဲး, နၥံၪစဲၪ့ထၪ့ လၧမံၩ့လၬကျၩ ဘဲၫၥိၭနၥံၪမိယိဖၧၩ့ဆၧနီၪလမံၩ့လဲၪ.",
			"25": "<sup>25</sup> မွဲဖီးလၧလံၩအူၪဝၭဝ့ၫလဘီၩ့နီၪဆ့ဧၪ.- အ့ၪလမွဲဘၪ တၭ,နၥံၪစဲၪ့ထၪ့ဘဲၫၥိၭ နၥံၪမိယိဖၧၩ့ဆၧနီၪလမံၩ့ လဲၪ.မွဲၦကီၩ့ဆၧၥိၭဆၧဖူၬလူၭနီၪဆ့ဧၪ. ယိခွါ,ၦလၧ အကီၩ့ဆၧၥိၭဆၧလၧအဂ့ၩ, ဒဲအၪ့ဆၧအီၩဆၧလၧ အအွံၪလဖၪနီၪ, အီၪလၧစဎွၩအနီးဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> အ့ၪလမွဲဘၪဘဲၫနီၪ, မွဲနၥံၪစဲၪ့ထၪ့ဘဲၫၥိၭနၥံၪမိယိ ဖၧၩ့ဆၧနီၪလမံၩ့လဲၪ. မွဲမီၪလဂၩဧၪ. မွဲယူၭ, ယ လီၩဘၪနၥံၪမွဲအဒိၪနဲၪ့မီၪဒံၭဖၭဒိၪလီၫ.",
			"27": "<sup>27</sup> အဝ့ၫနီၪမွဲၦလၧဆၧကွ့ၭအၥၭလၧအဂဲး, ယိခွါ, ယအၪ့မၧၫ့လၩ့ ယၥီၫ့လဂၩလၧနမ့ၬယၫ, အဝ့ၫဒၪမိတဲၩ့ဝဲၩနဖၧၩ့ၥၭ လၧနမ့ၬယၫလီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪ, ၦလၧၦမုၪအီၪဖျဲၪန့ ဝ့ၫအကျၩ, မီၪလၧအဒိၪနဲၪ့ၦဘၭတံၫဇၫ့ဆၧ စယီဟၫ့ နီၪအီၪနးဂၩအ့ၬ. မွဲလါနၫ့ဘိၩ, ၦအီၪဝ့ၫလၧယွၩအ ဘၩ့အမုးအဖၧၩ့ အဆံၭထုၬလဂၩ ဒိၪနဲၪ့အဝ့ၫနီၪဒံၭ လီၫ.",
			"29": "<sup>29</sup> ၦအၪ့ကံၩ့အခီၫ့, ဒဲၦခမျၧးထီးအလူၬလဖၪနီၪဒိၭ ဘၭတံၫဇၫ့အၥၭလၧ စယီဟၫ့အစူၪဖၧၩ့တၭ,အီၪက့ၪ",
			"30": "<sup>30</sup> တီၩအီၪက့ၪလီၩ့ယွၩလီၫ.- အ့ၪမွဲၦဖၫရစံၫ, ဒဲၦၥ့ၪ လံၬလဖၪနီၪ, လဒိၭဘၭတံၫဇၫ့ဘၪအၥၭ လၧအစူၪ ဖၧၩ့တၭ, ခွံၬၡိၭခွံၬယွၩအဆၧကိၪ့ လၧအဂးဒၪဝ့ၫ နီၪလီၫ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလဆၨၩယီၩမွဲယမိချဲၩ့ဒီၩ့ လၩ့ဝ့ၫလၧဆၧနီၪလမံၩ့လဲၪ. မွဲအမၩအၥၭဘဲၫဆၧနီၪလမံၩ့လဲၪ.-",
			"32": "<sup>32</sup> ဆၧမၩအၥၭဘဲၫဖိၪၥၪလဖၪ ဆၧၫ့နၩ့ လၧဘိၪ့ဖၧၩ့တၭ, ကိၭလိၬအၥၭလဒီၪ့လဒီၪ့ စံၭဝ့ၫ, ပအူၪပံၩလၧနၥံၪအဂးတၭ, နၥံၪဂဲထုၪ့လံအ့ၬ. ပဂၪ့",
			"33": "<sup>33</sup> ဆၧလၧနၥံၪအဂးတၭ, နၥံၪအမ့ၬထံၫလၩ့အ့ၬ.- အဂဲး ဘဲၫယီၩၦဘၭတံၫဇၫ့ ဆၧစယီဟၫ့လဂၩ ဂဲၫဝ့ၫတၭ, အၪ့ကိၪအီၩစဘံၭထံၫအ့ၬ. နၥံၪစံၭနၥံၪဝ့ၫဆၧနၪ",
			"34": "<sup>34</sup> အီၪလၧအလီၩ့လီၫ.- ၦၡၩအဖိၪခွၫယီၩ ဂဲၫဝ့ၫနီၪအၪ့ ဆၧအီၩဆၧတၭ, နၥံၪစံၭနၥံၪဝ့ၫ, ယိခွါ, ၦအၪ့လၨၪ ဆၧ, ဒဲအီၩလၨၪစဘံၭထံၫ ထၧၫ့ထံၩထၧၫ့ၥိၭလၧၦအၪ့ကံၩ့ အခီၫ့, ဒဲၦဆၧဒဲၩဘၭဖိၪၥံၪလဂၩနီၪလီၫ.",
			"35": "<sup>35</sup> မွဲလါနၫ့ဘိၩ, ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪဘၪဆၧအီၪက့ၪ တီၩအီၪက့ၪလီၩ့ ဝ့ၫလၧအဖိၪၥံၪကိၭဂၩဒ့ၭလီၫ.",
			"36": "<sup>36</sup> တၭၦဖၫရစံၫလဂၩကိၭယ့ၫၡုၬဘဲၫၥိၭအမိအၪ့ ဆၧလၧအၥိၭလီၫ. အဝ့ၫဒၪလ့ၩနုၬ လၧၦဖၫရစံၫအဂံၪ့ ဖၧၩ့တၭ, ဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫလၧစပွဲထံၭနီၪလီၫ.",
			"37": "<sup>37</sup> ယိခွါ,ၦဆၧဒဲၩဘၭဖိၪၦမုၪအီၪလၧဒိၩ့ဖၧၩ့လဂၩ နီၪ,ၥ့ၪယၫလၧအဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧ စပွဲထံၭလၧၦဖၫ ရစံၫအဂံၪ့ဖၧၩ့တၭ, ဂဲၫဆိၬကီၩ့လိးဘွၩလဖျိၪ့ အီၪ လၧဆၧနၧၫ့မၧၫ့တၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧအခၪ့ထံၭ လၧ",
			"38": "<sup>38</sup> အချိၫ့လခီၫတၭ,ဂၪ့ဝ့ၫ,- ၥူၫဝၭခွံၬအဝ့ၫအခၪ့လၧအ မ့ၬထံၫတၭ,ထူၭခွံၬဝ့ၫလၧအခိၪၥူၪတၭ, အဲၪဂါအခၪ့ တၭ,ဂုၪဝ့ၫလၧဆၧနၧၫ့မၧၫ့လီၫ.",
			"39": "<sup>39</sup> ၦဖၫရစံၫလၧအကိၭဝ့ၫလဂၩနီၪဒၪဘၪဝ့ၫတၭ, စံၭ ဆၧလၧအၥၭခံဖၧၩ့, အဝ့ၫလဂၩယီၩ, အ့ၪမွဲမီၪနီၪ, ၦမုၪလၧအထိၭဘၪဝ့ၫလဂၩယီၩ, မွဲၦဘဲၫၥ့ၪလဲၪဘဲၫ ၥ့ၪလဲၪနီၪ, မိၥ့ၪယၫဝ့ၫလီၫ. အဂဲးဘဲၫယီၩမွဲၦဆၧဒဲၩ ဘၭဖိၪလီၫ.",
			"40": "<sup>40</sup> ယ့ၫၡှူၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,စစဲမၧၫ့ဧ့,ယမိ ချဲၩ့ဆၧလၧနၧၩနးထံၪလီၫ. အဝ့ၫဒၪစံၭဝ့ၫ, ချဲၩ့ကဒၪ,",
			"41": "<sup>41</sup> ဆရၫဧ့,- စ့ၩကဆါလဂၩအစ့ၩအီၪ လၧၦနံၫဂၩအစူၪ ဖၧၩ့းအလဂၩဒန့ရံၩယဲယၩ, အဝ့ၫလဂၩယဲဆံၫလီၫ.",
			"42": "<sup>42</sup> ၦလဖၪနီၪ, စ့ၩလၧအမိလိၭထဲၩ့ဝ့ၫလအီၪဘၪတၭ, အဝ့ၫဒၪကွဲၪဖျါထဲၩ့အဝ့ၫၥံၪနံၫဂၩလူၬလီၫ. အ့ၪမွဲဘဲၫ နီၪတၭ,အဝ့ၫၥံၪနံၫဂၩနီၪ, မိအဲၪအဝ့ၫနီၪဒိၪလဂၩဂၩ လဲၪ.",
			"43": "<sup>43</sup> စစဲမၧၫ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,ယဆီၫ့မီၪ့ၦလၧအ ကွဲၪဖျါထဲၩ့အဆၧလၧအအၪလဂၩနီၪလီၫ. အဝ့ၫဒၪ",
			"44": "<sup>44</sup> စံၭအဝ့ၫ, နစ့ၩရၫ့ဆၧဂ့ၩဘၪစဲၪလီၫ.- ကၠၪစိၩအၥၭ လၧၦမုၪအီၪတၭ, စံၭစစဲမၧၫ့, ၦမုၪလဂၩယီၩမွဲန ဒၪဘၪဆ့ဧၪ. ယဂဲၫနုၬလၧနဂံၪ့ဖၧၩ့ယီၩ, ထံၫလၧယ ခၪ့အဂးနီၪ, နဖ့ၪလၫ့ဝ့ၫအ့ၬ. အ့ၪမွဲၦမုၪယီၩၥူၫဝၭခွံၬ ယခၪ့လၧအမ့ၬထံၫတၭ,ထူၭခွံၬဝ့ၫလၧအခိၪၥူၪလီၫ.",
			"45": "<sup>45</sup> နဝ့ၫဒၪယီၩနအဲၪဂါယၧၩအ့ၬ. အ့ၪမွဲၦမုၪယီၩ, လၧ ယဂဲၫနုၬၥၫ့ဝ့ၫနီၪ, အဲၪဂါယခၪ့နီၪ အီၪထီဝ့ၫအ့ၬ.",
			"46": "<sup>46</sup> နဝ့ၫဒၪယီၩနဂုၪယခိၪလၧၥိၪအ့ၬ. အ့ၪမွဲၦမုၪယီၩ",
			"47": "<sup>47</sup> ဂုၪယူၭယခၪ့လၧၥိၪနၧၫ့မၧၫ့ယူၭ.- မၩအၥၭဘဲၫနီၪ တၭ,ယစံၭနၧၩယီၩ အဆၧဒဲၩဘၭအအၪနီၪ, ဆၧ ဖျါခွံၬယူၭဝ့ၫယူၭ. အဂဲးဘဲၫယီၩ အဲၪဆၧဒိၪမၬလီၫ. အ့ၪမွဲၦလၧဆၧဖျါခွံၬဝ့ၫ လၧအၡၩနီၪ, အဲၪဆၧၡၩ",
			"48": "<sup>48</sup> လီၫ.- မွဲအလီၩဘၪၦမုၪနီၪ,နဆၧဒဲၩဘၭဖျါယူၭ,",
			"49": "<sup>49</sup> ၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫ လၧအၥိၭလဖၪနီၪ စံၭဝ့ၫလၧအ ၥၭခံဖၧၩ့ၦလၧအကွဲၪဖျါဆၧဒဲၩဘၭလဂၩယီၩ, မွဲပ",
			"50": "<sup>50</sup> လၫလဂၩလဲၪ.- အဝ့ၫဒၪစံၭၦမုၪ, နဆၧနဲၩနီၪ ထိးထဲၩ့တၩ့ထဲၩ့ယူၭနၧၩယူၭ, ထဲၩ့မုၬမုၬဆံၭ."
		},
		"8": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့နီၪ, ဆၧမၩအၥၭလၧအလ့ၩလီၩလၩ့ လၬလၩ့ယွၩအဘၩ့အမုး အဆၧၥၭထိၬအပရၧၫ့လၧ ကယဲဒိၩ့ကယဲတဝၫ့အဖၧၩ့ထူထူတၭ, ၦလဆံၫနံၫဂၩ",
			"2": "<sup>2</sup> နီၪအီၪလၧအၥိၭလီၫ.- ၦမုၪလနၩ့နၩ့လၧဆၧနၪအီၪ လၧအလီၩ့ ဒဲအဘၪဆၧဆၫ လၧအဘၪဆၧမၩဘျၪ ထဲၩ့ဝ့ၫလဖၪ, ၦလၧအဝ့ၫဒၪနၫ့ထၪ့ခွံၬဆၧနၪနွ့ၫဒုၩ လၧအလီၩ့နးမၫရံၫကိၭဝ့ၫ လၧမၭဂဒၫလံနံၫလဂၩ.",
			"3": "<sup>3</sup> ဒဲစဟ့ရၧၭအၡၩယိအဆၧဖိၪဆၧလံၩ, စစုဇၫအမၫ နးယိၫအၫ့နၫလဂၩ, ဒဲနးစုၫစၫ့နၫလဂၩ, ဒဲၦမုၪအဂူၫ ဂၩအၪဂၩလၧအလုအၪ့လုအီၩ အဝ့ၫၥံၪလၧအဆၧ ဖိၪဆၧလံၩအီၪဝ့ၫလၧအကျၩလီၫ.",
			"4": "<sup>4</sup> ၦခမျၧးဖၭဒိၪအီၪကီၪ့ဝ့ၫတၭ, ၦၡၩလၧကယဲဒိၩ့ၥံၪ ဂဲၫလၧအအီၪဆ့တၭ, အဝ့ၫဒၪချဲၩ့ဒီၩ့လၩ့ဆၧစံၭဝ့ၫ,",
			"5": "<sup>5</sup> ၦလၧအဎွံၪဆၧလဂၩနီၪ လ့ၩဎွံၪလၩ့အဆၧချံၫလီၫ. ဎွံၪဆၧနီၪလနၩ့နၩ့လၩ့ဘၪဝ့ၫ လၧဖၧၩ့ၥၭအနဲၩ့ထံၭ တၭ,ဘၪဆၧယဲးထဲးဝ့ၫတၭ, ထိၪၥံၪလံၪၥံၪလၧဆၧ",
			"6": "<sup>6</sup> ဖိၭဖၫ့အၪ့ခွံၬဝ့ၫဒၪလီၫ.- အဂူၫဂၩလနၩ့နၩ့လၩ့ဘၪဝ့ၫ လၧလိးကျၩတၭ, မွဲဆၧလစီၪဘၪအကၠီၩ့ ထီးအမဲၪ",
			"7": "<sup>7</sup> ထၪ့နီၪ,လၩ့ယံၭခွံၬဝ့ၫဒၪလီၫ.- အဂူၫဂၩလနၩ့နၩ့လၩ့ ဘၪဝ့ၫလၧဆၧဆူၪဆၧမဲၪအကျၩနီၪ, ဆၧဆူၪဆၧမဲၪၥံၪ",
			"8": "<sup>8</sup> မဲၪထၪ့ဎုၬဝ့ၫတၭ, ခဲၪဘံၭခွံၬဝ့ၫဒၪလီၫ.- အဂူၫဂၩ လနၩ့နၩ့လၩ့ဘၪဝ့ၫ လၧဂၪ့ခိၪအဂ့ၩတၭ, မဲၪထၪ့ဝ့ၫ နီၪ,အၥူၪအၥၪအၪနဲၪ့ထဲၩ့အလးလယၩလီၫ. စံၭ ဆၧလဖၪနီၪကိၭၡၭထၪ့ဝ့ၫ, ၦအီၪလၧအနါလၧအနါ ဂၧၫ့ဆၧနီၪ, မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ.",
			"9": "<sup>9</sup> အထံၩအဖျဲၥံၪအၪ့စၪ့ဝ့ၫတၭ, စံၭဝ့ၫ,ဆၧလၧဆၧ",
			"10": "<sup>10</sup> ချဲၩ့ဒီၩ့လၩ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, ဆၧအီၪၥူၪဘၪဆဲၫ့ လၧယွၩအဘၩ့အမုးနီၪ,ဆၧဖ့ၪ လၫ့ၥ့ၪယၫနၥံၪလီၫ. အ့ၪမွဲၦဂူၫဂၩလဖၪနီၪ, ဆၧဖ့ၪ လၫ့ဝ့ၫလၧဆၧချဲၩ့အဒီၩ့, ဘဲၫၥိၭလၧအယိဆၧနီၪ, လမိဒၪဘၪဆၧးဘဲၫၥိၭလၧအနါဂၧၫ့ဆၧနီၪ, နၪဝ့ၫ လမိၥ့ၪဘၪလီၫ.",
			"11": "<sup>11</sup> ဆၧချဲၩ့အဒီၩ့နီၪမွဲအယီၩ,ဆၧချံၫမွဲယွၩအလူ",
			"12": "<sup>12</sup> လီၫ.- ၦလၧဖၧၩ့ၥၭအနဲၩ့ထံၭလဖၪနီၪ, မွဲၦၡၩနါဂၧၫ့ ဝ့ၫ,ထီးနီၪလဖၧၫ့ဘဲၫၥိၭအထီးနဲၩဆၧ ဒဲထီၩ့လၧဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫလဂ့ၩတၭ, မုၪခီၩလဲးဂဲၫအၪ့ထုၫ့",
			"13": "<sup>13</sup> ခွံၬဆၧအလူလၧအၥၭဖၧၩ့နီၪလီၫ.- ၦလၧလိးကျၩ လဖၪနီၪ,မွဲၦၡၩနါဂၧၫ့ဝ့ၫတၭ, ဒိၭန့ဆၧအလူလၧ အၥုၪ့ထိၬၥၭထိၬတၭ, မွဲအဝံလအီၪဘၪနီၪ, နဲၩဝ့ၫ လဆိဖိၪတၭ,ထီးအဘၪဆၧကျဲၩ့ဖစီၩ့နီၪ, အၥၭဂၭဂီၩ့",
			"14": "<sup>14</sup> ဝ့ၫဒၪလီၫ.- ဆၧလၩ့ဘၪလၧဆၧဆူၪဆၧမဲၪအကျၩလ ဖၪနီၪ, မွဲပနါဂၧၫ့ဝ့ၫနီၪလ့ၩဆၧတၭ, မွဲဆၧအၪ့ယိၪလၧ စူၪလးခၪ့ခိၪလဖၪအကၠီၩ့နီၪ, ဒဲဆၧမုၬဆၧလၩလၧခီၫ့ ယီၩလၩ့ဘံၭခွံၬဝ့ၫဒၪတၭ, အၥၭဂၭဂီၩ့ဝ့ၫဒၪဆ့",
			"15": "<sup>15</sup> လီၫ.- ၦလၧဂၪ့ခိၪအဂ့ၩလဖၪ,မွဲၦၡၩနါဂၧၫ့ဆၧအလူ နီၪ, ဖီၪ့ထၬဝ့ၫလၧအၥၭဂ့ၩ, အၥုၪ့ဂ့ၩအၥၭဘွၩ တၭ,ၥၪထၪ့ဝ့ၫလၧအၥုၪ့ဂုးအၥၭခၧၫ့လီၫ.",
			"16": "<sup>16</sup> ၦစီၩ့ထၪ့မ့ၪဒိၩ့တၭ, မၩဘံၭဝ့ၫလၧဆၧဖၧၩ့အဖၫ့ လၬမွဲဂ့ၩ,အီၪက့ၪလၩ့ဝ့ၫလၧခၬအဖၫ့လၬမွဲဂ့ၩ,အီၪ နးဂၩအ့ၬ.မွဲအအီၪက့ၪဝ့ၫ လၧမ့ၪဒိၩ့အလးဘဲၫၥိၭ ၦၡၩလၧအလ့ၩနုၬလဖၪနီၪး မိဒၪဘၪအဆၧဖၩ့လီၫ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩဆၧအီၪၥူၪဝ့ၫ, လၧဆၧလမိဒုၭဖျီၪထၪ့ ဘၪနီၪ,အီၪနးမံၩ့အ့ၬ. ဆၧလၧအအီၪဘံၭဝ့ၫနီၪ, ဆၧလဒုၭၥ့ၪယၫဘၪ ဒဲလအီၪဖျီၪဘၪနီၪအီၪနးမံၩ့",
			"18": "<sup>18</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, နၥံၪနါဂၧၫ့ဆၧဘဲၫၥ့ၪလဲၪ နီၪ,ထီးလၩ့နၥံၪအၥၭဘီၪ. အဂဲးဘဲၫယီၩထီးဒၪ ၦလၧအဆၧအီၪဝ့ၫနီၪ,ဆၧဖ့ၪလၫ့လၧအဝ့ၫနီၪ, ထီးဒၪၦလၧအဆၧလအီၪဘၪနီၪ, ဆၧလၧအဆီၫ့မီၪ့ ဝ့ၫလၧအအီၪတၭ, ဆၧမိမၩန့ထဲၩ့လၧအဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> အမိ,ဒဲအထၧၫ့ဖုဝဲလဖၪဂဲၫလၧအအီၪတၭ,လၧ ၦခမျၧးအီၪအကၠီၩ့နီၪ, ဂဲၫထီၩ့ဘူၭလၧအအီၪၥ့ၪအ့ၬ.",
			"20": "<sup>20</sup> ၦလဂၩလီၩဘၪအဝ့ၫတၭ, စံၭဝ့ၫ, နမိဒဲနထၧၫ့ဖုဝဲ လဖၪမိဒၪဘၪအၥၭလၧနၧၩတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧခီၫ့",
			"21": "<sup>21</sup> လီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭအဝ့ၫၥံၪ,ယမိဒဲယ ထၧၫ့ဖုဝဲၥံၪ, မွဲၦလဖၪလၧအနါဂၧၫ့ယွၩအလူအထၫ, ဒဲမၩဝ့ၫဆ့လီၫ.",
			"22": "<sup>22</sup> လၧမုနံၩလဖၪနီၪ, ဆၧမၩအၥၭလၧအလ့ၩနုၬ လၧချံၫလဖျိၪ့အဖၧၩ့ အီၪလၧအထံၩအဖျဲၥံၪ အၥိၭ တၭ,စံၭအဝ့ၫၥံၪ, မွဲပခၫ့ဂၬၡီၩ့ လၧကွံၩဝါလခီၫဘီၪ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪလ့ၩဝ့ၫလီၫ.- ခၫ့ဂၬဝ့ၫအဘိၩ့ဘၭတၭ,အဝ့ၫ ဒၪမံၫမၪဝ့ၫလီၫ. လံၩမုဂဲၫထၪ့ဆီၪ့ဆီၪ့လ့ၬ လၧကွံၩ ဖၧၩ့တၭ,ချံၫနီၪဘူၭကၪမိဎွ့ၩလၧထံၫတၭ, အဝ့ၫၥံၪ",
			"24": "<sup>24</sup> မိဂၭဂီၩ့ကၪယူၭလီၫ.- အထံၩအဖျဲဂဲၫထိၪဂဲၩ အဝ့ၫ ဒၪတၭ,စံၭဝ့ၫ, ကဆါဧ့,ကဆါဧ့,ပမိဂၭဂီၩ့ဖီၩၬ အဝ့ၫဒၪဂဲထုၪ့တၭး အၪ့လၬလံၩဒဲလပီၩလဖၪနီၪ,အ",
			"25": "<sup>25</sup> ဝ့ၫၥံၪပထုၬဝ့ၫတၭ,ထံၫအီၪဂုးဖုးလီၫ.- အဝ့ၫဒၪစံၭအ ဝ့ၫၥံၪ, နၥံၪအဆၧနဲၩနီၪမွဲအအီၪခီၫခီၫလဲၪ. အဝ့ၫၥံၪ ၥၭမဲၪဆၧတၭ, ထီၫမံၫထီၫမၪဝ့ၫစံၭလိၬအၥၭ,အယီၩ မွဲၦလဂၩလဲၪ. အဝ့ၫဒၪမၪလူၬလံၩ,ဒဲထံၫတၭ,အဝ့ၫ ၥံၪခိၭနၪမၬအဝ့ၫနီၪကၨ.",
			"26": "<sup>26</sup> အဝ့ၫၥံၪခၫ့ဂၬဝ့ၫလၧၦဂၧဂစံၫ့ဖိၪအခးအီၪလၧ",
			"27": "<sup>27</sup> ဂၫလလံၫဝါလခီၫလီၫ.- အဝ့ၫနီၪစဲၪ့ထၪ့လၧခီၫ့တၭ, ၦလၧဆၧနၪအီၪလၧအလီၩ့ ယံၬယံၬလဂၩစဲၪ့ထၪ့ခွံၬ လၧဒိၩ့ဖၧၩ့အၪ့ဂၬဝ့ၫတၭ, ကီၩ့ဆၧၥိၭဆၧအ့ၬ, လအီၪ",
			"28": "<sup>28</sup> ဘၪလၧဂံၪ့ဖၧၩ့တၭ, အီၪဝ့ၫလၧလီၫ့ဖၧၩ့လီၫ.- ထီးအ ဒၪဘၪယ့ၫၡုၬနီၪ ကိၭၡၭထၪ့ဆၧတၭး စံၭဝ့ၫလၧအ လူဖၭဒိၪ,ယွၩအထီၫထုၬအဖိၪခွၫယ့ၫၡုၬဧ့, ယၧၩဒဲ နၧၩယီၩမွဲဆၧဘၪဆဲၫ့လိၬပၥၭ လၧဆၧနီၪလမံၩ့လဲၪ. ယအၪ့ကံၩ့အၪ့ယၫနၧၩ, ထီးမၩၡၪ့မၩနၭယၧၩလ",
			"29": "<sup>29</sup> ဂ့ၩဧီၪ.- အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမၪလူၬဆၧနၪဘဲၫၥိၭ အမိစဲၪ့ထၪ့ခွံၬ လၧၦနီၪအလီၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧနၪဖီၪ့ထၬအဝ့ၫအၪဘျၩ့ယူၭတၭ, အဝ့ၫဒၪဘၪဆၧ စၧၩ့ထၬဝ့ၫ လၧၥွ့ၫထၭ, ဒဲဘၪဆၧၥံၩ့ထၬဝ့ၫနီၪ ထုၭ ထ့ၬဝ့ၫအဆၧစၧၩ့ထၬတၭ, ဆၧနၪနီၪနၫ့လၩ့ခွံၬအဝ့ၫ လၧမံၩ့လၬကျၩနီၪလီၫ.",
			"30": "<sup>30</sup> ယ့ၫၡုၬအၪ့စၪ့အဝ့ၫနီၪ, စံၭဝ့ၫ, နမံၩ့မွဲဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪစံၭဝ့ၫ, မွဲလံစၧၫ့, အဂဲးဘဲၫယီၩဆၧနၪအၪဒုၩ",
			"31": "<sup>31</sup> အီၪဝ့ၫလၧအလီၩ့လီၫ.- အဝ့ၫၥံၪအၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအထီးမၪလူၬ အလ့ၩလၧဆၧယိၬဖၧၩ့လဂ့ၩ",
			"32": "<sup>32</sup> လီၫ.- ထီးအလးနီၪထိၭအဒီၪ့ ဖၭဒိၪလဒီၪ့အၪ့ဆၧလၧ ခိၪလီၩ့အလီၩ့တၭ, အဝ့ၫၥံၪအၪ့ကံၩ့အၪ့ယၫဝ့ၫဘဲၫ ၥိၭအမိဒုၭလ့ၩနုၬဝ့ၫ လၧအဖၧၩ့လီၫ. တၭအဝ့ၫဒၪဒုၭ လ့ၩနုၬအဝ့ၫၥံၪလီၫ.",
			"33": "<sup>33</sup> ဆၧနၪစဲၪ့ထၪ့လၧၦလဂၩအလီၩ့တၭ, လ့ၩနုၬဝ့ၫ လၧထိၭအဖၧၩ့တၭ, ထိၭလဒီၪ့နီၪ စဲၪ့ဖုၫလၩ့လၧၡၭ မ့ၬထုးဖၭထီၫနီၪ လၧကွံၩဖၧၩ့တၭ, လၩ့အုၭၥံၫခွံၬဝ့ၫ",
			"34": "<sup>34</sup> လီၫ.- ထီးၦယူၬထိၭလဖၪနီၪဒၪဘၪဆၧမၩအၥၭတၭ, ထဲၩ့စဲၪ့ဝ့ၫတၭ, လီၩဘၪဆၧနီၪလၧဒိၩ့ဖၧၩ့, ဒဲလၧ",
			"35": "<sup>35</sup> မံၩ့လၬကျၩလီၫ.- အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫဘဲၫၥိၭအမိယိ ဆၧမၩအၥၭလမံၩ့နီၪ, ဂဲၫလၧယ့ၫၡုၬအအီၪတၭ, ဒၪ ဘၪၦလၧဆၧနၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧအလီၩ့လဂၩကီၩ့ ဆၧၥိၭဆၧတၭ, အၥၭလၩ့ထံးလၩ့ဆ့ၭအီၪထၪ့ထဲၩ့ တၭ,ဆၧၫ့နၩ့လၧယ့ၫၡှူၬအခၪ့ထံၭနီၪ အဝ့ၫၥံၪၥၭမဲၪ",
			"36": "<sup>36</sup> အဝ့ၫလီၫ.- ၦလၧဆၧနၪအီၪလၧအလီၩ့လဂၩဘျၪထဲၩ့ ဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, ၦဒၪဘၪဝ့ၫလဖၪလီၩဘၪ",
			"37": "<sup>37</sup> အဝ့ၫၥံၪတၭ,- ၦခမျၧးလၧအအီၪလၧၦဂၧဂစံၫ့အခး ဖၧၩ့ဝၬဝၬ ထီးအလူၬလဖၪ အၪ့ကံၩ့အၪ့ယၫအဝ့ၫဒၪ လဂၩဘဲၫၥိၭအမိစဲၪ့ထၪ့ခွံၬလၧအအီၪလီၫ. အဂဲး ဘဲၫယီၩၥၭမဲၪဝ့ၫဒိၪမၬ လီၫ. အဝ့ၫဒၪလ့ၩနုၬလၧချံၫ ဖၧၩ့နီၪတၭ,ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"38": "<sup>38</sup> ၦလၧဆၧနၪစဲၪ့ထၪ့ခွံၬလၧအလီၩ့လဂၩနီၪ, ဘဲၫ ၥိၭအမိအီၪလၧအၥိၭတၭ,အၪ့ကံၩ့အၪ့ယၫဝ့ၫလီၫ.",
			"39": "<sup>39</sup> အ့ၪမွဲယ့ၫၡုၬအၪ့မၧၫ့အထဲၩ့ထဲၩ့တၭ, စံၭဝ့ၫ,- ထဲၩ့ လၧနဂံၪ့တၭ, ထီးဒၪယွၩမၩနၧၩလၧဆၧဖၭဒိၪ ယီၩ,လီၩဘၪနဝ့ၫဆံၭ. ထီးဒၪယ့ၫၡုၬမၩဝ့ၫလၧဆၧ ဖၭဒိၪလဖၪနီၪ မွဲအထဲၩ့လီၩလၩ့လၬလၩ့ဝ့ၫလၧဒိၩ့ ဖၧၩ့ထၧၫ့ဒိၩ့ယၫလီၫ.",
			"40": "<sup>40</sup> ဆၧမၩအၥၭလၧယ့ၫၡှူၬဂဲၫထဲၩ့ဝ့ၫတၭ, ၦခမျၧးနီၪ ထိးဆၧၫ့ဝ့ၫဒၪမုၬမၬတၭ, အဂဲးဘဲၫယီၩယိလါဝ့ၫအ",
			"41": "<sup>41</sup> ဖၧၩ့ၥၭလီၫ.- ယိခွါ,ၦၥရိၬခိၪအမံၩ့စယၫအရၧၭ လ ဂၩဂဲၫထွံၩလၩ့ လၧယ့ၫၡှူၬအခၪ့ထံၭတၭ,အၪ့ကံၩ့ အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအမိဂဲၫနုၬ လၧအဂံၪ့ဖၧၩ့လီၫ.",
			"42": "<sup>42</sup> အဂဲးဘဲၫယီၩအဖိၪမုၪလဂၩဎး အၥၭအီၪဝ့ၫလဆံၫ နံၫနံၪ့လဂၩနီၪမိၥံၫဝ့ၫဒၪလီၫ. အဝ့ၫဒၪလ့ၩဝ့ၫအဘိၩ့ ဘၭတၭ, ၦခမျၧးဘၪထံၭအဝ့ၫလီၫ",
			"43": "<sup>43</sup> ၦမုၪလၧအဆၫၥွံၪလၩ့ယူၭ လဆံၫနံၫနံၪ့ လၧအ ဖ့ၪလၫ့ခွံၬအဆၧထီးအလူၬလၧၥံၪဎၥံၪ့ဎွံၭဆရၫၥံၪ",
			"44": "<sup>44</sup> တၭ,အဝ့ၫၥံၪမၩဘျၪထဲၩ့လၥ့ၪဘၪနးဂၩနီၪ,- ဂဲၫ လၧယ့ၫၡှူၬအချိၫ့တၭ, ထိၭဘၪဝ့ၫအကီၩ့အၥိၭအနွံၫ",
			"45": "<sup>45</sup> တၭ,အၥွံၪလၩ့နီၪထုၬထဲၩ့ဝ့ၫချဲၫ့မၬလီၫ.- ယ့ၫၡှူၬ စံၭဝ့ၫ,မွဲပလၫထိၭဘၪယၧၩလဂၩလဲၪ. ၦထီးအလူၬ မီၪ့ဘံၭဝ့ၫဒၪတၭ, စပံတၧၫဒဲၦအီၪလၧအၥိၭလဖၪ, စံၭ ဝ့ၫ, ကဆါဧ့,ၦခမျၧးဘၪထံၭနၧၩတၭ, နစံၭ,မွဲပလၫ",
			"46": "<sup>46</sup> ထိၭဘၪယၧၩလဂၩလဲၪနီၪဧၪ.- ယ့ၫၡှူၬစံၭဝ့ၫ, ၦလ ဂၩဂၩထိၭဘၪယူၭယၧၩယူၭ. အဂဲးဘဲၫယီၩ ယၥ့ၪ ယၫလၧဆၧအစီၩ့အမၩ့စဲၪ့ထၪ့ခွံၬလၧယလီၩ့လီၫ.",
			"47": "<sup>47</sup> ထီးၦမုၪနီၪၥ့ၪယၫ လၧအအီၪၥူၪလဘံၭဘၪနီၪ, ဝၭထိၬဝၭတ့ၭ, ဂဲၫထွံၩလၩ့လၧအခၪ့ထံၭတၭ,ထိၭ ဘၪဝ့ၫအကၠီၩ့ဘျၪထဲၩ့ဝ့ၫချဲၫ့မၬ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ",
			"48": "<sup>48</sup> နီၪ,လီၩဘၪအဝ့ၫလၧၦထီးအလူၬအမ့ၬယၫလီၫ.- အ ဝ့ၫဒၪစံၭအဝ့ၫ, ဖိၪမုၪဧ့, မွဲနၥၭဎွံၫထၪ့ဘီၪ, နဆၧနဲၩ နီၪမၩဘျၪထဲၩ့ယူၭနၧၩယူၭး ထဲၩ့မုၬမုၬဆံၭ.",
			"49": "<sup>49</sup> အဝ့ၫဒၪချဲၩ့ဆၧနီၪအဘိၩ့အဘၭတၭ,ၦဂဲၫလၧၥရိၬ ခိၪအအီၪလဂၩတၭ, လီၩဘၪဝ့ၫ, နဖိၪမုၪၥံၫယူၭဝ့ၫ",
			"50": "<sup>50</sup> ယူၭး ထီးမၩထံၬထၬဆရၫလဂ့ၩ.- ယ့ၫၡှူၬနါဂၧၫ့ဆၧ နီၪ,ချဲၩ့ဆၧၫ့အဝ့ၫတၭ, စံၭဝ့ၫ, ထီးၥၭမဲၪဆၧလဂ့ၩ, နဲၩကဒၪဘီၪ. တၭအဝ့ၫဒၪမိဘၪဆၧမၩဘျၪထဲၩ့ ဝ့ၫဒၪလီၫ.",
			"51": "<sup>51</sup> အဝ့ၫဒၪလ့ၩထီၩ့လၧအဂံၪ့တၭ, အ့ၪလမွဲဘၪစပံတၧၫ, ဒဲစယီဟၫ့, ဒဲစယ့မံၭ, ဒဲၦဖိၪၥၪမုၪ အမိအဖါၥံၪနီၪ,",
			"52": "<sup>52</sup> မွဲအဒုၭလ့ၩနုၬၦနးဂၩအ့ၬ.- ၦထီးအလူၬဂၪ့ဆၧ ယၧၩ့ဆၧတၭ, အဝ့ၫဒၪစံၭဝ့ၫ, ဂၪ့လဂ့ၩ,ၥံၫအ့ၬ,မံၫ",
			"53": "<sup>53</sup> မၪဝ့ၫဒၪလီၫ.- ၦလဖၪနီၪ ၥ့ၪယၫဝ့ၫ လၧအၥံၫတၭ,",
			"54": "<sup>54</sup> နံဘၪဒုၪဒွ့ၪအဝ့ၫလီၫ.- အဝ့ၫနီၪနၫ့ထၪ့ခွံၬၦထီး အလူၬလၧခီၫ့တၭ,ဖီၪ့ထၬၦဖိၪၥၪမုၪနီၪအစူၪ, စံၭဝ့ၫ,",
			"55": "<sup>55</sup> ဖိၪၥၪမုၪဧ့,ဂဲထုၪ့ဘီၪ.- အၥၭဂဲၫထဲၩ့ထဲၩ့တၭ, ဂဲထုၪ့ချဲၫ့မၬလီၫ.-",
			"56": "<sup>56</sup> မွဲအအၪ့မၧၫ့ၦၡၩဒုၭအၪ့အဆၧ အၪ့လီၫ.အမိအဖါထီၫမံၫထီၫမၪဝ့ၫလီၫ. ဆၧမၩအ ၥၭနီၪ,ဘဲၫၥိၭအဝ့ၫၥံၪ ထီးလီၩဘၪၦနးဂၩ လဂ့ၩ တၭ,မၪလူၬဝ့ၫဒၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ယ့ၫၡှူၬကိၭကီၪ့ၦလဆံၫနံၫဂၩတၭ,ဖ့ၪလၫ့အဝ့ၫ ၥံၪလၧဆၧစီၩ့ဆၧမၩ့လၧဆၧနၪ ထီးအလူၬအဖၫ့ခိၪ,",
			"2": "<sup>2</sup> ဒဲဘဲၫၥိၭအမိမၩဘျၪထဲၩ့ဆၧဆၫလီၫ.- မွဲအအၪ့မၧၫ့ လၩ့ဝ့ၫဘဲၫၥိၭ အမိလီၩ့လၩ့လၬလၩ့ယွၩ အဘၩ့အမုး",
			"3": "<sup>3</sup> အဂဲး, ဒဲမၩဘျၪထဲၩ့ၦဘၪဆၧဆၫလီၫ.- အဝ့ၫဒၪလီၩ ဘၪအဝ့ၫၥံၪ, လၧနၥံၪလ့ၩဆၧအဂးနီၪ, ထီးဆိၬဆၧ နးမံၩ့လဂ့ၩ. နိၪထိၭမွဲဂ့ၩ, ဆၧအၪ့အထိၪ့မွဲဂ့ၩ,ကိၪ မွဲဂ့ၩ,ကျိၪၥံၪစ့ၩၥံၪမွဲဂ့ၩ, ဆဲၫ့နံၫဘံၪ့မွဲဂ့ၩ, မွဲအထီး",
			"4": "<sup>4</sup> အီၪလဂ့ၩ.- နၥံၪအ့ၪလ့ၩနုၬ လၧဂံၪ့လဖျိၪ့အဖၧၩ့နီၪ",
			"5": "<sup>5</sup> အီၪထီးနီၪတၭ,စဲၪ့ထၪ့ခွံၬထီးနီၪဆံၭ.- ထီးဒၪၦလၧ အလထိးဆၧၫ့ဘၪနၥံၪနီၪ, ထီးနၥံၪအ့ၪစဲၪ့ထၪ့ခွံၬလၧ ဒိၩ့နီၪ,တရူၩလၩ့ခွံၬဂၪ့ခိၪအမုၬလၧနၥံၪအခၪ့ယၫ ၥၭလၧဆၧထိးအၥၭ လၧအထၫ့ဒုၪဒၩအဝ့ၫၥံၪဆံၭ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫတၭ, လ့ၩလီၩလၩ့လၬလၩ့ဆၧ ၥၭထိၬအပရၧၫ့, မၩဘျၪထဲၩ့ဆၧဆၫၥံၪ လၧတဝၫ့ၥံၪ ဎံၩ့ဎံၩ့လ့ၬလီၫ.",
			"7": "<sup>7</sup> ၦဒိၪဖၭဒိၪစဟ့ရၧၭ နါဂၧၫ့ကယဲဆၧမၩအၥၭထီး အလူၬတၭ, အၥၭမၩအၥၭဆၧဝံၩ့ဆၧဝၩ့လီၫ. အဂဲး ဘဲၫယီၩၦလနၩ့နၩ့, စံၭဝ့ၫး စယီဟၫ့ဂဲထုၪ့ထဲၩ့ယူၭ",
			"8": "<sup>8</sup> လၧဆၧၥံၫယူၭ.- လနၩ့နၩ့, လၧစအံၫလဲယၫအီၪထၪ့ ယူၭ, လၧအဂူၫဂၩလနၩ့နၩ့ မွဲမီၪလၧဖျိၩ့လဂၩဂၩ",
			"9": "<sup>9</sup> ဂဲထုၪ့ထဲၩ့ယူၭ.- မွဲလါနၫ့ဘိၩစဟ့ရၧၭ, စံၭဝ့ၫ,စယီ ဟၫ့နီၪယဖ့ၬခွံၬယူၭအခိၬယူၭ. ၦလၧယနါဂၧၫ့အ ဂဲးဘဲၫအံၩဘဲၫအိၩလဂၩနီၪ, မွဲပလၫလဂၩလဲၪ. တၭ ဆၧမိဒၪဘၪအၥၭလၧအဝ့ၫနီၪလီၫ.",
			"10": "<sup>10</sup> ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ, ဂဲၫထဲၩ့လီၩဘၪအဝ့ၫဒၪ ထီးဒၪအမၩဆၧလဖၪထီးအလူၬလီၫ. အဝ့ၫနီၪကိၭ အဝ့ၫၥံၪတၭ, လ့ၩဝ့ၫလၧဆၧကဒုၩအလးလၧမံၩ့လၬ ကျၩလၧအဘၪဆဲၫ့လၧဒိၩ့လဖျိၪ့ ကိၭဝ့ၫဘ့ၭၥစ့ဒၫ",
			"11": "<sup>11</sup> လီၫ.- ၦခမျၧးနီၪၥ့ၪယၫဝ့ၫတၭ, ဖိၬထၪ့အခဲၫ့တၭ, အဝ့ၫဒၪထိးဆၧၫ့ဝ့ၫတၭ, လီၩလၩ့လၬလၩ့အဝ့ၫၥံၪ လၧယွၩအဘၩ့အမုးအဂဲးတၭ, ၦလၧဆၧမၩဘျၪ ထဲၩ့ဝ့ၫအလးအီၪလဖၪနီၪ, မၩဘျၪထဲၩ့ဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> မုမိဂၪလၩ့တၭ, ၦလဆံၫနံၫဂၩဂဲၫလီၩဘၪအဝ့ၫ နီၪ,ဘဲၫၥိၭၦခမျၧးယီၩ မိလ့ၩထၪ့လၧခီၫ့ နုၬမံၫလၧ တဝၫ့လဖၪအီၪဝၬဝၬအဖၧၩ့ ဒဲဒၪန့ဆၧအၪ့ဆၧအီၩ တၭ,ကွဲၪဖျါလါအဝ့ၫၥံၪဆံၭ. အဂဲးဘဲၫယီၩ ပအီၪထီး",
			"13": "<sup>13</sup> ယီၩမွဲမံၩ့လၬကျၩလီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ, နၥံၪဝ့ၫ ဒၪယီၩဖ့ၪလၫ့အဆၧအၪ့ဆံၭ,အဝ့ၫၥံၪစံၭဝ့ၫ, ပအ့ၪ လလ့ၩဎွ့ၩဘၪဆၧအၪ့ဆၧအီၩ လၧၦထီးအလူၬအ ဂးယီၩတၭ, ဆၧအၪ့ဆၧအီၩအီၪအ့ၬ.အီၪန့ၫကိၪယဲ",
			"14": "<sup>14</sup> လီၪ့,ဒဲယၪနံၫဘံၪ့လီၫ.- အဂဲးဘဲၫယီၩ ၦၡၩအီၪဖိၭ ဘိၭယဲထီၫ့ယူၭ. တၭအဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪအၪ့ မၧၫ့ၦခမျၧးဆၧၫ့နၩ့ဒံၩ့ခံၫ့ယဲဆံၫလဒီၪ့,ယဲဆံၫလ",
			"15": "<sup>15</sup> ဒီၪ့ဆံၭ.- အဝ့ၫၥံၪမၩဝ့ၫဘဲၫနီၪတၭ,အၪ့မၧၫ့ၦထီးအ",
			"16": "<sup>16</sup> လူၬဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫလီၫ.- အဝ့ၫဒၪမၩန့ကိၪယဲလီၪ့, ဒဲယၪနံၫဘံၪ့နီၪ, ယိထၪ့ဆၧလၧမူၭခိၪဆိၪဂ့ၩဝ့ၫတၭ, ကံၪ့ဘျ့ၭဝ့ၫနီၪ, ဖ့ၪလၫ့အထံၩအဖျဲၥံၪဘဲၫၥိၭအဝ့ၫၥံၪ",
			"17": "<sup>17</sup> မိအီၪက့ၪလၩ့လၧၦခမျၧးအမ့ၬယၫလီၫ.- ၦခမျၧးကိၭ ဂၩဒ့ၭအၪ့တၭဘျဲၩအၪ့ဝ့ၫလီၫ. ဆၧအၪ့ထုၫ့န့ဝ့ၫ အဘျဲၪအဆဲဎွ့ၩဒၩ့လဆံၫနံၫဖျိၪ့လီၫ.",
			"18": "<sup>18</sup> ဆၧမၩအၥၭလၧအဘၩဆိၪဖၪဆၧ လၧဆၧကဒုၩအ လးတၭအထံၩအဖျဲၥံၪ အီၪလၧအၥိၭနီၪ, အဝ့ၫဒၪ အၪ့စၪ့အဝ့ၫၥံၪတၭစံၭဝ့ၫ, ၦခမျၧးနီၪမွဲအစံၭလၧယမွဲ",
			"19": "<sup>19</sup> ပလၫလဂၩလဲၪ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ၦဘၭတံၫဇၫ့ဆၧစယီဟၫ့, အဂူၫဂၩလနၩ့နၩ့စအံၫ လဲယၫ,အဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫ, မီၪလၧဖျိၩ့လဂၩဂၩ",
			"20": "<sup>20</sup> ဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, အ့ၪမွဲနၥံၪဝ့ၫ ဒၪယီၩ, နၥံၪစံၭလၧယမွဲပလၫလဂၩလဲၪ. စပံတၧၫ့ ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, နဝ့ၫဒၪယီၩ, နမွဲယွၩအ ဎရံၬလီၫ.",
			"21": "<sup>21</sup> အဝ့ၫဒၪမၪလူၬအဝ့ၫၥံၪ, ဘဲၫၥိၭအထီးလီၩဘၪ",
			"22": "<sup>22</sup> ဆၧနီၪလၧၦနးဂၩလဂ့ၩ,- စံၭဝ့ၫ, ၦၡၩအဖိၪခွၫယီၩ မိဘၪဆၧအၪမံၩ့တၭ, မိဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫ လၧၦၥုၪ့ က့ၭၥၭၡါၥံၪ,ဒဲလၧၦလုဆၧအဒိၪၥံၪ,ဒဲလၧၦကွ့ၭလံၬ ၥံၪအစူၪဖၧၩ့တၭ, မိဘၪဆၧမၩၥံၫဝ့ၫတၭ, လၧၥၧၫ့နံၩ",
			"23": "<sup>23</sup> လနံၩနီၪ, မိဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- အဝ့ၫဒၪစံၭၦထီး အလူၬ,ၦအ့ၪမိဖိၬဘၪအၥၭလၧယခဲၫ့လဂၩဂၩနီၪ,မွဲ အခွံၬၡိၭခွံၬအၥၭဒၪဝ့ၫ, မၩန့အထုၪ့စူၪယၫကိၭမုနံၩ မုနၩဒ့ၭတၭ, ဖိၬယခဲၫ့ဆံၭ.",
			"24": "<sup>24</sup> အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအမိထိးထဲၩ့တၩ့ထဲၩ့ ဘၪအၥၭလၧ အၥၭမၧၫ့လဂၩဂၩနီၪ, အၥၭမၧၫ့မိ လၩ့မါခွံၬဝ့ၫဒၪလီၫ. ထီးဒၪၦလၧအၥၭမၧၫ့အ့ၪလၩ့ မါခွံၬဝ့ၫလၧယကၠီၩ့လဂၩဂၩနီၪ, အဝ့ၫဒၪမိထီၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"25": "<sup>25</sup> အဂဲးဘဲၫယီၩ ၦလဂၩအ့ၪန့ဘၪလါနၫ့ဂၪ့ခိၪထၧၫ့ ဖျိၪ့ယၫနီၪ, အနၫ့ဆါဒၪဝ့ၫအ့ၪလၩ့မါမွဲဂ့ၩ, ဘၪဆၧ ဂၭဂီၩ့ဂၭစၪမွဲဂ့ၩ, မွဲအန့ကၩဆၧနီၪလမံၩ့လဲၪ.",
			"26": "<sup>26</sup> အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအမ့ၬမဲလၧယကၠီၩ့, ဒဲလၧယဆၧချဲၩ့ၥံၪအကၠီၩ့လဂၩဂၩနီၪ, ထီးၦၡၩအ ဖိၪခွၫဂဲၫလၩ့ဝ့ၫ လၧအလၩအဖၩ့, ဒဲအဖါအလၩအ ဖၩ့,ဒဲအၥီၫ့ဆံၫ့ဎံၪလဖၪအလၩအဖၩ့နီၪ, အမ့ၬမိမဲ",
			"27": "<sup>27</sup> လၧအဝ့ၫၥံၪအကၠီၩ့လီၫ.- ယလီၩဘၪနၥံၪတီၩတီၩ, ၦဆၧၫ့ထုၪ့ဝ့ၫထီးယီၩလနၩ့နၩ့ လၧအလချႃၭဒၪဒံၭ ဘၪယွၩအဘၩ့အမုးနီၪ, ထဲးယိဘၪဆၧၥံၫအ့ၬ.",
			"28": "<sup>28</sup> ဆၧမၩအၥၭလၧအလီၩလၩ့လၬလၩ့ဆၧနီၪ, ဖီၩ့ခွံၬ ဎိၭနံၩကၪယူၭတၭ,အဝ့ၫဒၪကိၭန့စပံတၧၫ့, ဒဲစယီ ဟၫ့,ဒဲစယ့မံၭလဖၪတၭ, လ့ၩထၪ့ဘၩဆိၪဖၪဆၧလၧ",
			"29": "<sup>29</sup> ခိၪလီၩ့လဖျိၪ့အလီၩ့လီၫ.- ဆၧမၩအၥၭလၧအဘၩ ဆိၪဖၪဆၧအဘိၩ့ဘၭနီၪ, အမ့ၬအၪ့လဲၩအၥၭတၭ,",
			"30": "<sup>30</sup> အကီၩ့အၥိၭဘွၩထၪ့ဂိးၡ့ၭဂိးၡီၫလီၫ.- ယိခွါ,စမိစ့ၭ, ဒဲစအံၫလဲယၫနံၫဂၩအီၪထၪ့ လၧဆၧလၩဖၩ့အဖၧၩ့",
			"31": "<sup>31</sup> တၭ,ချဲၩ့ဒုၪ့လိၬအၥၭလၧအဝ့ၫနီၪတၭ,- ချဲၩ့ဝ့ၫလၧ အထဲၩ့ထဲၩ့ဝ့ၫနီၪ အဂဲးအကၠီၪ့လၧအမိလၧၫ့ထၪ့ဎွ့ၩ",
			"32": "<sup>32</sup> ထၪ့လၧယရုစလံၫ့အဖၧၩ့နီၪလီၫ.- စပံတၧၫဒဲၦအီၪ လၧအၥိၭနီၪ, မံၫခံၫ့ဝ့ၫလီၫ. ထီးအနၪ့ထၪ့အၥၭ, ဒၪဘၪအလၩအဖၩ့, ဒဲၦနံၫဂၩဆၧၫ့ထုၪ့လၧအၥိၭ",
			"33": "<sup>33</sup> လီၫ.- ဆၧမၩအၥၭထီးအဝ့ၫၥံၪစဲၪ့ထၪ့ခွံၬလၧအအီၪ တၭ,စပံတၧၫစံၭဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, လၥ့ၪယၫ ဘၪဝ့ၫ,စံၭယ့ၫၡှူၬ, ကဆါဧ့,ပအီၪထီးယီၩမုၬကၨး ပမိမၩတဲၩနးၥၧၫ့ဖျိၪ့, လၧနဂးနးဖျိၪ့,ဒဲလၧစမိစ့ၭအ",
			"34": "<sup>34</sup> ဂးနးဖျိၪ့,ဒဲလၧစအံၫလဲယၫအဂးနးဖျိၪ့လီၫ.- ချဲၩ့ဆၧ အဘိၩ့ဘၭနီၪ, ဆၧအုၪ့လၩ့ကဒုၩအဝ့ၫၥံၪလီၫ. ထီး အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫ လၧဆၧအုၪ့အဖၧၩ့နီၪၥၭမဲၪဝ့ၫဒၪ",
			"35": "<sup>35</sup> လီၫ.- ဆၧအလူၥီၫလၩ့လၧဆၧအုၪ့အကျၩတၭ, စံၭ ဝ့ၫ,ၦလဂၩယီၩမွဲယဖိၪခွၫလၧယရွံန့လဂၩ, ခိၭနၪအ လူဆံၭ. ထီးမွဲဆၧၥီၫလၩ့နီၪ,ယ့ၫၡှူၬအီၪဝ့ၫလဂၩ",
			"36": "<sup>36</sup> ဎးလီၫ.- အဝ့ၫၥံၪအီၪလၩ့မါပံၭတၭ, မုနံၩလဖၪနီၪ လီၩဘၪဆၧ လၧအဒၪဘၪဝ့ၫနီၪလၧၦနးဂၩအ့ၬ.",
			"37": "<sup>37</sup> ဆၧမၩအၥၭလၧကဲဂီၩလနံၩနီၪ, အဝ့ၫၥံၪဂဲၫထဲၩ့ လၩ့ဝ့ၫလၧခိၪလီၩ့အလီၩ့တၭ, ၦခမျၧးဖၭဒိၪဂဲၫအၪ့",
			"38": "<sup>38</sup> ဂၬအဝ့ၫနီၪလီၫ.- ယိခွါ,လၧၦခမျၧးအကျၩနီၪၦလဂၩ ကိၭၡၭထၪ့တၭစံၭဝ့ၫ, ဆရၫဧ့, ယအၪ့ကံၩ့အၪ့ယၫ နၧၩလၧနမိယိယဖိၪခွၫလဂၩဆံၭ. အဂဲးဘဲၫယီၩမွဲယ",
			"39": "<sup>39</sup> ဖိၪလဂၩဎးလီၫ.- ယိခွါ, ဆၧနၪမၩန့ဝ့ၫတၭ,ကိၭၡၭ ထၪ့ဝ့ၫချဲၫ့မၬတၭ, မၩဖျႃထိၭထၪ့ဝ့ၫ, အနိၭပၠူၭလၩ့, မၩလၩ့ဆါအဂဲးအဘၭတၭ, စဲၪ့ထၪ့ခွံၬကၪမၬလီၫ.",
			"40": "<sup>40</sup> ဘဲၫၥိၭနထံၩနဖျဲၥံၪ မိနၫ့ထၪ့ခွံၬဝ့ၫနီၪ ယအၪ့ကံၩ့အၪ့",
			"41": "<sup>41</sup> ယၫအဝ့ၫၥံၪတၭ, မၩဝ့ၫၥ့ၪအ့ၬ.- ယ့ၫၡှူၬချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭဝ့ၫ, ၦလၧအလနဲၩဘၪဆၧ, အနါကဲၪ့လ ဆိၩဧ့,ယဘၪအီၪလၧနၥံၪအၥိၭ ဆံၭယံၬလဲၪ,ယ ဘၪအွံၪၥၭဆၧၫ့ဒံၭ ဆံၭယံၬလဲၪ, ဂဲၫဆိၬစိၩနဖိၪခွၫ",
			"42": "<sup>42</sup> ထီးယီၩဘီၪ.- အဝ့ၫဒၪဂဲၫစိၩဝ့ၫအဘိၩ့ဘၭနီၪ, ဆၧ နၪဆၪ့လၩ့ထံၩဖါဝ့ၫတၭ, မၩဖျႃထၪ့ဝ့ၫလီၫ. ယ့ၫၡှူၬ အၪ့လၬဆၧနၪနီၪတၭ, မၩဘျၪထဲၩ့ဖိၪၥၪနီၪတၭ, ဖ့ၪလၫ့ထဲၩ့ဝ့ၫလၧအဖါလီၫ.",
			"43": "<sup>43</sup> လၧယွၩအစီၩ့အမၩ့ဖၭဒိၪအကၠီၩ့တၭ, ၦထီးအ လူၬထီၫမံၫထီၫမၪဝ့ၫဒၪလီၫ. ၦထီးအလူၬထီၫမံၫ ထီၫမၪလၧကယဲဆၧလၧယ့ၫၡုၬမၩဝ့ၫအကၠီၩ့ အဘိၩ့",
			"44": "<sup>44</sup> ဘၭတၭး- အဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪ, ဒိၭနၥံၪအနါ လၧဆၧချဲၩ့လဖၪယီၩဘီၪ. အဂဲးဘဲၫယီၩၦၡၩအဖိၪ",
			"45": "<sup>45</sup> ခွၫယီၩ,ဆၧမိဖ့ၪလၫ့ဝ့ၫလၧၦၡၩအစူၪဖၧၩ့လီၫ.- ဆၧ ချဲၩ့အဂဲးအကၠီၪ့နီၪအဝ့ၫၥံၪၥ့ၪယၫအ့ၬ. ဆၧအီၪဘံၭလၧ အဝ့ၫၥံၪထီးအနၪဝ့ၫလၥ့ၪဘၪတၭ, အၪ့စၪ့ဝ့ၫအဂဲး အကၠီၪ့ဘုၪ့ဆ့အ့ၬ.",
			"46": "<sup>46</sup> မွဲပလၫမိကဲၪအဒိၪထုၬ လၧအဝ့ၫၥံၪအကျၩနီၪလ ဂၩဂၩလဲၪ. အဝ့ၫၥံၪဆီၫ့မီၪ့ဝ့ၫအဂဲးလၧအၥၭဖၧၩ့",
			"47": "<sup>47</sup> တၭ,- ယ့ၫၡှူၬၥ့ၪယၫအဝ့ၫၥံၪ အဆၧကိၪ့လၧအၥၭခံ ဖၧၩ့နီၪ,မၩန့ဖိၪၥၪလဂၩတၭ, အီၪက့ၪလၩ့ဝ့ၫလၧ အ",
			"48": "<sup>48</sup> နၫ့ဆါအဂၩ့ထံၭ,- တၭစံၭအဝ့ၫၥံၪ, ထီးဒၪၦလၧအ ထိးဆၧၫ့ဖိၪၥၪယီၩလၧယမံၩ့အကၠီၩ့လဂၩဂၩနီၪ, မွဲအထိးဆၧၫ့ယၧၩ, ဒဲထီးဒၪၦလၧအထိးဆၧၫ့ယၧၩ လဂၩဂၩနီၪ,မွဲအထိးဆၧၫ့ ၦလၧအအၪ့မၧၫ့လၩ့န့ ယၧၩလဂၩလီၫ.အဂဲးဘဲၫယီၩ ၦလၧအဆံၭထုၬလၧ နၥံၪဝ့ၫထီးအလူၬအကျၩလဂၩနီၪမိကဲၪထၪ့ဝ့ၫလၧ အဒိၪလီၫ.",
			"49": "<sup>49</sup> စယီဟၫ့ချဲၩ့ဆၧၫ့ဆၧတၭစံၭဝ့ၫ,ကဆါဧ့, ပဒၪဘၪ ၦလဂၩလၧအဒိၭနဲၩ့အၥၭလၧနမံၩ့တၭ, နၫ့ထၪ့ ခွံၬဆၧနၪနီၪပပဒၩ့အဝ့ၫလီၫ. အဂဲးဘဲၫယီၩမွဲအဖိၬ",
			"50": "<sup>50</sup> နခဲၫ့လၧပၥိၭအ့ၬ.- ယ့ၫၡုၬစံၭအဝ့ၫဒၪ, ထီးပဒၩ့အဝ့ၫ လဂ့ၩ.အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအလထၫ့ဒုၪဒၩဘၪ ပၧၩလဂၩဂၩနီၪ, မွဲအအီၪလၧပဂးလီၫ.",
			"51": "<sup>51</sup> ဆၧမၩအၥၭလၧအထဲၩ့ထၪ့ထဲၩ့ဝ့ၫ အမုအလၩ လၩ့ဘူၭဝ့ၫတၭ, အီၪက့ၪအၥၭဂုးခၧၫ့လၧအမိလ့ၩ",
			"52": "<sup>52</sup> လၧယရုစလံၫ့နီၪလီၫ.- အၪ့မၧၫ့လၩ့အၥီၫ့လဖၪလ့ၩ ဝဲၩလၧအမ့ၬယၫလီၫ. အဝ့ၫၥံၪဘဲၫၥိၭအမိတဲၩ့ဝဲၩ ဆၧလၧအဂးတၭ, လ့ၩနုၬဝ့ၫလၧၦစမ့ရအၫဖိၪၥံၪအ",
			"53": "<sup>53</sup> တဝၫ့ဖၧၩ့လီၫ.- အဝ့ၫၥံၪထိးဆၧၫ့ဝ့ၫအ့ၬ. အဂဲး ဘဲၫယီၩမွဲအအီၪက့ၪအမ့ၬလၧအမိလ့ၩလၧယရုစလံၫ့",
			"54": "<sup>54</sup> လီၫ.- အထံၩအဖျဲစယ့မံၭ,ဒဲစယီဟၫ့ဒၪဘၪဝ့ၫတၭ, စံၭဝ့ၫ,ကဆါဧ့,ဘဲၫစအံၫလဲယၫမၩဝ့ၫအၥိၭနီၪပမၪ လူၬမ့ၪဂဲၫလၩ့လၧမူၭခိၪတၭ, အၪ့ခွံၬၦလဖၪနီၪ, မွဲန",
			"55": "<sup>55</sup> ၥၭအီၪဆ့ဧၪ.- အဝ့ၫဒၪကၠၪစိၩအၥၭတၭ, အၪ့လၬအ ဝ့ၫၥံၪ,စံၭဝ့ၫ, နၥံၪအၥၭယီၩ, မွဲဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ",
			"56": "<sup>56</sup> နီၪ,နၥံၪၥ့ၪယၫအ့ၬ.- ဎအဂဲးဘဲၫယီၩ, ၦၡၩအဖိၪခွၫ ယီၩ,ဂဲၫမၩၥံၫၦၡၩအၥၭမၧၫ့အ့ၬ. အ့ၪမွဲအဂဲၫထိး ထဲၩ့တၩ့ထဲၩ့ဆၧလီၫ.ၭ အဝ့ၫၥံၪလ့ၩထီၩ့ဝ့ၫလၧတဝၫ့ အဂူၫဂၩလီၫ.",
			"57": "<sup>57</sup> ဆၧမၩအၥၭ လၧအဝ့ၫၥံၪလ့ၩ လၧဖၧၩ့ၥၭအဘိၩ့ ဘၭနီၪ,ၦလဂၩစံၭအဝ့ၫ,ကဆါဧ့,ထီးဒၪနလ့ၩဆၧ",
			"58": "<sup>58</sup> လစီၪ့စီၪ့နီၪ,ယမိဖိၬနခဲၫ့လီၫ.- ယ့ၫၡှူၬလီၩဘၪဝ့ၫ,ထွံၪ မံၩ့အီၪဝ့ၫလၧအဖၧၩ့, ဒဲထိၪၥံၪလၧဆၧဖိၭဖၫ့အီၪဝ့ၫ လၧအၥွံၫ, အ့ၪမွဲၦၡၩအဖိၪခွၫလဂၩယီၩထီးအမိ အီၪက့ၪလၩ့အခိၪဎွံၪနီၪ အလးအီၪအ့ၬ.",
			"59": "<sup>59</sup> တၭစံၭၦလၧအဂူၫဂၩလဂၩ, ဖိၬယခဲၫ့ဆံၭ.အဝ့ၫ ဒၪစံၭဝ့ၫ,ကဆါဧ့, ဘဲၫၥိၭယမိခုၪ့လၩ့ဘၧၩ့ခွံၬယဖါ နီၪ,ဒုၭထဲၩ့ဆိၫဒၪခလူၬယၧၩနးထံၪဘီၪ.",
			"60": "<sup>60</sup> ယ့ၫၡှူၬစံၭအဝ့ၫနီၪ, ၦအၥံၫမွဲအခုၪ့လၩ့ဘၧၩ့ခွံၬအ ၡၩၥံၪနီၪဆံၭ. အ့ၪမွဲနဝ့ၫဒၪယီၩ, လ့ၩလီၩလၩ့လၬ လၩ့ယွၩအဘၩ့အမုးအဂဲးဆံၭ.",
			"61": "<sup>61</sup> ၦလၧအဂူၫဂၩလဂၩစံၭဝ့ၫ, ကဆါဧ့,ယမိဖိၬနခဲၫ့ လီၫ. မွဲလါနၫ့တၭ, ဒုၭထဲၩ့ဆိၫဒၪခလူၬယၧၩဘဲၫၥိၭ",
			"62": "<sup>62</sup> ယမိထဲၩ့ချဲၩ့ဒုၪ့ၦအီၪလၧယဂံၪ့ဖၧၩ့နးထံၪဘီၪ.- ယ့ၫ ၡုၬစံၭဝ့ၫ, ၦလၧအဖီၪ့ထၬထဲၫအဘီၩ့တၭ,ယိထဲၩ့ဆၧ လၧအလးခဲၫ့နီၪ, ကြၨၭလၧယွၩအဘၩ့အမုးအဂးနး ဂၩအ့ၬ."
		},
		"10": {
			"1": "<sup>1</sup> ဆၧနီၪလဖၪအလးခဲၫ့တၭ, ကဆါအီၪက့ၪလၩ့ၦဂူၫ ဂၩၥံၪနွ့ၫဆံၫဆ့တၭ, အၪ့မၧၫ့အလ့ၩဝဲၩဝ့ၫ နံၫဂၩလ စီၪ့,နံၫဂၩလစီၪ့, လၧယၫလၧကယဲဒိၩ့,ဒဲကယဲအလး",
			"2": "<sup>2</sup> လၧအနၫ့ဆါဒၪဝ့ၫမိလ့ၩနီၪလီၫ.- မွဲဘဲၫနီၪတၭ,အဝ့ၫ ဒၪလီၩဘၪအဝ့ၫၥံၪ, ကူၭဆၧအလးအီၪအၪမၬတၭ, အ့ၪမွဲၦမၩဆၧလဖၪနီၪအီၪၡၩခိၬဂၩလီၫ. မၩအၥၭ ဘဲၫနီၪတၭ, ဘၩဆိၪဖၪအၪ့ကံၩ့ကူၭဆၧအလး အက ဆါဘဲၫၥိၭအမိအၪ့မၧၫ့လၩ့န့ ၦမၩဆၧလၧကူၭဆၧအ",
			"3": "<sup>3</sup> လးအဖၧၩ့နီၪဆံၭ.- လ့ၩနၥံၪဝ့ၫဘီၪ,ယိခွါ,ယအၪ့မၧၫ့ နၥံၪလ့ၩဆၧ ဘဲၫၥိၪဖိၪလၧထွံၪမံၩ့အကျၩအၥိၭနီၪ",
			"4": "<sup>4</sup> လီၫ.- စ့ၩအထိၪ့မွဲဂ့ၩ, ဆၧအၪ့အထိၪ့မွဲဂ့ၩ, ခၪ့ဖံၭ လဖၪမွဲဂ့ၩ, နၥံၪထီးဆိၬလဂ့ၩးချဲၩ့ဒုၪ့ၦလၧဖၧၩ့ၥၭနး",
			"5": "<sup>5</sup> ဂၩလဂ့ၩ.- ထီးဒၪနၥံၪလ့ၩနုၬ လၧဂံၪ့လဖျိၪ့ဖျိၪ့ အ ဖၧၩ့နီၪ,စံၭဆိၫနၥံၪဝ့ၫ, မွဲဆၧမုၬဆၧလၩအီၪလၧဂံၪ့",
			"6": "<sup>6</sup> ယီၩဆံၭ.- ၦမုၬဖိၪအ့ၪအီၪထီးနီၪတၭ, နၥံၪအဆၧ မုၬဆၧလၩ့မိဘၪအဝ့ၫလီၫ. အ့ၪလမွဲဘၪတၭ, မိဂဲၫ",
			"7": "<sup>7</sup> ထဲၩ့ဘၪထဲၩ့နၥံၪလီၫ.- အီၪလၧဂံၪ့လဖျိၪ့ဎးအဖၧၩ့နီၪ တၭ,အၪ့ဆၧအီၩဆၧ ထီးဒၪဆၧလၧၦအီၪက့ၪလၩ့ဝ့ၫ ဘီၪ.အဂဲးဘဲၫယီၩၦမၩဆၧနီၪ ဂ့ၩန့ဘၪအလံၩ့အ",
			"8": "<sup>8</sup> လဲၫလီၫ.လဂံၪ့ဘၪလဂံၪ့နီၪနၥံၪထီးလ့ၩလဂ့ၩ.-ထီး ဒၪဒိၩ့လဖျိၪ့ဖျိၪ့လၧနၥံၪလ့ၩနုၬနီၪ, ၦအ့ၪထိးဆၧၫ့ နၥံၪတၭ,ဆၧလၧအအီၪက့ၪလၩ့ လၧနၥံၪအဂးနီၪအၪ့",
			"9": "<sup>9</sup> ဘီၪ.- မၩဘျၪထဲၩ့ၦအဆၫအီၪလၧအဖၧၩ့, လီၩဘၪ အဝ့ၫၥံၪ,ယွၩအဘၩ့အမုးနီၪဂဲၫဘူၭယူၭလၧနၥံၪ",
			"10": "<sup>10</sup> ယူၭ.- ထီးဒၪဒိၩ့လဖျိၪ့ဖျိၪ့လၧနၥံၪလ့ၩနုၬလၧအဖၧၩ့ နီၪ,ၦအ့ၪလထိးဆၧၫ့ဘၪနၥံၪတၭ, လ့ၩထၪ့လၧအ",
			"11": "<sup>11</sup> ဖၧၩ့ၥၭတၭ,စံၭနၥံၪဝ့ၫ,- နၥံၪအဒိၩ့အဂၪ့ခိၪမုၬဘုၭ ထၬလၧပခၪ့ယၫၥၭယီၩ, ပတရူၩလၩ့ခွံၬထၫ့ဒၩ နၥံၪလီၫ.မွဲလါနၫ့ဘိၩၥ့ၪယၫဆၧယီၩ တၭ, ယွၩအ ဘၩ့အမုးနီၪဂဲၫဘူၭယူၭလၧနၥံၪယူၭ.",
			"12": "<sup>12</sup> ယလီၩဘၪနၥံၪ, လၧမုနံၩလနံၩအဖၧၩ့နီၪ,ဒိၩ့စီဒၧၫ့ မိဘၪဆၧယီၫနဲၪ့ဒိၩ့နီၪဒံၭလီၫ.",
			"13": "<sup>13</sup> ခိၫရ့စံၫ့ဧ့,နဝ့ၫဒၪယီၩနဘၪအၡၪ့ဖီၩၬ ဘ့ၭၥစ့ဒၫဧ့, နဝ့ၫဒၪယီၩနဘၪအၡၪ့ဖီၩၬ အဂဲးဘဲၫယီၩဆၧလၩ့ လၭမၩအၥၭ လၧနၥံၪအဖၧၩ့လဖၪနီၪ, အ့ၪမၩအၥၭ လၧတဲအၫဒဲစဲဒၧၫ့အဖၧၩ့တၭ, အဝ့ၫၥံၪမိကီၩ့ၥိၭဝ့ၫ လၧရၧၬအဆၧယၬဒဲမိဆၧၫ့နၩ့ဝ့ၫ လၧဖံၫ့ချၪအကျၩ",
			"14": "<sup>14</sup> တၭ,မိနီၫ့ယါလၩ့ထဲၩ့အၥၭယံၬယံၬယူၭလီၫ.- လၧနီၪ အမ့ၬယၫလၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ, တဲအၫဒဲစဲဒၧၫ့မိဘၪ",
			"15": "<sup>15</sup> ဆၧယီၫနဲၪ့နၥံၪဒံၭလီၫ.- နဝ့ၫဒၪကပၧနအၫ့လၧအထၪ့ ဘၭလၧမူၭခိၪဧ့, နမိဘၪဆၧဆၪ့လၩ့ဖိးလၧဖျႃဖၧၩ့ နီၪလီၫ.",
			"16": "<sup>16</sup> ၦလၧအနါဂၧၫ့နၥံၪအလူနီၪမွဲအနါဂၧၫ့ယလူ, ဒဲၦလၧအခွံၬၡိၭနၥံၪနီၪ,မွဲအခွံၬၡိၭယၧၩ, ဒဲၦလၧ အခွံၬၡိၭယၧၩယီၩ, မွဲအခွံၬၡိၭၦလၧအအၪ့မၧၫ့လၩ့ န့ယၧၩလဂၩနီၪလီၫ.",
			"17": "<sup>17</sup> ၦနွ့ၫဆံၫနီၪဂဲၫထဲၩ့ထဲၩ့ဝ့ၫ လၧအၥုၪ့ထိၬအၥၭထိၬ တၭစံၭဝ့ၫ,ကဆါဧ့, မွဲလၧနမံၩ့အဖၧၩ့တၭ,ဆၧနၪလ",
			"18": "<sup>18</sup> ဖၪဒၪလ့ၬ အီၪလၧပဖၫ့လၬလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ဘဲၫလၫ့ဝဲအဒံၭအၥိၭနီၪယဒၪမုၪခီၩလဲးလၩ့ထ့ၬ",
			"19": "<sup>19</sup> ခွံၬလၧမူၭခိၪလီၫ.- ယိခွါ,ယဖ့ၪလၫ့နၥံၪအစီၩ့အမၩ့ ဘဲၫၥိၭနၥံၪမိယဲးဂူၥံၪ, ဒဲဆၧကဲၪ့မ့ၥံၪ,ဒဲလၧဆၧဒုၪ ဒၩအစီၩ့အမၩ့ ထီးအလူၬအဖၫ့ခိၪလီၫ. ဆၧမၩၡၪ့",
			"20": "<sup>20</sup> မၩနၭနၥံၪနးမံၩ့အ့ၬ.- မွဲလါနၩ့ဘိၩ မွဲလၧဆၧနၪအီၪ လၧနၥံၪအဖၫ့လၬတၭ,နၥံၪထီးၥၭထိၬလၧ ဆၧနီၪလ မံၩ့အကၠီၩ့လဂ့ၩး အ့ၪမွဲနၥံၪအမံၩ့ဆ့ၭလၩ့ အၥၭလၧ မူၭခိၪအဖၧၩ့အကၠီၩ့တၭ, ၥၭထိၬဆံၭ.",
			"21": "<sup>21</sup> လၧနၩရံၩထီးနီၪ ယ့ၫၡုၬၥုၪ့ဎွံၫၥၭယီၫတၭ, စံၭဝ့ၫ ဒၪ,မူၭခိၪဒဲဂၪ့ခိၪအကဆါ, ဖါဧ့, ယစံၭထၪ့အၪ့အူၭ နၧၩလီၫ. အဂဲးဘဲၫယီၩဆၧလဖၪယီၩနအီၪက့ၪၥူၪခွံၬ လၧၦကိၪ့ဆၧၥ့ၪ, ဒဲလၧၦအၥုၪ့ဆၭ အၥၭဆၭလဖၪ အမ့ၬယၫလါနၫ့တၭ, နမၩဖျီၪထၪ့လၧဖိၪၥၪၥံၪအမ့ၬ ယၫလီၫ. မွဲယူၭ,ဖါဧ့, မွဲအဘၪနၥၭဘဲၫနီၪအဂဲးလီၫ.",
			"22": "<sup>22</sup> ယဖါဖ့ၪလၫ့ယူၭယၧၩလၧဆၧထီးအလူၬယူၭ. အ့ၪလမွဲဘၪဖါတၭ, ၦၥ့ၪယၫဖိၪခွၫနးဂၩအ့ၬ. အ့ၪ လမွဲဘၪအဖိၪခွၫ ဒဲထီးဒၪၦလၧအဖိၪခွၫ မိဒုၭနဲၪဖျီၪ ထၪ့ဝ့ၫလဂၩဂၩနီၪ, ၦၥ့ၪယၫဖါနးဂၩအ့ၬ.",
			"23": "<sup>23</sup> အဝ့ၫဒၪကၠၪစိၩအၥၭ လၧအထံၩအဖျဲၥံၪအအီၪ တၭ,စံၭၥူၪဝ့ၫ, ၦအမ့ၬလၧအဒၪဆၧဘဲၫနၥံၪဒၪဘၪအ",
			"24": "<sup>24</sup> ၥိၭနီၪ,အီၪမုၬဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩယစံၭနၥံၪ,မီၪ ၥံၪဒဲစဎွၩၥံၪအၪဂၩမိဒၪဘၪအၥၭလၧ ဆၧလၧနၥံၪ ဒၪဘၪနီၪ,ဒၪဘၪဝ့ၫအ့ၬ. ဆၧမိနါဂၧၫ့ဘၪအၥၭဆၧ လၧနၥံၪနါဂၧၫ့နီၪ, နါဂၧၫ့ဘၪဝ့ၫအ့ၬ.",
			"25": "<sup>25</sup> ယိခွါ, ၦလၧအၥ့ၪလံၬဆၧၥီၪ့ဆၧၥၫ့လဂၩဂဲထုၪ့ ကျဲၩ့ဖစီၩ့အဝ့ၫဒၪတၭ,စံၭဝ့ၫ, ဆရၫဧ့,ဘဲၫၥိၭယမိန့ ၥၫထဲၩ့ဆၧမၧၫ့အဆိၩဆိၩအကၠၪကၠၪတၭ,ယဘၪမၩ",
			"26": "<sup>26</sup> ဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫဒၪလီၩဘၪဝ့ၫ, လၧလံၬ ဆၧမၪလူၬအဖၧၩ့နီၪ, ဆၧကွ့ၭဝ့ၫဘဲၫၥ့ၪလဲၪ. နဖီဘၪ",
			"27": "<sup>27</sup> ဘဲၫၥ့ၪလဲၪ,- အဝ့ၫနီၪချဲၩ့ဆၧၫ့ဆၧ,စံၭဝ့ၫ, အဲၪ ယွၩ န က ဆါ လၧ န ၥၭ ထၧၫ့ ဖျိၪ့ယၫ, ဒဲ လၧ န ၥၭ ၡီၩ့ ထီး အ လူၬ, ဒဲ လၧ န ၥၭ ကိၪ့ ၥ့ၪ ထီး အ လူၬ, ဒဲ လၧ န ဂဲး န ဘၭ ထီး အ လူၬ ဆံၭ. အဲၪ ၦ လၧ န နဲၩ့ ထံၭ ဘဲၫန နၫ့ ဆါ ဒၪ န ဝ့ၫ အ ၥိၭ နီၪ ဆံၭ. အဝ့ၫဒၪစံၭအဝ့ၫ,နချဲၩ့ဆၧဂ့ၩဘၪ စဲၪလီၫ.",
			"28": "<sup>28</sup> မၩဆၧဘဲၫနီၪတၭ,နမိမၧၫ့လီၫ.-အဝ့ၫ ဒၪ,လဂၩမိအီၪက့ၪတီၩအီၪက့ၪလီၩ့ဘၪ အၥၭလၧအ နၫ့ဆါဒၪဝ့ၫတၭ,စံၭယ့ၫၡုၬ, ၦလၧယနဲၩ့ထံၭနီၪ",
			"30": "<sup>30</sup> မွဲပလၫလဂၩလဲၪ.- ယ့ၫၡှူၬချဲၩ့ထၪ့တၭ, စံၭဝ့ၫ, ၦလဂၩစဲၪ့လၩ့ခွံၬလၧယရုစလံၫ့လ့ၩစိၩလၧယ့ၫရခိၫ နီၪ,လၩ့ဘၪဝ့ၫ လၧၦထမျၬအကျၩတၭ, အဝ့ၫၥံၪဘဲၪ့ လၩ့ခွံၬအကီၩ့အၥိၭ, ဒဲဒိၪဝ့ၫထးဝ့ၫထီးအလၩ့ဘူၭ အမိၥံၫတၭ, စဲၪ့ဒၪဝ့ၫလီၫ.",
			"31": "<sup>31</sup> ၦလုဆၧအဒိၪလဂၩလ့ၩဆၧလၧဖၧၩ့ၥၭနီၪ, ထီးအ ဒၪဘၪဝ့ၫတၭ, လ့ၩဖီၩ့ခွံၬဝ့ၫလၧဖၧၩ့ၥၭဝါလခီၫ",
			"32": "<sup>32</sup> လီၫ.- ဘဲၫနီၪအၥိၭ ၦလံဝဲၫဖိၪလဂၩထီၩ့ထီးနီၪတၭ, လ့ၩဒၪဘၪဝ့ၫတၭ, လ့ၩဖီၩ့ခွံၬဝ့ၫလၧဖၧၩ့ၥၭ,ဝါလ ခီၫဆ့လီၫ.",
			"33": "<sup>33</sup> အ့ၪမွဲၦစမ့ရအၫဖိၪလဂၩလ့ၩဆၧနီၪ, ထီၩ့ဝ့ၫလၧ",
			"34": "<sup>34</sup> အအီၪဒၪဘၪဝ့ၫတၭ,ယၫ့ၥၭဝ့ၫလီၫ.-အဝ့ၫဒၪလူၫ လၩ့ၥိၪ,ဒဲစဘံၭထံၫလၧအဖၧၩ့လး, ဒဲဘီၪ့ဘံၭဝ့ၫ တၭ,ဒုၭထူၬဝ့ၫလၧအဆၧဖိၪဆၧဎါ ဒၪဝ့ၫလဒုၩတၭ, ၥိၫ့ဝ့ၫလၧၦမွံၩအီၪအလးတၭ, ယိထဲၩ့ခွါထဲၩ့ဝ့ၫလီၫ.",
			"35": "<sup>35</sup> ကဲဂီၩလနံၩ ထီးအစဲၪ့ထၪ့ခွံၬနီၪ, မၩန့ဒန့ရံၫနံၫဘံၪ့ တၭ,ဖ့ၪလၫ့ၦပၧၩ့ဆၧအလးနီၪ လီၩဘၪဝ့ၫ, ယိထဲၩ့ခွါ ထဲၩ့အဝ့ၫဒၪဘီၪ. ထီးဒၪနလူၬအၪနဲၪ့ဒံၭအယီၩဒံၭ, ထီးယအ့ၪဂဲၫထဲၩ့တၭ, ယမိဖ့ၪလၫ့ထဲၩ့နၧၩလီၫ.",
			"36": "<sup>36</sup> မၩအၥၭဘဲၫနီၪတၭ, နဆီၫ့မီၪ့ဘဲၫၥ့ၪလဲၪ. လၧၦ ၥၧၫ့ဂၩအကျၩနီၪ, မွဲအကဲၪၦလၧအလၩ့ဘၪဝ့ၫလၧ ထမျၬအကျၩလဂၩနီၪ ၦအီၪလၧအနဲၩ့ထံၭနီၪမွဲလဂၩ",
			"37": "<sup>37</sup> ဂၩလဲၪ.- အဝ့ၫနီၪစံၭဝ့ၫ, မွဲၦလၧအယၫ့ၥၭဝ့ၫလဂၩ နီၪလီၫ.မၩအၥၭဘဲၪနီၪတၭ, ယ့ၫၡုၬလီၩဘၪအဝ့ၫ, လ့ၩဘီၪ,မၩနဝ့ၫဘဲၫနီၪအၥိၭဆံၭ.",
			"38": "<sup>38</sup> ဆၧမၩအၥၭထီးအဝ့ၫၥံၪ လ့ၩဆၧအဘိၩ့ဘၭနီၪ, အဝ့ၫဒၪလ့ၩနုၬ လၧတဝၫ့လဖျိၪ့အဖၧၩ့တၭ, ၦမုၪအ မံၩ့နးမၫၥၫလဂၩထိးဆၧၫ့ဝ့ၫ လၧအဂံၪ့ဖၧၩ့လီၫ.",
			"39": "<sup>39</sup> ၦမုၪနီၪအထၧၫ့ဖုဝဲမုၪကိၭဝ့ၫအမံၩ့ နးမၫရံၫအီၪဝ့ၫလ ဂၩလီၫ. အဝ့ၫဒၪဆၧၫ့နၩ့ဝ့ၫလၧယ့ၫၡုၬအခၪ့ထံၭ တၭ,ခိၭနၪအလူလီၫ.",
			"40": "<sup>40</sup> အ့ၪမွဲနးမၫၥၫနီၪ မၩဆၧအၪ့ဆၧအီၩတၭ, အၥၭခိ ထၪ့တၭလ့ၩလၧအအီၪစံၭဝ့ၫ, ကဆါဧ့, ဘဲၫၥိၭယမိ မၩဆၧလဂၩဎးတၭ, ယထၧၫ့ဖုဝဲမုၪအီၪဒၪအဆၧနီၪ, မွဲနအီၪက့ၪလၧ ဆၧနးမံၩ့အ့ၬဧၪ. မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭအမိမၩဆၧၩ့ယၧၩယီၩ, အၪ့မၧၫ့အဝ့ၫနးထံၪ ဘီၪ.",
			"41": "<sup>41</sup> ယ့ၬၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ,လီၩဘၪဝ့ၫ,နးမၫၥၫဧ့, နး မၫၥၫဧ့, နဝ့ၫဒၪယီၩ,နအၪ့ယိၪဆၧဒဲနၥၭခိလၧဆၧ",
			"42": "<sup>42</sup> အၪမံၩ့အကၠီၩ့လီၫ.- မွဲလါနၫ့ဘိၩ,ဆၧကြၨၭန့ဘၪအီၪ ဝ့ၫလမံၩ့လီၫ. တၭနးမၫရံၫရွံန့ဘၪယူၭ ဆၧအဂ့ၩလ မံၩ့နီၪလၧၦမၩန့ထဲၩ့ဝ့ၫ လၧအစူၪဖၧၩ့ၥ့ၪနးဂၩအ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭထီးအအီၪဘၩဆိၪဖၪ ဆၧလၧအလး လစီၪ့နီၪ, ထီးအဂီၩ့နီၪအထံၩအဖျဲလဂၩစံၭအဝ့ၫ, က ဆါဧ့, ၥီၪ့လိၪပၧၩလၧပဘၩဆိၪဖၪဆၧအဂဲးဘဲၫစယီ ဟၫ့ၥီၪ့လိၪအထံၩအဖျဲၥံၪအၥိၭနီၪဆ့ဆံၭ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ထီးနၥံၪဘၩဆိၪဖၪဆၧတၭ, စံၭအီၪလၧမူၭခိၪပဖါဧ့, မွဲနမံၩ့အီၪဆံၫ့ဎံၪဒၪဝ့ၫဆံၭ.",
			"3": "<sup>3</sup> နဘၩ့နမုးနီၪ မွဲအထီၩ့ထဲၩ့ဒၪဝ့ၫဆံၭ.- မွဲနၥၭလၧၫ့ ထၪ့ဎွ့ၩထၪ့ထဲၩ့ဒၪဝ့ၫထီးဂၪ့ခိၪချိၫ့ယီၩ ဘဲၫလၧမူၭခိၪ အၥိၭနီၪဆံၭ.ဆၧအၪ့လၧလနံၩအဂး လနံၩအဂးနီၪ ဖ့ၪလၫ့လါပၧၩလနံၩဘၪလနံၩ, လနံၩဘၪလနံၩဆံၭ.",
			"4": "<sup>4</sup> ကွဲၪဖျါခွံၬပဆၧဒဲၩဘၭဆံၭ. အဂဲးဘဲၫယီၩပကွဲၪဖျါ ဆ့ကယဲၦလၧအဒ့ၪအမါအီၪ လၧပစူၪဖၧၩ့ကိၭဂၩဒ့ၭ တၭ,ထီးဒုၭလ့ၩနုၬပၧၩ လၧဆၧကျဲၩ့ဖစီၩ့အဖၧၩ့နီၪ လဂ့ၩ,ဎအ့ၪမွဲထုၭထၪ့ခွံၬလါပၧၩ လၧဆၧအၧၩ့ဆၧ ၥၫ့အဖၧၩ့နီၪဆံၭ.ၭ",
			"5": "<sup>5</sup> မွဲအစံၭအဝ့ၫၥံၪ, ၦလဂၩလၧနၥံၪအကျၩအီၪလၧ အထံၩအၥိၭတၭ, လၧဖိၭဖၫ့မုလ့ၩဝ့ၫလၧအအီၪတၭ,",
			"6": "<sup>6</sup> စံၭအဝ့ၫ,- တခွၫဧ့, ယန့ဘၪကိၪၥၧၫ့လီၪ့အလးအီၪ ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယထံၩယၥိၭလဂၩ လ့ၩဆၧနီၪ, ဂဲၫထီၩ့လၧယအီၪတၭ, ဆၧလၧယမိအီၪက့ၪ လၧအ",
			"7": "<sup>7</sup> မ့ၬယၫနီၪအီၪနးမံၩ့အ့ၬ.- ၦအီၪလၧအဖၧၩ့ချဲၩ့ဆၧၫ့ ဆၧတၭစံၭဝ့ၫ ထီးမၩထံၬထၬယၧၩလဂ့ၩ,တရၫ့ကၭ ဘံၭထၬယူၭအၥၭယူၭး ယဖိၪယလံၩအီၪယူၭ လၧ ယၥိၭလၧလးမံၫအဖၧၩ့ယူၭ, ယဂဲထုၪ့ဖ့ၪလၫ့နၧၩၥ့ၪ",
			"8": "<sup>8</sup> အ့ၬ.- ယစံၭနၥံၪ, အဝ့ၫလဂၩမွဲလၧအထံၩအၥိၭအ ကၠီၩ့နီၪတၭ,လဂဲထုၪ့ဖ့ၪလၫ့ဘၪလါနၫ့တၭ, မွဲလၧအ အၪ့ကံၩ့ဝ့ၫဆီၪ့ဆီၪ့လ့ၬအကၠီၩ့နီၪ, မိဂဲထုၪ့ဖ့ၪလၫ့ဝ့ၫ",
			"9": "<sup>9</sup> ဒၪထီးအန့ဘၪဆၧအလးအီၪလဖၪလီၫ.- ယစံၭနၥံၪ ဆ့,အၪ့ကံၩ့ဆံၭ,ဆၧမိဖ့ၪလၫ့နၥံၪလီၫ. အၪ့ဎၬဆၧ ဆံၭ,နၥံၪမိဒၪန့ဆၧလီၫ. ဒိၪထိၬဆၧဆံၭ, ဆၧမိဝဲထၪ့",
			"10": "<sup>10</sup> န့ဝ့ၫလၧနၥံၪအဂးလီၫ.- အဂဲးဘဲၫယီၩကယဲၦလၧအ အၪ့ကံၩ့ဆၧလဂၩလါလါနီၪ,န့ဘၪဝ့ၫလီၫ. ၦလၧအ ဒိၪထိၬဆၧနီၪ, ဆၧမိဝဲထၪ့န့လၧအဝ့ၫနီၪအဂးလီၫ.",
			"11": "<sup>11</sup> လၧနၥံၪအကျၩဖါလဂၩ လၧအဖိၪအ့ၪအၪ့ကံၩ့အၪ့ ကိၪတၭ, မိဖ့ၪလၫ့အဝ့ၫလၧလိးနီၪ, မွဲအအီၪလဂၩဂၩ ဆ့ဧၪ. အ့ၪအၪ့ကံၩ့အၪ့ယၪနးဘံၪ့တၭ, လၧယၪအ",
			"12": "<sup>12</sup> လးနီၪ,မွဲအမိဖ့ၪလၫ့ဝ့ၫလၧဂူနးဘီၩ့ဆ့ဧၪ.- အ့ၪအၪ့ ကံၩ့ဆၧဒံၪနးဖျိၪ့နီၪ, မွဲအမိဖ့ၪလၫ့ဝ့ၫလၧဆၧကဲၪ့မ့",
			"13": "<sup>13</sup> နးဘီၩ့ဆ့ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,နၥံၪဝ့ၫဒၪမွဲၦအ အၧၩ့လဖၪနီၪ, နၥံၪအ့ၪၥ့ၪယၫဖ့ၪလၫ့ နၥံၪအဖိၪအ လံၩလၧဆၧအဂ့ၩတၭ, နၥံၪအဖါအီၪလၧမူၭခိၪနီၪ, မိဖ့ၪလၫ့ဝ့ၫလၧၦအၪ့ကံၩ့ဆၧ လၧအဝ့ၫနီၪလဖၪလၧ ၥၭမုဆံၫ့ ဎံၪနီၪအၪနဲၪ့အနီၪဒံၭလီၫ.",
			"14": "<sup>14</sup> အဝ့ၫဒၪနၫ့ထၪ့ခွံၬ ဆၧနၪအုၭအၭလဒုၩနီၪ, ဆၧမၩ အၥၭလၧဆၧနၪစဲၪ့ထၪ့ခွံၬဝ့ၫတၭ, ၦအုၭအၭနီၪချဲၩ့",
			"15": "<sup>15</sup> ထၪ့ဝ့ၫတၭ,ၦခမျၧးထီၫမံၫထီၫမၪဝ့ၫဒၪလီၫ.- ၦအီၪ လၧအကျၩလနၩ့နၩ့, စံၭဝ့ၫ,မွဲအနၫ့ထၪ့ခွံၬဆၧနၪလၧ",
			"16": "<sup>16</sup> ဆၧနၪအခိၪ ဘၫအလၭဇဘၧၭလီၫ.- အဂူၫဂၩလနၩ့, ကျဲၩ့ဖစီၩ့ဆၧတၭ, အၪ့ကံၩ့ဆၧလၩ့လၭလၧမူၭခိၪ",
			"17": "<sup>17</sup> လၧအဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪၥ့ၪယၫအဝ့ၫၥံၪအဆၧကိၪ့ ထၪ့ဖၭလၩ့လဖၪတၭ,စံၭအဝ့ၫ,ကယဲဘၩ့မုးလၧအ မၩလၩ့ဖၭလိၬအၥၭနီၪ,မိအီၪယူဝ့ၫလီၫ. ဂံၪ့အ့ၪ",
			"18": "<sup>18</sup> လၩ့ဖၭလိၬအၥၭတၭ, မိလၩ့ဎီးဝ့ၫလီၫ.- မုၪခီၩလဲး အ့ၪလၩ့မုလၩ့ဖၭဝ့ၫလၧအနၫ့ဆါဒၪဝ့ၫတၭ, အဘၩ့အ မုးမိခၧၫ့ ဝ့ၫဘဲၫၥ့ၪလဲၪ. အဂဲးဘဲၫယီၩ နၥံၪစံၭလၧယ",
			"19": "<sup>19</sup> နၫ့ထၪ့ခွံၬဆၧနၪလၧ ဘၫအလၭဇဘၧၭလီၫ.- ယအ့ၪ နၫ့ထၪ့ခွံၬဆၧနၪလၧဘၫအလၭဇဘၧၭတၭ, မွဲနၥံၪအ ဖိၪခွၫၥံၪနၫ့ထၪ့ခွံၬဆၧနၪလၧပလၫလဂၩလဲၪ. မၩအ ၥၭဘဲၫနီၪတၭ,ၦလဖၪနီၪမိကဲၪထၪ့ဝ့ၫ လၧၦစ့ၩရၫ့နၥံၪ",
			"20": "<sup>20</sup> လီၫ.- အ့ၪမွဲယၧၩယီၩယအ့ၪနၫ့ထၪ့ခွံၬဆၧနၪလၧယွၩ အစူၪနိၩ့တၭ, မွဲမၬ,ယွၩအဘၩ့အမုးဂဲၫထီၩ့ယူၭ လၧ နၥံၪအအီၪယူၭ.",
			"21": "<sup>21</sup> ထီးၦၡၩအဆီၪ့အီၪလၧအစူၪဝဲၩနီၪ အ့ၪပၧၩ့ဘၪ အဂံၪ့အဘိၩ့ဘၭတၭ, အဆၧဖိၪဆၧလံၩ အီၪခၧၫ့ဝ့ၫ",
			"22": "<sup>22</sup> လီၫ.- မွဲလါနၫ့ဘိၩ, ထီးၦအဂဲးအဘၭဆီၪ့နဲၪ့အဝ့ၫနီၪ လဂၩအ့ၪဂဲၫမၩနၧၩ့မၩစၪအဝ့ၫတၭ, အဝ့ၫဒၪမိမၩ န့ခွံၬအစူၪဝဲၩလၧအဒိၭနဲၩ့အၥၭ လၧအဖၧၩ့တၭ,အၪ့ နၩ့ဖၭအဆၧဖိၪဆၧလံၩအဆၧၫ့လီၫ.",
			"23": "<sup>23</sup> ၦလၧအလအီၪဘၪဝ့ၫလၧယၥိၭယီၩ, မွဲအထၫ့ဒုၪ ထၫ့ဒၩယၧၩတၭ, ဒဲၦလၧအလအၪ့ထုၫ့ကီၪ့ဘၪဆၧ လၧယၥိၭယီၩ, မွဲအမၩပြံၩပၩဆၧလီၫ.",
			"24": "<sup>24</sup> ထီးဆၧနၪလဒုၩစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ ၦၡၩအလီၩ့တၭ, အၪ့ဎၬဆၧအီၪပွံၭအလးနီၪ, စဲၪ့ဝံၩ့ဝၩ့ လၧပွ့ၪခိၪ တၭ,လဒၪန့ဘၪအလးနီၪ, စံၭဝ့ၫ,ယမိထဲၩ့ထဲၩ့လၧယ",
			"25": "<sup>25</sup> ဂံၪ့လၧယစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအဖၧၩ့လီၫ.- ထဲၩ့ထဲၩ့ဝ့ၫ တၭ,ဒၪန့ဝ့ၫလၧအအီၪဝ့ၬဆံၫ့အၥၭ, ဒဲအီၪဝ့ၫဂ့ၩလ့ၬ",
			"26": "<sup>26</sup> လီၫ.- ထီးနီၪလဖၧၫ့ လ့ၩမၩန့ဆၧနၪဂူၫဂၩလၧအအၧၩ့ နဲၪ့အနၫ့ဆါနွ့ၫဒုၩတၭ, အဝ့ၫၥံၪနုၬအီၪဝ့ၫ ထီးအဖၧၩ့ နီၪလီၫ.ၦလဂၩနီၪအထုၬနၭနဲၪ့လၧအခၪ့ထံၭဒံၭ လီၫ.",
			"27": "<sup>27</sup> လၧအချဲၩ့ဆၧနီၪအဘိၩ့ဘၭတၭ, ဆၧမၩအၥၭလၧ ၦခမျၧးနီၪအကျၩ, ၦမုၪလဂၩကိၭၡၭထၪ့ဆၧတၭ, စံၭအဝ့ၫးဒၧၩ့လးလၧအဒၧၩ့န့နၧၩ,ဒဲနူၥၪလၧနအၪ့",
			"28": "<sup>28</sup> ဆူၭနီၪအီၪမုၬဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ,မွဲမၬ, ၦလၧ အနါဂၧၫ့ယွၩအလူ, ဒဲထီးန့ဖံၭထၬဝ့ၫလဖၪနီၪ,အီၪမုၬ ဝ့ၫဒၪအၪနဲၪ့အနီၪဒံၭလီၫ.",
			"29": "<sup>29</sup> ၦခမျၧးအီၪကိၩ့အီၪကီၪ့ ကထံၬကထူၬတၭ, အဝ့ၫ ဒၪစံၭဝ့ၫ, ၦလဆိၩယီၩ မွဲအဘၪဆိၪအၧၩ့လီၫ. အၪ့ ဎၬဝ့ၫလၧဆၧလၩ့လၭတၭ, အ့ၪလမွဲဘၪစယိနၫအဆၧ",
			"30": "<sup>30</sup> လၩ့လၭနီၪ,ဆၧဖ့ၪလၫ့ဝ့ၫအဆၧလၩ့လၭအ့ၬ.- အ ဂဲးဘဲၫယီၩ ဘဲၫစယိနၫကဲၪဆၧလၩ့လၭလၧၦနံနဝ့ၫဖိၪ အမ့ၬယၫအၥိၭနီၪ, ၦၡၩအဖိၪခွၫယီၩမိကဲၪထၪ့ ဆၧလၧၦလဆိၩယီၩ အမ့ၬယၫဘဲၫနီၪအၥိၭလီၫ.",
			"31": "<sup>31</sup> လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ မုခံၫ့အနးဎွၩမုၪမိဂဲထုၪ့ ထၪ့လၧၦလဆိၩယီၩအၥိၭတၭ, မိစ့ၩရၫ့စၪအဝ့ၫၥံၪ လီၫ.အဂဲးဘဲၫယီၩ ဘဲၫၥိၭအမိနါဂၧၫ့ စစီလမၧၫ့အ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ, အဝ့ၫဒၪဂဲၫမၬ လၧဂၪ့ခိၪအနိၪ့ လီၫ.ယိခွါ, ၦဒိၪနဲၪ့ဒံၭစစီလမၧၫ့အီၪမၬ ထီးယီၩလ ဂၩကၨ.",
			"32": "<sup>32</sup> လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ, ၦနံနဝ့ၫဖိၪမိဂဲထုၪ့ထၪ့လၧ ၦလဆိၩယီၩအၥိၭတၭ,မိစ့ၩရၫ့စၪဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩစယိနၫလီၩလၩ့လၬလၩ့ဆၧတၭ, အဝ့ၫၥံၪနီၫ့ယါ လၩ့ထဲၩ့အၥၭလီၫ.",
			"33": "<sup>33</sup> ၦစီၩ့ထၪ့မ့ၪဒိၩ့တၭ, အီၪက့ၪဝ့ၫလၧဆၧကဒုၩအလး မွဲဂ့ၩ, လၧဒၩ့အဖၫ့လၬမွဲဂ့ၩ,နးဂၩအ့ၬ. မွဲဘဲၫၥိၭ ၦဂဲၫနုၬလဖၪ မိဒၪဘၪအဆၧဖၩ့တၭ, အီၪက့ၪထၪ့ဝ့ၫ",
			"34": "<sup>34</sup> လၧမ့ၪဒိၩ့အလးအဖၫ့ခိၪလီၫ.- နမိၡါအမ့ၪဒိၩ့မွဲနမ့ၬ ၥၪလီၫ.မၩအၥၭဘဲၫနီၪတၭ, နမ့ၬၥၪအ့ၪဆၭနီၪ, နမိၡါအီၪလၧဆၧဖၩ့ထၧၫ့ဂၩယၫလီၫ. အ့ၪမွဲနမ့ၬၥၪ",
			"35": "<sup>35</sup> နီၪအ့ၪလဆၭဘၪတၭ,နမိၡါမိခံၭဝ့ၫလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ဆၧဖၩ့အီၪလၧနဖၧၩ့နီၪ, ဘဲၫၥိၭအ",
			"36": "<sup>36</sup> ထီးကဲၪဆၧခံၭလဂ့ၩတၭးထီးလၩ့နၥၭဘီၪ.- အယီၩ တၭဆၧဖၩ့အ့ၪအီၪလၧနမိၡါထၧၫ့ဂၩယၫနီၪ, ဆၧ ခံၭအီၪနးစီၪ့ အ့ၬ.ဘဲၫမ့ၪဒိၩ့အဂိးဖၩ့ထၪ့ဘၪနၧၩအ ၥိၭနီၪ,နမိအီၪဖၩ့ထၪ့နဝ့ၫထၧၫ့ဂၩယၫလီၫ.",
			"37": "<sup>37</sup> အဝ့ၫဒၪချဲၩ့ဆၧ အဘိၩ့ဘၭတၭ, ၦဖၫရစံၫလဂၩ အၪ့ကံၩ့အဝ့ၫဘဲၫၥိၭ အမိဂဲၫအၪ့ဆၧ လၧအၥိၭလီၫ. အဝ့ၫလ့ၩနုၬဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဝ့ၫလၧစပွဲထံၭလီၫ.- အဝ့ၫ",
			"38": "<sup>38</sup> ဒၪလၥူၫဝၭဘၪအစူၪ လၧအလချႃၭအၪ့ဆၧနီၪ, ၦဖၫ",
			"39": "<sup>39</sup> ရစံၫဒၪဘၪဝ့ၫတၭ,ထီၫမံၫထီၫမၪဝ့ၫလီၫ.- ကဆါ စံၭအဝ့ၫ,ၦဖၫရစံၫ, နၥံၪဝ့ၫဒၪယီၩ, နၥံၪမၩဆံၫ့ထၪ့ လိၫ့ၥံၪဒဲတဲၪလဲၪၥံၪအချိၫ့လီၫ. အ့ၪမွဲလၧနၥံၪအ ဖၧၩ့လခီၫနီၪ, လၧၫ့ဎွ့ၩဝ့ၫ လၧဆၧအၪ့ဘျံၭအၪ့",
			"40": "<sup>40</sup> ဘျၪ,ဒဲလၧဆၧအၧၩ့ဆၧၥၫ့လီၫ.- ၦဂီၩ့ဖိၪဧ့ၬ ၦလၧအ တဲၩ့လၩ့အချိၫ့နီၪ, မွဲအတဲၩ့လၩ့ဝ့ၫအဖၧၩ့ဆ့အ့ၬဧၪ.",
			"41": "<sup>41</sup> အ့ၪမွဲဆၧအီၪလၧနၥံၪအစူၪဖၧၩ့နီၪ, ဖ့ၪလၫ့ယၫ့ ၥၭဆၧဆံၭ.ယိခွါ,ကယဲဆၧထီးအလူၬနီၪ မိဆံၫ့ထၪ့ လၧနၥံၪအဂးလီၫ.",
			"42": "<sup>42</sup> မွဲလါနၫ့တၭ, ၦဖၫရစံၫၥံၪဧ့,နၥံၪဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪမၩဘိၪ့ဖီၫကဘၩ့, ဒဲရူၩ, ဒဲဆၧဒိၭ ဆၧလၪလမံၩ့လါလါ, ဆံၫပိၩ့နီၪလပိၩ့လီၫ. နၥံၪလ့ၩ ဖၬဆၧစ့ၩရၫ့, ဒဲယွၩအဆၧအဲၪဆၧကွံၩလီၫ. အယီၩ လဖၪနၥံၪဂ့ၩမၩတၭ, အနီၪလဖၪကြၨၭနၥံၪလ့ၩဖၬ ဘၪဆ့အ့ၬ.",
			"43": "<sup>43</sup> ၦဖၫရစံၫၥံၪဧ့, နၥံၪဘၪအၡၪ့လီၫ.အဂဲးဘဲၫယီၩ နၥံၪအဲၪဒိၭလးဆၧၫ့နၩ့အဂ့ၩထုၬလၧၥရိၬဖၧၩ့, ဒဲ ဆၧချဲၩ့ဒုၪ့လၧဖၠၫဖၧၩ့လီၫ.",
			"44": "<sup>44</sup> နၥံၪဝ့ၫဒၪယီၩနၥံၪဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ နၥံၪလၩ့ဂၬ ၦၥွၪခိၪလဖၪ လၧအလအီၪဖျီၪဘၪတၭ, ၦၡၩလ့ၩဆၧထဲၩ့ဆၧလၧအဖၫ့ခိၪလါနၫ့နီၪၥ့ၪယၫ ဝ့ၫအ့ၬ.",
			"45": "<sup>45</sup> ၦၥ့ၪလံၬလဂၩချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ဆရၫ ဧ့,နစံၭဆၧယီၩနဒုၪ့ဒွ့ၪပၧၩဆ့မၬကၨ.",
			"46": "<sup>46</sup> အဝ့ၫဒၪစံၭဝ့ၫ, ၦၥ့ၪလံၬနၥံၪဝ့ၫဒၪဧ့,နၥံၪဘၪအၡၪ့ ဆ့လီၫ.အဂဲးဘဲၫယီၩ ဆၧအွံၪဆၧယိၭ လၧအဎၧၫ့ မၬနီၪ,နၥံၪအီၪက့ၪထၪ့ဝ့ၫလၧ ၦၡၩအလီၩ့တၭ, နၥံၪ အနၫ့ဆါဒၪနၥံၪဝ့ၫ, နၥံၪထိၭဘၪလၧ နၥံၪအစူၪနိၩ့ နးဘီၩ့အ့ၬ.",
			"47": "<sup>47</sup> နၥံၪဝ့ၫဒၪယီၩ, နၥံၪဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ နၥံၪမၩထၪ့မီၪၥံၪအၥွၪခိၪတၭ, နၥံၪအဖါၥံၪမၩၥံၫအ",
			"48": "<sup>48</sup> ဝ့ၫၥံၪလီၫ.- မွဲမၬ, နၥံၪထိး နၥံၪအၥၭ လၧနၥံၪအဖါ အဆၧမၩ, ဒဲနၥံၪအုၩ့လၩ့အဝ့ၫၥံၪလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪ မၩၥံၫမီၪလဖၪတၭ, နၥံၪဝ့ၫဒၪနၥံၪမၩထၪ့",
			"49": "<sup>49</sup> အၥွၪခိၪနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယွၩအဆၧကိၪ့ ၥ့ၪကိၪ့ဘၪ,စံၭဝ့ၫ, ယမိအၪ့မၧၫ့လၩ့မီၪ, ဒဲၦဆၧ အၪ့မၧၫ့ဖိၪၥံၪလၧအအီၪတၭ, မွဲအမိမၩၥံၫဝ့ၫလ",
			"50": "<sup>50</sup> နၩ့မိမၩအၧၩ့မၩနၭဝ့ၫလနၩ့လီၫ.- လၧစအၫဘလၭအ ၥွံၪထီၩ့လၩ့ လၧစဇၭခရဲအၫ လၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧဆၧလုအလးဒဲလၧဆၧလုအဒူၭဖၧၩ့ အဘိၩ့ဆၧၩ့ နီၪ,ကယဲမီၪလဖၪအၥွံၪအထံၫလူၫလၩ့အၥၭ လၧဂၪ့ ခိၪအခၪ့ထံၭလံၩလံၩနီၪ ဆၧမိအၪ့ဎၬဝ့ၫလၧၦလ",
			"51": "<sup>51</sup> ဆိၩယီၩ,- မွဲမၬ,ယစံၭနၥံၪတီၩတီၩ,ဆၧမိအၪ့ဎၬဝ့ၫ လၧၦလဆိၩယီၩအစူၪဖၧၩ့လီၫ.",
			"52": "<sup>52</sup> ၦၥ့ၪလံၬၥံၪဧ့, နၥံၪဘၪအၡၪ့လီၫ.အဂဲးဘဲၫယီၩ ဆၧၥ့ၪယၫအနိၪဝံၬနီၪ, နၥံၪဆိၬခွံၬယူၭ.နၥံၪလလ့ၩနုၬ ဘၪလၧနၥံၪအနၫ့ဆါဒၪနၥံၪဝ့ၫလကၭလၧၩ့တၭ,ၦ လၧအမိလ့ၩနုၬဝ့ၫလဖၪနီၪ, နၥံၪပဒၩ့အဝ့ၫၥံၪဆ့လီၫ.",
			"53": "<sup>53</sup> မွဲအစံၭအဝ့ၫၥံၪ လၧဆၧနီၪလဖၪအဘိၩ့ဘၭတၭ, ၦကွ့ၭလံၬၥံၪ, ဒဲၦဖၫရစံၫၥံၪမၩထံၬထၬဝ့ၫ ဆီၪ့ဆီၪ့",
			"54": "<sup>54</sup> လ့ၬတၭ, ထိၪဂဲၩဝ့ၫချဲၩ့ဆၧအၪမံၩ့အဂဲးတၭ,ဘဲၫ ၥိၭအမိအီၪက့ၪဆၧမၪလၧအဝ့ၫနီၪအလီၩ့တၭ, အဝ့ၫ ၥံၪယိၥူၪဝ့ၫအၪ့ဎၬမၩဘံၪဘူၪအဆၧချဲၩ့လီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ၦခမျၧးအလၬလဖၪ အီၪကိၩ့အီၪကီၪ့ ဝ့ၫဒၪထီးအယဲးဘၪလိၬအၥၭတၭ, အဝ့ၫဒၪလီၩဘၪ ဆိၫအထံၩအဖျဲၥံၪ, ထီးလၩ့နၥံၪအၥၭ လၧၦဖၫရစံၫ",
			"2": "<sup>2</sup> အမံၪ,ဘဲၫၦစံၭဆၧအၥိၭ, ဆၧအၪ့လီၫနီၪဆံၭ.- ဆၧ လၧအဘၪဆၧချႃၬဘံၭထၬဝ့ၫနီၪ, လမိအီၪဖျီၪထၪ့ ဘၪတၭ,အီၪဝ့ၫနးမံၩ့အ့ၬ, ဆၧလၧအဘၪဆၧအီၪ က့ၪၥူၪခွံၬဝ့ၫနီၪၦလၥ့ၪယၫဘၪတၭး အီၪဝ့ၫနးမံၩ့",
			"3": "<sup>3</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးဒၪနၥံၪလီၩထဲၩ့ဆၧ လၧဆၧခံၭကျၩလဖၪနီၪ, ဆၧမိနါဂၧၫ့ဝ့ၫ လၧဆၧဖၩ့ အကျၩလီၫ.နၥံၪချဲၩ့ဆၧလၧၦအနါဖၧၩ့ လၧဒူၭဖၧၩ့ နီၪ, ဆၧမိလီၩဘၪကိၭၡၭထၪ့ဝ့ၫ လၧဂံၪ့ခိၪလီၫ.",
			"4": "<sup>4</sup> ယထံၩယၥိၭဧ့, ယစံၭနၥံၪ,ၦၡၩၥံၪလၧအမၩၥံၫ ပမိၡါတၭ,လၧခဲၫ့ထဲၩ့ မၩဝ့ၫလၥ့ၪလၧၩ့ဘၪနးမံၩ့နီၪ,",
			"5": "<sup>5</sup> ထီးၥၭမဲၪအဝ့ၫလဂ့ၩ.- အ့ၪမွဲနၥံၪကြၨၭၥၭမဲၪပလၫ လဂၩလဲၪနီၪ,ယမိဒုၭနဲၪနၥံၪလီၫ. ၦမၩၥံၫဆၧအလး ခဲၫ့တၭ,ခွံၬလၩ့ဝ့ၫလၧလရၬဖၧၩ့ၥ့ၪလဂၩ နီၪၥၭမဲၪ အဝ့ၫနီၪဆံၭ. မွဲမၬ, ယစံၭနၥံၪ,ၥၭမဲၪအဝ့ၫနီၪဆံၭ.",
			"6": "<sup>6</sup> ၦအၪ့ဆၫထိၪဎွံၭယဲဘံၪ့ လၧထီးနံၫဘံၪ့မွဲအ့ၬဧၪ. ဆၧ",
			"7": "<sup>7</sup> ၥၭနၪ့အဝ့ၫၥံၪ လၧယွၩအမ့ၬယၫနးဘံၪ့အ့ၬ.- နၥံၪအ ခိၪၥူၫအဘီၩ့ဒၪလ့ၬနီၪ, ဘၪဆၧဝံထၪ့နၬထၪ့ဝ့ၫထီးအ လူၬလီၫ.မၩအၥၭဘဲၫနီၪတၭ, နၥံၪထီးၥၭမဲၪဆၧလ ဂ့ၩ,နၥံၪဂ့ၩနဲၪ့ဒံၭထိၪဎွံၭအခမျၧးနီၪလီၫ.",
			"8": "<sup>8</sup> ယစံၭနၥံၪကယဲၦလၧအအုၩ့လၩ့ယၧၩ လၧၦၡၩ အမ့ၬယၫလဂၩဂၩနီၪ, ၦၡၩအဖိၪခွၫယီၩမိအုၩ့လၩ့",
			"9": "<sup>9</sup> အဝ့ၫလၧယွၩအၥီၫ့လဖၪအမ့ၬယၫလီၫ.- ၦလၧအ မီၪ့ဘံၭယူၭယၧၩလၧၦၡၩအမ့ၬယၫနီၪ, ဆၧမိမီၪ့",
			"10": "<sup>10</sup> ဘံၭအဝ့ၫဒၪလၧယွၩအၥီၫ့အမ့ၬယၫလီၫ.- ကယဲၦလၧ အချဲၩ့မၪၦၡၩအဖိၪခွၫလဂၩဂၩယီၩ, ဆၧမိမၩဖီၩ့မၩ ဖျ့ၭအဝ့ၫလီၫ. အ့ၪမွဲၦလၧအဒုၪဒွ့ၪ ၥၭမုဆံၫ့ဎံၪနီၪ, ဆၧမိမၩဖီၩ့မၩဖျ့ၭဝ့ၫအ့ၬ.",
			"11": "<sup>11</sup> ထီးၦလ့ၩၥိၫ့နၥံၪလၧၥရိၬဖၧၩ့လဖၪ, ဒဲလၧၦၥုၪ့က့ၭ ၥၭၡါၥံၪအအီၪတၭ, မွဲနၥံၪမိချဲၩ့ဖီၩ့ဖျ့ၭ ဆၧဘဲၫၥ့ၪ လဲၪဘဲၫၥ့ၪလဲၪမွဲဂ့ၩ, မွဲနၥံၪမိချဲၩ့ဆၧဘဲၫအံၩဘဲၫအိၩ",
			"12": "<sup>12</sup> မွဲဂ့ၩ,နၥံၪထီးအၪ့ယိၪလဂ့ၩ.- အဂဲးဘဲၫယီၩနၥံၪဂ့ၩ ချဲၩ့ဘဲၫအံၩဘဲၫအိၩနီၪ, ၥၭမုဆံၫ့ဎံၪ မိဒုၭနဲၪနၥံၪထီး အနၩရံၩနီၪလီၫ.",
			"13": "<sup>13</sup> လၧၦခမျၧးအကျၩ ၦလဂၩစံၭအဝ့ၫ, ဆရၫဧ့, မၪလူၬ ယထၧၫ့ဖုဝဲဘဲၫၥိၭ အမိအၪ့နၩ့ဖၭန့ယၧၩ လၧဆၧန့",
			"14": "<sup>14</sup> ၥၫအဆၧၫ့ဘီၪ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫ,ၦၡၩဧ့,မွဲပ လၫအီၪက့ၪယၧၩလၧဆၧစ့ၩရၫ့မွဲဂ့ၩ, ၦအၪ့နၩ့ဖၭ",
			"15": "<sup>15</sup> ဆၧအဆၧၫ့မွဲဂ့ၩ,လၧနၥံၪအဖၫ့ခိၪလဂၩလဲၪ.- အဝ့ၫ ဒၪစံၭအဝ့ၫၥံၪ,ဆၧလီၫ့ကီၩ့ၥၭကွံၩနီၪ, ထီးလၩ့နၥံၪအ ၥၭဂၭဎ့ၭခွံၬဆံၭ. အဂဲးဘဲၫယီၩဆၧစူၪလးခၪ့ခိၪ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩနီၪမွဲၦၡၩအဆၧမၧၫ့အ့ၬ.",
			"16": "<sup>16</sup> အဝ့ၫဒၪချဲၩ့ဆၧလၧအဝ့ၪၥံၪ, လၧဆၧချဲၩ့အဒီၩ့ တၭ,စံၭဝ့ၫ, ၦၥထံၫလဂၩနီၪ, အဂၪ့ခိၪၥၪထၪ့ဝ့ၫအီၪ",
			"17": "<sup>17</sup> အၪအၪလ့ၬလီၫ.- တၭဆီၫ့မီၪ့ဝ့ၫလၧအၥၭ,စံၭဝ့ၫ,ယ မိမၩဘဲၫၥ့ၪလဲၪး အဂဲးဘဲၫယီၩယဆၧၥူၪဆၧၥၪနီၪယ",
			"18": "<sup>18</sup> အီၪက့ၪကီၪ့ထဲၩ့အလးအီၪအ့ၬ.- တၭစံၭဝ့ၫ,ယမိမၩ ဘဲၫယီၩ, ယမိရိလၩ့ခွံၬယဖၫ့တၭ,ယမိၥုၪ့ဒိၪထၪ့ ထဲၩ့ဝ့ၫတၭ, ယမိအီၪက့ၪကီၪ့ယဆၧၥူၪဆၧၥၪ,ဒဲယ",
			"19": "<sup>19</sup> ဆၧဖိၪဆၧလံၩထီးအလူၬလီၫ.- ယမိစံၭယၥၭၡီၩ့,ၥၭ ၡီၩ့ဧ့, နဆၧဂ့ၩနဆၧဘွၩအၪအၪလ့ၬအီၪဝဲၩယူၭ လၧအၪနံၪ့အၪလၩအဂးယူၭ. အီၪပွံၭဒၪခလူၬတၭ,",
			"20": "<sup>20</sup> အၪ့ဆၧအီၩဆၧတၭ,မုၬလၩနၥၭဘီၪ.- မွဲလါနၫ့ ဘိၩယွၩစံၭအဝ့ၫ, ၦဂီၩ့ဖိၪဧ့,လနၩယီၩဆၧမိကိၭ ထဲၩ့နၥၭလၧနအီၪလီၫ. ထီးနီၪလဖၧၫ့ဆၧဖိၪဆၧလံၩ လၧနတဲၩ့ဝဲၩနီၪ,မိကဲၪလၧပလၫလဂၩအဆၧလဲၪ.",
			"21": "<sup>21</sup> ၦလၧအအီၪက့ၪကီၪ့ဆၧလၧအဂးဒၪဝ့ၫ, ဒဲအစူၪလး အခၪ့ခိၪလအီၪဘၪလၧယွၩလခီၫနီၪ, မၩအၥၭဘဲၫ နီၪၥိၭဆ့လီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪမၩအၥၭဘဲၫနီၪတၭ, ယ စံၭနၥံၪ မွဲနၥံၪမိအၪ့ဘၪဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, နၥံၪထီးအၪ့ယိၪလၧနၥံၪအၥၭမၧၫ့အဂးလဂ့ၩ, မွဲ နၥံၪမိကီၩ့ဘၪမိၥိၭဘၪဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, နၥံၪ",
			"23": "<sup>23</sup> ထီးအၪ့ယိၪလၧနၥံၪအမိၡါ အဂးလဂ့ၩ.- ၦၥၭမၧၫ့နီၪ ဂ့ၩနဲၪ့ဆၧအၪ့ဒံၭ, ဒဲၦမိၡါနီၪဂ့ၩနဲၪ့ ဆၧကီၩ့ဆၧၥိၭ",
			"24": "<sup>24</sup> ဒံၭလီၫ.- ယိဆီၫ့မီၪ့ခွါကျၭၥံၪဘီၪ.အဝ့ၫၥံၪလဎွံၪ ဘၪဆၧဒဲလကူၭဘၪဆၧတၭ,အထိၬအဖၫ့အီၪဆ့အ့ၬ. မွဲလါနၫ့တၭယွၩဘုၪအၪ့ဒၪအဝ့ၫၥံၪလီၫ. မွဲနၥံၪဂ့ၩနဲၪ့",
			"25": "<sup>25</sup> ထိၪၥံၪလံၪၥံၪဆံၭဒိၪလဲၪ.- မွဲပလၫလၧနၥံၪအကျၩ လၧအအၪ့ယိၪဆၧအကၠီၩ့နီၪ, ထုၭထီၫထၪ့အယုၬနး",
			"26": "<sup>26</sup> ဖျါနီၪမိၥ့ၪလဂၩလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧ အဆံၭထုၬနီၪ, နၥံၪအ့ၪမၩလၥ့ၪဘၪတၭ, ဆၧလၧအ ဂူၫဂၩလဖၪနီၪ, မွဲဘၪနီၫနၥံၪအၪ့ယိၪဆၧ လၧအကၠီၩ့ နီၪလဲၪ.",
			"27": "<sup>27</sup> ဆၧလၧဖီၫယၫၥံၪ, မွဲအဒိၪထၪ့ဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪ လဲၪနီၪ, ယိဆီၫ့မီၪ့ခွါဘီၪ.အဝ့ၫၥံၪမၩဆၧအ့ၬ, ဝံၭဆၧ အ့ၬ,မွဲလါနၫ့တၭ,ယလီၩဘၪနၥံၪ, စစီလမၧၫ့ဒၪလ့ၬ အီၪလၧအကယးကဖးထီးအလူၬနီၪ, ကီၩ့ၥိၭဝ့ၫထီး အလူၬနီၪ, ကီၩ့ၥိၭဝ့ၫထီးဎီၩ့လၧဖီၫလမုၫနီၪအ့ၬ.",
			"28": "<sup>28</sup> နၥံၪနဲၩဆၧၡၩၥံၪဧ့, ယွၩအ့ၪဒုၭကီၩ့ဒုၭၥိၭ နၪ့ၥံၪလၧ အယီၩလနံၩအီၪဝ့ၫလၧဆၧပျၩ့ဖၧၩ့, အ့ၪမွဲကဲဂီၩလ နံၩဘၪဆၧဖျႃၭလၩ့ခွံၬဝ့ၫလၧ ဖံၫ့ချၪဖၧၩ့တၭ, မွဲအမိ",
			"29": "<sup>29</sup> ဒုၭကီၩ့ဒုၭၥိၭနၥံၪအၪနဲၪ့အနီၪဒံၭ ဆံၭဒိၪလဲၪ.- နၥံၪ ဝ့ၫဒၪယီၩနၥံၪမိအၪ့ဘၪ, နၥံၪမိအီၩဘၪ ဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, နၥံၪထီးအၪ့ဎၬလဂ့ၩ, ဒဲနၥံၪအၥၭထီး",
			"30": "<sup>30</sup> ဂံၩ့ဂၩ့လၧအကၠီၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩဆၧလဖၪနီၪ ၦဆၨၩလဖၪလၧဂၪ့ခိၪချိၫ့ယီၩ, အၪ့ဎၬဝ့ၫထီးအလူၬ လီၫ.တၭနၥံၪအဖါၥ့ၪယၫ လၧနၥံၪန့ဘၪဆၧလဖၪနီၪ",
			"31": "<sup>31</sup> အလးအီၪဝ့ၫလီၫ.- အ့ၪမွဲအၪ့ဎၬနၥံၪဝ့ၫ အဝ့ၫဒၪအ ဘၩ့အမုးဆံၭ. တၭဆၧမိဖ့ၪလၫ့နၥံၪလၧဆၧလ ဖၪနီၪလီၫ.",
			"32": "<sup>32</sup> ၥိၪလဒီၪ့အဆံၭဧ့,ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩ မွဲအဘၪနၥံၪအဖါအၥၭလၧအမိဖ့ၪလၫ့ နၥံၪအဘၩ့အ",
			"33": "<sup>33</sup> မုးအီၪနီၪလီၫ.- နၥံၪအစူၪလးအခၪ့ခိၪနီၪ,အၪ့ဆၫ ခွံၬတၭ,ဖ့ၪလၫ့ယၫ့ၥၭဆၧဆံၭ. ထိၪ့လၧအလလး လံၩဘၪဝ့ၫနီၪမၩထဲၩ့လၧနၥံၪအဂးဒၪနၥံၪဝ့ၫ, ဘဲၫ ၦစံၭဆၧအၥိၭ, ဆၧလူဒိၪဎွ့ၩဒိၪလၧအလူၬလၥ့ၪဘၪ လၧမူၭခိၪဖၧၩ့, ထီးအလးလၧဆၧအၪ့ဂူၪ လၥုၭဘူၭ",
			"34": "<sup>34</sup> ဘၪအၥၭ, ဒဲဆၧအဎါလအၪ့ဂီၩ့ဘၪ နီၪဘီၪ.- အဂဲး ဘဲၫယီၩ ထီးဒၪအလးလၧနၥံၪ အစူၪလးခၪ့ခိၪအီၪဝ့ၫ လစီၪ့စီၪ့နီၪ, နၥံၪအၥၭမိအီၪဝ့ၫထီးနီၪဆ့လီၫ.",
			"35": "<sup>35</sup> ခဲးထူၬနၥံၪအယးဒံၩ့တၭ, အီၪလၧနၥံၪအမ့ၪဒိၩ့",
			"36": "<sup>36</sup> ခဲၩဖၩ့ထၪ့ဘီၪ.- အီၪနၥံၪဝ့ၫဘဲၫၦလၧအယိလါအ ကဆါအဖၧၩ့ၥၭအၥိၭနီၪဘီၪး ထီးအဝ့ၫဒၪလ့ၩလၧ မူၭဖၧၩ့ဂဲၫထဲၩ့ဒိၪထိၬဆၧနီၪ, ဘဲၫၥိၭအဝ့ၫၥံၪမိဝဲထၪ့",
			"37": "<sup>37</sup> န့အဂးချဲၫ့မၬလီၫ.- အဎီးအၡၩလဖၪလၧအကဆါဂဲၫ ထဲၩ့ဒၪဘၪအအီၪခိၭဝ့ၫလဖၪနီၪ, အီၪမုၬဝ့ၫဒၪလီၫ. ယလီၩဘၪနၥံၪတီၩတီၩလၧ အကဆါမိခဲးထူၬအယး ဒံၩ့ဒၪဝ့ၫတၭ, မိအၪ့မၧၫ့အဝ့ၫဒၪ ဆၧၫ့နၩ့ဝ့ၫတၭ, မိဂဲၫ",
			"38": "<sup>38</sup> မၩအဝ့ၫၥံၪလၧအဎီးအၡၩအဆၧမၩလီၫ.- ၦခိၭဆၧ နံၫဆၫ့လဆၫ့မွဲဂ့ၩ, ၥၧၫ့ဆၫ့လဆၫ့မွဲဂ့ၩ,အကဆါအ့ၪ ဂဲၫထဲၩ့ဒၪဘၪဆၧမၩအၥၭဘဲၫနီၪတၭ, အဎီးအၡၩ",
			"39": "<sup>39</sup> လဖၪနီၪ,အီၪမုၬဝ့ၫဒၪလီၫ.- နၥံၪၥ့ၪယၫလၧဂံၪ့ကဆါ အ့ၪၥ့ၪယၫဆၧအဆၧၫ့အထီ လၧဆၧဂူၪဆၧဘျၪမိ ဂဲၫဝ့ၫတၭ, ဘဲၫၥိၭအဆၧထီးဘုၪ့ဖိးဘၪ အဂံၪ့လဂ့ၩ",
			"40": "<sup>40</sup> တၭ,မိအီၪခိၭဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အီၪ တဲၩ့ဝဲၩနၥံၪအၥၭဆ့ဆံၭ. အဂဲးဘဲၫယီၩၦၡၩအ ဖိၪခွၫယီၩ,မိဂဲၫဝ့ၫ လၧအဆၧၫ့အထီ လၧနၥံၪလဆီၫ့ မီၪ့ဘၪနၥံၪဝ့ၫလီၫ.",
			"41": "<sup>41</sup> စပံတၧၫစံၭအဝ့ၫ, ကဆါဧ့,ဆၧချဲၩ့အဒီၩ့ယီၩ,နလီၩ",
			"42": "<sup>42</sup> ဘၪန့ၫပၧၩယီၩမွဲနလီၩဘၪဆ့ၦထီးအလူၬလဲၪ.- က ဆါစံၭဝ့ၫ, အဎီးအၡၩလၧအလူတီၩ,ဒဲအကိၪ့ၥ့ၪလၧ အကဆါမိအီၪက့ၪလၩ့ဝ့ၫ လၧအဒိၪဘဲၫၥိၭ အမိဒုၭ",
			"43": "<sup>43</sup> အၪ့ၦဂံၪ့ဖိၪထီးမုဘၪနီၪ,မွဲပလၫလဂၩလဲၪ.- အဎီး အၡၩလၧအကဆါ ဂဲၫထဲၩ့ဒၪဘၪလၧ အမၩဝ့ၫဘဲၫနီၪ",
			"44": "<sup>44</sup> အီၪမုၬဝ့ၫဒၪလီၫ.- ယလီၩဘၪနၥံၪလၩ့ထံးလၩ့ဆ့ၭ လၧအမိဒုၭကဲၪထၪ့ အဝ့ၫဒၪလၧအဆၧဖိၪဆၧလံၩ ထီးအလူၬအခိၪလီၫ.",
			"45": "<sup>45</sup> မွဲလါနၫ့တၭ အဎီးအၡၩအ့ၪစံၭဝ့ၫလၧ အၥၭ,ယက ဆါမၩယံၬမၩနးအၥၭတၭ, ထးအဎီးအၡၩအမုၪ, ဒဲအဎီးအၡၩခွၫလဖၪတၭ, အၪ့ဆၧအီၩဆၧဒဲအီၩမၧၩ့",
			"46": "<sup>46</sup> အၥၭနီၪ,- ထီးမုနံၩမုနၩ လၧအလယိလါ ဘၪဝ့ၫအ ဖၧၩ့ၥၭ,ဒဲနၩရံၩလၧအလၥ့ၪယၫဘၪဝ့ၫနီၪအက ဆါမိဂဲၫထဲၩ့ဒၪ့ထ့ၬ အဝ့ၫနံၫကုၭတၭ, မိခွံၬလၩ့ခွံၬဝ့ၫ လၧၦလဆူလနဲၩဘၪ ဆၧအၥိၭနီၪလီၫ.",
			"47": "<sup>47</sup> အဎီးအၡၩလၧအၥ့ၪယၫ, အကဆါအၥၭနီၪ,လ တဲၩ့ဝဲၩဘၪအၥၭတၭ, လမၩဘၪဝ့ၫထီးအကဆါအ",
			"48": "<sup>48</sup> ၥၭနီၪ,မိဘၪဆၧထးဝ့ၫအၪထံၪလီၫ.- အ့ၪမွဲၦလၧ အလၥ့ၪယၫဘၪတၭ, မၩဝ့ၫထီးအကြၨၭဘၪထး နီၪမိဘၪထးဝ့ၫၡၩခိၬထံၪလီၫ. ကယဲၦလၧအန့ဘၪဆၧ အၪလဂၩလါလါနီၪ, ဆၧမိအၪ့ကံၩ့န့ထဲၩ့ဆၧလၧအ အၪလၧအဝ့ၫနီၪလီၫ. ၦလၧဆၧဖ့ၪလၫ့ဝ့ၫလၧ အစူၪ ဖၧၩ့အၪနီၪ, ဆၧမိအၪ့ကံၩ့န့ထဲၩ့အၪဒံၭလၧအဝ့ၫ နီၪဆ့လီၫ.",
			"49": "<sup>49</sup> ယဂဲၫခွံၬလၩ့မ့ၪလၧဂၪ့ခိၪချိၫ့ယီၩး အ့ၪခဲၩထၪ့ယူၭ ဘိၩ့နဲၪ့ယီၩတၭ, ယမိဆိၫ့ဒံၭလၧဆၧနီၪလမံၩ့လဲၪ.",
			"50": "<sup>50</sup> ယဆၧဒိၭဘၭတံၫဇၫ့အီၪဝ့ၫလၧ ယဘၪဒိၭဘၭတံၫ ဇၫ့ယၥၭတၭ,ယလချႃၭဒိၭဒံၭဘၪနီၪ,ယကထံၬကထၬ",
			"51": "<sup>51</sup> နၭမၬကလဲၪၬ- မွဲနၥံၪဆီၫ့မီၪ့လၧယဂဲၫဖ့ၪဝဲၩဆၧဘၪ လိၬအိၭလိၬ လၧဂၪ့ခိၪချိၫ့ယီၩဆ့ဧၪ. ယစံၭနၥံၪ,မွဲ",
			"52": "<sup>52</sup> အ့ၬ.မွဲဆၧလၩ့မုလၩ့ဖၭလီၫ.- အဂဲးဘဲၫယီၩထီးယီၩ စူၪယၫခိၬၦအီၪလၧဂံၪ့လဖျိၪ့အဖၧၩ့ယဲဂၩနီၪ မိလၩ့ ဖၭဝ့ၫ,ၥၧၫ့ဂၩထၫ့ဒုၪဒၩနံၫဂၩ, ဒဲနံၫဂၩထၫ့ဒုၪဒၩၥၧၫ့",
			"53": "<sup>53</sup> ဂၩလီၫ.- အဖါထၫ့ဒုၪဒၩအဖိၪခွၫ, အဖိၪခွၫထၫ့ဒုၪ ဒၩအဖါ,အမိထၫ့ဒုၪဒၩအဖိၪမုၪ, အဖိၪမုၪထၫ့ဒုၪဒၩ အမိ,အမံၩ့ၡါမုၪထၫ့ဒုၪဒၩအဒဲၪ, အဒဲၪထၫ့ဒုၪဒၩအ မံၩ့ၡါမုၪၥံၪ, မိလၩ့ဖၭလိၬအၥၭလီၫ.",
			"54": "<sup>54</sup> အဝ့ၫဒၪစံၭၦခမျၧးၥံၪ, ထီးနၥံၪဒၪဘၪဆၧအုၪ့ထၪ့ လၧမုနုၬတၭး နၥံၪစံၭချဲၫ့မၬလၧဆၧမိဂဲၫဆၧၩ့တၭ,",
			"55": "<sup>55</sup> ဆၧမၩအၥၭဘဲၫနီၪလီၫ.- ထီးလံၩဂဲၫလၧမုခံၫ့တၭ,",
			"56": "<sup>56</sup> နၥံၪစံၭလၧဆၧမိခိတၭ, ဆၧမၩအၥၭလီၫ.- ၦအၪ့လီၫ ဆၧၥံၪဧ့, ဂၪ့ခိၪဒဲမူၭခိၪအမ့ၬနီၪ, နၥံၪယိနဲၪ့ၥ့ၪလီၫ. အ့ၪမွဲအမုအလၩဘိၩ့နဲၪ့ယီၩ, မွဲဘၪနီၫလၧနၥံၪ လ ယိနဲၪ့ဘၪနီၪလဲၪ.",
			"57": "<sup>57</sup> ထီးဒၪနၥံၪအၥၭနၥံၪဝ့ၫဒၪယီၩ, မွဲဘၪနီၫလၧနၥံၪ",
			"58": "<sup>58</sup> လစ့ၩရၫ့ဘၪ လၧအတီၩအလီၩ့နီၪလဲၪ.- ထီးနအ့ၪ လ့ၩဆၧလၧဖၧၩ့ၥၭလၧနဒုၪနဒၩအၥိၭလၧၦဒိၪအအီၪ တၭ,ဘဲၫၥိၭနမိဂၭဖျ့ၭလၧအဝ့ၫနီၪတၭ,အၪ့ဂူၬမၩဘီၪ. အ့ၪလမွဲဘၪတၭ, အဝ့ၫမိဖ့ၪလၫ့နၧၩလၧၦစ့ၩရၫ့ခွး တၭ,ၦစ့ၩရၫ့ခွးနီၪ မိဖ့ၪလၫ့ထဲၩ့နၧၩ လၧၦအၪ့ကံၩ့ ဆၧအခိၪတၭ, ၦအၪ့ကံၩ့ဆၧအခိၪမိအီၪက့ၪလၩ့နၧၩ",
			"59": "<sup>59</sup> လၧထီၫ့ဖၧၩ့လီၫ.- ယလီၩဘၪနၧၩ, ထီးလၧအထုၬ လဘံၪ့နီၪ, နလချႃၭလိၭထူၬခွံၬဒံၭဘၪတၭ, နစဲၪ့ထၪ့ခွံၬ ဘၪထီးနီၪအ့ၬ."
		},
		"13": {
			"1": "<sup>1</sup> ဆၧအထီထီးနီၪ, ၦအီၪဝ့ၫလနၩ့နၩ့လၧအလီၩဘၪအ ဝ့ၫလၧစပဲလၭလဲၩဎုၬၦဂၫလလံၫဖိၪအၥွံၪလၧအဆၧ",
			"2": "<sup>2</sup> လုအဂဲးလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ၦဂၫလလံၫဖိၪဘၪဆၧဘဲၫနီၪအကၠီၩ့တၭ, မွဲနၥံၪဆီၫ့ မီၪ့လၧအမွဲၦဆၧဒဲၩဘၭဖိၪအၧၩ့နဲၪ့ ကယဲၦဂၫလလံၫ",
			"3": "<sup>3</sup> ဖိၪၥံၪထီးအလူၬဒံၭဧၪ.- ယလီၩဘၪနၥံၪမွဲအ့ၬ.မွဲလါ နၫ့ဘိၩနၥံၪအ့ၪလနီၫ့ယါလၩ့ထဲၩ့ဘၪနၥံၪ,အၥၭ တၭ,နၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့ဘဲၫနီၪအၥိၭ ထီးအလူၬ လီၫ.",
			"4": "<sup>4</sup> ၦလၧတဲၩခိၭဆၧစံလိၫအၫ့လၩ့ဎီး လၧအဖၫ့ခိၪတၭ, ဘၪၥံၫၦၡၩလဆံၫဎိၭဂၩနီၪ, မွဲနၥံၪဆီၫ့မီၪ့လၧအဝ့ၫ ၥံၪမွဲၦဆၧဒဲၩဘၭဖိၪအၧၩ့နဲၪ့ ၦအီၪလၧယရုစလံၫ့အ",
			"5": "<sup>5</sup> ဖၧၩ့ထီးအလူၬဒံၭဧၪ.- ယလီၩဘၪနၥံၪ, မွဲအ့ၬ,မွဲလါ နၫ့ဘိၩ,နၥံၪအ့ၪလနီၫ့ယါလၩ့ထဲၩ့ဘၪ နၥံၪအၥၭတၭ, နၥံၪမိထီၩ့လၧဆၧဂၭဂီၩ့ ဘဲၫနီၪအၥိၭ ထီးအလူၬဆ့ လီၫ.",
			"6": "<sup>6</sup> အဝ့ၫဒၪချဲၩ့ဒီၩ့လၩ့ဆၧယီၩလမံၩ့ဆ့, ၦလဂၩလၧ အချိၪ့ဒိၩ့ဘၪဆၧၥုၪ့လၩ့ဝ့ၫ လၧအဆၧၥၪအလးဖၧၩ့ အီၪဝ့ၫလထံၭတၭ, လ့ၩအၪ့ဎၬအဆၧၥၪနီၪဒၪန့ဝ့ၫ",
			"7": "<sup>7</sup> အ့ၬ.- အဝ့ၫဒၪလီၩဘၪၦလၧအပၧၩ့ဘၪဆၧၥၪအလး လဂၩနီၪ,ယိခွါ, ယဂဲၫအၪ့ဎၬယူၭမၬဆၧၥၪလၧချိၪ့ ဒိၩ့ယီၩ အလီၩ့ၥၧၫ့နံၪ့ယူၭတၭ, ယဒၪန့အ့ၬ, ခူၬလၩ့",
			"8": "<sup>8</sup> ခွံၬအဝ့ၫဘီၪ. မွဲဘၪနီၫလၧအအီၪထၬဂၪ့ခိၪလဲၪ.- အ ဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭလီၩဘၪဝ့ၫ, ကဆါဧ့, အ ယီၩလနံၪ့ယီၩ,အီၪဒၪဝ့ၫခလူၬ ထီးယမိခုၪ့ဘွဲၪထၪ့ဝၬ",
			"9": "<sup>9</sup> ဖီၩ့အဝ့ၫ,ဒဲအီၪက့ၪဆၧအ့ၪလၧအခၪ့ထံၭနီၪ,- ဘၪ လဘၪမိၥၪဝ့ၫလၧယၫလခီၫတၭ,အ့ၪလမွဲဘၪနီၪ, နမိ ဘၪခူၬခွံၬဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> လၧမးၥံၫအနံၩလနံၩနီၪ, အဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့",
			"11": "<sup>11</sup> ဆၧလၧၥရိၬလဖျိၪ့အဖၧၩ့,- ယိခွါ, ၦမုၪလၧဆၧနၪ အီၪလၧအလီၩ့, ဘၪဆၧနၭဆၧၡၪ့လဆံၫဎိၭနံၪ့လီၫ. အီၪကူၭလၩ့ဝ့ၫတၭ, စီၪ့လီၩ့ထၪ့အၥၭ ကဲၪလါလါ",
			"12": "<sup>12</sup> အ့ၬ.- ယ့ၫၡုၬဒၪဘၪအဝ့ၫနီၪ, ကိၭထဲၩ့ဝ့ၫလၧအအီၪ",
			"13": "<sup>13</sup> တၭ,စံၭအဝ့ၫ,ၦမုၪဧ့, နဆၧဆၫဘျၪထဲၩ့ယူၭ.- အီၪ က့ၪအစူၪလၧအလီၩ့တၭ, အဝ့ၫဒၪစီၪ့လီၩ့ထၪ့အၥၭ",
			"14": "<sup>14</sup> ချဲၫ့မၬတၭ, စံၭထၪ့အၪ့အူၭယွၩလီၫ.- ယ့ၫၡုၬမၩဘျၪ ထဲၩ့ဆၧလၧမးၥံၫအနံၩအကၠီၩ့နီၪ ၦၥရိၬအခိၪအ ၥၭထၪ့ဝ့ၫနီၪ, ချဲၩ့ဆၧၫ့ဆၧတၭ,စံၭၦခမျၧးနီၪ ၦကြၨၭ မၩဆၧအနံၩ အီၪဎူၫနံၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, လၧအဝ့ၫၥံၪအနံၩအထးဖၧၩ့နီၪ, ဂဲၫဒိၭမၩဘျၪထဲၩ့ဆၧ",
			"15": "<sup>15</sup> ဆံၭး- လၧမးၥံၫအနံၩနီၪမွဲအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ကဆါချဲၩ့ဆၧၫ့ဆၧတၭ စံၭအဝ့ၫ, ၦအၪ့လီၫဆၧၥံၪဧ့, နၥံၪဝ့ၫဒၪလဂၩလါလါနီၪ, နၥံၪအချီဂ့ၩ,နၥံၪအက ၥ့ၪယီၩ့ဂ့ၩ,နၥံၪကွဲၪဖျါလၧအလးတၭ, လ့ၩမီၩ့ဒုၭ",
			"16": "<sup>16</sup> အီၩဝ့ၫလၧထံၫလၧမးၥံၫအနံၩမွဲအ့ၬဧၪ.- ၦစအၫဘြ ဟၫ့အဖိၪမုၪလၧမုၪခီၩလဲးစၧၩ့ထၬအဝ့ၫ, ယိခွါ,လ ဆံၫဎိၭနံၪ့ယၫလဂၩယီၩ, ဘၪဆၧကွဲၪဖျါခွံၬ လၧအ ဆၧစၧၩ့ထၬလၧမးၥံၫအနံၩနီၪ, မွဲလဘၪဘၪဆ့ဧၪ.",
			"17": "<sup>17</sup> အဝ့ၫဒၪချဲၩ့ဆၧလဖၪနီၪတၭ, အဒုၪအဒၩၥံၪထီးအ လူၬအမ့ၬမဲတၭ, မွဲကယဲဆၧဂ့ၩဆၧဘၪလၧအမၩအ ၥၭလၧအစူၪဖၧၩ့အကၠီၩ့နီၪ, ၦခမျၧးၥုၪ့ထိၬၥၭထိၬ ထီးအလူၬလီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭဝ့ၫ, ယွၩအဘၩ့အမုးနီၪ မၩအၥၭဘဲၫၥ့ၪလဲၪ,မွဲယမိဒီၩ့လၩ့ဝ့ၫ လၧဆၧနီၪ",
			"19": "<sup>19</sup> လမံၩ့လဲၪ.- မၩအၥၭဘဲၫဘၪချံၫလၧၦလဂၩၥုၪ့လၩ့ဝ့ၫ လၧအကျိၭဖၧၩ့အၥိၭနီၪလီၫ. မဲၪထၪ့ဝ့ၫနီၪ, ကဲၪထၪ့ လၧအထံၭဖၭဒိၪတၭး ထိၪၥံၪလံၪၥံၪလၧဆၧဖိၭဖၫ့ လဖၪနီၪ,ဂဲၫဆီးလၩ့ အီၪပွံၭဝ့ၫ လၧအထဲၩ့ခံၫထဲၩ့လီၩ့ လီၫ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪစံၭဒီၭဝ့ၫ, ယွၩအဘၩ့အမုးနီၪ, မွဲယမိဒီၩ့",
			"21": "<sup>21</sup> လၩ့ဝ့ၫလၧဆၧနီၪလမံၩ့လဲၪ.- မၩအၥၭဘဲၫမံၪလၧၦမုၪ လဂၩဒူၭလၩ့ဝ့ၫ လၧကိၪမုၬၥၧၫ့ဒၩ့အကျၩ ထီးအဖၭ ထၪ့ဝ့ၫထီးအလူၬအၥိၭ လီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪလ့ၩဝ့ၫလၧဒိၩ့ၥံၪ, တဝၫ့ၥံၪထူထူတၭ, ၥီၪ့ ထဲၩ့ၥၫ့ထဲၩ့ဆၧ, လ့ၩဝ့ၫလၧယရုစလံၫ့ အဖၧၩ့ၥၭနီၪ",
			"23": "<sup>23</sup> လီၫ.- ၦလဂၩစံၭအဝ့ၫ, ကဆါဧ့းၦလၧအထီၩ့ဝ့ၫလၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့အလးနီၪ, မွဲအၡၩခိၬဂၩဆ့ဧၪ.",
			"24": "<sup>24</sup> အဝ့ၫဒၪစံၭဝ့ၫ, အၪ့ဂူၬလ့ၩနုၬလၧတရၫ့အအံၪ့ဆံၭ. အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪ, ၦအၪဂၩမိအၪ့ဎၬ",
			"25": "<sup>25</sup> နုၬဝ့ၫတၭ,နုၬဝ့ၫၥ့ၪအ့ၬ.- ထီးဂံၪ့ကဆါဂဲထုၪ့ကၭ ဘံၭထၬတရၫ့နီၪ, နၥံၪမိဆၧၫ့ထုၪ့လၧခီၫ့,ဒိၪထိၬတရၫ့ တၭ,မိစံၭနၥံၪဝ့ၫ,ကဆါဧ့,ကဆါဧ့,ဝဲထၪ့န့ပၧၩဘီၪ. အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ,မိစံၭနၥံၪ,နၥံၪဂဲၫလၧအလး",
			"26": "<sup>26</sup> ခီၫခီၫလဲၪနီၪ,ယၥ့ၪယၫအ့ၬ.- ထီးနီၪလဖၧၫ့နၥံၪမိစံၭ, ပဝ့ၫဒၪယီၩ, ပအၪ့ပအီၩယူၭ ဆၧလၧနမ့ၬယၫတၭ,",
			"27": "<sup>27</sup> နၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ယူၭ ဆၧလၧပဖၧၩ့ၥၭဖၧၩ့ယူၭ.- အ ဝ့ၫဒၪမိစံၭဝ့ၫ,ယလီၩဘၪနၥံၪ, မွဲနၥံၪဂဲၫလၧအလးခီၫ ခီၫလဲၪနီၪ,ယၥ့ၪယၫအ့ၬ. နၥံၪမၩဆၧအၧၩ့ထီးအ",
			"28": "<sup>28</sup> အလူၬၥံၪဧ့,စဲၪ့ဖၭလၧယၧၩဆံၭ.- ထီးနၥံၪအ့ၪဒၪဘၪ စအၫဘြဟၫ့,စအံစၭ, ဒဲစယၫကူၭ,ဒဲမီၪၥံၪထီးအလူၬ အီၪလၧယွၩအဘၩ့အမုးအဖၧၩ့နီၪ, နၥံၪဝ့ၫဒၪယီၩ နၥံၪမိဘၪဆၧနၫ့ထၪ့ခွံၬနၥံၪဝ့ၫလၧခီၫ့တၭ, ဆၧဘၪ ဂၪ့ဆၧဘၪယၧၩ့ဆၧခၪအဲၪ့ထံး ဆၧမဲၪအဲၪ့ဎံၬနီၪ",
			"29": "<sup>29</sup> မိအီၪဝ့ၫထီးနီၪလီၫ.- ၦမိဂဲၫလၧမုနုၬ,လၧမုထၪ့,လၧ မုဖၩ,လၧမုခံၫ့တၭ, မိဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစပွဲထံၭလၧ",
			"30": "<sup>30</sup> ယွၩအဘၩ့အမုးအဖၧၩ့လီၫ.- ယိခွါ, ၦအီၪလၧခဲၫ့လ ဖၪနီၪ, မိအီၪထၪ့ဝ့ၫလၧယၫဒဲၦအီၪလၧယၫလဖၪ နီၪ,မိအီၪထဲၩ့ဝ့ၫလၧခဲၫ့လီၫ.",
			"31": "<sup>31</sup> လၧမုလနံၩနီၪ, ၦဖၫရစံၫလနၩ့နၩ့ ဂဲၫလၧအအီၪ တၭ,စံၭအဝ့ၫ စဲၪ့ထၪ့ခွံၬထီးယီၩဘီၪ. အဂဲးဘဲၫယီၩ",
			"32": "<sup>32</sup> စဟ့ရၧၭမိမၩၥံၫဘၪအၥၭလၧနၧၩလီၫ.- အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪလ့ၩလီၩဘၪထွံၪမံၩ့နီၪ,ယိခွါ, မုဆၫလနံၩ ဒဲကဲဂီၩလနံၩနီၪ, ယနၫ့ထၪ့ခွံၬဆၧနၪ ဒဲမၩဘျၪထဲၩ့ ဆၧဆၫတၭ,လၧၥၧၫ့နံၩလနံၩအဖၧၩ့နီၪ, ယမိလၧၫ့",
			"33": "<sup>33</sup> ထၪ့ဎွ့ၩထၪ့ယဝ့ၫလီၫ.- လၧနီၪအမ့ၬယၫဒံၭ, မုဆၫ လနံၩယီၩ,ဒဲကဲဂီၩဒဲကဲတဂီၩခိၬယီၩ, ယမိဘၪလ့ၩ ဆၧလီၫ.အဂဲးဘဲၫယီၩ လၧယရုစလံၫ့အချိၫ့လခီၫ နီၪ,မီၪလဂၩဘၪဆၧ ဂၭဂီၩ့ၥ့ၪနးဂၩအ့ၬ.",
			"34": "<sup>34</sup> ယရုစလံၫ့ဧ့,ယရုစလံၫ့ဧ့,နဝ့ၫဒၪယီၩနမၩၥံၫ မီၪလဖၪနီၪ, ဒဲၦလၧအဘၪဆၧအၪ့မၧၫ့လၩ့ဝ့ၫလၧန အီၪလဖၪနီၪ, နခွံၬအဝ့ၫၥံၪလၧလိးလီၫ. ဘဲၫဆၫ့မိၡါ ဒုၭအီၪကီၪ့အဖိၪလၧအဒံၭဖၫ့လၬအၥိၭနီၪ, ဆၧမိဒုၭ အီၪကီၪ့ဘၪယၥၭလၧနဖိၪအဘျၩ့ဆံၭအၪလဲၪ! အ့ၪ",
			"35": "<sup>35</sup> မွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪအၥၭအီၪအ့ၬ.- ယိခွါ,နၥံၪအ ဂံၪ့အီၪလၩ့ထးအီၪယူဝ့ၫလီၫ. ယစံၭနၥံၪတီၩတီၩ, နၥံၪလဒၪဘၪယၧၩ ထီးအမုအလၩဘၪလၧနၥံၪမိစံၭ, ၦလၧအဂဲၫလၧယွၩအမံၩ့နီၪ,မွဲအဘၪဆၧဆိၪဂ့ၩ ဝ့ၫဆံၭ,နီၪလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧမးၥံၫအနံၩ, ထီးအလ့ၩအၪ့ဆၧ လၧၦဖၫရစံၫ အခိၪလဂၩ အဂံၪ့ဖၧၩ့တၭ, ၦလဖၪနီၪ",
			"2": "<sup>2</sup> ယိၥူၪအဝ့ၫလီၫ.- ယိခွါ, ၦဆၫယိၭထံၫလဂၩ အီၪ",
			"3": "<sup>3</sup> လၧအမ့ၬယၫလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭၦၥ့ၪ လံၬ,ဒဲၦဖၫရစံၫၥံၪ, စံၭဝ့ၫ, ဆၧလၧမးၥံၫအနံၩနီၪမၩ ဘျၪထဲၩ့ဆၧဆၫဘၪမိဂ့ၩဧၪ. လဂ့ၩဘၪဧၪ. တၭအ",
			"4": "<sup>4</sup> ဝ့ၫၥံၪအီၪလၩ့မါပံၭလီၫ.- အဝ့ၫဒၪမၩန့ၦဆၫနီၪ, မၩ",
			"5": "<sup>5</sup> ဘျၪထဲၩ့ဝ့ၫတၭ, ကွဲၪဖျါထဲၩ့အဝ့ၫလီၫ.- ချဲၩ့ဆၧၫ့အ ဝ့ၫၥံၪတၭ, စံၭဝ့ၫ, ၦလၧနၥံၪအကျၩအကၥ့ၪယီၩ့မွဲဂ့ၩ, အချီမွဲဂ့ၩ,အ့ၪလၩ့ထ့ၬလၧဆၧဖၧၩ့လၧမးၥံၫအနံၩ, နီၪ,လထုၭထၪ့ထဲၩ့ဘၪဝ့ၫ ချဲၫ့မၬတၭ, မွဲပလၫလဂၩ",
			"6": "<sup>6</sup> လဲၪ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဝ့ၫလၧဆၧနီၪအဂဲးၥ့ၪအ့ၬ.",
			"7": "<sup>7</sup> ထီးအဒၪဘၪၦလၧဆၧကိၭဝ့ၫလဖၪ ရွံန့လးဆၧၫ့နၩ့ လၧအဂ့ၩထုၬ ဘဲၫအံၩဘဲၫအိၩတၭ, ချဲၩ့ဒီၩ့လၩ့ဆၧ",
			"8": "<sup>8</sup> တၭ,စံၭအဝ့ၫၥံၪ,- ထီးၦကိၭနၧၩလၧအမူၭဖၧၩ့တၭ, ဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧ လးဆၧၫ့နၩ့အဂ့ၩထုၬ အဖၫ့ခိၪလ ဂ့ၩ,ဘၪလဘၪၦလၧအဂ့ၩနဲၪ့နၧၩ မိဘၪဆၧကိၭလၧ",
			"9": "<sup>9</sup> အဝ့ၫနီၪတၭ,- ၦလၧအကိၭနၧၩ ဒဲအဝ့ၫဒၪလဂၩနီၪမိ ဂဲၫလၧနအီၪတၭ, မိလီၩဘၪနၧၩ, ဖ့ၪလၫ့ၦလဂၩယီၩ အလးဘီၪ. ထီးနီၪလဖၧၫ့နမ့ၬမိမဲတၭ, နမိဘၪလ့ၩ",
			"10": "<sup>10</sup> လၩ့လၧ အလးဖၨၪထုၬလီၫ.- အ့ၪမွဲထီးၦအ့ၪကိၭနၧၩ နီၪ, လ့ၩဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧအလးဖၨၪထုၬဘီၪ. ဘဲၫ ၥိၭၦလၧအကိၭနၧၩထီးအဂဲၫထီၩ့တၭ, မိစံၭနၧၩ, တ ခွၫဧ့,လ့ၩထၪ့လၧအလး ထီၫနဲၪ့အနီၪဘီၪ. ထီးနီၪလ ဖၧၫ့နလၩနဖၩ့ မိအီၪထၪ့လၧၦဆၧၫ့နၩ့ဎုၬလၧနၧၩအ",
			"11": "<sup>11</sup> မ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩၦလၧ အအီၪက့ၪထၪ့ထီၫ ဒၪအၥၭလဂၩလါလါနီၪ, မိဘၪဆၧဆၪ့လၩ့ဝ့ၫတၭ, ၦလၧအဆၪ့လၩ့ဒၪအၥၭနီၪ မိဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭအဝ့ၫဒၪစံၭ ၦလၧအကိၭဆၧလဂၩနီၪ, ထီးန အ့ၪမၩဆၧအၪ့လၧဂီၩမွဲဂ့ၩ,လၧဂၪမွဲဂ့ၩး နထံၩနၥိၭ မွဲဂ့ၩ,နဖုနဝဲမွဲဂ့ၩ,နဘူၭနထံၭမွဲဂ့ၩ, ၦၥထံၫလၧနနဲၩ့ ထံၭမွဲဂ့ၩ,နထီးကိၭအဝ့ၫၥံၪလဂ့ၩး အဝ့ၫၥံၪမိကိၭ",
			"13": "<sup>13</sup> ဆၧၫ့ဘၪခိၬနၧၩတၭ, မိဖ့ၪလၫ့ထဲၩ့နၧၩလီၫ.- အ့ၪမွဲန ဝ့ၫဒၪယီၩ, ထီးနအ့ၪမၩဆၧအၪ့ဆၧအီၩနီၪ, ကိၭၦအ ၡၪ့,ၦအဂၩ့ဂၭဂီၩ့, ၦအခၪ့ဂၭဂီၩ့, ၦအမ့ၬဘျီၪၥံၪနီၪ",
			"14": "<sup>14</sup> ဘီၪ.- နမိဘၪဆၧဆိၪဂ့ၩလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ ဖ့ၪလၫ့ထဲၩ့နၧၩၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩ ထီးၦအတီၩ အလီၩ့ဂဲထုၪ့ထဲၩ့တၭ, ဆၧမိဖ့ၪလၫ့ထဲၩ့နၧၩလီၫ.",
			"15": "<sup>15</sup> ၦအီၪလၧၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဎုၬ လၧစပွဲထံၭအကျၩလ ဂၩ,နါဂၧၫ့ဆၧလဖၪနီၪ, စံၭအဝ့ၫဒၪ, ၦလၧအမိအၪ့ ဘၪဆၧလၧယွၩအဘၩ့အမုးအဖၧၩ့နီၪအီၪမုၬဝ့ၫဒၪ",
			"16": "<sup>16</sup> လီၫ.- အဝ့ၫဒၪစံၭဝ့ၫ ၦလဂၩမၩဆၧအၪ့ဖၭဒိၪလၧဂၪ",
			"17": "<sup>17</sup> လခီၫတၭ ကိၭၦအၪဂၩလီၫ.- ထီးအၪ့ဆၧအနၩရံၩ ဘၪနီၪမွဲအအၪ့မၧၫ့အဎီးအၡၩ လ့ၩလၧၦဘၪဆၧ ကိၭဝဲၩဝ့ၫလဖၪအအီၪနီၪ, စံၭအဝ့ၫၥံၪ, ဂဲၫဘီၪးအဂဲး ဘဲၫယီၩဆၧထီးအလူၬအီၪတဲၩ့ဝဲၩယူၭအၥၭယူၭ.",
			"18": "<sup>18</sup> ၦလဖၪနီၪကိၭဂၩဒ့ၭ လၧအၥၭလဖျိၪ့ဎးနီၪ, ချဲၩ့ဖီၩ့ ဖျ့ၭလၩ့အၥၭလီၫ. အဝံခိၪလဂၩ,စံၭအဝ့ၫဒၪ, ယ ဝ့ၫဒၪယီၩယဎွ့ၩယူၭဂၪ့ခိၪလဝၩ့ယူၭ, ယမိလ့ၩယိဝ့ၫ လီၫ.ယအၪ့ကံၩ့အၪ့ယၫနၧၩ ကွဲၪဖျါလါယၧၩဘီၪ.",
			"19": "<sup>19</sup> အဝ့ၫလဂၩဒၪစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ ယဎွ့ၩယူၭချီဖၫယဲ ခိၪယူၭ, ယဘၪလ့ၩမၩခွါ အဝ့ၫၥံၪလီၫ. ယအၪ့ကံၩ့",
			"20": "<sup>20</sup> အၪ့ယၫနၧၩကွဲၪဖျါလါယၧၩဘီၪ.- အလဂၩဒၪနီၪ, စံၭ ဝ့ၫ, ယဝ့ၫဒၪယီၩယန့မၫယူၭး မၩအၥၭဘဲၫနီၪတၭ, ယလ့ၩၥ့ၪအ့ၬ.",
			"21": "<sup>21</sup> အဎီးအၡၩနီၪဂဲၫထဲၩ့လၧ အကဆါအအီၪတၭ, လီၩထဲၩ့ဆၧနီၪလဖၪလီၫ. ထီးနီၪလဖၧၫ့ဂံၪ့ကဆါအ ၥၭခိထၪ့တၭ, စံၭအဎီးအၡၩ, လ့ၩချဲၫ့ချဲၫ့လၧဖၧၩ့ ၥၭဖၭဒိၪ,ဒဲဖၧၩ့ၥၭဖိၪလၧဒိၩ့ဖၧၩ့တၭ,ၦအၡၪ့,ဒဲၦအ ဂၩ့ဂၭဂီၩ့,ဒဲၦအခၪ့ဂၭဂီၩ့, ဒဲၦအမ့ၬဘျီၪၥံၪနီၪဂဲၫမီၩ့နုၬ",
			"22": "<sup>22</sup> ထီးယီၩဘီၪ.- ဆၧအဎီးအၡၩစံၭဝ့ၫ, ကဆါဧ့, ဘဲၫ နမၪလူၬဆၧအၥိၭနီၪ, ဆၧမၩယူၭအၥၭယူၭတၭ, အ",
			"23": "<sup>23</sup> လးအီၪဒံၭလီၫ.- ကဆါလီၩဘၪအဎီးအၡၩ, လ့ၩ ထၪ့လၧဖၧၩ့မု ဒဲဖၧၩ့ၥၭၥံၪတၭ, ဒုၭဂဲၫနုၬဆီၪ့ဝ့ၫ ဘဲၫ",
			"24": "<sup>24</sup> ၥိၭယဂံၪ့မိဎွ့ၩထၪ့ဘီၪ.-အဂဲးဘဲၫယီၩယလီၩဘၪ နၥံၪ,ၦလၧအဘၪဆၧကိၭဝဲၩယူၭလဖၪနီၪ, မိထဲးယိ ဘၪဆၧအၪ့နးဂၩအ့ၬ.",
			"25": "<sup>25</sup> ၦခမျၧးဖၭဒိၪဖိၬထၪ့အခဲၫ့တၭ, အဝ့ၫဒၪကၠၪစိၩအ",
			"26": "<sup>26</sup> ၥၭ,စံၭအဝ့ၫၥံၪ,- ၦလဂၩဂၩအ့ၪဂဲၫထဲၩ့လၧယအီၪ တၭ,လၥၭဂဲၫ့ဘၪအမိ,ဒဲအဖါ,ဒဲအဖိၪအမၫ,ဒဲအ ဖိၪအလံၩ, ဒဲအထၧၫ့ဖုဝဲမုၪ,ဒဲအထၧၫ့ဖုဝဲခွၫ, ဒဲအၥုၪ့ အၥၭဒၪဝ့ၫဆ့တၭ, ကဲၪထၪ့ယထံၩယဖျဲၥ့ၪအ့ၬ.",
			"27": "<sup>27</sup> ၦလၧအလယိၭဘၪအထုၪ့စူၪယၫတၭး လဖိၬဘၪ",
			"28": "<sup>28</sup> ယခဲၫ့နီၪ, ကဲၪထၪ့ယထံၩယဖျဲၥ့ၪအ့ၬ.- အဂဲးဘဲၫယီၩ ၦလၧနၥံၪအကျၩ မိမၩထၪ့ဂံၪ့ဖၭဒိၪတၭ, အဆၧမိ လၧၫ့လလၧၫ့ဘၪနီၪ, အ့ၪလဆၧၫ့နၩ့တွၭယိဆိၫဒၪ",
			"29": "<sup>29</sup> ခလူၬဝ့ၫမွဲပလၫလဂၩလဲၪ.- အ့ၪလမွဲဘၪဘဲၫနီၪ, မၩ ထၪ့အခၪ့ထံၭတၭ, မၩဝ့ၫထီးအဂီၩ့လၥ့ၪဘၪနီၪ, ၦဒၪ ဘၪဆၧလဖၪကိၭဂၩဒ့ၭ မိဒုၪဒွ့ၪဘၪခိၬအဝ့ၫတၭ, မိ",
			"30": "<sup>30</sup> စံၭဝ့ၫ,- ၦလဂၩယီၩ, မၩထၪ့ဂံၪ့အခၪ့ထံၭတၭ,မၩ ဝ့ၫထီးအဂီၩ့ၥ့ၪအ့ၬ.",
			"31": "<sup>31</sup> စဎွၩလဂၩမိလ့ၩဒုၭစဎွၩအဂူၫဂၩလဂၩတၭ, လၧ ၦလလၬနီၪ, မွဲအမၩနၧၩ့မၩစၪ ၦဂဲၫထၪ့ထၫ့ဒုၪဒၩဝ့ၫ လၧၦနံၫလၬမိၥ့ၪဧၪ,လၥ့ၪဘၪလဲၪနီၪ, လဆၧၫ့နၩ့",
			"32": "<sup>32</sup> ဆီၫ့မီၪ့ဆိၫဘၪဝ့ၫတၭ,မွဲပလၫလဂၩလဲၪ.- အ့ၪလၥ့ၪ ဘၪတၭ, အဝ့ၫလဂၩအီၪယဲၩ့ဒံၭအဘိၩ့ဘၭနီၪ,မိအၪ့ မၧၫ့လၩ့ၦၥၭၡါတၭ, အၪ့ကံၩ့မၩဘၪလိၬထဲၩ့ဆၧလီၫ.",
			"33": "<sup>33</sup> ဘဲၫနီၪအၥိၭ ၦလဂၩဂၩလၧနၥံၪအကျၩယီၩ,အ့ၪ လခွံၬၡိၭခွံၬဘၪ အဆၧထီးအလူၬတၭ, ကဲၪထၪ့ယ ထံၩယဖျဲၥ့ၪအ့ၬ.",
			"34": "<sup>34</sup> ထံၫလၪမွဲဆၧဂ့ၩလီၫ. မွဲလါနၫ့တၭ,အဂၫ့အ့ၪ ဘျိၪခွံၬတၭ, မွဲအမိဂၫ့ထဲၩ့ဝ့ၫလၧ ဆၧနီၪလမံၩ့လဲၪ.",
			"35": "<sup>35</sup> လၧဂၪ့ခိၪအဂးမွဲဂ့ၩ, လၧဆၧဘံၪၥိၭဘွဲၪဆၧအဂး မွဲဂ့ၩ,ဂ့ၩအ့ၬ. ၦခွံၬၡိၭခွံၬဝ့ၫလၧခီၫ့လီၫ. ၦအီၪလၧ အနါလၧအနါဂၧၫ့ဆၧနီၪ, မွဲအနါဂၧၫ့ဒၪဝ့ၫဆံၭ."
		},
		"15": {
			"1": "<sup>1</sup> ၦအၪ့ကံၩ့အခီၫ့, ဒဲၦဆၧဒဲၩဘၭဖိၪထီးအလူၬနီၪ, ဘဲၫၥိၭအမိနါဂၧၫ့ဘၪဆၧတၭ, ၥုၭဘူၭအၥၭလၧအ",
			"2": "<sup>2</sup> အီၪလီၫ.- ၦဖၫရစံၫ, ဒဲၦကွ့ၭလံၬၥံၪၥူၭဝံၥူၭလၩဆၧတၭ, စံၭဝ့ၫ ၦလဂၩယီၩထိးဆၧၫ့ၦဆၧဒဲၩဘၭဖိၪ, ဒဲ အၪ့ဎုၬဆၧလၧအဝ့ၫၥံၪအၥိၭလီၫ. အဝ့ၫဒၪချဲၩ့ဒီၩ့လၩ့ဆၧလမံၩ့ယီၩ, စံၭဝ့ၫ,",
			"3": "<sup>3</sup> ၦလၧ နၥံၪအကျၩလၧအအီၪလၧအၥိၪလယၩနီၪ အ့ၪလၩ့ မါလဒုၩတၭ, လအီၪက့ၪလၩ့ထးဘၪဝ့ၫ ခွံၫဆံၫခွံၫဒုၩ လၧမံၩ့လၬကျၩတၭ, လလ့ၩအၪ့ဎၬဘၪလၧအလၩ့မါ",
			"5": "<sup>5</sup> လဒုၩထီးအဒၪန့ထဲၩ့ဝ့ၫနီၪ, မွဲပလၫလဂၩလဲၪ.- အ့ၪ ဒၪန့ထဲၩ့ဝ့ၫနီၪ, အၥုၪ့ထိၬအၥၭထိၬတၭ, အီၪက့ၪထၪ့",
			"6": "<sup>6</sup> ဝ့ၫလၧအခိၬထံၭခိၪ,- ဂဲၫထဲၩ့ဝ့ၫထီၩ့ လၧအဂံၪ့နီၪ, ကိၭကီၪ့အထံၩအၥိၭ, ဒဲၦအီၪလၧအနဲၩ့ထံၭလဖၪ တၭ,လီၩဘၪအဝ့ၫၥံၪ, စံၭဝ့ၫ, ၥၭထိၬဎုၬလၧယၥိၭ ဘီၪ.အဂဲးဘဲၫယီၩ ယၥိၪလၧအလၩ့မါ လဒုၩနီၪ,",
			"7": "<sup>7</sup> ယဒၪန့ထဲၩ့ယူၭအဝ့ၫယူၭ.- ယလီၩဘၪနၥံၪဘဲၫနီၪ အၥိၭ,ၦဆၧဒဲၩဘၭဖိၪလဂၩ လၧအနီၫ့ယါလၩ့ထဲၩ့ အၥၭနီၪ,ၦမူၭခိၪဖိၪၥၭထိၬ လၧအကၠီၩ့အၪနဲၪ့ဒံၭလၧ ၦအတီၩ ခွံၫဆံၫခွံၫဂၩ လၧအနီၫ့ယါလၩ့ထဲၩ့အၥၭ အလးလအီၪဘၪလဖၪအကၠီၩ့ဒံၭလီၫ.",
			"8": "<sup>8</sup> ၦမုၪလဂၩအီၪလၧစ့ၩဆံၫဘံၪ့တၭ, အ့ၪလၩ့မါခွံၬ နးဘံၪ့နီၪ, လစီၩ့ထၪ့ဘၪမ့ၪဒိၩ့တၭ, လဝ့ၬဘၪဝ့ၫလၧ အဂံၪ့ထၧၫ့ဖျိၪ့ယၫ, ဒဲအၪ့ဎၬလၩ့ထံးလၩ့ဆ့ၭ ထီးအ",
			"9": "<sup>9</sup> ဒၪန့ထဲၩ့ဝ့ၫနီၪ,မွဲၦလၫလဂၩလဲၪ.- ထီးအဒၪန့ထဲၩ့ဝ့ၫ နီၪကိၭကီၪ့အထံၩအၥိၭ, ဒဲၦအီၪလၧအနဲၩ့ထံၭလဖၪ တၭစံၭဝ့ၫ, ၥၭထိၬဎုၬလၧယၥိၭဘီၪ. အဂဲးဘဲၫယီၩ",
			"10": "<sup>10</sup> ယစ့ၩလၧအလၩ့မါလဘံၪ့နီၪ, ယဒၪန့ထဲၩ့ယူၭ.- ဘဲၫ နီၪအၥိၭယစံၭနၥံၪ, ၦဆၧဒဲၩဘၭဖိၪလဂၩ လၧအနီၫ့ ယါလၩ့ထဲၩ့အၥၭအကၠီၩ့နီၪ, ဆၧၥၭထိၬအီၪထၪ့ဝ့ၫ လၧယွၩအၥီၫ့လဖၪအမ့ၬယၫလီၫ.",
			"11": "<sup>11</sup> တၭအဝ့ၫဒၪ စံၭၦလဂၩ အဖိၪခွၫအီၪနံၫဂၩလီၫ.",
			"12": "<sup>12</sup> အဖိၪခွၫဒၪဘၨၩလဂၩ လ့ၩလၧအဖါအအီၪတၭ, စံၭ ဝ့ၫ,ဖါဧ့, ဆၧဖိၪဆၧလံၩလၧနမိဖ့ၪၥၫလဖၪနီၪအၪ့နၩ့ ဖၭအဆၧၫ့တၭ, ဖ့ၪလၫ့ယၧၩဘီၪ. အဝ့ၫနီၪအၪ့နၩ့",
			"13": "<sup>13</sup> ဖၭအဆၧဖိၪဆၧလံၩတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလီၫ.- လ အၪနံၩအၪၥၫ့ဘၪတၭ, အဖိၪခွၫဒၪဘၨၩအီၪက့ၪကီၪ့ န့အစူၪလးအခၪ့ခိၪ ထီးအလူၬတၭ, လ့ၩဝ့ၫထီၩ့လၧ ထံၫယဲၩ့ခးယဲၩ့လီၫ. အၪ့ဂီၩ့ခွံၬအစူၪလးအခၪ့ခိၪ ထီး",
			"14": "<sup>14</sup> နီၪလၧဆၧလၨၪဖၬအဖၧၩ့လီၫ.- အၪ့ဂီၩ့ကယဲအဆၧ ထီးအလူၬနီၪ, ဆၧၥၭဝံလၩ့ဒိၩဖၭဒိၪ အီၪထၪ့လၧခး လဘံၪ့နီၪအဖၧၩ့တၭ, အဝ့ၫဘၪၡၪ့ဘၪယၬဝ့ၫဒၪ",
			"15": "<sup>15</sup> လီၫ.- လ့ၩအီၪဝ့ၫလၧၦခးဖိၪလဂၩအၥိၭတၭ, အဝ့ၫ ဒၪအၪ့မၧၫ့အလ့ၩ ယိထိၭလဖၪလၧမံၩ့လၬကျၩလီၫ.",
			"16": "<sup>16</sup> ဆၧမိအၪ့ဘၪအၥၭလၧၥံၪ့ကၩရိၬအၥၪလၧထိၭအၪ့",
			"17": "<sup>17</sup> ဝ့ၫနီၪ,ဆၧဖ့ၪဒုၭအၪ့ဘၪနးဂၩအ့ၬ.- အဝ့ၫဒၪနၪ့လၩ့ ထဲၩ့အၥၭတၭ, စံၭဝ့ၫ, ယဖါအဎီးအၡၩဒိၭအၪ့လံၩ့ အၥၭလၧအအၪ့ကုၭ အီၩဎွ့ၩလဖၪ အီၪဎွ့ဂၩဎွ့ဂၩ လဲၪနီၪးယဝ့ၫဒၪယီၩယအီၪဝံအီၪဆံၩ့တၭ, ယမိၥံၫမၬ",
			"18": "<sup>18</sup> ထီးယီၩလီၫ.- ယမိဂဲထုၪ့ထဲၩ့ထဲၩ့လၧယဖါအအီၪ တၭ, ယမိလီၩဘၪအဝ့ၫ, ဖါဧ့, ယမၩမၪဘၪယူၭမူၭ",
			"19": "<sup>19</sup> ခိၪယူၭ. ယမၩမၪဆၧလၧနမ့ၬယၫယူၭ.- ၦကိၭယၧၩ လၧနဖိၪခွၫနီၪ ယကြၨၭလၧၩ့အ့ၬ, အီၪက့ၪယၧၩဘဲၫ နဎီးနၡၩဒိၭအၪ့လံၩ့အၥၭလဂၩအၥိၭဘီၪ.",
			"20": "<sup>20</sup> အဝ့ၫဒၪဂဲထုၪ့ထဲၩ့ထဲၩ့ဝ့ၫလၧအဖါအအီၪတၭ, အီၪ ဒံၭဆီၩ့ဆုၩယဲၩ့ယိၬနီၪ, အဖါဒၪဘၪယၫ့ၥၭဝ့ၫတၭ,",
			"21": "<sup>21</sup> လ့ၩစဲၪ့တလဲးဖိၭဝ့ၫအခိၬ, ဒဲအဲၪဂါဝ့ၫလီၫ.- တၭအဖိၪ ခွၫစံၭအဝ့ၫ,ဖါဧ့, ယမၩမၪဘၪယူၭမူၭခိၪယူၭ, ဒဲယ မၩမၪဆၧလၧနမ့ၬယၫယူၭ, ၦကိၭယၧၩလၧနဖိၪခွၫ",
			"22": "<sup>22</sup> ကြၨၭလၧၩ့အ့ၬ.- တၭအဖါစံၭအဎီးအၡၩ, ဂဲၫဆိၬ စိၩဆၧကီၩ့ဆၧၥိၭလၧအဂ့ၩထုၬနီၪ, ဒုၭကီၩ့ဒုၭၥိၭ အဝ့ၫဆံၭ.ဖ့ၪလၫ့စူၪၥံၭလၧအစူၪအဂး, ဒဲခၪ့ဖံၭလၧ",
			"23": "<sup>23</sup> အခၪ့အဂးဘီၪ.- ချီဖိၪလၧအဘီၪနီၪဂဲၫဆိၬမၩၥံၫဘီၪ.",
			"24": "<sup>24</sup> အၪ့ဆၧတၭမုၬလၩၡီၩ့ဘီၪ.- အဂဲးဘဲၫယီၩ ယဖိၪခွၫ လၧအၥံၫယူၭလဂၩယီၩ, မၧၫ့ထၪ့ထဲၩ့ဒီၭဝ့ၫတၭ, လၩ့မါဝ့ၫနီၪ ဆၧဒၪန့ထဲၩ့ဒီၭအဝ့ၫယူၭ. အဝ့ၫၥံၪမုၬ လၩဝ့ၫလီၫ.",
			"25": "<sup>25</sup> အဖိၪခွၫဝဲၡါလဂၩအီၪလၧဆံၬဖၧၩ့နီၪ, ဂဲၫထဲၩ့ဘူၭ လၧဂံၪ့တၭ, နါဂၧၫ့ဆၧဖိၬဒိၩ့,အူၪပံၩ,ဒဲဆၧဂဲထုၪ့",
			"26": "<sup>26</sup> လံနီၪ,- ကိၭန့ဆၧအဎီးအၡၩလဂၩတၭ, အၪ့စၪ့ဝ့ၫ,",
			"27": "<sup>27</sup> ဆၧယီၩမွဲဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫဒၪစံၭအဝ့ၫ, နဖုဂဲၫ ထဲၩ့ထီၩ့ယူၭ. နဖါမၩၥံၫယူၭချီဖိၪလၧအဘီၪယူၭ.အ ဂဲးဘဲၫယီၩ မွဲအန့ထဲၩ့အဝ့ၫဒၪ လၧအအီၪဆီၪ့အီၪချဲၫ့",
			"28": "<sup>28</sup> ဝ့ၫလီၫ.- အဝ့ၫဒၪအၥၭထၪ့တၭ,လ့ၩနုၬဝ့ၫအ့ၬ. အ",
			"29": "<sup>29</sup> ဖါဂဲၫစဲၪ့လၩ့တၭ, အၪ့ယၫဝ့ၫလီၫ.- အဝ့ၫနီၪချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭအဖါ,ယိခွါ,ယမၩနဆၧအၪနံၪ့အၪလၩ ယူၭ.နဆၧမၪလူၬနီၪ, ယလၨၪခၫ့ဖၬနးဆိၭအ့ၬ. ဘဲၫၥိၭယမိမုၬလၩဆၧ လၧယထံၩယၥိၭနီၪးန့ၫဘ့ၪ",
			"30": "<sup>30</sup> ဖိၪလဒုၩနီၪ,နဖ့ၪလၫ့ယၧၩနးဆိၭအ့ၬ.- မွဲလါနၫ့ဘိၩ, ထီးနဖိၪခွၫလၧအအၪ့ဂီၩ့နစူၪလးနခၪ့ခိၪ, လၧၦမဲၩ ဎွဲၩမုၪအကျၩလဂၩယီၩ ဂဲၫထဲၩ့တၭနမၩၥံၫချီဖိၪအ",
			"31": "<sup>31</sup> ဘီၪ့လၧအဂးမၬကၨ.- အဝ့ၫဒၪစံၭအဝ့ၫ, ဖိၪခွၫဧ့, နအီၪလၧယၥိၭလထံၪဎးတၭ, ယစူၪလးယခၪ့ခိၪမွဲန",
			"32": "<sup>32</sup> ဆၧထီးအလူၬလီၫ.- မွဲလါနၫ့ဘိၩ,နဖုလၧအၥံၫယူၭ လဂၩနီၪ, မၧၫ့ထၪ့ထဲၩ့ဒီၭဝ့ၫတၭ, လၩ့မါဝ့ၫနီၪ,ဆၧဒၪ န့ထဲၩ့ဒီၭဝ့ၫယူၭ. အခိးမွဲကြၨၭလၧပၥၭထိၬဒဲမုၬ လၩပဝ့ၫဆ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> အဝ့ၫစံၭအထံၩအဖျဲၥံၪ, ၦၥထံၫလဂၩအီၪလၧၦ ယိအဆၧလဂၩတၭ, ၦအီၪက့ၪဆၧမၪလၧအလီၩ့ လၧ",
			"2": "<sup>2</sup> အမၩလူၬဂီၩ့ အစူၪလးအခၪ့ခိၪလီၫ.- မွဲအကိၭထဲၩ့ အဝ့ၫတၭစံၭဝ့ၫ, ယနါဂၧၫ့ဆၧလၧနဂဲးနကၠီၪ့ယီၩ, မွဲ ဆၧနီၪလမံၩ့လဲၪ. ဖ့ၪလၫ့နယိဆၧအဆရၫ့ဘီၪ. အ",
			"3": "<sup>3</sup> ဂဲးဘဲၫယီၩ နကဲၪဘၪလၧၩ့ၦယိဆၧအ့ၬ.- ၦယိဆၧနီၪ စံၭလၩ့အၥၭ, မွဲယမိမၩဘဲၫၥ့ၪလဲၪ, အဂဲးဘဲၫယီၩက ဆါမိမၩလၩ့ထ့ၬခွံၬယမံၩ့ လၧၦယိဆၧအလးလီၫ. ယခုၪ့ဆၧကဲၪအ့ၬ, ယအၪ့ကံၩ့ဆၧနီၪ ယမ့ၬမဲလီၫ.",
			"4": "<sup>4</sup> ထီးဆၧအ့ၪနၫ့ထၪ့ခွံၬယၧၩ လၧၦယိဆၧအလးဘဲၫၥိၭ ၦၡၩၥံၪမိထိးဆၧၫ့ယၧၩ လၧအဂံၪ့ဖၧၩ့တၭ, ယမိမၩ",
			"5": "<sup>5</sup> ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ ယစ့ၩရၫ့ဝဲၩယူၭလီၫ.- တၭ အဝ့ၫဒၪကိၭ ၦလၧအဒ့ၪအမါအီၪလၧအကဆါအစူၪ ဖၧၩ့လဂၩဘၪလဂၩ လဂၩဘၪလဂၩတၭ, စံၭအခၪ့ ထံၭလဂၩ, နဒ့ၪနမါလၧနဘၪလိၭထဲၩ့ယကဆါနီၪ,မွဲ",
			"6": "<sup>6</sup> အဆံၭအၪလဲၪ.- အဝ့ၫဒၪစံၭဝ့ၫ, ၥိၪအဘၭၥၫလယၩ လီၫ.အဝ့ၫဒၪစံၭ, မၩန့နလံၬတၭ, ဆၧၫ့နၩ့ကွ့ၭလၩ့ယဲ",
			"7": "<sup>7</sup> ဆံၫချဲၫ့ချဲၫ့ဘီၪ.- ထီးနီၪလဖၧၫ့စံၭအဂူၫဂၩလဂၩနဒ့ၪ နမါဆံၭအၪလဲၪ. တၭအဝ့ၫဒၪစံၭ ဘုၪကၠိၩ့အကိရၫလ ယၩလီၫ. တၭစံၭအဝ့ၫဒၪ, မၩန့နလံၬနီၪကွ့ၭလၩ့ဎိၭ",
			"8": "<sup>8</sup> ဆံၫဘီၪ.- အကဆါအၪ့အူၭထၪ့ ၦယိဆၧလၧအလ တီၩလလီၩ့ဘၪလဂၩလီၫ. အဂဲးဘဲၫယီၩမွဲအမၩဆၧ လၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪလီၫ. အဂဲးဘဲၫယီၩ ၦလဆိၩ လကၠၪယီၩ အဖိၪအီၪလၧအဆိၩဒၪဝ့ၫအကျၩနီၪ, အ",
			"9": "<sup>9</sup> ကိၪ့ၥ့ၪကိၪ့ဘၪဂ့ၩနဲၪ့ၦဆၧဖၩ့ဖိၪဒံၭလီၫ.- ယစံၭန ၥံၪ,ဒုၭကဲၪထၪ့ နၥံၪအထံၩအၥိၭလဖၪလၧမၫမၧၫ့လ တီၩဘၪအကၠီၩ့နီၪ, ဘဲၫၥိၭထီးဆၧနီၪအ့ၪလူၬတၭ,အ ဝ့ၫၥံၪမိထိးဆၧၫ့နၥံၪလၧဂံၪ့ၥံၪ လၩ့ဆိၩလၩ့ကၠၪနီၪ",
			"10": "<sup>10</sup> ဆံၭ.- ၦလၧအမၩတီၩဝ့ၫလၧဆၧအၡၩထုၬနီၪ,မိ မၩတီၩဝ့ၫလၧဆၧအအၪဆ့လီၫ. ၦလၧအမၩလတီၩ ဘၪလၧဆၧအၡၩထုၬနီၪ, မိမၩဝ့ၫလၧအလတီၩဘၪ",
			"11": "<sup>11</sup> လၧဆၧအအၪဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, မၫမၧၫ့ လတီၩဘၪနီၪး နၥံၪအ့ၪလမၩဘၪလၧအတီၩတၭ, မွဲပ လၫမိဖ့ၪလၫ့နၥံၪ အဎၧၩ့အဎီ လၧအတီၩအလီၩ့လဂၩ",
			"12": "<sup>12</sup> လဲၪ.- ၦဂူၫဂၩအဆၧနီၪ, နၥံၪအ့ၪလမၩဘၪလၧအတီၩ တၭ, မွဲပလၫမိဖ့ၪလၫ့နၥံၪလၧနၥံၪအဆၧဒၪနၥံၪဝ့ၫလ",
			"13": "<sup>13</sup> ဂၩလဲၪ.- ဆၧလၧအဎီးအၡၩယီၩ,ကဆါနံၫဂၩအဆၧ မၩနီၪ, မၩဝ့ၫဎွ့ၩထၪ့နးဂၩအ့ၬ. မိမ့ၬလဲၩဝ့ၫနးဂၩ တၭ,မိအဲၪဝ့ၫနးဂၩလီၫ. အ့ၪလမွဲဘၪတၭ, မိမၩဆၧၩ့ ဝ့ၫနးဂၩ,မိမၩကြၩ့ထမးဝ့ၫနးဂၩလီၫ. ယွၩအဆၧမၩ, ဒဲမၫမၧၫ့အဆၧမၩနီၪ, နၥံၪမၩၥ့ၪအ့ၬ.",
			"14": "<sup>14</sup> ၦဖၫရစံၫလၧအၥၭကွံၩစ့ၩလဖၪနီၪ,နါဂၧၫ့ဆၧနီၪ",
			"15": "<sup>15</sup> လဖၪထီးအလူၬတၭး ဒုၪဒွ့ၪအဝ့ၫလီၫ.- တၭအဝ့ၫဒၪ စံၭအဝ့ၫၥံၪ, နၥံၪဝ့ၫဒၪယီၩ, နၥံၪမွဲၦလၧအအီၪက့ၪ တီၩအၥၭလၧၦၡၩအမ့ၬယၫလီၫ.မွဲလါနၫ့ဘိၩယွၩၥ့ၪ ယၫနၥံၪအၥၭလီၫ. အဂဲးဘဲၫယီၩဆၧလၧၦၡၩအီၪက့ၪ လၧဆၧၥၭကွံၩနီၪမွဲဆၧစံၪစၪလၧယွၩအမ့ၬယၫလီၫ.",
			"16": "<sup>16</sup> ဆၧမၪလူၬ, ဒဲမီၪၥံၪအီၪဝ့ၫထီၩ့လၩ့လၧစယီဟၫ့ လဂၩနီၪလီၫ. လၧနီၪအလးခဲၫတၭ, ဆၧလီၩလၩ့လၬ လၩ့ယွၩအဘၩ့အမုး အဆၧၥၭထိၬအပရၧၫ့တၭ, ၦ",
			"17": "<sup>17</sup> နုၬဆီၪ့ဝ့ၫလၧ အဖၧၩ့ကိၭဂၩဒ့ၭလီၫ.- ဂၪ့ခိၪဒဲမူၭခိၪ ဒံၩခွံၬဒံၩဖျိၭ ယီၫနဲၪ့လံၬဆၧမၪလူၬအဖျိၪ့ လနိၪ့ဖိၪ မိဂၭဂီၩ့ဒံၭလီၫ.",
			"18": "<sup>18</sup> ၦလၧအခွံၬၡိၭခွံၬ အမၫတၭ, အီၪဎုၬဝ့ၫလၧအ ဂူၫဂၩလဂၩလါလါနီၪ, အဲၪဘိၩ့အမၫလီၫ. ဒဲၦလၧ အအီၪဎုၬ လၧၦလၧအဝၩခွံၬၡိၭဝ့ၫ လဂၩလါလါနီၪ, အဝ့ၫဒၪမၩမၪၦအမၫလီၫ.",
			"19": "<sup>19</sup> ၦၥထံၫအီၪဝ့ၫလဂၩတၭ, ကီၩ့ၥိၭဝ့ၫလၧဆၧဝီၩလုၭဖုၭ, ဒဲဆၧဘွၩဖျ့ၫလံၬကံၭတၭ, မုၬလၩဝ့ၫလၧဆၧအၪ့",
			"20": "<sup>20</sup> လၨၪအီၩလၨၪ ကိၭမုနံၩမုနၩဒ့ၭဒိၪမၬလီၫ.- တၭၦၡၪ့ ဖိၪဘၪဆၧဆၫ အီၪဝ့ၫလၧအဖၧၩ့လး ထၧၫ့ဂၩယၫ, အမံၩ့မွဲစလၭဇရၧၭလဂၩနီၪ, ၦအီၪက့ၪလၩ့အဝ့ၫလၧ",
			"21": "<sup>21</sup> အဝ့ၫနီၪအဖၧၩ့ၥၭအတရၫ့အခၪ့ထံၭလီၫ.- တၭဆၧမိ အၪ့ဘၪအၥၭ လၧၦၥထံၫအၪ့ဆၧအလၩ့ဎွံၪ လၧစပွဲ ထံၭနီၪး ထွံၪလဖၪဂဲၫအၪ့လဲၪ့အဆၧဆၫ အဖၧၩ့လး",
			"22": "<sup>22</sup> ၥံၪလီၫ.- ဆၧမၩအၥၭလၧၦၡၪ့ဖိၪနီၪၥံၫဝ့ၫတၭ,ဆၧအ ၥီၫ့ၥံၪဆိၬထၪ့ထဲၩ့အဝ့ၫ လၧစအၫဘြဟၫ့အၥၭနၫ ၡါအလီၩ့လီၫ. ၦၥထံၫလဂၩနီၪၥံၫဝ့ၫဒၪဆ့တၭ,",
			"23": "<sup>23</sup> ဘၪဆၧခုၪ့လၩ့ဘၧၩ့ဝ့ၫလီၫ.- လၧဖျႃဖၧၩ့နီၪဘၪဆၧၡၪ့ နၭနၭလ့ၬတၭ, စၪ့ထၪ့အမ့ၬၥၪ လၧဖျႃဖၧၩ့တၭ,ဒၪ ဘၪစအၫဘြဟၫ့, ဒဲစလၭဇရၧၭ အီၪလၧအၥၭနၫၡါ",
			"24": "<sup>24</sup> အလီၩ့လီၫ.- အဝ့ၫဒၪကိၭထၪ့ဆၧတၭ,စံၭဝ့ၫ, ဖါအၫ ဘြဟၫ့ဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါယၧၩဆံၭ. အၪ့မၧၫ့စလၭ ဇရၧၭဘၧၩ့လၩ့အစူၪနိၩ့ထိၭနၫ လၧထံၫကျၩတၭ,ဂဲၫ မၩၡုၪလၩ့ယဖျ့ၩဆံၭ. အဂဲးဘဲၫယီၩ ယဘၪဆၧနၭ",
			"25": "<sup>25</sup> ဆၧၡၪ့လၧမ့ၪခဲၩအဖၧၩ့ယီၩလီၫ.- စအၫဘြဟၫ့, စံၭဝ့ၫ,ဖိၪခွၫဧ့, လၧနမၧၫ့ဒံၭအဆၧၫ့အထီ နဒိၭန့နဆၧ ဂ့ၩလဖၪတၭ, စလၭဇရၧၭဘၪလၧဆၧအၧၩ့လဖၪ နီၪ,နၪ့ထၪ့ထဲၩ့နဝ့ၫဆံၭ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, အဝ့ၫဒၪ လဂၩအီၪမုၬဘၪယူၭဝ့ၫယူၭ. တၭနဝ့ၫဒၪ နဘၪဆၧနၭ",
			"26": "<sup>26</sup> ဆၧၡၪ့ယူၭလီၫ.- လၧဆၧယီၩထီးအလူၬ အမ့ၬယၫ, လၧပၧၩဒဲနၥံၪအဘိၩ့ဆၧၩ့နီၪ, ဆၧအီၪက့ၪထၬထိၩ့ဖၭ ဒိၪလဘီၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦအီၪထီးယီၩ လဖၪဆၧအ့ၪမိလ့ၩစိၩဘၪအၥၭ လၧနၥံၪအအီၪနီၪ, လ့ၩဖိးအ့ၬ. ဒဲၦလၧနၥံၪအအီၪလခီၫနီၪ, ဆၧအ့ၪမိ ဂဲၫဘၪအၥၭလၧပအီၪလခီၫယီၩတၭ, ဂဲၫဖိးဆ့အ့ၬ.",
			"27": "<sup>27</sup> အဝ့ၫဒၪစံၭဝ့ၫ, ဖါဧ့, အ့ၪမွဲဘဲၫနီၪတၭ, ယအၪ့ကံၩ့အၪ့ ယၫနၧၩ လၧနမိအၪ့မၧၫ့အလ့ၩ လၧယဖါအဂံၪ့လီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩ ယထၧၫ့ဖုဝဲခွၫအီၪယဲဂၩ, ဘဲၫၥိၭအမိ ၥီၪ့ထဲၩ့အဝ့ၫၥံၪ, ဘဲၫၥိၭအထီၩ့ဂဲၫဘၪလၧ ဆၧၡၪ့ဆၧ",
			"29": "<sup>29</sup> နၭဖၭဒိၪအလးယီၩလဂ့ၩလီၫ.- စအၫဘြဟၫ့စံၭအ ဝ့ၫ,ၦလဖၪနီၪအီၪလၧစမိစ့ၭဒဲမီၪၥံၪလီၫ. မွဲအခိၭ",
			"30": "<sup>30</sup> နၪဒၪဝ့ၫလၧအဝ့ၫၥံၪဆံၭ.- အဝ့ၫဒၪစံၭဝ့ၫ, မွဲအ့ၬ, ဖါ အၫဘြဟၫ့ဧ့, ၦလၧအၥံၫ လဂၩဂၩနီၪ အ့ၪဂဲထုၪ့ထဲၩ့လ့ၩ",
			"31": "<sup>31</sup> လၧအအီၪတၭ, မိနီၫ့ယါလၩ့ထဲၩ့အၥၭလီၫ.- အဝ့ၫဒၪ စံၭအဝ့ၫ, အဝ့ၫၥံၪအ့ၪလခိၭနၪဘၪဝ့ၫလၧစမိစ့ၭ ဒဲမီၪၥံၪနီၪ, ၦလၧအၥံၫလဂၩဂၩအ့ၪဂဲထုၪ့လါနၫ့ တၭ,နဲၩဝ့ၫဒၪဆ့အ့ၬ."
		},
		"17": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪစံၭအထံၩအဖျဲၥံၪ, ဆၧလၩ့ထံၩဖါအ လးလဖၪနီၪမိဘၪအီၪဝ့ၫလီၫ. မွဲလါနၫ့ဘိၩ,ၦလၧအ",
			"2": "<sup>2</sup> မၩအီၪထၪ့ဝ့ၫလဂၩနီၪဘၪအၡၪ့လီၫ.- ၦအ့ၪမၩလၩ့ ထံၩဖါၦလဂၩ အီၪလၧၦဆံၭလဖၪယီၩ အကျၩတၭ, အခိၬအ့ၪဘၪဆၧစၧၩ့ထၬ လၧဆုၪ့ဂူၬလိးတၭ, ဘၪ ဆၧခွံၬလၩ့ခွံၬဝ့ၫ လၧမၫဆမံၭအဖၧၩ့နီၪ, မွဲအဂ့ၩဒၪ အဆၧလၧအဂးဒံၭလီၫ.",
			"3": "<sup>3</sup> နၥံၪဝ့ၫဒၪယီၩ ထီးလၩ့နၥံၪအၥၭဘီၪး နထၧၫ့ဖုဝဲ အ့ၪမၩမၪဘၪနၧၩတၭ, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫဆံၭ. အ့ၪနီၫ့ယါလၩ့ထဲၩ့အၥၭတၭ, ကွဲၪဖျါခွံၬ အဝ့ၫဒၪ",
			"4": "<sup>4</sup> ဆံၭ.လၧလနံၩအထးဖၧၩ့နီၪ, အ့ၪမၩမၪဘၪနၧၩ ထီး အဎွ့ၩထၪ့နွ့ၫဘျၩ့တၭ, အ့ၪဂဲၫထဲၩ့ထဲၩ့ လၧနအီၪထီး အဎွ့ၩထၪ့နွ့ၫဘျၩ့တၭ, စံၭဝ့ၫ, ယနီၫ့ယါလၩ့ထဲၩ့ယ ၥၭယူၭး နမိဘၪကွဲၪဖျါခွံၬအဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> တၭဆၧအၪ့မၧၫ့ဖိၪလဖၪနီၪ, စံၭကဆါး မၩအၪထၪ့",
			"6": "<sup>6</sup> ပဆၧနဲၩဆံၭ.-ကဆါစံၭဝ့ၫ, နၥံၪအဆၧနဲၩ အ့ၪအီၪ န့ၫဘၪချံၫနးဖျိၪ့တၭ, နၥံၪမိစံၭကူၪလထံၭယီၩ,စဲၪ့ ထၪ့ခွံၬတၭ, အီၪၥုၪ့လၩ့နၥၭ လၧမၫဆမံၭဖၧၩ့ဆံၭ, တၭဆၧမိခိၭနၪနၥံၪအလူလီၫ.",
			"7": "<sup>7</sup> တၭၦလၧနၥံၪအကျၩလဂၩဂၩ အီၪလၧအဎီး အၡၩလဂၩ ထဲၫဆၧမွဲဂ့ၩ, ယိဆၧဖိၪဆၧဎါမွဲဂ့ၩ, အ့ၪဂဲၫထဲၩ့ထဲၩ့လၧဆံၬဖၧၩ့တၭ, မိစံၭအဝ့ၫ, ဂဲၫဘီၪ, ဆၧၫ့နၩ့ဒံၩ့ခံၫ့ချဲၫ့မၬ လၧစပွဲထံၭနီၪ, မွဲပလၫလဂၩ",
			"8": "<sup>8</sup> လဲၪ.- အ့ၪမွဲမိစံၭအဝ့ၫ တဲၩ့ဝဲၩဆၧလၧယမိအၪ့ယ ဝ့ၫတၭ, ယအၪ့ဆၧအီၩဆၧအဘိၩ့ဘၭနီၪ, ခဲးထူၬန ခၧၩ့ယး,ဒဲမၩယဎီးယၡၩ အဆၧမၩဘီၪး အနီၪဂီၩ့",
			"9": "<sup>9</sup> တၭ,အၪ့နဝ့ၫဆံၭနီၪ, မွဲအ့ၬဧၪ,- အခ့ၫအၡၩမၩဝ့ၫဘဲၫ အမၪလူၬဝ့ၫအၥိၭနီၪ, မွဲအမိစံၭထၪ့အၪ့အူၭ ဝ့ၫဆ့",
			"10": "<sup>10</sup> ဧၪ.ယဆီၫ့မီၪ့မွဲအ့ၬ.- ဘဲၫနီၪအၥိၭ နၥံၪဝ့ၫဒၪယီၩ, ဘဲၫဆၧမၪလူၬနၥံၪအၥိၭနီၪ, နၥံၪမၩထီးအလူၬ အ့ၪ ဂီၩ့တၭ,စံၭနၥံၪဝ့ၫ,ပဝ့ၫဒၪယီၩ, ပမွဲဆၧအဎီးအၡၩလၧအလဒုၭန့ကဲၩ့န့ကၩဘၪဆၧလီၫ. အဂဲးဘဲၫယီၩ ဆၧလၧပမၩပဝ့ၫ ထီးအလူၬနီၪ, မွဲအန့ၫဆၧလၧ ပ ကြၨၭမၩလီၫ.",
			"11": "<sup>11</sup> ဆၧမၩအၥၭလၧအလ့ၩစိၩလၧယရုစလံၫ့နီၪ, မွဲအ လ့ၩခၫ့ဂၬခွံၬ စမ့ရအၫဒဲဂၫလလံၫအၥၭကျၩလီၫ.",
			"12": "<sup>12</sup> မိလ့ၩနုၬဝ့ၫလၧတဝၫ့လဖျိၪ့အဖၧၩ့တၭ, ၦခံၫထူၬဆၫ အၧၩ့ဆံၫဂၩဂဲၫထၪ့လၧဖၧၩ့ၥၭနီၪ, ဆၧၫ့ထုၪ့ဆီၩ့ဆုၩ",
			"13": "<sup>13</sup> ဝ့ၫယဲၩ့ယိၬတၭ,- ကိၭၡၭထၪ့ဆၧ, စံၭဝ့ၫ, ယ့ၫၡုၬ",
			"14": "<sup>14</sup> ကဆါဧ့,ယၫ့ၥၭပၧၩဆံၭ.- မွဲအဒၪဘၪဝ့ၫတၭ, စံၭအ ဝ့ၫၥံၪ,လ့ၩဘီၪ, ဒုၭနဲၪနၥံၪအၥၭလၧၦလုဆၧအမ့ၬ ယၫဆံၭ.ဆၧမၩအၥၭ လၧအလ့ၩဆၧအဘိၩ့ဘၭနီၪ အဝ့ၫၥံၪဆံၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> လၧၦလဖၪနီၪအကျၩအလဂၩ, ထီးအၥ့ၪယၫလၧ အဆံၫ့ထၪ့ထဲၩ့ဝ့ၫတၭ, ဂဲၫထဲၩ့ထဲၩ့ စံၭထၪ့အၪ့အူၭ",
			"16": "<sup>16</sup> ယွၩလၧအလူဖၭဒိၪ,- ထွံၩလၩ့အခၪ့လၧအခၪ့ထံၭ တၭ,စံၭထၪ့အၪ့အူၭအခိးအတၩလီၫ. ၦလဂၩနီၪမွဲ",
			"17": "<sup>17</sup> ၦစမ့ရအၫဖိၪလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭ ဝ့ၫၦဆံၫ့ထၪ့ယူၭဆံၫဂၩမွဲအ့ၬဧၪ. ၦခွံၫဂၩနီၪအီၪခီၫ",
			"18": "<sup>18</sup> ခီၫလဲၪ.- ၦဂဲၫထဲၩ့ထဲၩ့ စံၭထၪ့အၪ့အူၭယွၩအခိးအ တၩအီၪအ့ၬး အီၪန့ၫၦလခီၫဘၩ့မုးဖိၪလဂၩယီၩ",
			"19": "<sup>19</sup> မၬကၨ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫဂဲထုၪ့တၭ ထဲၩ့ထဲၩ့ ဆံၭ.နဆၧနဲၩနီၪမၩဘျၪထဲၩ့ယူၭနၧၩယူၭ.",
			"20": "<sup>20</sup> ၦဖၫရစံၫၥံၪအၪ့စၪ့အဝ့ၫ, လၧယွၩအဘၩ့အမုးမိဂဲၫ ဆံၭယံၬဆံၭယံၬလဲၪနီၪဂီၩ့, အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧ, စံၭ ဝ့ၫ,ယွၩအဘၩ့အမုးနီၪ, ဂဲၫဝ့ၫလၧဆၧယိနဲၪ့ အဂဲး",
			"21": "<sup>21</sup> အ့ၬ.- ၦစံၭဝ့ၫ, ယိခွါ, ထီးယီၩ, ယိခွါထီးနီၪမွဲအ့ၬ. အဂဲးဘဲၫယီၩ, ယိခွါ, ယွၩအဘၩ့အမုးအီၪလၧနၥံၪ အဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭစံၭအထံၩအဖျဲၥံၪ, အနံၩအၥၫ့မိဘၪလၧဆၧမိ ဒၪဘၪနၥံၪအၥၭလၧ ၦၡၩအဖိၪခွၫအမုနံၩလနံၩနီၪန",
			"23": "<sup>23</sup> ၥံၪဒၪဘၪအ့ၬ.- ၦလဖၪမိစံၭနၥံၪ, ယိခွါ,ထီးယီၩ,",
			"24": "<sup>24</sup> ယိခွါ,ထီးနီၪ, လ့ၩလဂ့ၩ,ဖိၬအခဲၫ့လဂ့ၩ.- အဂဲးဘဲၫ ယီၩ ဘဲၫလၫ့ဝဲဒံၭလၧမူၭထံၭအယီၩလခီၫတၭ, ဖၩ့ ထၪ့ဖိးလၧမူၭထံၭ အနီၪလခီၫအၥိၭ, ၦၡၩအဖိၪခွၫ လၧအမုနံၩအဖၧၩ့နီၪ, မိမၩအၥၭဘဲၫနီၪအၥိၭလီၫ.",
			"25": "<sup>25</sup> မွဲလါနၫ့ဘိၩအဝ့ၫမိဘၪထိးဆိၫဆၧအၪမံၩ့တၭ,မိ ဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫလၧ ၦလဆိၩယီၩအစူၪဖၧၩ့လီၫ.",
			"26": "<sup>26</sup> တၭဘဲၫဆၧမၩအၥၭလၧစနိအၫအမုနံၩလဖၪ အၥိၭနီၪ, ဆၧမိမၩအၥၭလၧၦၡၩအဖိၪခွၫအမုနံၩဘဲၫ",
			"27": "<sup>27</sup> နီၪအၥိၭဆ့လီၫ.- ၦၡၩၥံၪနီၪအၪ့ဆၧအီၩဆၧ, အီၪဎုၬ လိၬအၥၭဒုၭအီၪဎုၬလိၬအၥၭ ထီးမုလနံၩလၧစနိအၫ လ့ၩနုၬလၧတလၫဖၭဒိၪအဖၧၩ့နီၪ ထံၫဂဲၫလုၬဘံၭဆၧ",
			"28": "<sup>28</sup> တၭ,မၩဂၭဂီၩ့ခွံၬၦထီးအလူၬနီၪလီၫ.- ဘဲၫနီၪအၥိၭ, ဆၧမၩအၥၭလၧစလီၭ အမုနံၩလဖၪဆ့လီၫ. ၦအၪ့ ဆၧအီၩဆၧ ဎွ့ၩဆၧအၪ့ဆၫဆၧ, ၥုၪ့လၩ့ဖျၭလၩ့ဆၧ,",
			"29": "<sup>29</sup> ၥုၪ့ဂံၪ့ၥံၪဎၫ့ၥံၪလီၫ.- မွဲလါနၩ့ဘိၩ, မုလနံၩလၧစလီၭ စဲၪ့ထၪ့ခွံၬလၧစီဒၧၫ့အဖၧၩ့နီၪ, ဆၧဂဲၫဆၧၩ့လၩ့မ့ၪ ဒဲကးလၧမူၭခိၪတၭ, မၩဂၭဂီၩ့ခွံၬၦၡၩကိၭအဂၩဒ့ၭ",
			"30": "<sup>30</sup> လီၫ.- မုနံၩလၧၦၡၩအဖိၪခွၫယီၩ မိအီၪဖျီၪထၪ့တၭ, ဆၧမိမၩအၥၭဘဲၫနီၪအၥိၭလီၫ.",
			"31": "<sup>31</sup> ဆၧလၧမုလနံၩနီၪ, ၦအ့ၪအီၪလၧအဂံၪ့ခိၪတၭ, အ ဆၧဖိၪဆၧလံၩအီၪလၧအဒူၭဖၧၩ့နီၪ, မွဲအထီၩ့စဲၪ့လၩ့ မၩန့ထဲၩ့အဆၧနီၪလဂ့ၩ. ဘဲၫနီၪအၥိၭ ၦအီၪလၧဆံၬ",
			"32": "<sup>32</sup> ဖၧၩ့တၭ, ထီးထဲၩ့ထဲၩ့လၧအလးခဲၫ့လဂ့ၩ.- နၪ့ထၪ့",
			"33": "<sup>33</sup> ထဲၩ့စလီၭအမၫနီၪဘီၪ.- ထီးဒၪၦလၧအအၪ့ဎၬထိး ထဲၩ့တၩ့ထဲၩ့အၥၭမၧၫ့လဂၩဂၩနီၪ, မွဲအမိမၩလၩ့ မါခွံၬဝ့ၫဒၪလီၫ. ထီးဒၪၦလၧအၥၭမၧၫ့ လၩ့မါခွံၬလ ဂၩဂၩနီၪ,မိထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"34": "<sup>34</sup> ယစံၭနၥံၪဆၧလၧမုလနံၩနီၪ, ၦခွၫနံၫဂၩမိအီၪ လၧအလးမံၫလစီၪ့ဎး, ဆၧမိမၩန့ထဲၩ့ဝ့ၫနးဂၩတၭ,",
			"35": "<sup>35</sup> အလဂၩမိအီၪလၩ့ထးဝ့ၫလီၫ.- ၦမုၪနံၫဂၩမိဂူၬဆုၪ့ ဂူၬလစီၪ့ဎးတၭ ဆၧမိမၩန့ထဲၩ့နးဂၩတၭ,အလဂၩမိ",
			"36": "<sup>36</sup> အီၪထးဝ့ၫလီၫ.- ဎၦခွၫအီၪလၧဆံၬဖၧၩ့နံၫဂၩ, ဆၧမိ မၩန့ထဲၩ့နးဂၩတၭ, အလဂၩမိအီၪလၩ့ထးဝ့ၫလီၫ.",
			"37": "<sup>37</sup> ၦလဖၪချဲၩ့ဆၧၫ့ဆၧတၭ, အၪ့စၪ့ဝ့ၫ, ကဆါဧ့, ခီၫခီၫလဲၪ. အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ထီးဒၪဆၧစွၪအီၪဝ့ၫ လစီၪ့စီၪ့နီၪ, လၫ့ကထၬလဖၪမိအီၪကိၩ့အီၪကီၪ့ဝ့ၫထီးနီၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ဘဲၫၥိၭၦၡၩမိဘၩဆိၪဖၪ ဆၧလထံၪဎးဘီၩ့ဎး တၭ,ထီးအီၪက့ၪလၩ့ဆါ အၥၭလဂ့ၩနီၪ, မွဲအလီၩ",
			"2": "<sup>2</sup> ထဲၩ့အဝ့ၫၥံၪလၧဆၧချဲၩ့ဒီၩ့လထံၪယီၩ,- ၦစ့ၩရၫ့ခွး လၧအလၥၭမဲၪဘၪယွၩ ဒဲလယူၭလယၪ့ဘၪၦၡၩအီၪ",
			"3": "<sup>3</sup> လၧဒိၩ့လဖျိၪ့အဖၧၩ့လဂၩလီၫ.- ၦမုၪမဲၪအီၪလၧဒိၩ့ နီၪအဖၧၩ့လဂၩတၭ, လ့ၩလၧအအီၪစံၭဝ့ၫ, စ့ၩရၫ့တီၩ",
			"4": "<sup>4</sup> န့ယၧၩလၧယဒုၪယဒၩဆံၭ.- အဝ့ၫဒၪလစ့ၩရၫ့ဘၪနီၪ အီၪဝ့ၫလယံၬလမီဘၪတၭး လၧခဲၫ့ထဲၩ့စံၭလၩ့အၥၭ, ယဝ့ၫဒၪယီၩ, ယလၥၭမဲၪဘၪယွၩ, ယလယူၭလယၪ့",
			"5": "<sup>5</sup> ဘၪၦၡၩလါနၫ့ဘိၩ,- မွဲလၧၦမုၪမဲၪလဂၩ မၩထံၬထၬ ယၧၩအကၠီၩ့တၭ, ယမိစ့ၩရၫ့တီၩန့အဝ့ၫဘဲၫၥိၭအထီး မၩပွံၭယၥၭ လၧအဆၧဂဲၫကိၭ အဆၧၫ့အထီဒ့ၭ အ ကၠီၩ့နီၪလဂ့ၩလီၫ.",
			"6": "<sup>6</sup> ကဆါစံၭဝ့ၫ, ၦစ့ၩရၫ့ခွးလၧအလတီၩဘၪလဂၩ",
			"7": "<sup>7</sup> စံၭဆၧနီၪခိၭနၪနၥံၪဝ့ၫဆံၭ,- ယွၩအီၪလါနၫ့ယံၬယံၬနီၪ, မိစ့ၩရၫ့တီၩန့အခ့ၫအၡၩလၧအရွံန့ဝ့ၫလၧအကိၭထၪ့",
			"8": "<sup>8</sup> အဝ့ၫလၧမုနၩနၩလၧမုဆၫဆၫနီၪ,မွဲအ့ၬဧၪ.- ယစံၭ နၥံၪလၧအမိစ့ၩရၫ့တီၩန့အဝ့ၫၥံၪချဲၫ့ချဲၫ့လီၫ. မွဲလါ နၫ့ဘိၩ,ထီးၦၡၩအဖိၪခွၫယီၩဂဲၫလၩ့တၭ, မွဲအမိဒၪ န့ဆၧနဲၩလၧဂၪ့ခိၪချိၫ့ဆ့ဧၪ.",
			"9": "<sup>9</sup> ၦစံၭလၩ့အၥၭလၧအမွဲၦအတီၩတၭ, လယူၭလ ယၪ့ဘၪၦဂူၫဂၩလနၩ့နၩ့နီၪ, အဝ့ၫဒၪလီၩဘၪအဝ့ၫ",
			"10": "<sup>10</sup> ၥံၪလၧဆၧချဲၩ့ဒီၩ့လၩ့ယီၩ,- ၦနံၫဂၩလ့ၩထၪ့ဘၩဆိၪ ဖၪဆၧလၧဆၧလုဂံၪ့အဖၧၩ့လီၫ. အလဂၩမွဲၦဖၫရစံၫ",
			"11": "<sup>11</sup> တၭ,အဝ့ၫလဂၩမွဲၦအၪ့ကံၩ့အခီၫ့လီၫ.- ၦဖၫရစံၫလ ဂၩဆၧၫ့ထုၪ့တၭ, အနၫ့ဆါဒၪဝ့ၫဘၩဆိၪဖၪဆၧဘဲၫ ယီၩ,ယွၩဧ့, ယစံၭထၪ့အၪ့အူၭနၧၩလီၫ. အဂဲးဘဲၫ ယီၩယလမီၪ့ဎီၩ့ဘၪၦဂူၫဂၩ, ၦအၪ့ဂူၬဆီၪ့ဆၧၦလ တီၩလလီၩ့ဘၪ, ၦမၩမၪၦမုၪၦမၧၩ့,ဒဲၦအၪ့ကံၩ့အခီၫ့",
			"12": "<sup>12</sup> လဂၩယီၩဒၪလ့ၬလီၫ.- နွ့ၫနံၩအထးဖၧၩ့ယဒုၪဆၧ အၪ့ဆၧအီၩနံၫနံၩလီၫ. ထီးဒၪယန့ဆၧထီးအလူၬနီၪ,",
			"13": "<sup>13</sup> ဆံၫပိၩ့ယမၩဘိၪ့လပိၩ့လီၫ.- ၦအၪ့ကံၩ့အခီၫ့လဂၩ အီၪဆၧၫ့ထုၪ့ဝ့ၫယဲၩ့ယိၬတၭ, လယိထၪ့ဘၪလၧမူၭ ခိၪနီၪ,ဒဲၩလၩ့အၥၭနၫၡါတၭစံၭဝ့ၫ, ယွၩဧ့,ယၫ့ၥုၪ့",
			"14": "<sup>14</sup> ယၫ့ၥၭၦဆၧဒဲၩဘၭဖိၪယၧၩယီၩဆံၭ.- ယလီၩဘၪန ၥံၪ,အယီၩလဂၩဆၧအီၪက့ၪဝ့ၫလၧအတီၩတၭ, ထဲၩ့ လၩ့ဝ့ၫလၧအဂံၪ့လီၫ. အ့ၪမွဲအဝ့ၫဒၪလဂၩနီၪ မွဲအ့ၬ. အဂဲးဘဲၫယီၩ ကယဲၦလၧအအီၪက့ၪထၪ့ထီၫအၥၭ ဒၪဝ့ၫလဂၩလါလါနီၪ, မိဘၪဆၧဆၪ့လၩ့ဝ့ၫလီၫ.ၦ လၧအဆၪ့လၩ့အၥၭဒၪဝ့ၫလဂၩ လါလါနီၪ, မိဘၪ ဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.",
			"15": "<sup>15</sup> ၦဂဲၫဆိၬဖိၪၥၪအၪ့နူလဖၪလၧအအီၪဘဲၫၥိၭအမိ ထိၭဘၪအဝ့ၫၥံၪလီၫ. အထံၩအဖျဲၥံၪဒၪဘၪဝ့ၫတၭ,ပ",
			"16": "<sup>16</sup> ဒၩ့အဝ့ၫၥံၪလီၫ.- ယ့ၫၡုၬကိၭအဝ့ၫၥံၪတၭ, စံၭဝ့ၫ, ဖိၪ ၥၪအဆံၭလဖၪနီၪဖ့ၪလၫ့အဂဲၫလၧယအီၪတၭ, ထီးပ ဒၩ့အဝ့ၫၥံၪလဂ့ၩ. အဂဲးဘဲၫယီၩ ယွၩအဘၩ့ဖိၪမုးဖိၪ",
			"17": "<sup>17</sup> နီၪမွဲၦဘဲၫနီၪအၥိၭလီၫ.- ယစံၭနၥံၪ တီၩတီၩယီၩ, ထီးဒၪၦလၧအလဒိၭန့ဘၪ ယွၩအဘၩ့အမုးဘဲၫဖိၪၥၪ ဆံၭအၥိၭလဂၩဂၩနီၪ, လ့ၩနုၬဘၪဝ့ၫလၧအဖၧၩ့ အ့ၬ.",
			"18": "<sup>18</sup> ၦဒိၪလဂၩအၪ့စၪ့အဝ့ၫတၭ,စံၭဝ့ၫ,ဆရၫလၧအ ဂ့ၩဧ့,ယဝ့ၫဒၪယီၩ, ဘဲၫၥိၭယမိန့ၥၫဆၧမၧၫ့အဆိၩ",
			"19": "<sup>19</sup> အကၠၪတၭ, ယဘၪမၩဆၧနီၪလမံၩ့လဲၪ.- ယ့ၫၡုၬ စံၭအဝ့ၫ,မွဲဘၪနီၪနကိၭယၧၩလၧအဂ့ၩလဲၪ အ့ၪလ မွဲဘၪယွၩလဂၩနီၪ, ၦအဂ့ၩအီၪ နးဂၩအ့ၬ. ဆၧမၪ",
			"20": "<sup>20</sup> လူၬလဖၪနီၪ,နၥ့ၪယၫလီၫ.- ထီး မၩ မၪ ၦ မၫ ၦ ဝၩ လ ဂ့ၩး ထီး အဲၪ ဘိၩ့ မၫ အဲၪ ဘိၩ့ ဝၩ လ ဂ့ၩး ထီး မၩ ၥံၫ ၦ ၡၩ လ ဂ့ၩး ထီး အၪ့ ဂူၪ ဆၧ လ ဂ့ၩး ထီး ထိး န ၥၭ လၧ ဆၧ ချဲၩ့ အ ဘျံၭ",
			"21": "<sup>21</sup> အ ဘျၪ လ ဂ့ၩးယူၭ ယၪ့ န မိ န ဖါ ဆံၭး- အ ဝ့ၫဒၪစံၭဝ့ၫ, ဆၧနီၪလဖၪ, ယထီးန့ယူၭခီၫဒၪလၧယ",
			"22": "<sup>22</sup> ဖိၪၥၪခွၫခီးဘိၩ့နဲၪ့ယီၩထီးအလူၬယူၭ.- ယ့ၫၡုၬနါ ဂၧၫ့ဆၧနီၪတၭ, စံၭအဝ့ၫ, နလလၧၫ့လဎွ့ၩထၪ့ဘၪနီၪ အီၪဒံၭလမံၩ့ဒံၭ, ကယဲနစူၪလးနခၪ့ခိၪထီးအလူၬနီၪ, အၪ့ဆၫခွံၬတၭ, ဖ့ၪလၫ့ၦၡၪ့ဖိၪယၬဖိၪဘီၪ. နမိအီၪ လၧဆၧလူဒိၪဎွ့ၩဒိၪလၧမူၭခိၪအဖၧၩ့တၭ, ဂဲၫဘီၪ,",
			"23": "<sup>23</sup> ဖိၬယခဲၫ့ဆံၭ.- ထီးအနါဂၧၫ့ဆၧနီၪလဖၪတၭ,အၥၭ အုၭထၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအစူၪလးအခၪ့ခိၪအီၪ",
			"24": "<sup>24</sup> အၪမၬလီၫ.- အၥၭအုၭထၪ့နီၪ,ယ့ၫၡုၬဒၪဘၪတၭ, စံၭဝ့ၫ,ၦလၧအစူၪလးအခၪ့ခိၪအၪလဖၪနီၪ, လ့ၩနုၬ",
			"25": "<sup>25</sup> ဝ့ၫလၧယွၩအဘၩ့အမုးအဖၧၩ့ကၪမၬလီၫ.- အဂဲး ဘဲၫယီၩကလအူၭနုၬဖျီၫ့ထၭမ့ခဲၫ့ယီၫနဲၪ့ ၦၥထံၫလ ဂၩလ့ၩနုၬဝ့ၫ လၧယွၩအဘၩ့အမုးအဖၧၩ့ဒံၭလီၫ.",
			"26": "<sup>26</sup> ၦနါဂၧၫ့ဆၧလဖၪစံၭဝ့ၫ,အ့ၪမွဲဘဲၫနီၪတၭ, မွဲပလၫထီၩ့",
			"27": "<sup>27</sup> လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫမိၥ့ၪနးဂၩလဲၪ.- အဝ့ၫဒၪ စံၭဝ့ၫ,ဆၧလၧၦၡၩလဖၪမၩလၥ့ၪဘၪနီၪ, ယွၩမၩ ဝ့ၫဒၪၥ့ၪလီၫ.",
			"28": "<sup>28</sup> တၭစပံတၧၫစံၭဝ့ၫ, ယိခွါ,ပဝ့ၫဒၪယီၩ,ပစဲၪ့ဒၪဆၧ",
			"29": "<sup>29</sup> ထီးအလူၬတၭ, ပဖိၬနခဲၫ့ယူၭ,- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ယလီၩဘၪနၥံၪတီၩတီၩယီၩ, ၦလၧအစဲၪ့ဒၪ အဂံၪ့ အဎၫ့မွဲဂ့ၩ, အမိအဖါမွဲဂ့ၩ, အဖုအဝဲမွဲဂ့ၩ,အဖိၪ အမၫမွဲဂ့ၩ, အဖိၪအလံၩမွဲဂ့ၩ, လၧယွၩအဘၩ့အမုး",
			"30": "<sup>30</sup> အကၠီၩ့လဂၩလါလါနီၪ,- ဘိၩ့နဲၪ့ယီၩလကၠၪမိန့ထဲၩ့ ဝ့ၫအၪနဲၪ့အလးအၪဘျၩ့တၭ, ကဲခိၬနးကၠၪဒီၭမိန့ဘၪ ဆၧမၧၫ့အဆိၩအကၠၪလီၫ.",
			"31": "<sup>31</sup> အဝ့ၫဒၪမၩန့ၦလဆံၫနံၫဂၩနီၪတၭ, စံၭအဝ့ၫၥံၪ, ယိခွါ,ပလ့ၩ ထၪ့ စိၩ လၧ ယ ရု စ လံၫ့  တၭ, ဆၧ ကွ့ၭ အ ၥၭ လၧ မီၪ အ စူၪ ဖၧၩ့ လၧ ၦ ၡၩ အ ဖိၪ ခွၫ ယီၩ အ ဂဲး နီၪ, မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ",
			"32": "<sup>32</sup> ထီးအလူၬလီၫ.- အဂဲးဘဲၫယီၩ ၦမိဖ့ၪလၫ့အဝ့ၫ လၧၦဆၨၩဂူၫဂၩအစူၪဖၧၩ့တၭ, မိဘၪဆၧဒုၪဒွ့ၪဝ့ၫ, ဒဲမိဘၪဆၧမၩအၧၩ့မၩနၭဝ့ၫ, ဒဲမိဘၪဆၧထိၪဖျံၭဝ့ၫ",
			"33": "<sup>33</sup> လီၫ.- အဝ့ၫၥံၪမိဒိၪဝ့ၫထးဝ့ၫ ဒဲမိမၩၥံၫဝ့ၫတၭ, ထီးအဘၪၥၧၫ့နံၩလနံၩနီၪ မိဂဲထုၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"34": "<sup>34</sup> ဆၧနီၪလဖၪအဝ့ၫၥံၪနၪၥ့ၪနးထံၪအ့ၬ. ဆၧချဲၩ့အဂဲး နီၪအီၪၥူၪလၧအဝ့ၫၥံၪတၭ, လီၩလၩ့လၬလၩ့ဆၧနီၪ, အဝ့ၫၥံၪၥ့ၪယၫအဂဲးအ့ၬ.",
			"35": "<sup>35</sup> တၭထီးအလ့ၩဘူၭလၧယ့ၫရခိၫနီၪ, ၦအမ့ၬဘျီၪ",
			"36": "<sup>36</sup> ဆၧၫ့နၩ့အၪ့ကံၩ့ဆၧ လၧဖၧၩ့ၥၭအနဲၩ့ထံၭလီၫ.- အဝ့ၫ လဂၩနါဂၧၫ့ၦခမျၧးဂဲၫဝ့ၫတၭ, အၪ့စၪ့ဝ့ၫ, မွဲဆၧနီၪ",
			"37": "<sup>37</sup> လဲၪ.- တၭၦလီၩဘၪဝ့ၫ, မွဲၦနၭဇရ့ၭဖိၪယ့ၫၡုၬဂဲၫဝ့ၫ",
			"38": "<sup>38</sup> လီၫ.- အဝ့ၫဒၪကိၭၡၭထၪ့တၭ, စံၭဝ့ၫ,စဒၫဝံၭအဖိၪ",
			"39": "<sup>39</sup> ခွၫယ့ၫၡုၬဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါယၧၩဆံၭ.- ၦလ့ၩ လၧယၫလဖၪနီၪ ဘဲၫၥိၭအဆၧမိအီၪလၩ့မါပံၭတၭ, အၪ့လၬအဝ့ၫလါနၫ့ဘိၩ့, မွဲအကိၭၡၭအၪထၪ့လခီၫ နီၪ,စဒၫဝံၭအဖိၪခွၫဧ့, ယၫ့ၥုၪ့ယၫ့ၥၭလါယၧၩဆံၭ.",
			"40": "<sup>40</sup> ယ့ၫၡုၬအီၪထီတၭ, အၪ့မၧၫ့ၦၡၩကိၭန့အဝ့ၫဒၪလီၫ. ထီးအဂဲၫဘူၭတၭ, ယ့ၫၡုၬအၪ့စၪ့အဝ့ၫ,စံၭ, နၥၭအီၪ",
			"41": "<sup>41</sup> လၧယမိမၩနၧၩ လၧဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫဒၪစံၭဝ့ၫ,",
			"42": "<sup>42</sup> ကဆါဧ့, မွဲဘဲၫၥိၭယမိဒၪထၪ့ထဲၩ့ဆၧလီၫ.- ယ့ၫၡုၬ စံၭအဝ့ၫ, မွဲနဒၪထၪ့ထဲၩ့ဆၧဆံၭ. နဆၧနဲၩနီၪမၩ",
			"43": "<sup>43</sup> ဘျၪထဲၩ့ယူၭနၧၩယူၭ.- အဝ့ၫလဂၩဒၪထၪ့ထဲၩ့ဆၧ ချဲၫ့မၬ,စံၭထၪ့အၪ့အူၭယွၩတၭ, ဖိၬထၪ့အခဲၫ့လီၫ. ၦထီးအလူၬဒၪဘၪဝ့ၫတၭ, အၪ့အူၭထၪ့ယွၩလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> တၭအဝ့ၫဒၪလ့ၩနုၬခၫ့ဂၬယ့ၫရခိၫအဘိၩ့ဘၭနီၪ,",
			"2": "<sup>2</sup> ယိခွါ,ၦကိၭဝ့ၫအမံၩ့ လၧစဇၭခံအၧၭ အီၪဝ့ၫလဂၩ လီၫ.အဝ့ၫနီၪမွဲၦအၪ့ကံၩ့အခီၫ့အခိၪ, ဒဲမွဲၦၥထံၫလ",
			"3": "<sup>3</sup> ဂၩလီၫး- ယ့ၫၡုၬမွဲပလၫလဂၩလဲၪနီၪ, အၪ့ဎၬယိဝ့ၫ တၭ,အဂၩ့ဖၨၪဒၪဝ့ၫလၥ့ၪဘၪ လၧၦခမျၧးနီၪအကၠီၩ့",
			"4": "<sup>4</sup> တၭ,- လ့ၩစဲၪ့ဝ့ၫလၧယၫတၭ,ထၪ့ဝ့ၫလၧကူၪလထံၭ အခံၫဘဲၫၥိၭအမိဒၪဘၪအဝ့ၫနီၪး အဂဲးဘဲၫယီၩမိဂဲၫ",
			"5": "<sup>5</sup> ဝ့ၫလၧဖၧၩ့ၥၭနီၪလီၫ.- ထီးယ့ၫၡုၬလ့ၩထီၩ့ထီးနီၪ, ယိထၪ့ဆၧဒၪဘၪဝ့ၫတၭ,စံၭအဝ့ၫ, စဇၭခံအၧၭဧ့, ဂဲၫထဲၩ့လၩ့ချဲၫ့ချဲၫ့ဘီၪ. အဂဲးဘဲၫယီၩ ယဘၪအီၪလၧ",
			"6": "<sup>6</sup> နဂံၪ့ဖၧၩ့လနံၩယီၩလီၫ.- အဝ့ၫဒၪစဲၪ့လၩ့ဝ့ၫချဲၫ့ချဲၫ့",
			"7": "<sup>7</sup> တၭ,ထိးဆၧၫ့ဝ့ၫလၧအၥုၪ့ထိၬအၥၭထိၬလီၫ.- ၦကိၭ ဂၩဒ့ၭဒၪဘၪဝ့ၫတၭ, ၥူၭဝံၪၥူၭလၩဆၧ, စံၭဝ့ၫ, အဝ့ၫ ဒၪလ့ၩလၧၦဆၧဒဲၩဘၭဖိၪအအီၪတၭ, မိမံၫမၬဝ့ၫ လၧအဂံၪ့ဖၧၩ့နီၪကၨ.",
			"8": "<sup>8</sup> စဇၭခံအၧၭဆၧၫ့ထုၪ့တၭ, လီၩဘၪကဆါနီၪ,ယိခွါ, ကဆါဧ့, ယစူၪလးယခၪ့ခိၪနံၫပိၩ့နီၪ, ယဖ့ၪလၫ့ၦၡၪ့ ဖိၪလပိၩ့လီၫ. တၭယအ့ၪအၪ့မၩန့ ၦလဂၩဂၩအ ဆၧလၧကဘျံၭကဘျၪလမံၩ့မံၩ့နီၪ,ယမိဖ့ၪလၫ့ထဲၩ့",
			"9": "<sup>9</sup> အၪနဲၪ့အလးလံစၩလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ,ဆၧထိး ထဲၩ့တၩ့ထဲၩ့ ထီၩ့လၧဂံၪ့ယီၩအဖၧၩ့လနံၩယီၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪမွဲစအၫဘြဟၫ့အဖိၪဆ့လီၫ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩၦၡၩအဖိၪခွၫယီၩ ဂဲၫလၩ့ဝ့ၫဘဲၫၥိၭအမိအၪ့ ဎၬန့, ဒဲထိးထဲၩ့တၩ့ထဲၩ့ၦလၧအလၩ့မါဝ့ၫလဖၪနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးၦနါဂၧၫ့ဆၧနီၪလဖၪတၭ, မွဲအအီၪဘူၭလၧယ ရုစလံၫ့အကၠီၩ့, ဒဲၦဆီၫ့မီၪ့ဝ့ၫလၧယွၩအဘၩ့အမုးမိ အီၪထၪ့ချဲၫ့မၬအကၠီၩ့တၭ,အဝ့ၫဒၪချဲၩ့အၪထၪ့ဆၧချဲၩ့",
			"12": "<sup>12</sup> အဒီၩ့တၭ,စံၭဝ့ၫ,- ၦဒိၪလဂၩမိလ့ၩလၧ ထံၫယဲၩ့ခး ယဲၩ့ဘဲၫၥိၭအမိမၩန့အဘၩ့အမုးတၭ, မိဂဲၫထဲၩ့",
			"13": "<sup>13</sup> ထဲၩ့ဝ့ၫလီၫ.- မွဲအကိၭန့အဎီးအၡၩဆံၫဂၩတၭ, ဖ့ၪ လၫ့အဝ့ၫၥံၪဆံၫမဲနၫတၭ, လီၩဘၪအဝ့ၫၥံၪ, အၪ့ခၩ ဆၧထီးယဂဲၫထဲၩ့ဆံၭ.",
			"14": "<sup>14</sup> အဎီးအၡၩၥံၪမ့ၬလဲၩဝ့ၫတၭ, အၪ့မၧၫ့ၦလဂၩလ့ၩ ဆီးအဝ့ၫတၭ, စံၭဝ့ၫ, အဝ့ၫလဂၩယီၩကဲၪစဎွၩလၧ ပဖၫ့ခိၪ, ဘၪပၥၭအ့ၬ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭလၧအမၩန့အဘၩ့အမုးဂီၩ့တၭ, ဂဲၫ ထဲၩ့ထဲၩ့ဝ့ၫတၭ, အၪ့မၧၫ့ၦကိၭန့ဆၧအဎီးအၡၩ လ ဖၪလၧအဖ့ၪလၫ့အစ့ၩလၧ အစူၪဖၧၩ့နီၪ, ဘဲၫၥိၭအမိ ၥ့ၪယၫဝ့ၫလဂၩဘၪလဂၩနီၪ, မွဲအမၩအၪထၪ့အဆၧ",
			"16": "<sup>16</sup> ဆံၭအၪဆံၭအၪလဲၪနီၪလီၫ.- အခၪ့ထံၭလဂၩဂဲၫစိၩ တၭ,စံၭဝ့ၫ, ကဆါဧ့, နစ့ၩလမဲနၫနီၪ, န့အၪထၪ့ယူၭ",
			"17": "<sup>17</sup> ဆံၫမဲနၫယူၭ.- တၭအဝ့ၫဒၪ စံၭအဝ့ၫ, ဘၪယူၭဎီးအ ၡၩလၧအဂ့ၩဧ့, မွဲနအီၪလၧဆၧၡၩ အဖၫ့ခိၪနလူ",
			"18": "<sup>18</sup> တီၩယူၭ.အီၪနဝ့ၫလၧဒိၩ့ဆံၫဒိၩ့အဖၫ့ခိၪဆံၭ.- ၦနံၫ ဂၩလဂၩဂဲၫဝ့ၫတၭ, စံၭဝ့ၫ, ကဆါဧ့, နစ့ၩလမဲနၫနီၪ",
			"19": "<sup>19</sup> န့အၪထၪ့ယူၭယဲမဲနၫယူၭ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫနီၪ",
			"20": "<sup>20</sup> ဆ့,အီၪနဝ့ၫလၧဒိၩ့ယဲဒိၩ့ အဖၫ့ခိၪဆံၭ.- အဂူၫဂၩ လဂၩဂဲၫစိၩဝ့ၫတၭ,စံၭဝ့ၫ,ကဆါဧ့,ယိခွါ, နစ့ၩလမဲ နၫနီၪ,လၧယအီၪက့ၪလၧပဝၫအဖၧၩ့နီၪအီၪဝ့ၫလီၫ.",
			"21": "<sup>21</sup> အဂဲးဘဲၫယီၩယၥၭမဲၪနၧၩတၭ, နမွဲၦအကၪတၭ,ဆၧ လၧနလအီၪက့ၪဘၪနီၪ,နမၩန့နဝ့ၫ,ဒဲဆၧလၧနလဎွံၪ",
			"22": "<sup>22</sup> ဘၪနီၪ,နကူၭနဝ့ၫလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫ,ဎီးအၡၩလၧ အအၧၩ့လဂၩဧ့, ယမိစ့ၩရၫ့စၪနၧၩလၧနနိၭဒၪနဝ့ၫ လီၫ.နၥ့ၪယၫလၧယမွဲၦအကၪတၭ, ဆၧလၧယလအီၪ က့ၪဘၪနီၪ,ယမၩန့ယဝ့ၫ, ဆၧလၧယလဎွံၪဘၪနီၪ,ယ",
			"23": "<sup>23</sup> ကူၭယဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ထီးယအ့ၪဂဲၫ ထဲၩ့တၭဘဲၫၥိၭယမိန့ဘၪယစ့ၩ, ဒဲအအ့ၪထၪ့နီၪ,မွဲ",
			"24": "<sup>24</sup> ဘၪနီၫလၧနလဒုၭအၪ့လီးဘၪယစ့ၩလဲၪ.-တၭလီၩ ဘၪၦဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭနီၪ, မၩန့အဆၧလမဲနၫ",
			"25": "<sup>25</sup> နီၪဖ့ၪလၫ့ၦအီၪလၧဆံၫမဲနၫလဂၩနီၪဆံၭ.- အဝ့ၫၥံၪ စံၭအဝ့ၫ,ကဆါဧ့,အဝ့ၫဒၪနီၪအဆၧအီၪယူၭ ဆံၫမဲနၫ",
			"26": "<sup>26</sup> ယူၭ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪလၧကယဲၦလၧ အန့ဘၪဆၧလဂၩလါလါနီၪ, ဆၧမိဖ့ၪလၫ့အဝ့ၫဒၪ လီၫ.ၦလၧအလန့ဘၪဝ့ၫနီၪ, ထီးဒၪအဆၧအီၪဝ့ၫဒၪ လ့ၬတၭ, ဆၧမိမၩန့ထဲၩ့ဝ့ၫလၧ အအီၪလီၫ.",
			"27": "<sup>27</sup> အ့ၪမွဲယဒုၪယဒၩလဖၪ လၧအၥၭလအီၪဘၪလၧ ယမိကဲၪစဎွၩနီၪ, ဂဲၫဆိၬအဝ့ၫၥံၪထီးယီၩတၭ, မၩ ၥံၫခွံၬဝ့ၫလၧယမ့ၬယၫဆံၭ.",
			"28": "<sup>28</sup> စံၭဆၧနီၪလဖၪဂီၩ့တၭ, လ့ၩထၪ့ဝ့ၫလၧယၫလၧ",
			"29": "<sup>29</sup> ယရုစလံၫ့အဖၧၩ့ၥၭနီၪလီၫ.- ဆၧမၩအၥၭထီးအလ့ၩ ထီၩ့ဘူၭလၧဘ့ၭၥဖ့ၭ, ဒဲဘ့ၭၥနံၫထီးခိၪလီၩ့ကိၭဝ့ၫ အမံၩ့လၧအလဲအိၫ့အအီၪနီၪတၭ, အၪ့မၧၫ့လၩ့အ",
			"30": "<sup>30</sup> ထံၩအဖျဲနံၫဂၩလီၫ.- စံၭဝ့ၫဒၪ,လ့ၩလၧတဝၫ့တီၩလၧ နၥံၪအမ့ၬယၫဆံၭ. ထီးနၥံၪလ့ၩနုၬနီၪ နၥံၪမိဒၪဘၪ ကၥ့ၪယီၩ့ဖိၪလဒုၩ လၧၦလထူၬဒံၭဘၪဝ့ၫနးဆိၭဘၪ စၧၩ့ထၬအၥၭလီၫ. ကွဲၪလၩ့ဝ့ၫတၭ, ဂဲၫထဲၩ့မီၩ့ဝ့ၫ",
			"31": "<sup>31</sup> ဆံၭ.- တၭၦလဂၩဂၩအ့ၪအၪ့စၪ့ဝ့ၫ,မွဲဘၪနီၫလၧနၥံၪ ကွဲၪလၩ့နီၪလဲၪး လီၩဘၪဝ့ၫဘဲၫယီၩ,မွဲကဆါန့ဘၪ",
			"32": "<sup>32</sup> နီၪအလးအီၪဝ့ၫအဂဲးလီၫ.- ၦလၧအဘၪဆၧအၪ့ မၧၫ့လၩ့ဝ့ၫလဖၪနီၪလ့ၩဝ့ၫတၭ, ဒၪဘၪဆၧဘဲၫအလီၩ",
			"33": "<sup>33</sup> ဘၪဝ့ၫအၥိၭလီၫ.- တၭကွဲၪလၩ့ကၥ့ၪယီၩ့ဖိၪအဘိၩ့ ဘၭနီၪ,ကဆါစံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪကွဲၪလၩ့",
			"34": "<sup>34</sup> ကၥ့ၪယီၩ့ဖိၪနီၪလဲၪ.- အဝ့ၫၥံၪစံၭ,ကဆါန့ဘၪနီၪအ",
			"35": "<sup>35</sup> လးအီၪဝ့ၫလီၫ.- တၭဂဲၫမီၩ့ဝ့ၫလၧယ့ၫၡုၬအအီၪနီၪ, ဒၩလၩ့အကီၩ့အၥိၭ လၧကၥ့ၪယီၩ့ဖိၪအလီၩ့တၭ,",
			"36": "<sup>36</sup> အီၪက့ၪထၪ့ယ့ၫၡုၬလၧအဖၫ့ခိၪလီၫ.- အဝ့ၫဒၪလ့ၩ ဆၧအဘိၩ့ဘၭနီၪ, ၦဒၩလၩ့အကီၩ့အၥိၭလၧဖၧၩ့ၥၭ",
			"37": "<sup>37</sup> လီၫ.- လ့ၩဘူၭလၧခိၪလီၩ့အလဲအိၫ့ အခၪ့ထံၭတၭ, အထံၩအဖျဲခမျၧး အၥုၪ့ထိၬ အၥၭထိၬတၭ, စံၭထၪ့ အၪ့အူၭယွၩလၧအလူဖၭဒိၪ လၧအဒၪဘၪယူၭဆၧ",
			"38": "<sup>38</sup> လၩ့လၭအဂဲး,- တၭစံၭဝ့ၫ, စဎွၩလၧအဂဲၫလၧကဆါ အမံၩ့လဂၩယီၩ, မွဲအဘၪဆၧဆိၪဂ့ၩဆံၭ. ဆၧဘၪ လိၬအိၭလိၬအီၪလၧမူၭခိၪ, ဒဲဆၧလၩဖၩ့အီၪလၧဆၧ ထၪ့ထီၫထုၬလီၫ.",
			"39": "<sup>39</sup> ၦဖၫရစံၫအီၪလၧၦခမျၧးအကျၩလနၩ့နၩ့ စံၭအဝ့ၫ,",
			"40": "<sup>40</sup> ဆရၫဧ့,အၪ့လၬနထံၩနဖျဲၥံၪဘီၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယလီၩဘၪနၥံၪလၧၦလဖၪယီၩ, အ့ၪအီၪလၩ့မါပံၭနီၪ, လိးလဖၪမိကိၭၡၭထၪ့ဆၧလီၫ.",
			"41": "<sup>41</sup> အဝ့ၫဒၪလ့ၩထီၩ့ဘူၭဝ့ၫတၭ, ယိဒိၩ့နီၪအမ့ၬထံၫ",
			"42": "<sup>42</sup> လၩ့လၧအဂးတၭ,- စံၭဝ့ၫ, နအ့ၪၥ့ၪယၫနဝ့ၫဆၧ လၧအဘၪဆဲၫ့ လၧနဆၧဘၪလိၬအိၭလိၬ လၧနနံၩနၥၫ့ ယီၩအဖၧၩ့တၭ,ဂ့ၩလၧနဂးလီၫ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ,",
			"43": "<sup>43</sup> အီၪကဒုၩလၧနမ့ၬလီၫ.- အဂဲးဘဲၫယီၩ မုနံၩမုနၩ လဖၪမိဘၪလၧနဒုၪနဒၩ မိမၩထိၬဝၬဖီၩ့နၧၩတၭ,",
			"44": "<sup>44</sup> မိလ့ၩဎဲၪ့နၧၩဝၬဝၬ ဒဲပဒၩ့နၧၩ ကိၭခီၫဒ့ၭတၭ,- နၧၩ ဒဲနဖိၪၥံၪအီၪလၧနဖၧၩ့နီၪ မိမၩလၩ့ဒၩဝ့ၫလၧဂၪ့ခိၪ အလီၩ့တၭ, လိးလၧအဒၩ့ဒိၭလိၬအၥၭလဖျိၪ့လ ဖျိၪ့နီၪ,မိအီၪလၩ့ထးနးဖျိၪ့အ့ၬ. အဂဲးဘဲၫယီၩဆၧ ဂဲၫယိထဲၩ့ခွါထဲၩ့နၧၩအမုအလၩနီၪ,နၥ့ၪယၫအ့ၬ.",
			"45": "<sup>45</sup> အဝ့ၫဒၪလ့ၩနုၬဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, နၫ့",
			"46": "<sup>46</sup> ထၪ့ခွံၬၦဎွ့ၩဆၧ, ၦအၪ့ဆၫဆၧလဖၪ,- တၭလီၩဘၪ အဝ့ၫၥံၪဆၧကွ့ၭအၥၭ, ယ ဂံၪ့ မွဲ ဆၧ ဘၩ ဆိၪ ဖၪ အ ဂံၪ့ လီၫ. အ့ၪ မွဲ န ၥံၪ ဝ့ၫ ဒၪ ယီၩ, န ၥံၪ မၩ ယူၭ မၬ ဝ့ၫ လၧ ထ မျၬ  အ ဖၧၩ့ လီၫ.",
			"47": "<sup>47</sup> တၭအဝ့ၫဒၪၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ လၧဆၧလုအဂံၪ့ဖၧၩ့ ကိၭမုနံၩဒ့ၭလီၫ. တၭၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭ လံၬၥံၪ,ဒဲၦအဒိၪအၡါၥံၪနီၪ, အၪ့ဎၬမၩၥံၫဝ့ၫလီၫ.",
			"48": "<sup>48</sup> တၭမိမၩဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, အၪ့ဎၬဝ့ၫဘၪ အ့ၬ.အဂဲးဘဲၫယီၩ ၦခမျၧးထီးအလူၬ ခိၭနၪဆၧလၩ့ ထံးလၩ့ဆ့ၭလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭ လၧမုနံၩလဖၪအကျၩအလနံၩနီၪ, လၧအၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ၦခမျၧးတၭ, လီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအပရၧၫ့လၧ ဆၧလုအဂံၪ့ဖၧၩ့အဘိၩ့ဘၭ နီၪ,ၦလုဆၧအဒိၪလဖၪ, ဒဲၦကွ့ၭလံၬၥံၪ ဂဲထုၪ့ဎုၬလၧ",
			"2": "<sup>2</sup> ၦၥုၪ့က့ၭၥၭၡါလဖၪနီၪ,- လီၩဘၪအဝ့ၫဒၪတၭ, စံၭဝ့ၫ, နမၩဆၧလဖၪယီၩ, မွဲလၧပလၫအစီၩ့အမၩ့လဂၩ လဲၪ,မွဲပလၫဖ့ၪလၫ့ နစီၩ့နမၩ့ယီၩ လဂၩလဲၪ, လီၩ",
			"3": "<sup>3</sup> ဘၪပၧၩဆံၭ,- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယမိအၪ့စၪ့နၥံၪအဆၧနးမံၩ့တၭ, လီၩဘၪယၧၩဆံၭ.",
			"4": "<sup>4</sup> စယီဟၫ့အဆၧဘၭတံၫဇၫ့နီၪ, မွဲအဂဲၫဝ့ၫ လၧမူၭခိၪ",
			"5": "<sup>5</sup> ဧၪ,မွဲအဂဲၫဝ့ၫလၧၦၡၩလခီၫလဲၪ.- အဝ့ၫၥံၪချဲၩ့လိၬအ ၥၭတၭ,စံၭဝ့ၫ, ပအ့ၪစံၭလၧမူၭခိၪတၭ, အဝ့ၫမိစံၭ ပၧၩ,အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၫနၥံၪလနဲၩဘၪ အဝ့ၫ",
			"6": "<sup>6</sup> နီၪလဲၪ.- ပအ့ၪစံၭလၧၦၡၩတၭ,ၦခမျၧးထီးအလူၬမိ",
			"7": "<sup>7</sup> ခွံၬပၧၩလၧလိးလီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအီၪက့ၪ စယီဟၫ့ဘဲၫမီၪလဂၩအၥိၭလီၫ. အဝ့ၫၥံၪချဲၩ့ဆၧၫ့",
			"8": "<sup>8</sup> ဝ့ၫ,မွဲအဂဲၫခီၫခီၫလဲၪနီၪပၥ့ၪယၫအ့ၬ.- ယ့ၫၡုၬစံၭအ ဝ့ၫၥံၪ,ဘဲၫနီၪအၥိၭဆ့ ယဝ့ၫဒၪယီၩယမၩဆၧလဖၪ ယီၩ,မွဲလၧပလၫအစီၩ့အမၩ့လဂၩလဲၪနီၪ, ယလီၩ ဘၪနၥံၪဆ့အ့ၬ.",
			"9": "<sup>9</sup> တၭအဝ့ၫဒၪလီၩဘၪၦခမျၧးလၧ ဆၧချဲၩ့အဒီၩ့ယီၩ, ၦလဂၩၥုၪ့လၩ့စဘံၭမုအလးတၭ, ဖ့ၪလၫ့ဝ့ၫလၧၦ မၩကၩအစူၪဖၧၩ့တၭ, စဲၪ့ထၪ့ဝ့ၫလၧထံၫယဲၩ့ခးယဲၩ့",
			"10": "<sup>10</sup> နီၪအီၪဝ့ၫယံၬယံၬလီၫ.- ထီးအမုအလၩဘၪနီၪ, ဘဲၫ ၥိၭအမိန့ဘၪစဘံၭအၥၪတၭ, အၪ့မၧၫ့အဎီးအၡၩ လဂၩလ့ၩလၧ ၦမၩကၩအအီၪလီၫ. ၦမၩကၩလဖၪ နီၪဒိၪဝ့ၫထးဝ့ၫတၭ, အၪ့မၧၫ့အထဲၩ့ထဲၩ့ဝ့ၫ ပျီၩပျီၩ",
			"11": "<sup>11</sup> လီၫ.- မၩဒီၭလဖၧၫ့အဝ့ၫဒၪအၪ့မၧၫ့ အဎီးအၡၩလၧ အဂူၫဂၩလ့ၩဝ့ၫတၭ, အဝ့ၫၥံၪထးအဝ့ၫနီၪဆ့တၭ, မၩ ကြၩ့ထမးဝ့ၫတၭ, အၪ့မၧၫ့အထဲၩ့ထဲၩ့ဝ့ၫပျီၩပျီၩဆ့",
			"12": "<sup>12</sup> လီၫ.- မၩဒီၭလဖၧၫ့အၪ့မၧၫ့အဎီးအၡၩ ၥၧၫ့ဂၩလဂၩ တၭ,အဝ့ၫၥံၪထးအဝ့ၫထီးအဖၧၩ့လးအီၪဝ့ၫတၭ, နၫ့ ထၪ့ခွံၬဝ့ၫဒၪလီၫ.",
			"13": "<sup>13</sup> တၭစဘံၭအလး အကဆါ စံၭဝ့ၫ, ယမိမၩဘဲၫၥ့ၪ လဲၪ.ယမိအၪ့မၧၫ့ယဖိၪခွၫၥၭဘီၩ့လဂၩ လ့ၩလၧအ အီၪလီၫ. ထီးအဝ့ၫၥံၪဒၪဘၪအဝ့ၫနီၪတၭ, ဘၪလဘၪ",
			"14": "<sup>14</sup> မိယူၭမိယၪ့ဝ့ၫဒၪလီၫ.- အ့ၪမွဲထီးၦမၩကၩလဖၪဒၪ ဘၪအဝ့ၫဒၪနီၪတၭ, ချဲၩ့လိၬအၥၭစံၭဝ့ၫ, အဝ့ၫယီၩမွဲ ၦလၧအန့ၥၫဆၧလဂၩလီၫ. ဘဲၫၥိၭအဆၧဖ့ၪၥၫနီၪ",
			"15": "<sup>15</sup> မိကဲၪထၪ့ပဆၧ, ဂဲၫမၩၥံၫၡီၩ့အဝ့ၫဒၪဘီၪ.- မွဲအနၫ့ ထၪ့ခွံၬအဝ့ၫ လၧစဘံၭမုအလးအချိၫ့တၭ, မၩၥံၫခွံၬဝ့ၫ ဒၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, စဘံၭမုးအလးအကဆါ",
			"16": "<sup>16</sup> နီၪမိမၩအဝ့ၫၥံၪဘဲၫၥ့ၪလဲၪ.- မိဂဲၫမၩၥံၫခွံၬၦမၩကၩ လဖၪတၭ, ဖ့ၪလၫ့ခွံၬစဘံၭမုအလးလၧၦဂူၫဂၩၥံၪ လီၫ.ၦလဖၪနီၪနါဂၧၫ့ဝ့ၫဒၪတၭ,စံၭဝ့ၫ, မွဲလၩလါအ့ၬ.",
			"17": "<sup>17</sup> မွဲအယိထၪ့အဝ့ၫၥံၫတၭ, စံၭဝ့ၫ, အ့ၪမွဲဘဲၫနီၪတၭ, လိးလၧၦမၩဂံၪ့လဖၪခွံၬၡိၭဝ့ၫလဖျိၪ့နီၪ, ကဲၪထၪ့ဝ့ၫ လၧဆၧအနိၪ့အခိၪစီၪ့လီၫ. ဆၧကွ့ၭအၥၭလဆၫ့နီၪ, မွဲဆၧဘဲၫၥ့ၪလဲၪ.",
			"18": "<sup>18</sup> ကယဲၦလၧအလၩ့ထံၩဖါဝ့ၫ လၧလိးယီၩအလီၩ့ လဂၩလါလါနီၪ, မိခါဝ့ၫ, အ့ၪမွဲထီးဒၪၦလၧလိးယီၩ အ့ၪလၩ့ထ့ၬဝ့ၫလၧအလီၩ့လဂၩဂၩနီၪ မွဲအမိမၩလၩ့ ဘျ့ၭအဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> တၭလၧနၩရံၩနီၪ, ၦလုဆၧအဒိၪလဖၪဒဲၦကွ့ၭလံၬ ၥံၪနီၪ အၪ့ဎၬအီၪက့ၪအစူၪလၧအလီၩ့ တၭ, ၥၭမဲၪၦ ခမျၧးလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪၥ့ၪယၫ လၧအဝ့ၫ လီၩဘၪဆၧချဲၩ့အဒီၩ့နီၪ ထၫ့ဒုၪဒၩ အဝ့ၫၥံၪလီၫ.",
			"20": "<sup>20</sup> ၦလဖၪနီၪခိၭယိဝ့ၫတၭ, အၪ့မၧၫ့ၦကျဲၩ့မၩဆၧဘဲၫ ၦအတီၩအလီၩ့လဖၪအၥိၭနီၪ, လ့ၩလၧအအီၪဘဲၫ ၥိၭအမိမၩဘံၪဘူၪအဆၧချဲၩ့ဘဲၫၥိၭ အမိဖ့ၪလၫ့ ဝ့ၫလၧၦဒိၪအစူၪဖၧၩ့, ဒဲလၧၦပၧၩ့ဆၧအစီၩ့အမၩ့အ",
			"21": "<sup>21</sup> ဂဲးလီၫ.- အဝ့ၫၥံၪအၪ့စၪ့အဝ့ၫတၭ, စံၭဝ့ၫ, ဆရၫဧ့, ပၥ့ၪယၫလၧနလီၩလၩ့လၬလၩ့, ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧ တီၩတီၩတၭ, နယိဒိၪဆံၭအၪၡၩဘၪၦနးဂၩအ့ၬ. မွဲ",
			"22": "<sup>22</sup> နၥီၪ့လိၪဆၧလၧယွၩအဖၧၩ့ၥၭတီၩတီၩလီၫ.- ပဖ့ၪလၫ့",
			"23": "<sup>23</sup> အခီၫ့လၧစံစၧၫနီၪ မွဲအတီၩလတီၩဘၪလဲၪ.- အဝ့ၫဒၪ ၥ့ၪယၫလၧအဝ့ၫၥံၪအၪ့လီၫဆၧတၭ, စံၭဝ့ၫ, မွဲဘၪနီၫ",
			"24": "<sup>24</sup> လၧနၥံၪကျဲၩ့ဖစီၩ့ယၧၩလဲၪ.- ဒုၭနဲၩယၧၩလၧစ့ၩဒန့ ရံၫနးဘံၪ့ဘီၪ. မွဲပလၫအခံးအဂၩ့, ဒဲမွဲပလၫအဆၧ ကွ့ၭအၥၭလၧအလီၩ့လဂၩလဲၪ. အဝ့ၫၥံၪချဲၩ့ဆၧၫ့",
			"25": "<sup>25</sup> ဆၧတၭ,စံၭဝ့ၫ,မွဲစံစၧၫအဆၧလီၫ.- တၭမွဲအစံၭအ ဝ့ၫၥံၪ,မၩအၥၭဘဲၫနီၪတၭ, စံစၧၫအဆၧနီၪဖ့ၪလၫ့",
			"26": "<sup>26</sup> ထဲၩ့လၧစံစၧၫတၭ, ဒဲယွၩအဆၧနီၪလၧယွၩဆံၭ.- တၭ အဝ့ၫၥံၪမၩဘံၪဘူၪအဆၧချဲၩ့ လၧၦခမျၧးအမ့ၬယၫ ၥ့ၪအ့ၬ.တၭအဝ့ၫၥံၪထီၫမံၫထီၫမၪဝ့ၫ လၧအချဲၩ့ဆၧၫ့ ဆၧအဂဲးနီၪ, အီၪဝ့ၫလၩ့မါပံၭလီၫ.",
			"27": "<sup>27</sup> ၦစၭဒုၫစံၫလၧအစံၭဝ့ၫ, ဆၧဂဲထုၪ့ထဲၩ့လအီၪ",
			"28": "<sup>28</sup> ဘၪလနၩ့နၩ့လ့ၩလၧအအီၪတၭ,အၪ့စၪ့အဝ့ၫ,- စံၭ ဝ့ၫ,ဆရၫဧ့, စမိစ့ၭကွ့ၭန့ပလံၬ,စံၭဝ့ၫ,ၦလဂၩဂၩ အထၧၫ့ဖုဝဲလၧအအီၪလၧအမၫအ့ၪၥံၫတၭ, ထီးအ ၥံၫနီၪအဖိၪအ့ၪလအီၪဘၪတၭ, အထၧၫ့ဖုဝဲဘၪအီၪ ဎုၬလၧအမၫတၭ, ဘၪမၩအီၪထၪ့န့ အထၧၫ့ဖုဝဲအချံၫ အၥၪလီၫ.",
			"29": "<sup>29</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦထၧၫ့ဖုဝဲခွၫအီၪနွ့ၫဂၩလီၫ. အခၪ့ထံၭလဂၩန့အမၫတၭ, အဖိၪလအီၪဘၪၥံၫဝ့ၫ",
			"30": "<sup>30</sup> လီၫ.- နံၫဂၩလဂၩမၩန့အမၫတၭ, အဖိၪလအီၪဘၪၥံၫ",
			"31": "<sup>31</sup> ဝ့ၫလီၫ.- ၥၧၫ့ဂၩလဂၩမၩန့ဝ့ၫတၭ, ဆၧမၩအၥၭ ဘဲၫနီၪဆ့နွ့ၫဂၩလူၬတၭ, အဖိၪလအီၪလၩ့ထးဘၪ",
			"32": "<sup>32</sup> နီၪၥံၫဝ့ၫဒၪလီၫ.- တၭလၧခဲၫ့ထုၬၦမုၪလဂၩၥံၫဝ့ၫဆ့",
			"33": "<sup>33</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,လၧဆၧဂဲထုၪ့ထဲၩ့အဖၧၩ့ နီၪ,မွဲအမိကဲၪထဲၩ့လၧၦလဖၪနီၪ အမၫလဂၩဂၩလဲၪ. အဂဲးဘဲၫယီၩၦနွ့ၫဂၩနီၪန့အမၫလၧအဝ့ၫလီၫ.",
			"34": "<sup>34</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧလၧအဝ့ၫၥံၪတၭ, စံၭဝ့ၫၦအ ယီၩလကၠၪဖိၪအီၪဎုၬတၭ, ဒုၭအီၪဎုၬလိၬအၥၭလီၫ.",
			"35": "<sup>35</sup> အ့ၪမွဲၦၡၩလၧအဂ့ၩဒိၭန့ဝ့ၫလၧနးကၠၪဒီၭ, ဒဲဆၧဂဲ ထုၪ့ထဲၩ့လၧဆၧၥံၫအဖၧၩ့လဖၪနီၪ,အီၪဎုၬလၧၩ့",
			"36": "<sup>36</sup> အ့ၬ. ဘၪဆၧဒုၭအီၪဎုၬလိၬအၥၭ ဆ့အ့ၬ.- တၭအဝ့ၫ ၥံၪၥံၫၥ့ၪလၧၩ့ဆ့အ့ၬးအဂဲးဘဲၫယီၩ မွဲဘဲၫအၥီၫ့ လဖၪအၥိၭတၭ,မွဲဆၧဂဲထုၪ့ထဲၩ့အဖိၪတၭ, မွဲယွၩ အဖိၪလီၫ.",
			"37": "<sup>37</sup> မွဲလါနၫ့ဘိၩလၧၦၥံၫမိဂဲထုၪ့ထဲၩ့နီၪ, စမိစ့ၭဒုၭနဲၪ လၧဆၧၡိၬအဖၧၩ့ထီးအကိၭယွၩလၧစအၫဘြဟၫ့ အယွၩ, လၧစအံစၭအယွၩ, လၧစယၫကူၭအယွၩ",
			"38": "<sup>38</sup> နီၪလီၫ.- လမွဲဘၪၦၥံၫအယွၩတၭ, မွဲၦမၧၫ့အယွၩ လီၫ.အဂဲးဘဲၫယီၩ ၦထီးအလူၬမၧၫ့ဝ့ၫလၧအဖၧၩ့ လီၫ.",
			"39": "<sup>39</sup> ၦကွ့ၭလံၬၥံၪ လနၩ့နၩ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,",
			"40": "<sup>40</sup> ဆရၫဧ့,နစံၭဆၧဂ့ၩမၬလီၫ.- ၦအၪ့စၪ့အဆၧဘုၪ့ လၧၩ့နးဂၩအ့ၬ.",
			"41": "<sup>41</sup> အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၦစံၭလၧဎရံၬ မွဲစဒၫဝံၭအ",
			"42": "<sup>42</sup> ဖိၪခွၫဘဲၫၥ့ၪလဲၪ.- စဒၫဝံၭအနၫ့ဆါဒၪလ့ၬ လၧလံၬ စံၭထၪ့အၪ့အူၭဆၧအဖၧၩ့နီၪ,စံၭဝ့ၫ, ယွၩစံၭယကဆါ, ဆၧၫ့နၩ့လၧယစူၪထွ့ၪ,",
			"43": "<sup>43</sup> ထီးယအီၪက့ၪလၩ့နဒုၪနဒၩၥံၪ လၧနခၪ့ယဲးလၩ့ အလးဆံၭ.",
			"44": "<sup>44</sup> မၩအၥၭဘဲၫနီၪတၭ, စဒၫဝံၭကိၭအဝ့ၫလၧ အကဆါနီၪ, မိမွဲအဖိၪခွၫဘဲၫၥ့ၪလဲၪ.",
			"45": "<sup>45</sup> တၭၦခမျၧးထီးအလူၬ ဒိၭအနါအဘိၩ့ဘၭနီၪ, အဝ့ၫဒၪလီၩဘၪအထံၩအဖျဲၥံၪ, ထီးလၩ့နၥံၪအၥၭ",
			"46": "<sup>46</sup> လၧၦကွ့ၭလံၬၥံၪဆံၭ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအဲၪဒိၭ လၧအမိစဲၪ့ဝံၩ့ဝၩ့ ၥိၭဆဲၫ့ထီၫထီၫလ့ၬ ဒဲအဲၪဒိၭဝ့ၫလၧ ဆၧချဲၩ့မုၬနါလၧဖၠၫဖၧၩ့, ဒဲလးဆၧၫ့နၩ့လၧအထီၫ ထုၬလၧၥရိၬဖၧၩ့ ဒဲဆၧအလးလၧအဂ့ၩထုၬ လၧၦ",
			"47": "<sup>47</sup> ဘုၪအၪ့ဘုၪအီၩ ဆၧအဖၧၩ့လဖၪနီၪလီၫ.- မွဲလၧအ အၪ့ယုလၩ့ခွံၬၦမုၪမဲၪအဂံၪ့တၭ, ဘဲၫဆၧမိဖျီၪထၪ့ လၧအဂးအၥိၭနီၪ, အဝ့ၫၥံၪဘၩဆိၪဖၪဆၧထီၫထီၫ လ့ၬလီၫ. အခိးမွဲအဝ့ၫၥံၪမိဘၪဆၧစ့ၩရၫ့နၭထၪ့ လခီၫဒံၭလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> အဝ့ၫဒၪယိထၪ့ဝ့ၫတၭ, ဒၪဘၪၦၥထံၫခွံၬလၩ့အ",
			"2": "<sup>2</sup> ဆၧဖ့ၪလၫ့ လၧစ့ၩအီၪကီၪ့အလးဖၧၩ့လီၫ.- တၭဒၪ ဘၪဆ့ၦမုၪမဲၫအၡၪ့လဂၩ ဂဲၫခွံၬလၩ့ကၭနံၫဘံၪ့လီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယစံၭနၥံၪလၩ့ထံးလၩ့ဆ့ၭၦမုၪ မဲၫအၡၪ့လဂၩယီၩ,ခွံၬလၩ့ဆၧအၪနဲၪ့ၦထီးအလူၬ",
			"4": "<sup>4</sup> လီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪကိၭဂၩဒ့ၭနီၪ, မၩန့ဝ့ၫ လၧအဆၧဎွ့ၩလၨၪခွံၬအဘျဲၪတၭ, ခွံၬလၩ့လၧဆၧ မၩဘိၪ့အဖၧၩ့လီၫ. အ့ၪမွဲၦမုၪမဲၫလဂၩယီၩ,မၩန့ဝ့ၫ လၧအဆၧလလၧၫ့လဎွ့ၩဘၪအဖၧၩ့တၭ, ခွံၬလၩ့က ယဲအဆၧအီၪလၧအဆၧအၪ့ဆၧအီၩအဂး ထီး အလူၬလီၫ.",
			"5": "<sup>5</sup> တၭၦလနၩ့နၩ့စံၭဝ့ၫ,လၧဆၧလုအဂံၪ့အဂဲး,လၧ အဘၪဆၧကယၧၩ့အၥၭလၧလိးဂ့ၩ, ဒဲလၧဆၧမၩဘိၪ့",
			"6": "<sup>6</sup> လဖၪတၭ, အဝ့ၫဒၪစံၭဝ့ၫ,- ဆၧလၧနၥံၪဒၪဘၪလဖၪ ယီၩ,အနံၩအၥၫ့မိဘၪဝ့ၫ လၧလိးအီၪဒၩ့ဒိၭ လိၬအၥၭ နီၪလလၩ့ဎီးခွံၬဘၪတၭ, အီၪလၩ့ထးဘၪနးဖျိၪ့အ့ၬ.",
			"7": "<sup>7</sup> တၭအဝ့ၫၥံၪအၪ့စၪ့ဆၧ, စံၭဝ့ၫ ဆရၫဧ့, ဆၧနီၪ လဖၪမိမၩအၥၭဆံၭယံၬခိၬလဲၪ. ထီးအမိမၩအၥၭ ဘူၭထၪ့နီၪ, ဆၧလၩ့လၭမိမၩအၥၭ လၧဆၧနီၪလမံၩ့လဲၪ.",
			"8": "<sup>8</sup> တၭအဝ့ၫဒၪစံၭဝ့ၫ, ဘဲၫၥိၭၦထီးအၪ့လီၫန့နၥံၪလ ဂ့ၩနီၪ,ထီးလၩ့နၥံၪအၥၭဆံၭ. အဂဲးဘဲၫယီၩၦမိဂဲၫ ထၪ့ဝ့ၫလၧယမံၩ့အၪဂၩတၭ, မိစံၭဝ့ၫ,ယဝ့ၫဒၪယီၩ ယမွဲအဝ့ၫလီၫ. တၭအမုအလၩနီၪမိဘူၭယူၭဝ့ၫလီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, နၥံၪထီးဖိၬအခဲၫ့လဂ့ၩ.-ထီး နၥံၪအ့ၪနါဂၧၫ့ ဆၧဒုၭၥုၭဒုၭၥ့ၪလဖၪ,ဒဲဆၧတုၩ့ထၪ့ တုၩ့လၩ့အဂဲးတၭ, ၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩ ဆၧနီၪလဖၪဘၪမၩဆိၫအၥၭလီၫ. မွဲလါနၫ့ဘိၩအ ထုၬအီၪဒံၭချဲၫ့ဝါဒံၭအ့ၬ.",
			"10": "<sup>10</sup> ထီးနီၪလဖၧၫ့စံၭအဝ့ၫၥံၪ, ၦၡၩလဆၨၩမိထၫ့ဒုၪ ဒၩၦၡၩလဆၨၩဒၪတၭ, ဘၩ့မုးမိထၫ့ဒုၪဒၩဘၩ့မုး",
			"11": "<sup>11</sup> လီၫ.- တၭဂၪ့ခိၪမိဝၭၡိၩ့ၡိၬဝ့ၫ နၭနၭလ့ၬလၧအံၩလ စီၪ့လၧအိၩလစီၪ့, ဒဲဆၧအီၪဝံအီၪဆံၩ့, ဒဲဆၧဆၫၥံၫ ချဲၫ့မိအီၪထၪ့ဝ့ၫလီၫ. တၭဆၧလၩ့လၭဖၭဒိၪ အီၪလၧ ဆၧၥၭမဲၪၥၭဖျဲၩ့နီၪ, မိအီၪထၪ့ဝ့ၫလၧမူၭဖိၭဖၫ့လီၫ.",
			"12": "<sup>12</sup> မွဲလါနၫ့ဘိၩဆၧနီၪလဖၪ လချႃၬမၩဒံၭဘၪအၥၭထီး အလူၬတၭ, ၦမိဖီၪ့ထၬနၥံၪတၭ, မိမၩအၧၩ့မၩနၭနၥံၪ, မိဖ့ၪလၫ့နၥံၪလၧဆၧစ့ၩရၫ့အလး, ဒဲလၧထီၫ့ဖၧၩ့ တၭ,မိလ့ၩမီၩ့နၥံၪလၧစဎွၩၥံၪ, ဒဲလၧၦဒိၪၦၡါၥံၪအ",
			"13": "<sup>13</sup> အီၪလၧယမံၩ့အခိၪအကၠီၩ့လီၫ.- ဆၧမိကဲၪထဲၩ့ဝ့ၫ လၧဆၧထိးအၥၭလၧနၥံၪအဂးလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭနၥံၪမိချဲၩ့ဖီၩ့ဖျ့ၭဆၧ ဘဲၫအံၩဘဲၫအိၩနီၪ, ထီးလၩ့နၥံၪအၥၭ လၧနၥံၪထီး",
			"15": "<sup>15</sup> ဆီၫ့မီၪ့ဝဲၩဆၧလဂ့ၩ.- အဂဲးဘဲၫယီၩယမိဖ့ၪလၫ့ နၥံၪအနိၭ, ဒဲဆၧကိၪ့ၥ့ၪလၧ နၥံၪအဒုၪအဒၩလဖၪဂဲး",
			"16": "<sup>16</sup> လိၬတ့ၭလိၬဝ့ၫၥ့ၪနးဂၩအ့ၬ.- နၥံၪအမိအဖါ,ဒဲနၥံၪ အဖုအဝဲ, ဒဲနၥံၪအဘူၭအထံး, ဒဲနၥံၪအထံၩအၥိၭလ ဖၪနီၪမိဖ့ၪလၫ့ခွံၬနၥံၪတၭ, မိမၩၥံၫခွံၬနၥံၪလနၩ့",
			"17": "<sup>17</sup> နၩ့ဆ့လီၫ.- တၭၦမိမ့ၬလဲၩနၥံၪ လၧယမံၩ့အကၠီၩ့ကိၭ",
			"18": "<sup>18</sup> ဂၩဒ့ၭလီၫ.- မွဲလါနၫ့ဘိၩ နၥံၪအခိၪၥူၫလဘီၩ့နီၪ",
			"19": "<sup>19</sup> လၩ့မါဘၪအ့ၬ.- အီၪက့ၪနၥံၪအၥၭလၧနၥံၪမိအီၪ ဂုးဂုးခၧၫ့ခၧၫ့ဆံၭ.",
			"20": "<sup>20</sup> တၭထီးနၥံၪအ့ၪဒၪဘၪ ၥုၭဖိၪၥ့ၪဖိၪအီၪဝၬဖီၩ့ ယရု စလံၫ့နီၪ ၥ့ၪယၫနၥံၪဝ့ၫ လၧအဆၧအီၪယူဝ့ၫဘူၭထၪ့",
			"21": "<sup>21</sup> ယူၭလီၫ.- ထီးနီၪလဖၧၫ့ ၦအီၪလၧခးယုဒၫအဖၧၩ့ လဖၪနီၪ,မွဲအစဲၪ့လၧခိၪလီၩ့ဆံၭ. တၭၦအီၪလၧဒိၩ့ဖၧၩ့ နီၪ,မွဲအစဲၪ့ထၪ့ခွံၬလၧခီၫ့ဆံၭ. တၭၦအီၪလၧမံၩ့လၬ ကျၩလဖၪနီၪ, မွဲအထီးထဲၩ့နုၬထဲၩ့ လၧဒိၩ့ဖၧၩ့လ",
			"22": "<sup>22</sup> ဂ့ၩ.- အဂဲးဘဲၫယီၩ ဆၧလၧမုနံၩလဖၪနီၪ, မွဲဆၧဖ့ၪ ထဲၩ့ဆၧအၧၩ့အမုနံၩၥံၪ, ဘဲၫၥိၭဆၧကွ့ၭအၥၭမိလၧၫ့ ထၪ့ဎွ့ၩထၪ့ဝ့ၫထီးအလူၬလီၫ.",
			"23": "<sup>23</sup> ဆၧလၧမုနံၩလဖၪနီၪ, ၦလၧအဒၧၩ့,ဒဲၦလၧအဒုၭ အၪ့နူလဖၪနီၪဘၪအၡၪ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧၡၪ့ ဖၭဒိၪမိဘၪခးလဘံၪ့ယီၩတၭ, ဆၧၥၭထၪ့မိဘၪ ၦလ",
			"24": "<sup>24</sup> ဆၨၩယီၩလီၫ.- အဝ့ၫၥံၪမိဘၪၥံၫလၧနၭတၭ, မိဘၪ ဆၧဆိၬခွံၬဝ့ၫ လၧၦကိၭအဆၨၩဒ့ၭ အကျၩတၭ, ၦ ဆၨၩအဂူၫဂၩၥံၪနီၪ ဘိၩ့အမုအလၩလချႃၭလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဒံၭဘၪနီၪ, မိယဲးထဲးယရုစလံၫ့လီၫ.",
			"25": "<sup>25</sup> တၭဆၧလၩ့လၭမိအီၪထၪ့လၧမုအလီၩ့ ဒဲလၧလၩ အလီၩ့, ဒဲလၧၡၪၥံၪအလီၩ့, ဒဲဆၧကၪဆၧဂဲၩ, ဆၧခိ ဆၧဝီၩမိဘၪၦၡၩအဆၨၩၥံၪလၧဂၪ့ခိၪချိၫ့, လၧမၫ",
			"26": "<sup>26</sup> ဆမံၭဒဲလပီၩလဖၪမိၥီၫထၪ့အကၠီၩ့လီၫ.- ၦၡၩၥံၪမိ ၥၭမဲၪဆၧတၭ, မိအၪ့ယိၪဆၧလၧ ဆၧမိမၩအၥၭလၧ ဂၪ့ခိၪအဂဲးတၭ,မိၥံၫဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ မူၭခိၪအ",
			"27": "<sup>27</sup> စီၩ့အမၩ့နီၪမိဝၭဒိၪမၬလီၫ.- ထီးနီၪလဖၧၫ့ၦမိဒၪ ဘၪၦၡၩအဖိၪခွၫယီၩ ဂဲၫထူၬဆၧအုၪ့အီၪဝ့ၫ လၧအ",
			"28": "<sup>28</sup> စီၩ့ဒိၪအမၩ့ဒိၪ,ဒဲအလၩဒိၪအဖၩ့ဒိၪလီၫ.- ထီး ဆၧနီၪလဖၪမၩအၥၭတၭ, ဆၧထိးထဲၩ့တၩ့ထဲၩ့နၥံၪ အမုအလၩဘၪ ဘူၭထၪ့ယူၭတၭ, မိၬထၪ့နၥံၪအခိၪ, ယိထၪ့ဆၧဆံၭ.",
			"29": "<sup>29</sup> အဝ့ၫဒၪလီၩဘၪအဝ့ၫၥံၪလၧဆၧချဲၩ့အဒီၩ့းချိၪ့",
			"30": "<sup>30</sup> ဒိၩ့အထံၭ, ဒဲၥံၪ့ထီးအလူၬနီၪ, ယိအဝ့ၫၥံၪဆံၭ.- ထီး အလၪအ့ၪဒိၭထၪ့နီၪ, နၥံၪဒၪဘၪတၭ, နၥံၪၥ့ၪယၫဒၪ",
			"31": "<sup>31</sup> နၥံၪဝ့ၫလၧဆၧခိအထီ မိဘၪဝ့ၫဘူၭယူၭလီၫ.- ဘဲၫ နီၪအၥိၭထီးနၥံၪအ့ၪဒၪဘၪဆၧလဖၪနီၪ မၩအၥၭ တၭ,ၥ့ၪယၫနၥံၪဝ့ၫ လၧယွၩအဘၩ့အမုး အီၪဘူၭမၬ",
			"32": "<sup>32</sup> ဝ့ၫလီၫ.- ယလီၩဘၪနၥံၪတီၩတီၩ ၦၡၩလဆၨၩယီၩ လချႃၭဖီၩ့ခွံၬဒံၭဘၪတၭ, ဆၧလဖၪနီၪ မိမၩအၥၭ",
			"33": "<sup>33</sup> ထီးအလူၬလီၫ.- မူၭခိၪဒဲဂၪ့ခိၪမိဒံၩခွံၬဒံၩဖျိၭဝ့ၫ လီၫ.အ့ၪမွဲယဆၧချဲၩ့လဖၪ, ဒံၩခွံၬဝ့ၫအ့ၬ.",
			"34": "<sup>34</sup> ထီးလၩ့နၥံၪအၥၭဆံၭ.အ့ၪလမွဲဘၪဘဲၫနီၪနၥံၪ အၥၭမိမၧၫ့လၧဆၧအၪ့လၨၪအီၩလၨၪဆၧတၭ, မွဲ လၧအယီၩလကၠၪ အဆၧအၪ့ယိၪအကၠီၩ့တၭ, မုလနံၩ နီၪမိဘၪနၥံၪလၧ နၥံၪလဆီၫ့မီၪ့ဘၪဆၧ အထီလီၫ.",
			"35": "<sup>35</sup> အဂဲးဘဲၫယီၩ မိဂဲၫဘၪ ကယဲၦအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့",
			"36": "<sup>36</sup> ထၧၫ့ဖျိၪ့ယၫ ဘဲၫဖျံၩခွၩ့အၥိၭနီၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ,ဘဲၫၥိၭ ဆၧမိအီၪက့ၪနၥံၪ ဂ့ၩဖီၩ့ဂ့ၩဖျ့ၭ ဆၧလၧအမိမၩအၥၭနီၪ လဖၪတၭ, မိအီၪဆၧၫ့ထုၪ့ ဘၪလၧၦၡၩအဖိၪခွၫ အမ့ၬယၫတၭ, အီၪခိၭဘၩဆိၪ ဖၪဆၧကိၭအဆၧၫ့အထီဒ့ၭဆံၭ.",
			"37": "<sup>37</sup> အဝ့ၫဒၪၥီၪ့ဆၧၥၫ့ဆၧလၧ မုဆၫလခီၫလၧဆၧလု အဂံၪ့ဖၧၩ့တၭ, လၧမုနၩလခီၫလ့ၩအီၪဝ့ၫ လၧခိၪလီၩ့",
			"38": "<sup>38</sup> ကိၭဝ့ၫအလဲအိၫ့အလီၩ့လီၫ.- ဘဲၫၥိၭအမိခိၭနၪဆၧ တၭ,ၦၡၩထီးအလူၬနီၪ ဂဲၫလၧဆၧလုအဂံၪ့ဖၧၩ့လၧ ဆၧဖၩ့ထၪ့ဂီၩဂီၩလ့ၬလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ဆၧဘိၪ့ကိၪလဘၪဘၪလၧမံၪ ကိၭဝ့ၫဘိၪ့လ့ၩဖၬနီၪ",
			"2": "<sup>2</sup> လၩ့ဘူၭဝ့ၫတၭ,- ၦလုဆၧအဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪ, မိမၩၥံၫအဝ့ၫ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪအၪ့ဎၬဝ့ၫအ လးတၭးအဂဲးဘဲၫယီၩ ၥၭမဲၪၦခမျၧးနီၪလီၫ.",
			"3": "<sup>3</sup> ၦအီၪလၧၦလဆံၫနံၫဂၩအကျၩ စယုဒၭကိၭဝ့ၫလၧ အံၫစကၫရအၧၭလဂၩနီၪ, မုၪခီၩလဲးနုၬလၧအဖၧၩ့",
			"4": "<sup>4</sup> တၭ,- မိဖ့ၪလၫ့ခွံၬဝ့ၫဘဲၫအံၩဘဲၫအိၩ အဂဲးအကၠီၪ့ နီၪ,အဝ့ၫဒၪလ့ၩကၩ့ကၩလိၬအၥၭလၧ ၦလုဆၧအဒိၪ",
			"5": "<sup>5</sup> ၥံၪ,ဒဲၦၥုၭခိၪလဖၪလီၫ.- အဝ့ၫၥံၪၥၭထိၬဝ့ၫတၭ, အုၩ့",
			"6": "<sup>6</sup> လၩ့ဝ့ၫလၧအမိဖ့ၪလၫ့အစ့ၩလီၫ.- အဝ့ၫဒၪအုၩ့လၩ့ ဝ့ၫဘဲၫၥိၭ အမိဖ့ၪလၫ့ခွံၬအဝ့ၫလၧ ၦခမျၧးလအီၪဘၪ အခၫနီၪ, အၪ့ဎၬဝ့ၫအဆၧၫ့အထီ လၧအဘၪလီၫ.",
			"7": "<sup>7</sup> ဆၧဘိၪ့ကိၪလဘၪဘၪလၧမံၪ,မုလနံၩလၧအဘၪ",
			"8": "<sup>8</sup> မၩၥံၫဆၧလ့ၩဖၬထီၩ့ဝ့ၫတၭ,- အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ စပံတၧၫဒဲစယီဟၫ့တၭ, စံၭဝ့ၫ, လ့ၩတဲၩ့ဝဲၩဘိၪ့လ့ၩ",
			"9": "<sup>9</sup> ဖၬဘဲၫၥိၭပမိအၪ့ဘၪဆံၭ.- တၭအဝ့ၫၥံၪအၪ့စၪ့ဝ့ၫ,",
			"10": "<sup>10</sup> မွဲအဘၪနၥၭလၧပမိတဲၩ့ဝဲၩ ဆၧခီၫခီၫလဲၪ.- တၭ အဝ့ၫဒၪ,စံၭအဝ့ၫၥံၪယိခွါ, ထီးနၥံၪအ့ၪလ့ၩနုၬလၧဒိၩ့ ဖၧၩ့တၭ, နၥံၪမိဒၪဘၪ ၦလ့ၩယိၭထံၫနးဂၩတၭ, ဖိၬအ",
			"11": "<sup>11</sup> ခဲၫ့ထီၩ့လၧဂံၪ့ ထီးအလ့ၩနုၬဝ့ၫ အလးနီၪဆံၭ.- တၭ စံၭဂံၪ့ကဆါ, ဆရၫလီၩဘၪနၧၩ, ဒူၭလဒူၭထီးယမိ အၪ့ဘိၪ့လ့ၩဖၬလၧယထံၩယဖျဲၥံၪ အၥိၭနီၪ,မွဲအအီၪ",
			"12": "<sup>12</sup> ခီၫခီၫလဲၪ.- အဝ့ၫနီၪမိဒုၭနဲၪနၥံၪ အဒူၭဖၭဒိၪလၧဆၧ ထၪ့ထီၫလဆၫ့ အီၪတဲၩ့ဝဲၩအၥၭလီၫ. တဲၩ့ဝဲၩဆၧထီး",
			"13": "<sup>13</sup> နီၪဆံၭ.- အထံၩအဖျဲၥံၪလ့ၩဝ့ၫနီၪ, ဒၪဘၪဆၧဘဲၫ အဝ့ၫဒၪစံၭဆၧအၥိၭနီၪ, တၭအဝ့ၫၥံၪ တဲၩ့ဝဲၩဘိၪ့ လ့ၩဖၬလီၫ.",
			"14": "<sup>14</sup> ထီးအနၩရံၩဘၪနီၪ, အဝ့ၫဒၪဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဎုၬလၧ ၦဆၧအၪ့မၧၫ့ဖိၪလဆံၫနံၫဂၩအၥိၭ လၧစပွဲထံၭနီၪ,",
			"15": "<sup>15</sup> စံၭအဝ့ၫၥံၪ, ယဝ့ၫဒၪယီၩ ယလချႃၭ ထိးဒံၭဘၪဆၧ တၭ,ဆၧမိအၪ့ဘၪယၥၭဘိၪ့လ့ၩဖၬယီၩ လၧနၥံၪအ",
			"16": "<sup>16</sup> ၥိၭဒိၪမၬလီၫ.- အဂဲးဘဲၫယီၩယစံၭနၥံၪ လၧအလချႃၭ လၧၫ့ထၪ့ဎွ့ၩထၪ့ဒံၭဘၪ လၧယွၩအဘၩ့အမုးအ ဖၧၩ့နီၪ,ယအၪ့လၧၩ့အဝ့ၫအ့ၬ.",
			"17": "<sup>17</sup> တၭအဝ့ၫဒၪမၩန့လိၫ့ စံၭထၪ့အၪ့အူၭ ဆၧအခိးအ တၩတၭ,စံၭဝ့ၫ,မၩန့ဆၧယီၩတၭ, အၪ့နၩ့ဖၭလိၬနၥံၪ",
			"18": "<sup>18</sup> အၥၭဆံၭ.- အဂဲးဘဲၫယီၩယလီၩဘၪနၥံၪ လၧယွၩအ ဘၩ့အမုးလချႃၭ ထီၩ့ဒံၭဘၪနီၪ, ယအီၩလၧၩ့စဘံၭမု",
			"19": "<sup>19</sup> အၥၪဆ့အ့ၬ.- အဝ့ၫမၩန့ကိၪလလီၪ့တၭ, စံၭထၪ့အၪ့ အူၭ ဆၧအခိးအတၩဂီၩ့တၭ, ကံၪ့ဘျ့ၭဝ့ၫတၭ, ဖ့ၪ လၫ့အထံၩအဖျဲၥံၪနီၪ, စံၭဝ့ၫ, ဆၧယီၩမွဲယမိၡါလၧ အဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫ လၧနၥံၪအကၠီၩ့လီၫ. မၩဆၧ",
			"20": "<sup>20</sup> ယီၩလၧနၥံၪနၪ့ထၪ့ထဲၩ့ယၧၩဆံၭ.- လၧအအၪ့ဆၧ လၧဂၪလခီၫဂီၩ့နီၪ, မၩန့လိၫ့ဘဲၫနီၪအၥိၭ, စံၭဝ့ၫဒၪ, လိၫ့ယီၩမွဲဆၧအုၩ့လၩ့အၥၫ့ လၧယၥွံၪအဖၧၩ့, လၧ အဘၪဆၧလူၫလၩ့အၥၭ လၧနၥံၪအဂးလီၫ.",
			"21": "<sup>21</sup> မွဲလါနၫ့ဘိၩ,ယိခွါ, ၦလၧအမိဖ့ၪလၫ့ခွံၬယၧၩလဂၩ",
			"22": "<sup>22</sup> အစူၪအီၪလၧယၥိၭလၧစပွဲအဖၫ့ခိၪလီၫ.- မွဲမၬ,ၦၡၩ အဖိၪခွၫယီၩမိထဲၩ့ဝ့ၫဘဲၫဆၧစ့ၩရၫ့ဝဲၩဝ့ၫအၥိၭနီၪ လီၫ.မွဲလါနၫ့ဘိၩ, ၦလၧအဖ့ၪလၫ့ခွံၬဝ့ၫလဂၩနီၪဘၪ",
			"23": "<sup>23</sup> အၡၪ့လီၫ.- အဝ့ၫၥံၪအၪ့စၪ့လိၬအၥၭ, မွဲပလၫမိမၩ ဆၧဘဲၫယီၩလဂၩလဲၪ.",
			"24": "<sup>24</sup> လၧအဝ့ၫၥံၪအကျၩ မွဲပလၫမိကဲၪထၪ့ အခိၪ လဂၩလဲၪနီၪ, အဝ့ၫၥံၪဂဲးလိၬတ့ၭလိၬအၥၭဆ့လီၫ.",
			"25": "<sup>25</sup> အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၦဆၨၩလဖၪအစဎွၩၥံၪစ့ၩရၫ့ ဘၪဝ့ၫလီၫ. ၦစ့ၩရၫ့ဆၧနီၪ,ၦကိၭအဝ့ၫၥံၪလၧၦမၩဂ့ၩ",
			"26": "<sup>26</sup> ဆၧလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩမွဲဘဲၫနီၪအၥိၭအ့ၬ.ၦ လၧအဒိၪထုၬလၧနၥံၪအကျၩနီၪ, မွဲအကဲၪထၪ့ဘဲၫ အဆံၭထုၬအၥိၭဆံၭ. ဒဲၦလၧအစ့ၩရၫ့ဆၧနီၪ, မွဲအ",
			"27": "<sup>27</sup> ကဲၪထၪ့ဘဲၫဆၧအခ့ၫအၡၩအၥိၭဆံၭ.- အဂဲးဘဲၫယီၩ ၦလဂၩလၧ အဆၧၫ့နၩ့ဒံၩ့ခံၫ့အၪ့ဆၧလၧစပွဲထံၭမွဲ ဂ့ၩ,အခ့ၫအၡၩလဂၩမွဲဂ့ၩ, မွဲအဒိၪနဲၪ့ဂၩဂၩလဲၪ. မွဲၦ လၧအဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧစပွဲထံၭနီၪ, မွဲအ့ၬဧၪ. အ့ၪမွဲ ယဝ့ၫဒၪယီၩ, ယအီၪလၧနၥံၪအကျၩဘဲၫဆၧအခ့ၫအ",
			"28": "<sup>28</sup> ၡၩအၥိၭလီၫ.- လၧယဘၪဆၧကျဲၩ့ဖစီၩ့အဖၧၩ့နီၪန",
			"29": "<sup>29</sup> ၥံၪမွဲၦလၧအအီၪလၧယၥိၭလီၫ.- ယအီၪက့ၪလၩ့န့ နၥံၪအဘၩ့အမုးဘဲၫဖါအီၪက့ၪလၩ့န့ယၧၩအၥိၭ,",
			"30": "<sup>30</sup> ဘဲၫၥိၭနၥံၪမိဆၧၫ့နၩ့ဒံၩ့ခံၫ့ အၪ့ဆၧအီၩဆၧလၧယစပွဲ ထံၭလၧယဘၩ့ယမုးအဖၧၩ့နီၪ,ဒဲနၥံၪမိဆၧၫ့နၩ့လၧ လးဆီၩ့ဆီအဖၫ့ခိၪတၭ, စ့ၩရၫ့ၦအံၫစရ့လၭလဆံၫ နံၫဒီၪ့လီၫ.",
			"31": "<sup>31</sup> ကဆါနီၪစံၭဝ့ၫ,စစဲမၧၫ့ဧ့, စစဲမၧၫ့ဧ့,ယိခွါ,မုၪခီၩ",
			"32": "<sup>32</sup> လဲးအၪ့ကံၩ့ဂု နၥံၪဘဲၫဘုၪအၥိၭနီၪလီၫ.- အ့ၪမွဲယဝ့ၫ ဒၪယီၩ,ဘဲၫၥိၭနဆၧနဲၩထီးၡၩလၩ့ခွံၬလဂ့ၩတၭ, ယ ဘၩဆိၪဖၪန့ယူၭနဂးယူၭ. ထီးနကၠၪလီၩ့ထဲၩ့ယူၭ နၥၭနီၪ, ဒုၭဆီၪ့ထၪ့ နထၧၫ့ဖုဝဲၥံၪအဂဲးအဘၭဆံၭ.",
			"33": "<sup>33</sup> တၭအဝ့ၫစံၭဝ့ၫ, ကဆါဧ့,လၧထီၫ့ဖၧၩ့မွဲဂ့ၩ, လၧ ဆၧၥံၫအဖၧၩ့မွဲဂ့ၩ, ယအီၪတဲၩ့ဝဲၩယူၭယၥၭလၧယမိ",
			"34": "<sup>34</sup> လ့ၩလၧနၥိၭလီၫ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ, စပံတၧၫဧ့,ယ စံၭနၧၩ, လနၩယီၩ ဆၫ့ဖၫလချႃၭအီၩ့အိၪထၪ့ဒံၭဘၪ နီၪ,နမိစံၭလၩ့နၥၭလၧနလၥ့ၪယၫဘၪယၧၩ နးၥၧၫ့ ဘျၩ့လီၫ.",
			"35": "<sup>35</sup> တၭစံၭအဝ့ၫၥံၪ, လၧယအၪ့မၧၫ့နၥံၪ လ့ၩဆၧလၧ စ့ၩအထိၪ့မွဲဂ့ၩ, ဒဲဆၧအၪ့အထိၪ့မွဲဂ့ၩ,ဒဲခၪ့ဖံၭလ ဖၪမွဲဂ့ၩ,လအီၪဘၪနီၪ, နၥံၪအဆၧ လလၧၫ့လဎွ့ၩဘၪ နီၪ, မွဲအအီၪလမံၩ့မံၩ့ဆ့ဧၪ. တၭအဝ့ၫၥံၪစံၭဝ့ၫ, အီၪ",
			"36": "<sup>36</sup> နးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, မွဲအစံၭအဝ့ၫၥံၪ,အ့ၪ မွဲဘိၩ့နဲၪ့ယီၩ ၦအီၪလၧစ့ၩအထိၪ့နီၪ, မွဲအမၩန့ဒၪဝ့ၫ ဆံၭ,ဘဲၫနီၪအၥိၭ, ဆၧအၪ့အထိၪ့ဆ့လီၫ. ၦလၧအနၭ လအီၪဘၪနီၪ, မွဲအအၪ့ဆၫခွံၬအဖၬဘဲၩ့တၭ, ဎွ့ၩန့",
			"37": "<sup>37</sup> နးဘံၪ့ဆံၭ.- အဂဲးဘဲၫယီၩ ယစံၭနၥံၪ လၧဆၧကွ့ၭ အၥၭယီၩ, ဆၧအီၪက့ၪအဝ့ၫလၧၦမၩမၪဆၧၥံၪအ ကျၩနီၪ,မိဘၪလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဒံၭ လၧယဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧလၧအဘၪဆဲၫ့ လၧယၧၩယီၩမိလၧၫ့ ထၪ့ဎွ့ၩထၪ့ဝ့ၫလီၫ.",
			"38": "<sup>38</sup> တၭၦလဖၪနီၪ,စံၭဝ့ၫ, ကဆါဧ့,ယိခွါ,နၭနံၫဘံၪ့ အီၪထီးယီၩလီၫ. အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ဘၪယူၭ.",
			"39": "<sup>39</sup> ဘဲၫအထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪ, အဝ့ၫဒၪလ့ၩထၪ့ လၧခိၪလီၩ့အလဲအိၫ့အလီၩ့တၭ, အထံၩအဖျဲၥံၪဖိၬ ထၪ့အခဲၫ့လီၫ.",
			"40": "<sup>40</sup> လ့ၩထီၩ့ဝ့ၫထီးနီၪတၭ, စံၭအဝ့ၫၥံၪ, ဘဲၫၥိၭနၥံၪ ထီးလ့ၩနုၬဘၪလၧဆၧကျဲၩ့ဖစီၩ့ အဖၧၩ့လဂ့ၩနီၪ,ဘၩ",
			"41": "<sup>41</sup> ဆိၪဖၪဆၧဆံၭ.- အဝ့ၫဒၪလ့ၩလၧယၫလခွံၬတၭ,ထွံၩ",
			"42": "<sup>42</sup> လၩ့အခၪ့ဘၩဆိၪဖၪဆၧ,- စံၭဝ့ၫ, ဖါဧ့, အ့ၪဘၪနၥၭ တၭ, ဆၧလၧလိၫ့ယီၩ, မွဲအလ့ၩဖီၩ့ခွံၬယၧၩဆံၭ. မွဲ လါနၫ့ဘိၩ ထီးဒၪယၥၭဒၪယဝ့ၫမွဲအ့ၬ, မွဲထီးဒၪနၥၭ ဒၪနဝ့ၫဆံၭ.",
			"43": "<sup>43</sup> အၥီၫ့လၧမူၭခိၪလဂၩအီၪထၪ့တၭ, ဒုၭဆီၪ့ထၪ့အ",
			"44": "<sup>44</sup> ဂဲးအဘၭလီၫ.- ဘၪဆၧအၡၪ့ အီၪဝ့ၫလကဲၪဘၪ တၭ,ဘၩဆိၪဖၪဆီၪ့နဲၪ့ဒံၭအလးလီၫ. တၭဆၧမၩ အၥၭလၧအခိၥွ့ၫလၩ့ဝ့ၫ လၧဂၪ့ခိၪအဖၫ့ခိၪ ဘဲၫဆၧ",
			"45": "<sup>45</sup> ၥွံၪလၩ့ဆၩ့အဖျိၪ့ဖၭဒိၪအၥိၭနီၪလီၫ.- တၭဂဲထုၪ့လၧ အဘၩဆိၪဖၪဆၧနီၪ, ထဲၩ့ဝ့ၫလၧအထံၩအဖျဲၥံၪ အ အီၪတၭ, ဒၪဘၪလၧအဝ့ၫၥံၪမံၫမၪ လၧဆၧၥၭအုၭအ",
			"46": "<sup>46</sup> ကၠီၩ့,- တၭမွဲအစံၭအဝ့ၫၥံၪ, မွဲဘၪနီၫလၧနၥံၪမံၫမၪ ဘဲၫယီၩလဲၪ. ဂဲထုၪ့တၭ, ဘဲၫၥိၭနၥံၪထီးလ့ၩနုၬဘၪ လၧ ဆၧကျဲၩ့ဖစီၩ့ အဖၧၩ့လဂ့ၩနီၪဘၩဆိၪဖၪဆၧဆံၭ.",
			"47": "<sup>47</sup> လၧအချဲၩ့ဆၧအဘိၩ့ဘၭနီၪ,ယိခွါ, ၦခမျၧး,ဒဲၦ အီၪလၧၦလဆံၫနံၫဂၩအကျၩ, ကိၭဝ့ၫစယုဒၭ လဂၩ ဂဲၫလၧယၫလခီၫတၭ လ့ၩလၧယ့ၫၡုၬအအီၪဘဲၫၥိၭ",
			"48": "<sup>48</sup> အမိအဲၪဂါဝ့ၫလီၫ.- အ့ၪမွဲယ့ၫၡုၬစံၭအဝ့ၫ, စယုဒၭဧ့, မွဲနဖ့ၪလၫ့ခွံၬ ၦၡၩအဖိၪခွၫလၧ ဆၧအဲၪဂါနီၪဆ့ဧၪ.",
			"49": "<sup>49</sup> တၭၦအီၪလၧအၥိၭလဖၪ ဒၪဘၪဆၧလၧအမိမၩအ ၥၭတၭ,စံၭအဝ့ၫ,ကဆါဧ့, မွဲပမိဘၪဖ့ၬလၧနၭဆ့ဧၪ.",
			"50": "<sup>50</sup> ၦလဂၩနီၪဖ့ၬၦလုဆၧအခိၪ အဎီးအၡၩလဂၩတၭ,",
			"51": "<sup>51</sup> အနါထွ့ၪလခီၫထူၬခွံၬဝ့ၫလီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫ, ဎွ့ၩနီၪလီၫ. ထိၭဘၪအနါတၭ, မၩဘျၪ ထဲၩ့အဝ့ၫလီၫ.",
			"52": "<sup>52</sup> တၭၦလုဆၧအဒိၪၥံၪ,ဒဲၦပၧၩ့ဆၧလုအဂံၪ့ၥံၪ, ဒဲ ၦၥၭၡါၥံၪ လၧအဂဲၫထၫ့ဒုၪဒၩအဝ့ၫနီၪ, ယ့ၫၡုၬစံၭအ ဝ့ၫၥံၪ,ဘဲၫၦဖီၪ့ထမျၬအၥိၭနီၪ, မွဲနၥံၪဂဲၫလၧနၭဒဲနိၪ",
			"53": "<sup>53</sup> ထိၭလဖၪနီၪဆ့ဧၪ.- လၧယအီၪလၧနၥံၪအၥိၭလၧဆၧ လုအဂံၪ့အဖၧၩ့ၥံၫ့ၥံၫ့နံၩနီၪ, နၥံၪယူၬထၪ့နၥံၪအစူၪထၫ့ ဒုၪဒၩယၧၩအ့ၬ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, မွဲနၥံၪအနၩရံၩ, ဒဲဆၧခံၭအစီၩ့အမၩ့လီၫ.",
			"54": "<sup>54</sup> အဝ့ၫၥံၪဖီၪ့ထၬလ့ၩမီၩ့ဝ့ၫလၧ ၦလုဆၧအခိၪအဂံၪ့",
			"55": "<sup>55</sup> လီၫ. တၭစပံတၧၫဖိၬထၪ့အခဲၫ့ ယဲၩ့ယိၬလီၫ.- ၦၡၩ ၥံၪဆူၭခဲၩမ့ၪလၧအဝၩ့ဖၧၩ့နီၪ, ဆၧၫ့နၩ့အီၪဖီၩ့ဝ့ၫတၭ,",
			"56": "<sup>56</sup> စပံတၧၫဆၧၫ့နၩ့လၧအကျၩလီၫ.- ဆၧအဎီးအၡၩမုၪ လဂၩဒၪဘၪအဆၧၫ့နၩ့လၧမ့ၪထံၭတၭ, ယိဝ့ၫထံၫ ထံၫဆၭဆၭနီၪ, စံၭဝ့ၫ, အဝ့ၫလဂၩယီၩ, အီၪယူၭလၧ",
			"57": "<sup>57</sup> အဝ့ၫဒၪနီၪအၥိၭလီၫ.- အဝ့ၫဒၪမီၪ့ဘံၭဝ့ၫတၭ, စံၭဝ့ၫ, ၦမုၪဧ့းယၥ့ၪယၫအဝ့ၫအ့ၬ.",
			"58": "<sup>58</sup> လဆိဖိၪဖီၩ့ခွံၬနီၪ, ၦဂူၫဂၩလဂၩဒၪဘၪအဝ့ၫတၭ, စံၭဝ့ၫ, နဝ့ၫဒၪယီၩ, နဘၪဆဲၫ့ လၧၦလဖၪနီၪဆ့",
			"59": "<sup>59</sup> လီၫ.- တၭစပံတၧၫစံၭဝ့ၫ, ၦၡၩဧ့, မွဲယၧၩအ့ၬ, လၩ့ ဘူၭဖီၩ့ခွံၬလနၩရံၩတၭ, ၦဂူၫဂၩလဂၩချဲၩ့ဆၧလၩ့ ထံးလၩ့ဆ့ၭတၭ, စံၭဝ့ၫ, အဝ့ၫလဂၩယီၩ, အီၪယူၭလၧ အဝ့ၫဒၪအၥိၭတၡါလီၫ. အဂဲးဘဲၫယီၩမွဲၦဂၫလလံၫ",
			"60": "<sup>60</sup> ဖိၪလီၫ.- တၭစပံတၧၫစံၭဝ့ၫ,ၦၡၩဧ့,နစံၭဆၧနီၪယၥ့ၪ ယၫအ့ၬ. ချဲၩ့ဆၧနီၪအဘိၩ့ဘၭတၭ, ဆၫ့ဖၫအီၩ့အိၪ ထၪ့ဝ့ၫဒၪချဲၫ့မၬလီၫ. ကဆါနီၪကၠၪစိၩအၥၭတၭ,ယိ",
			"61": "<sup>61</sup> စပံတၧၫလီၫ.- တၭစပံတၧၫနၪ့ထၪ့ထဲၩ့ ကဆါအလူ ဘဲၫအစံၭဝ့ၫအၥိၭနီၪ, :လၧဆၫ့ဖၫလချႃၭအီၩ့အိၪ",
			"62": "<sup>62</sup> ထၪ့ဒံၭဘၪတၭ, နမိမီၪ့ဘံၭယၧၩ နးၥၧၫ့ဘျၩ့လီၫ.:- စပံ တၧၫစဲၪ့ထၪ့လၧခီၫ့တၭ, ဂၪ့ဝ့ၫနၭမၬလီၫ.",
			"63": "<sup>63</sup> ၦလၧအဖီၪ့န့ ယ့ၫၡုၬလဖၪနီၪဒုၪဒွ့ၪဝ့ၫတၭ,ဒိၪ",
			"64": "<sup>64</sup> ဝ့ၫထးဝ့ၫလီၫ.- မၩဘံၭထၬဝ့ၫအမ့ၬဂီၩ့နီၪ, မ့ၭဝ့ၫဒၪ တၭ,အၪ့စၪ့ဝ့ၫ, စံၭဝ့ၫ, မွဲပလၫမ့ၭနၧၩ လဂၩလဲၪ,",
			"65": "<sup>65</sup> လီၩဘၪပၧၩလၧမီၪအချိၬဆံၭ.- တၭချဲၩ့ဒုၪဒွ့ၪအဝ့ၫ လၧဆၧချဲၩ့အဂူၫဂၩအၪမံၩ့လီၫ.",
			"66": "<sup>66</sup> ထီးဆၧဖၩ့ထၪ့တၭ, ၦၥုၪ့က့ၭၥၭၡါၥံၪ,ဒဲၦလုဆၧ အဒိၪၥံၪ, ဒဲၦကွ့ၭလံၬၥံၪနီၪ, အီၪကိၩ့အီၪကီၪ့တၭ,",
			"67": "<sup>67</sup> လ့ၩၥိၫ့အဝ့ၫလၧဆၧစ့ၩရၫ့ခွးအဖၧၩ့,- စံၭဝ့ၫ, နအ့ၪမွဲ ဎရံၬနီၪ, လီၩဘၪပၧၩဆံၭ. တၭအဝ့ၫဒၪစံၭအဝ့ၫ",
			"68": "<sup>68</sup> ၥံၪ,ယအ့ၪလီၩဘၪလါနၫ့နၥံၪနီၪ, နၥံၪနဲၩအ့ၬ.- တၭ ယအ့ၪအၪ့စၪ့နၥံၪနီၪ နၥံၪလချဲၩ့ဆၧၫ့ဘၪယၧၩတၭ,",
			"69": "<sup>69</sup> (နၥံၪကွဲၪဖျါယၧၩဆ့အ့ၬ),- စူၩယၫခိၬလခီၫနီၪ, ၦၡၩ အဖိၪခွၫယီၩမိဆၧၫ့နၩ့ လၧယွၩအစီၩ့အမၩ့အစူၪ ထွ့ၪလီၫ.",
			"70": "<sup>70</sup> ၦထီးအလူၬစံၭဝ့ၫ, အ့ၪမွဲဘဲၫနီၪတၭ,နမွဲယွၩအ ဖိၪခွၫဆ့ဧၪ. အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ,နၥံၪစံၭဘၪယူၭ,ယမွဲ",
			"71": "<sup>71</sup> လီၫ.- တၭၦလဖၪစံၭဝ့ၫ, ပမၩဆၧထိးအၥၭလၧအဂူၫ ဂၩနီၪ, အလးအီၪဒံၭဧၪ. အဂဲးဘဲၫယီၩ ပနါဂၧၫ့ယူၭ လၧအနိၭဒၪဝ့ၫလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> ၦခမျၧးထီးအလူၬနီၪဂဲထုၪ့တၭ, လ့ၩမီၩ့အဝ့ၫဒၪ",
			"2": "<sup>2</sup> ထီၩ့လၧစပဲလၭအအီၪလီၫ.- အဝ့ၫၥံၪအီၪက့ၪဆိၫဆၧ မၪလၧအလီၩ့တၭ,စံၭဝ့ၫ,အဝ့ၫလဂၩယီၩ, ပဒၪဘၪ လၧအအၪ့မၧၫ့ၦလဆၨၩယီၩမၩမၪဆၧတၭ, ဘဲၫၥိၭ ၦထီးဖ့ၪလၫ့အခီၫ့ လၧစံစၧၫလဂ့ၩနီၪပဒၩ့ဝ့ၫတၭ, စံၭ",
			"3": "<sup>3</sup> လၩ့အၥၭလၧအမွဲဎရံၬစဎွၩလဂၩဒၪလီၫ.- တၭစပဲ လၭအၪ့စၪ့အဝ့ၫ, နဝ့ၫဒၪယီၩ,နမွဲၦယုဒၫဖိၪၥံၪအစဎွၩ ဆ့ဧၪ. အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,နစံၭဆၧနီၪ",
			"4": "<sup>4</sup> ဘၪယူၭ.- တၭစပဲလၭစံၭ, ၦလုဆၧအဒိၪၥံၪ,ဒဲၦခမျၧး လဖၪနီၪ, အဝ့ၫလဂၩယီၩ, ယဒၪဘၪဆၧအမၪလၧအ",
			"5": "<sup>5</sup> လီၩ့နးမံၩ့အ့ၬ.- အဝ့ၫၥံၪအီၪက့ၪဒူၩအၥၭဆီၪ့နဲၪ့အ လးဒံၭတၭ,စံၭဝ့ၫ, အဝ့ၫလဂၩယီၩ ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆၧလၧခးယုဒၫထၧၫ့ခးယၫ, မၩထၪ့ဝ့ၫအခၪ့ထံၭလၧ ဂၫလလံၫအဖၧၩ့နီၪဖိးလၩ့ထီးယီၩတၭ, မၩတုၩ့ထၪ့ တုၩ့လၩ့ၦခမျၧးနီၪလီၫ.",
			"6": "<sup>6</sup> စပဲလၭနါဂၧၫ့ဝ့ၫလၧဂၫလလံၫလထံၪနီၪ, အၪ့စၪ့ဝ့ၫ",
			"7": "<sup>7</sup> ၦလဂၩယီၩမွဲၦဂၫလလံၫဖိၪဆ့ဧၪ.- ထီးအၥ့ၪယၫဝ့ၫ လၧအဘၪဆဲၫ့ လၧစဟ့ရၧၭအစီၩ့အမၩ့တၭ, မွဲအ အၪ့မၧၫ့အလ့ၩလၧအအီၪလၧမုနံၩ လဖၪနီၪ,စဟ့ရၧၭ အီၪလၧယရုစလံၫ့လီၫ.",
			"8": "<sup>8</sup> ထီးစဟ့ရၧၭဒၪဘၪယ့ၫၡုၬတၭ, ၥၭထိၬဝ့ၫဒိၪမၬ လီၫ.အဂဲးဘဲၫယီၩနါဂၧၫ့ဘၪယူၭ အဂဲးအကၠီၪ့အၪ မံၩ့တၭ,ဆၧမိဒၪဘၪအၥၭလၧ အဝ့ၫဒၪယံၬယံၬယူၭ, ယိလါဝ့ၫလၧအမိဒၪဘၪဆၧလၩ့လၭ လၧအမၩဝ့ၫလ",
			"9": "<sup>9</sup> မံၩ့မံၩ့လီၫ.- အၪ့စၪ့ဆၧအၪမံၩ့တၭ, အဝ့ၫဒၪချဲၩ့ဆၧၫ့",
			"10": "<sup>10</sup> ဆၧနးထံၪအ့ၬ.- ၦလုဆၧအဒိၪလဖၪ, ဒဲၦကွ့ၭလံၬ ၥံၪအီၪဆၧၫ့ထုၪ့တၭ, အီၪက့ၪဆၧမၪလၧအလီၩ့နၭနၭ",
			"11": "<sup>11</sup> လ့ၬလီၫ.- စဟ့ရၧၭဒဲအၥုၭဖိၪလဖၪနီၪ မၩကြၩ့ထမး အဝ့ၫ,ဒဲဒုၪဒွ့ၪဝ့ၫတၭ, ဒုၭၥိၭထၪ့ဝ့ၫလၧအဝိၬလိၫ့ ယုၩ့ယဲတၭ,အၪ့မၧၫ့အထဲၩ့ထဲၩ့လၧစပဲလၭအအီၪ",
			"12": "<sup>12</sup> လီၫ.- လၧမုလနံၩဎးနီၪ, စပဲလၭဒဲစဟ့ရၧၭအိၭထၪ့ ထဲၩ့လိၬအၥၭလီၫ. အဂဲးဘဲၫယီၩလၧမီခိၬနီၪထၫ့ ဒုၪဒၩလိၬအၥၭလီၫ.",
			"13": "<sup>13</sup> စပဲလၭကိၭကီၪ့ထဲၩ့ၦလုဆၧအဒိၪလဖၪ, ဒဲၦခမျၧး",
			"14": "<sup>14</sup> အၦဒိၪၦၡါၥံၪ,- စံၭအဝ့ၫၥံၪ, နၥံၪဂဲၫမီၩ့ၦလဂၩယီၩ လၧယအီၪဘဲၫၦလၧအအၪ့မၧၫ့ ၦခမျၧးမၩမၪဆၧအ ၥိၭတၭ, ယိခွါ,ယအၪ့စိၭအၪ့စၪ့ယူၭ အဝ့ၫလၧနၥံၪအ မ့ၬယၫလါနၫ့ဘိၩ့, ဆၧမၪလၧနၥံၪအီၪက့ၪ လၧအလီၩ့",
			"15": "<sup>15</sup> နီၪ, ယဒၪဘၪနးမံၩ့အ့ၬ.- လၧနီၪအမ့ၬယၫ,စဟ့ ရၧၭဒၪဘၪဆ့အ့ၬ, ယအၪ့မၧၫ့နၥံၪလ့ၩမီၩ့ အဝ့ၫလၧ အအီၪတၭ, ယိခွါ, ဆၧလၧအဂ့ၩဘၪၥံၫနီၪ မၩဘၪဝ့ၫ",
			"16": "<sup>16</sup> နးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိဒိၪဆီၪ့ဆီၪ့တၭ,",
			"17": "<sup>17</sup> ယမိကွဲၪဖျါခွံၬအဝ့ၫလီၫ.- ဎအဂဲးဘဲၫယီၩလၧဘိၪ့",
			"18": "<sup>18</sup> ဖၧၩ့နီၪဘၪကွဲၪဖျါ ၦလဂၩလၧအဝ့ၫၥံၪအဂးလီၫ.ၭ-အ ဝ့ၫၥံၪကိၭၡၭထၪ့လစီၪ့ဎးတၭ, စံၭဝ့ၫ,အဝ့ၫလဂၩယီၩ မၩၥံၫခွံၬတၭ, ကွဲၪဖျါန့လါပၧၩ လၧစဘရၭဘၭဆံၭ.",
			"19": "<sup>19</sup> (ဆၧလၧစဘရၭဘၭနီၪ, မွဲၦလၧအမၩတုၩ့ထၪ့ တုၩ့လၩ့ဆၧလၧဒိၩ့ဖၧၩ့, ဒဲလၧဆၧမၩၥံၫၦၡၩအကၠီၩ့ တၭ,လၩ့ဘၪဝ့ၫလၧထီၫ့ဖၧၩ့လီၫ.)",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, စပဲလၭမိကွဲၪဖျါဘၪအၥၭလၧ",
			"21": "<sup>21</sup> ယ့ၫၡုၬနီၪ, လီၩဘၪဒီၭၦခမျၧးလီၫ.- မွဲလါနၫ့ဘိၩအ ဝ့ၫၥံၪကိၭၡၭထၪ့တၭ, စံၭဝ့ၫ, ဖျၩထၪ့ခွံၬအဝ့ၫဒၪလၧ ထုၪ့စူၪယၫအလီၩ့ဘီၪ, ဖျၩထၪ့ခွံၬအဝ့ၫဒၪလၧထုၪ့",
			"22": "<sup>22</sup> စူၪယၫအလီၩ့ဘီၪ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ ဎွ့ၩထၪ့ ၥၧၫ့ဖၧၫ့လဖၧၫ့, မွဲလၧဆၧနီၪအဂဲးလမံၩ့လဲၪ. မွဲအမၩ မၪဆၧနီၪလမံၩ့လဲၪ. ဆၧအမၪလၧအဝ့ၫမိဘၪၥံၫနီၪ, ယဒၪဘၪလၧအလီၩ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ယမိ",
			"23": "<sup>23</sup> ဒိၪဆီၪ့ဆီၪ့တၭ, ယမိကွဲၪဖျါခွံၬအဝ့ၫဒၪလီၫ.- ဘဲၫၥိၭ အဝ့ၫမိဒုၭဖျၩထၪ့ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့နီၪ, အဝ့ၫ ၥံၪကိၭၡၭထၪ့ လၧအလူဖၭဒိၪဆီၪ့ဆီၪ့တၭ, အၪ့ ကံၩ့အၪ့ယၫဝ့ၫလီၫ. ၦလဖၪနီၪအလူ ဒဲၦလုဆၧအဒိၪ",
			"24": "<sup>24</sup> ၥံၪအလူနီၪ, မၩနၧၩ့မၩစၪဆၧလီၫ.- ဘဲၫအဝ့ၫၥံၪအ",
			"25": "<sup>25</sup> ၥၭအီၪဝ့ၫအၥိၭနီၪ, စပဲလၭစ့ၩရၫ့ဝ့ၫ,- ဒဲၦလၧအ မၩတုၩ့ထၪ့တုၩ့လၩ့ဆၧ, ဒဲမၩၥံၫၦၡၩ အကၠီၩ့တၭ, လၩ့ဘၪဝ့ၫလၧထီၫ့ဖၧၩ့လဂၩနီၪ, မွဲအကွဲၪဖျါခွံၬဝ့ၫ တၭ,ဖ့ၪလၫ့ခွံၬယ့ၫၡုၬ ဘဲၫအဝ့ၫၥံၪ အၥၭအီၪဝ့ၫ အၥိၭ နီၪလီၫ.",
			"26": "<sup>26</sup> တၭအဝ့ၫၥံၪမီၩ့ခွံၬဝ့ၫအဘိၩ့ဘၭနီၪ, ဖီၪ့ထၬၦစဲၫ ရံၫနံၫဖိၪစစဲမၧၫ့လဂၩ ဂဲၫလၧမံၩ့လၬကျၩတၭ, အီၪ က့ၪထၪ့ထုၪ့စူၪယၫ လၧအလီၩ့ ဘဲၫၥိၭအမိယိၭဝ့ၫ",
			"27": "<sup>27</sup> တၭ,ဖိၬယ့ၫၡုၬအခဲၫ့လီၫ.- ၦခမျၧးဖၭဒိၪ, ဒဲၦမုၪ လဖၪဖိၬထၪ့အခဲၫ့တၭ, ဒဲၩလၩ့အၥၭနၫတၭ, ဂၪ့ဆၧ",
			"28": "<sup>28</sup> ယၧၩ့ဆၧလၧအကၠီၩ့လီၫ.- တၭယ့ၫၡုၬကၠၪစိၩအၥၭ လၧအအီၪတၭ, စံၭဝ့ၫ, ၦယရုစလံၫ့ဖိၪမုၪၥံၪဧ့, ဂၪ့လၧ ယကၠီၩ့လဂ့ၩ, ဂၪ့လၧနၥံၪအကၠီၩ့ဒၪနၥံၪဝ့ၫ,ဒဲလၧနၥံၪ",
			"29": "<sup>29</sup> အဖိၪအလံၩအကၠီၩ့ဆံၭ.- အဂဲးဘဲၫယီၩ, ယိခွါ,အမု နံၩလဖၪ မိဘၪဝ့ၫလၧၦမိစံၭဝ့ၫ, ၦထူၬဖိၪအမုၪ, ဒဲၦဒၧၩ့လးလၧအလဒၧၩ့ဘၪနးဆိၭ, ဒဲၦနူခိၪမၪ့လၧ အလဒုၭအၪ့နူဘၪဆၧနးဆိၭလဖၪနီၪ ဘၪဆိၪဂ့ၩဝ့ၫ",
			"30": "<sup>30</sup> လီၫ.- ထီးနီၪလဖၧၫ့,အဝ့ၫၥံၪနီၪ,မိလီၩဘၪခိၪလီၩ့ ထိၩ့ချိၬၥံၪ,လၩ့ထ့ၬလၧပလီၩ့ဘီၪ. မိလီၩဘၪဆၧစီၩ့",
			"31": "<sup>31</sup> ခိၪၥံၪ,မၩဘံၭပၧၩဘီၪ.- အဂဲးဘဲၫယီၩ ၦအ့ၪမၩၥံၪ့ ၥံၫ့ဆ့ၬဘဲၫယီၩတၭ, ဆၧမိမၩဆၧအဎဲၫ့ ဘဲၫၥ့ၪ",
			"32": "<sup>32</sup> လဲၪ.- ၦမီၩ့ဎုၬထမျၬၥံၪနံၫဂၩ လၧအၥိၭဆ့ ဘဲၫၥိၭအ မိမၩၥံၫဝ့ၫလီၫ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪလ့ၩထီၩ့လၧဆၧအလးကိၭဝ့ၫ ကြၫနံတၭ, ၦဖျၩထၪ့အဝ့ၫ,ဒဲၦထမျၬၥံၪနံၫဂၩ,လဂၩလၧအစူၪ စ့ၪ,လဂၩလၧအစူၪထွ့ၪ လၧထုၪ့စူၪယၫအလီၩ့လီၫ.",
			"34": "<sup>34</sup> ယ့ၫၡုၬစံၭဝ့ၫ,ဖါဧ့, ကွဲၪဖျါခွံၬအဝ့ၫၥံၪအဆၧဒဲၩဘၭ ဆံၭ.အဂဲးဘဲၫယီၩ မၩဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪၥ့ၪ ယၫဝ့ၫအ့ၬ. ၦဖၭဝ့ၫတၭ, အၪ့နၩ့ဖၭအကီၩ့အၥိၭလီၫ.",
			"35": "<sup>35</sup> ၦခမျၧးၥံၪဆၧၫ့ထုၪ့ယိဆၧလီၫ. ဒဲၦဒိၪၦၡါၥံၪဒုၪ ဒွ့ၪဆၧတၭ, စံၭဝ့ၫ,ၦလဂၩယီၩထိးထဲၩ့တၩ့ထဲၩ့ မၬၦဂူၫဂၩတၭ, အ့ၪမွဲဎရံၬၦလၧယွၩရွံန့ဝ့ၫလဂၩနီၪ,",
			"36": "<sup>36</sup> မွဲအထိးထဲၩ့တၩ့ထဲၩ့ဒၪအၥၭဆံၭ.- ၦၥုၭဖိၪလ့ၩလၧ အအီၪတၭ, ဒုၭအီၩဝ့ၫဆၧဆဲၪ့ထံၫ, ဒဲဒုၪဒွ့ၪဝ့ၫဆ့",
			"37": "<sup>37</sup> တၭ,- စံၭဝ့ၫ,နအ့ၪမွဲၦယုဒၫဖိၪအစဎွၩနီၪ, ထိးထဲၩ့ တၩ့ထဲၩ့ဒၪနၥၭဆံၭ.",
			"38": "<sup>38</sup> လံၬဒုၭနဲၪဆၧအီၪကွ့ၭအၥၭ (လၧဂြံစၭ,ဒဲရိမၫ,ဒဲဟံ ဘြႃၫအဆၧချဲၩ့) ဘၪဆၧအီၪက့ၪထၪ့ဝ့ၫလၧအဖၫ့ခိၪ,",
			"39": "<sup>39</sup> ၦထမျၬၥံၪလၧအဘၪဆၧဖျၩထၪ့ဝ့ၫနီၪ အလဂၩဒုၪ ဒွ့ၪဆၧတၭ, စံၭဝ့ၫ, နအ့ၪမွဲဎရံၬနီၪ ထိးထဲၩ့တၩ့",
			"40": "<sup>40</sup> ထဲၩ့န့ဎုၬလါနၥၭဒၪ နဝ့ၫဒဲပဝ့ၫဒၪယီၩဆ့ဘီၪ.- အ့ၪမွဲ အဝ့ၫဒၪလဂၩချဲၩ့ဆၧၫ့ဆၧ, အၪ့လၬအဝ့ၫနီၪ, စံၭဝ့ၫ, နဘၪဆၧစ့ၩရၫ့စၪလမံၩ့ဎးလၧၦလဂၩယီၩတၭ,မွဲ",
			"41": "<sup>41</sup> နၥၭမဲၪယွၩအ့ၬဧၪ.- ပဝ့ၫဒၪယီၩပဘၪဆၧစ့ၩရၫ့တီၩ တီၩလီၫ. အဂဲးဘဲၫယီၩပထိးဘၪဆၧ ထီးဒၪအကြၨၭ လၧပမၩဆၧအဂဲးလီၫ. အ့ၪမွဲအဝ့ၫလဂၩယီၩ, မၩမၪ",
			"42": "<sup>42</sup> ဆၧနးမံၩ့အ့ၬ.- အဝ့ၫဒၪစံၭယ့ၫၡုၬ, ကဆါဧ့,ထီး နအ့ၪနုၬလၧ နဘၩ့နမုး အဖၧၩ့တၭ,နၪ့ထၪ့ထဲၩ့",
			"43": "<sup>43</sup> ယၧၩဆံၭ.- ယ့ၫၡုၬစံၭအဝ့ၫဒၪ, ယလီၩဘၪနၧၩတီၩ တီၩယီၩ, မုဆၫလနံၩယီၩ နမိအီၪလၧယၥိၭ လၧပၫရ ဒဲၭအဖၧၩ့လီၫ.",
			"44": "<sup>44</sup> ဘၪဎူၫနၩရံၩကၪယူၭတၭ, ဆၧခံၭလၩ့ဝ့ၫ လၧခး",
			"45": "<sup>45</sup> နီၪထၧၫ့ဘံၪ့ယၫ, ထီၩ့လၩ့လၧခွံၫနၩရံၩလီၫ.- မုခံၭ လၩ့ဝ့ၫတၭ, ဆၧလုဂံၪ့အကလကၫနီၪ ထ့ဖၭဝ့ၫဒၪလၧ",
			"46": "<sup>46</sup> အကျၩလီၫ.- ယ့ၫၡုၬ ကိၭၡၭထၪ့ဆၧလၧအလူဖၭ ဒိၪတၭ,စံၭဝ့ၫ, ဖါဧ့, ယဖ့ၪလၫ့ယၥၭလၧနစူၪဖၧၩ့ လီၫ.စံၭဆၧလဖၪနီၪဂီၩ့တၭ, အၥၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လီၫ.",
			"47": "<sup>47</sup> ၦၥုၭဖိၪလယၩအခိၪ ဒၪဘၪဆၧမၩအၥၭနီၪ, စံၭ ထၪ့အၪ့အူၭယွၩတၭ, စံၭဝ့ၫ, ၦလဂၩယီၩမွဲၦအတီၩ",
			"48": "<sup>48</sup> လီၫ.- ကယဲၦထီးအလူၬလၧအဂဲၫအီၪကီၪ့လၧအယိ ဖၧၩ့ဆၧနီၪ, ထီးအဒၪဘၪဆၧမၩအၥၭ ဘဲၫနီၪလဖၪ တၭ,ဒဲၩလၩ့အၥၭနၫတၭ, ထဲၩ့ဝ့ၫလီၫ.",
			"49": "<sup>49</sup> ၦလၧအၥ့ၪယၫအဝ့ၫထီးအလူၬ, ဒဲၦမုၪလၧအဂဲၫ ဖိၬအခဲၫ့လၧဂၫလလံၫလဖၪနီၪ, ဆၧၫ့ထုၪ့အီၪယဲၩ့ ယိၬတၭ,ယိဆၧလဖၪနီၪလီၫ.",
			"50": "<sup>50</sup> ယိခွါ, ၦခးယုဒၫအဒိၩ့အၫရမၥံအၫဖိၪကိၭဝ့ၫအမံၩ့ စယိၥၭၦကိၪ့လိၬဆၧလဂၩနီၪ, မွဲအဂ့ၩအဘွၩ ဒဲအ",
			"51": "<sup>51</sup> တီၩအလီၩ့တၭ,- (အဝ့ၫဒၪအုၩ့လၫ့အဝ့ၫၥံၪ အဆၧ ကိၪ့ထၪ့ဖၭလၩ့ဒဲအဆၧမၩနီၪအ့ၬ.) မွဲအယိလါယွၩ",
			"52": "<sup>52</sup> အဘၩ့အမုးအဖၧၩ့ၥၭလီၫ.- အဝ့ၫနီၪလ့ၩလၧစပဲ လၭအအီၪတၭ, အၪ့ကံၩ့န့ယ့ၫၡုၬအစွၪနီၪလီၫ.",
			"53": "<sup>53</sup> ဆိၬလၩ့ဝ့ၫအစွၪတၭ, ဘီၪ့ဘံၭထၬဝ့ၫလၧဆၧဘွၩ ဖျ့ၫလံၬကံၭတၭ, ဒုၭနုၬဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့လၧ ဆၧချိၬန့ဝ့ၫလၧလိးအဖၧၩ့, လၧဆၧလဒုၭနုၬဒံၭဘၪ ၦၡၩနးဆိၭလီၫ.",
			"54": "<sup>54</sup> ဆၧလၧမုနံၩနီၪမွဲတဲၩ့ဝဲၩဆၧအနံၩတၭ, မးၥံၫအ",
			"55": "<sup>55</sup> နံၩလၩ့ဘူၭဝ့ၫဒၪလီၫ.- ၦဂဲၫဝ့ၫလၧအၥိၭလၧဂၫလ လံၫၦမုၪလဖၪဖိၬထၪ့အခဲၫ့ဆ့တၭ, ယိနဲၪ့ဆၧၥွၪခိၪ",
			"56": "<sup>56</sup> အလးဒဲၦအီၪက့ၪလၩ့အစွၪအလးလီၫ.- ထဲၩ့ထဲၩ့ဝ့ၫ တၭ, တဲၩ့ဝဲၩဆၧနၧၫ့မၧၫ့,ဒဲမူၫရၫ့တၭ, ဘဲၫဆၧမၪ လူၬအီၪဝ့ၫအၥိၭနီၪ, အီၪပွံၭဝ့ၫလၧမးၥံၫအနံၩ လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> လၧနွ့ၫနံၩအထးဖၧၩ့မုခၪ့ထံၭဂီၩဂီၩလ့ၬနီၪ, အ ဝ့ၫၥံၪဒဲၦဂူၫဂၩလနၩ့နၩ့ လ့ၩဆိၬဆၧနၧၫ့မၧၫ့ လၧအ",
			"2": "<sup>2</sup> တဲၩ့ဝဲၩဝ့ၫထီၩ့လၧဆၧၥွၪခိၪအအီၪနီၪလီၫ.- ဒၪဘၪ ဝ့ၫလၧလိးလဖျိၪ့ ချံးခွံၬယူၭအၥၭ လၧဆၧၥွၪခိၪအလး",
			"3": "<sup>3</sup> ယူၭ.- အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫတၭ, ဒၪလၧၩ့ကဆါယ့ၫၡုၬ",
			"4": "<sup>4</sup> အစွၪဆ့အ့ၬ.- ဆၧမၩအၥၭလၧအၥၭဘံၪဘူၪဝ့ၫလၧ ဆၧနီၪအဂဲးတၭ, ယိခွါ, ၦနံၫဂၩဆၧၫ့ထုၪ့ဝ့ၫလၧအ",
			"5": "<sup>5</sup> နဲၩ့ထံၭတၭ, ၥိၭအကီၩ့အၥိၭဂိးၡ့ၭဂိးၡီၫလီၫ.- ၦလ ဖၪနီၪ,ဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့တၭ, ၡီၫ့လၩ့အခိၪထီၩ့ လၩ့လၧဂၪ့ခိၪတၭ, အဝ့ၫၥံၪစံၭ, ၦလဖၪနီၪ, လၧၦၥံၫ အကျၩယီၩ, မွဲဘၪနီၫနၥံၪအၪ့ဎၬ ၦအမၧၫ့နီၪလဲၪ.",
			"6": "<sup>6</sup> အီၪလၧၩ့ထီးယီၩအ့ၬ. ဂဲထုၪ့ထဲၩ့ယူၭဝ့ၫယူၭ. လၧ အအီၪလၧဂၫလလံၫအဘိၩ့ဘၭတၭ, လီၩဘၪနၥံၪ",
			"7": "<sup>7</sup> ဘဲၫအံၩဘဲၫအိၩနီၪ, နၪ့ထၪ့ထဲၩ့ဆံၭ.- စံၭဝ့ၫ, ၦၡၩအ ဖိၪခွၫယီၩမိဘၪဆၧဖ့ၪလၫ့ခွံၬဝ့ၫ လၧၦဆၧဒဲၩဘၭဖိၪ အစူၪဖၧၩ့တၭ, မိဘၪဆၧဖျၩထၪ့ဝ့ၫလၧ ထုၪ့စူၪယၫ အလီၩ့နီၪ, လၧၥၧၫ့နံၩလနံၩအဖၧၩ့တၭ, မိဂဲထုၪ့ထဲၩ့ ဝ့ၫလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫၥံၪနၪ့ထၪ့ထဲၩ့အဆၧချဲၩ့နီၪ,- စဲၪ့ဒၪ ခွံၬဆၧၥွၪခိၪထဲၩ့ထဲၩ့ဝ့ၫတၭ, လီၩဘၪၦဆံၫလဂၩ ဒဲၦ ဂူၫဂၩၥံၪကိၭဂၩဒ့ၭ လၧဆၧမၩအၥၭထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> ၦမၭဂဒၫလံနံၫဖိၪနးမၫရံၫဒဲနးယိၫအၪ့နၫ, ဒဲစယ့မံၭ အမိနးမၫရံၫဒဲၦဂူၫဂၩ လၧအအီၪလၧအၥိၭလဖၪနီၪ, မွဲၦလၧအလီၩဘၪ ၦဆၧအၪ့မၧၫ့ဖိၪလဖၪလၧဆၧမၩ",
			"11": "<sup>11</sup> အၥၭနီၪလီၫ.- အဆၧချဲၩ့နီၪဖျီၪထၪ့လၧအဝ့ၫၥံၪအမ့ၬ",
			"12": "<sup>12</sup> ယၫဘဲၫဆၧချဲၩ့ပျီၩပျီၩနီၪနဲၩဝ့ၫအ့ၬ.- မွဲလါနၫ့ဘိၩ စပံတၧၫဂဲထုၪ့တၭ, လ့ၩစဲၪ့လၧဆၧၥွၪခိၪအအီၪနီၪ, ၡီၫ့လၩ့အခိၪယိနုၬဝ့ၫတၭ, ဒၪန့ဆၧဘွၩဖျ့ၫလံၬကံၭ အီၪလၩ့ထးတၭ, အၥၭထီၫမံၫထီၫမၪ လၧဆၧမၩအ ၥၭအကၠီၩ့နီၪထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ယိခွါ, လၧအဝ့ၫၥံၪအကျၩၦနံၫဂၩလ့ၩဆၧလၧမု လနံၩဎးနီၪ လၧတဝၫ့လဖျိၪ့အမံၩ့ မွဲအ့ၫမ့အၧၭယဲၩ့လၧ",
			"14": "<sup>14</sup> ယရုစလံၫ့စတ့ဒအၧၫ့ဎူၫဆံၫလီၫ.- အဝ့ၫၥံၪချဲၩ့ဒုၪ့လိၬ အၥၭလၧဆၧမၩအၥၭနီၪ အဂဲးအကၠီၪ့ထီးအလူၬလီၫ.",
			"15": "<sup>15</sup> ဆၧမၩအၥၭထီးအချဲၩ့လိၬအၥၭ ဒဲအၪ့စၪ့လိၬအၥၭ အဘိၩ့ဘၭနီၪ, ယ့ၫၡုၬၥုၭဘူၭထၪ့အၥၭတၭ, လ့ၩ",
			"16": "<sup>16</sup> ဆၧလၧအဝ့ၫၥံၪအၥိၭလီၫ.- ဆၧမၩကဒၩအမ့ၬဘဲၫ",
			"17": "<sup>17</sup> ၥိၭအထီးၥ့ၪယၫအဝ့ၫလဂ့ၩလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪ,နၥံၪလ့ၩဆၧအဘိၩ့ဘၭတၭ, နၥံၪချဲၩ့လိၬနၥံၪအ ၥၭယီၩ,မွဲဆၧချဲၩ့ဘဲၫၥ့ၪလဲၪ. တၭနၥံၪအမ့ၬလၩ့ၡါ",
			"18": "<sup>18</sup> မွဲဘၪလဲၪ.- အလဂၩအမံၩ့စကျံအိၫဖၭနီၪချဲၩ့ဆၧၫ့ ဆၧတၭ, စံၭအဝ့ၫနီၪ, နဝ့ၫဒၪယီၩ, နမွဲန့ၫၦမွံၩလၧ ယရုစလံၫ့အဖၧၩ့တၭ, ဆၧမၩအၥၭလၧမုနံၩလဖၪယီၩ",
			"19": "<sup>19</sup> မွဲနၥ့ၪယၫအ့ၬဧၪ.- အဝ့ၫဒၪလဂၩစံၭအဝ့ၫၥံၪ,မွဲ ဆၧနီၪလဖၪလဲၪ. အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, မွဲၦနၭဇရ့ၭဖိၪ ယ့ၫၡုၬအဂဲးအကၠီၪ့လီၫ. အဝ့ၫနီၪ,မွဲမီၪလဂၩအီၪ လၧအစီၩ့အမၩ့လၧအလူဒဲအဆၧမၩ လၧယွၩအ",
			"20": "<sup>20</sup> မ့ၬယၫ,ဒဲလၧၦၡၩထီးအလူၬအမ့ၬယၫလီၫ.- ဘဲၫၥိၭ အမိထိးဆၧစ့ၩရၫ့ထီးအၥံၫတၭ, ၦလုဆၧအခိၪ, ဒဲၦ ဒိၪၦၡါလဖၪနီၪဖ့ၪလၫ့ၥံၫခွံၬဝ့ၫ, ဒဲဖျၩထၪ့အဝ့ၫ",
			"21": "<sup>21</sup> လၧထုၪ့စူၪယၫအလီၩ့လီၫ.- အ့ၪမွဲပယိလါလၧအဝ့ၫ နီၪမွဲဝ့ၫၦလၧအမိထိးထဲၩ့တၩ့ထဲၩ့ ၦအံၫစရ့လၭ ဖိၪၥံၪလီၫ.တၭလၧဆၧနီၪလဖၪ ထီးအလူၬအမ့ၬယၫ, လၧဆၧမၩအၥၭဘဲၫနီၪလဖၪအလးခဲၫ့, အယီၩလနံၩ",
			"22": "<sup>22</sup> မွဲမုၥၧၫ့နံၩလနံၩလီၫ.- တၭၦမုၪလၧပကျၩလနၩ့နၩ့",
			"23": "<sup>23</sup> လ့ၩလၧဆၧၥွၪခိၪအအီၪဂီၩဂီၩလ့ၬနီၪ,- လဒၪဘၪအ စွၪတၭ, ဂဲၫထဲၩ့လီၩဘၪဝ့ၫလၧ အဒၪဘၪဆၧလမံၩ့အ ၥီၫ့ၥံၪလၧအစံၭ, အဝ့ၫလဂၩမၧၫ့ထၪ့ထဲၩ့ဝ့ၫတၭ, မၩ",
			"24": "<sup>24</sup> ထီၫမံၫထီၫမၪပၥၭလီၫ.- ၦလၧပကျၩလနၩ့နၩ့လ့ၩ လၧဆၧၥွၪခိၪတၭ, ဒၪဘၪဆၧဘဲၫ ၦမုၪစံၭဝ့ၫအၥိၭ လါနၫ့ဘိၩဒၪဘၪအဝ့ၫနီၪလဂၩဆ့အ့ၬ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၦလၧအၥၭ",
			"26": "<sup>26</sup> လဖၭဘၪ, ဒဲၦလၧအလနဲၩဘၪမီၪအလူၥံၪဧ့,- ဎရံၬ ဘၪထိးဆၧဘဲၫနီၪတၭ,လ့ၩနုၬထၪ့န့ဘၪအလၩ",
			"27": "<sup>27</sup> အဖၩ့နီၪမွဲအ့ၬဧၪ.- တၭအဝ့ၫဒၪလီၩဆိၫဝ့ၫလၧစမိ စ့ၭဒဲမီၪလဖၪထီးအလူၬနီၪ,ဒုၭနဲၪမၩဖျီၪထၪ့ဆၧဘၪ ဆဲၫ့လၧအနၫ့ဆါဒၪဝ့ၫ အဂဲးဘဲၫအအီၪလၧဆၧကွ့ၭ",
			"28": "<sup>28</sup> အၥၭထီးအလူၬအဖၧၩ့လီၫ.- အဝ့ၫၥံၪလ့ၩဘူၭထၪ့ လၧတဝၫ့လၧအမိလ့ၩဝ့ၫနီၪ, အဝ့ၫဒၪမၩအၥၭလၩ့ဂၬ",
			"29": "<sup>29</sup> လၧအမိလ့ၩဒံၭလၧယၫလခီၫလီၫ.- အဝ့ၫၥံၪအၪ့ ကံၩ့အၪ့ယၫဝ့ၫဆီၪ့ဆီၪ့လ့ၬ,စံၭဝ့ၫ, အီၪလၧပၥိၭဘီၪ. အဂဲးဘဲၫယီၩမုဂၪလၩ့တၭ, မုဘၪယူၭး တၭအဝ့ၫဒၪ လ့ၩနုၬအီၪလၧအၥိၭလီၫ.",
			"30": "<sup>30</sup> ဆၧမၩအၥၭလၧအဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧစပွဲထံၭလၧ အဝ့ၫၥံၪအၥိၭတၭ, အဝ့ၫဒၪမၩန့ကိၪ, ဆိၪဂ့ၩကံၪ့",
			"31": "<sup>31</sup> ဘျ့ၭဝ့ၫတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪလီၫ.- အဝ့ၫၥံၪအမ့ၬၥၪ ဝဲထၪ့အၥၭတၭ, ၥ့ၪယၫဝ့ၫလီၫ.အဝ့ၫဒၪမၩလၩ့မါ",
			"32": "<sup>32</sup> ခွံၬအၥၭလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- အဝ့ၫၥံၪချဲၩ့လိၬ အၥၭတၭ, စံၭဝ့ၫ, လၧအဝ့ၫနီၪချဲၩ့လိၬအၥၭလၧပၧၩ လၧဖၧၩ့ၥၭနီၪ, ဒုၭနဲၪဆၧကွ့ၭအၥၭအဂဲးအကၠီၪ့တၭ, ပၥၭလၧပဂူၭဖိၫ့ဖၧၩ့ မွဲအခဲၩထၪ့အ့ၬဧၪ.",
			"33": "<sup>33</sup> အဝ့ၫၥံၪဂဲထုၪ့လၧနၩရံၩထီးနီၪ, ထဲၩ့ထဲၩ့ဝ့ၫလၧ ယရုစလံၫ့တၭ,ဒၪဘၪဝ့ၫလၧၦဆံၫလဂၩ, ဒဲၦအီၪလၧ",
			"34": "<sup>34</sup> အၥိၭအီၪကိၩ့အီၪကီၪ့,- စံၭဝ့ၫ, ကဆါနီၪဂဲထုၪ့ထဲၩ့",
			"35": "<sup>35</sup> တၡါတၭ,ဒုၭနဲၪယူၭအၥၭလၧစစဲမၧၫ့ယူၭ.- တၭ အဝ့ၫၥံၪလီၩလၩ့လၬလၩ့ ဆၧမၩအၥၭလၧဖၧၩ့ၥၭနီၪ, ဒဲအဝ့ၫဒၪဒုၭၥ့ၪယၫအၥၭလၧ အဝ့ၫၥံၪ, ဘဲၫၥ့ၪလဲၪဘဲၫ ၥ့ၪလဲၪလၧဆၧကံၪ့ဘျ့ၭကိၪနီၪလီၫ.",
			"36": "<sup>36</sup> အဝ့ၫၥံၪချဲၩ့လိၬအၥၭအဘိၩ့ဘၭတၭ, အနၫ့ဆါ ဒၪဝ့ၫအီၪဆၧၫ့ထုၪ့လၧ အကျၩတၭ, စံၭအဝ့ၫၥံၪ, မွဲဆၧ",
			"37": "<sup>37</sup> မုၬဆၧလၩအီၪလၧနၥံၪအၥိၭဆံၭ.- အဝ့ၫၥံၪဆီၫ့မီၪ့ ဝ့ၫလၧအဒၪၦစၪတၭ, ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫတၭ, အၥုၪ့အ",
			"38": "<sup>38</sup> ၥၭဝၭထိၬဝ့ၫလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, နၥံၪအၥုၪ့ အၥၭဝၭထိၬမွဲဘၪလဲၪ. ဆၧဆီၫ့မီၪ့အီၪထၪ့ လၧနၥံၪ",
			"39": "<sup>39</sup> အၥၭဖၧၩ့မွဲဘၪလဲၪ.- ယိယစူၪယၫၥၭဒဲယခၪ့ယၫၥၭ ဆံၭ.အဂဲးဘဲၫယီၩ မွဲယနၫ့ဆါဒၪယဝ့ၫလီၫ. ဖီၪ့ယိ ယၧၩဆံၭ, အဂဲးဘဲၫယီၩၦစၪနီၪအီၪလၧအဎွံၪဒဲအယၪ",
			"40": "<sup>40</sup> ဘဲၫနၥံၪဒၪဘၪယၧၩယီၩ အၥိၭအ့ၬ.- စံၭဆၧဘဲၫနီၪ တၭ,ဒုၭနဲၪအစူၪယၫၥၭဒဲအခၪ့ယၫၥၭ လၧအဝ့ၫၥံၪ",
			"41": "<sup>41</sup> လီၫ.- အဝ့ၫၥံၪအၥုၪ့ထိၬၥၭထိၬ, ထီၫမံၫထီၫမၪလၧအ ကၠီၩ့တၭ,ဘိၩ့အလချႃၭနဲၩဒံၭဘၪနီၪ,အဝ့ၫဒၪစံၭ အဝ့ၫၥံၪ,ဆၧအၪ့မွဲအအီၪလမံၩ့မံၩ့ထီးယီၩဆ့ဧၪ.",
			"42": "<sup>42</sup> အဝ့ၫၥံၪဖ့ၪလၫ့ယၪကၪလကုၭတၭ, ဒဲန့ၫခိၪထံၪလကုၭ",
			"43": "<sup>43</sup> တၭ,- အဝ့ၫဒၪမၩန့အၪ့ဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬယၫ",
			"44": "<sup>44</sup> လီၫ.- တၭစံၭအဝ့ၫၥံၪ, ဆၧချဲၩ့လဖၪယီၩ,ယစံၭဝဲၩ နၥံၪလၧယအီၪဒံၭ လၧနၥံၪအၥိၭ, လၧကယဲဆၧကွ့ၭ အၥၭလၧစမိစ့ၭ အဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့, ဒဲလၧမီၪၥံၪ အဖၧၩ့, ဒဲလၧအၪ့အူၭဆၧအဖၧၩ့, လၧယဂဲးယကၠီၪ့",
			"45": "<sup>45</sup> နီၪ,ဘၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ထီးအလူၬလီၫ.- ထီးနီၪ လဖၧၫ့ဘဲၫၥိၭ အဝ့ၫၥံၪအနါမိဖိး လၧဆၧကွ့ၭအၥၭအ",
			"46": "<sup>46</sup> ဂဲးနီၪ, အဝ့ၫဒၪဒုၭဖၩ့ထၪ့အဝ့ၫၥံၪအၥၭလီၫ.- လီၩဘၪ ဝ့ၫလၧဆၧကွ့ၭအၥၭနီၪတၭ, ဎရံၬမိဘၪထိးဆၧဘဲၫနီၪ တၭ,လၧၥၧၫ့နံၩလနံၩအဖၧၩ့နီၪမိဂဲထုၪ့ထဲၩ့ဝ့ၫ,",
			"47": "<sup>47</sup> ဒဲၦဘၪလီၩလၩ့လၬလၩ့ ဆၧနီၫ့ယါလၩ့ထဲၩ့ အၥၭ အဂဲး,ဒဲဆၧကွဲၪဖျါခွံၬဆၧဒဲၩဘၭအဂဲး လၧအမံၩ့အ ကၠီၩ့လၧယရုစလံၫ့ဖိၪၥံၪ, ထီးအဖိးလၧၦကိၭဆၨၩ",
			"48": "<sup>48</sup> ဒ့ၭလီၫ.- နၥံၪမွဲၦထိးအၥၭလၧဆၧနီၪလဖၪအ ဂဲးလီၫ.",
			"49": "<sup>49</sup> ယိခွါ, ယအၪ့မၧၫ့ယဖါအဆၧစံၭဝဲၩနီၪ, လၧနၥံၪ အအီၪလီၫ. မွဲလါနၫ့ဘိၩ, ဆၧလချႃၭဒုၭအီၪထၪ့ဒံၭ ဘၪနၥံၪလၧဆၧအစီၩ့အမၩ့လၧထၭနီၪ,အီၪဒၪခလူၬ လၧဒိၩ့ဖၧၩ့ဆံၭ.",
			"50": "<sup>50</sup> အၥိၫ့ထၪ့အဝ့ၫၥံၪထီၩ့လၧဘ့ၭၥနံၫတၭ, ယူၬ ထၪ့အစူၪတၭ, ဆိၪဂ့ၩအဝ့ၫၥံၪလီၫ.-",
			"51": "<sup>51</sup> တၭဆၧမၩအ ၥၭလၧအဆိၪဂ့ၩဝ့ၫအဘိၩ့ဘၭနီၪ, လၩ့ဖၭဝ့ၫလၧ အဝ့ၫၥံၪတၭ,ဘၪဆၧဆိၬထၪ့ဝ့ၫလၧမူၭခိၪလီၫ.-",
			"52": "<sup>52</sup> အဝ့ၫၥံၪဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫ တၭ, အၥုၪ့ထိၬအၥၭထိၬဖၭ ဒိၪနီၪ,ထဲၩ့ထဲၩ့ဝ့ၫလၧယရုစလံၫ့တၭ,-",
			"53": "<sup>53</sup> ၥံၫကျံၩထၪ့ ဆၧ,စံၭထၪ့အၪ့အူၭယွၩလၧဆၧလုအဂံၪ့ဖၧၩ့ထံၪဎးဘီၩ့ဎးလီၫ. [အၩမံၩ့]"
		}
	}
};
module.exports = book;